INSERT INTO `prod_eventtools_clinics` (`id`, `number`, `name`, `start_date`, `end_date`, `description`, `status_code`, `cart_item`, `clinic_presenter`, `clinic_location_code`, `clinic_url`, `clinic_presenter_email`, `comment`, `clinic_ok`, `clinic_presenter_cell_number`, `clinic_presenter_confirm_comment`, `clinic_presenter_av_comment`, `clinic_presenter_av_request`, `mark_changed`, `last_mod_time`) VALUES
(14, 'C014', 'DCC: Overview', '2011-07-04 08:00:00', '2011-07-04 09:00:00', 'What <i>is</i> DCC?  And what it <i>isn''t</i>!  This clinic is targetted to those of us who are still on the fence or who have newly installed DCC - and just want some help in understanding the basics of how DCC works and a few "best practices".', 0, '', 'Jim Betz', 2, '', 'jim@jimbetz.com', '', '', '', '', '', '', '', NULL),
(15, 'C015', 'DCC: Installing Decoders', '2011-07-04 09:30:00', '2011-07-04 10:30:00', '', 0, '', 'Marcus Ammann', 2, '', 'mammann@optusnet.com.au', '', 'Y', '', '', '', 'mywindows', '', NULL),
(13, 'C013', 'Layout Design Panel: What Would you do Differently?', '2011-07-04 16:00:00', '2011-07-04 17:00:00', 'Join a panel of Operating Layout Owners as they discuss lessons learned from their layouts and what they plan to do differently.  Some of these owners are building new layouts based on their experiences with previous layouts.  Moderated by Layout Design Special Interest Group (LDSIG) President, Seth Neumann.', 0, '', 'Seth Neumann, and others', 5, '', 'sneumann@pacbell.net', '', '', '', '', 'I will confirm the other panelists this week', '', '', '2011-06-23 01:49:50'),
(9, 'C009', 'SP: Sacramento Shops ', '2011-07-03 20:30:00', '2011-07-03 22:30:00', 'The Sacramento General Shops were the core of Southern Pacific''s system-wide shops. With a need to be self-reliant in the Far West, Sacramento long maintained the capability to build any and every piece of equipment needed on the railroad. This included nearly 200 steam locomotives, over 500 completely rebuilt diesels, and a great many freight and passenger cars, along with many specialized pieces of equipment and, naturally, upgrades and rebuilds of almost anything on the railroad.', 62, '', 'Bob Pecotich', 4, '', 'bobpec@comcast.net', '', '', '916-220-0695', 'please modify as follows: . . . nearly 200 steam locomotives, over 500 completely rebuilt diesels, and a great  . . . ', '', 'convention', 'Y', '2011-06-28 16:07:47'),
(10, 'C010', 'The State Belt Railroad', '2011-07-03 16:00:00', '2011-07-03 17:00:00', 'The San Francisco Belt Railroad was a short-line railroad along the Embarcadero in San Francisco. It began as the State Belt Railroad in 1889, and was renamed when the city bought the Port of San Francisco in 1969. The railroad ceased operation in 1993.\r\n\r\nThe railroad connected the Port of San Francisco to many waterfront docks and to industries and warehouses which were adjacent to the waterfront. It had 67 miles (108 km) of trackage and its general offices were in the Ferry Building. Its function was to switch railroad cars from four major railroads to points along its system and vice versa. At the southern portion of the line, a track along King Street (passing the location now occupied by AT&T Park) connected with the Southern Pacific. A train ferry slip at Pier 43 allowed interchange with the Northwestern Pacific, the Western Pacific, and the Atchison. Topeka & Santa Fe railroads. To reach its northern terminus in the Presidio, the line passed through Fisherman''s Wharf, Aquatic Park, and a tunnel under Fort Mason.', 0, '', 'Bill Kaufman', 3, '', 'whk58@pacbell.net', '', 'Y', '415 491-0543', '', '', 'mywindows', 'Y', '2011-06-28 16:10:06'),
(11, 'C011', 'Layout Design Boot Camp', '2011-07-04 08:00:00', '2011-07-04 12:00:00', 'Join Byron Henderson and other members of the NMRA''s Layout Design SIG for an intensive session on track planning and layout design. Discover how to refine vision, concept, and purpose; select layout footprints and schematics; draw accurate and useful plans; create efficient and engaging yards and industrial areas; make best use of staging tracks; maintain space for people; and avoid common track planning errors. Whether your dream layout is strongly prototype-based, a creative freelanced theme, or somewhere in between, this practical session will give you the tools and best practices to design a great layout!', 0, '', 'Byron Henderson', 1, '', 'cuyama@earthlink.net', '', 'Y', '408 398 6395', '', 'I will bring my powerpoint on a USB drive.', 'convention', '', '2011-06-13 18:05:38'),
(12, 'C012', 'Multi-deck Layout Design', '2011-07-05 09:30:00', '2011-07-05 10:30:00', 'Model Railroad Planning editor and NMRA director Tony Koester will discuss the design and construction of multi-deck model railroads with emphasis on their advantages and potential liabilities as well as why good lighting is critical to a successful design.', 0, '', 'Tony Koester, ALWWD', 2, '', 'nkpfan@ptd.net', '', '', '862-266-2958', '', '', 'mymac', '', NULL),
(16, 'C016', 'DCC: Programming Decoders', '2011-07-04 11:00:00', '2011-07-04 12:00:00', 'An introduction to the process of setting up a decoder. The focus will be on the use of DecoderPro (JMRI) to set the address, motor control, lights, and a simple approach to speed matching - and upon de-mystifying the concepts. This clinic is targetted to those who are relatively new to the topic and will -not- cover advanced topics. Programming sound decoders will be touched upon briefly.\r\n', 0, '', 'Jim Betz', 2, '', 'jimbetz@jimbetz.com', '', '', '', '', '', '', '', NULL),
(17, 'C017', 'NMRANET', '2011-07-04 13:00:00', '2011-07-04 14:00:00', 'NMRANET(TM) is an independent bus to the DCC bus for the control of accessories (turnouts, signals, lights) on a layout and does not impact the responsiveness of locomotive control on the DCC bus. This clinic will describe the ''Producer/Consumer'' approach used in the control of accessories (turnouts, signals, lights) on the layout and demonstrate its application. The P/C model provides a powerful ability of control multiple accessories with one simple command. NMRANET uses the same technology found in control systems for factories and other industrial applications.', 0, '', 'Didrik Voss, MMR', 2, '', 'davoss@pvmtengr.com', '', '', '425-327-8549', '', 'mywindows', 'mywindows', '', NULL),
(18, 'C018', 'Model Railroading with Arduino: Introduction', '2011-07-04 14:30:00', '2011-07-04 15:30:00', 'Arduino is an open-source electronics prototyping platform based on flexible, easy-to-use hardware and software.\r\nIt''s intended for artists, designers, hobbyists, and anyone interested in creating interactive objects or environments.\r\nA little programmable computer platform designed help people "make things go."', 0, '', 'John Plocher and Dave Falkenburg', 2, '', 'john.plocher@gmail.com, falken@mac.com', NULL, '', '408 425-3936 (d', '', 'mymac, electrical outlet strip , table for demo ', 'mymac', '', NULL),
(19, 'C019', 'Model Railroading with Arduino: Applications', '2011-07-04 16:00:00', '2011-07-04 17:00:00', 'A follow-on to the introduction, this clinic will outline specific examples of how an Arduino and expansion "shields" can be used to animate your layout, create sophisticated control panels, or even interface with commercial DCC systems, C/MRI, and other computers using JMRI.', 0, '', 'John Plocher', 2, '', 'john.plocher@gmail.com', NULL, '', '650/996-9462', '', 'mymac, electrical outlet strip, table for demos', 'mymac', '', NULL),
(21, 'C021', 'World Wide Model Railroad Tour', '2011-07-04 11:00:00', '2011-07-04 12:00:00', 'Look over John''s shoulder as we go on a &quot;you-are-there&quot; fast-paced photo, movie, and multi-media tour of worldwide Americas, European, and Asian model and prototype railroad sites and people the world over. Enjoy the incredible diversity and interest. Gather ideas for future travels. Or just save the expense and watch here! \r\n<p>\r\nWW, European sites include: Miniature Wonderland, Hamburg 2007 - Narrow Gauge Live Steam, Saxony, Germany 2008 - The Deutsch Museum, Munich 2007 - Nuremburg Deutschbahn Museum - French TGV, Germany ICE - Gotthard Pass, Switzerland - Atlas Model RR HQ in NJ - Hawaii RR Museum, Oahu - Argentina has model railroading too! - Prototype industrial trackage you have to see to believe\r\n<p>\r\nNotable Hobby shops in countries around the world: - Visit to Japan Kato Showroom 2008 - Caboose Hobbies, Denver\r\n<p>\r\nModel RR Exhibitions and Conventions include: - Nottingham UK Model Railway Exhibition 2006 - US-themed Model RR Convention in Germany 2007 - Two largest N-Trak Layouts ever (2008 Louisville, 2004 Chantilly) - Amherst Model RR Show 2005 - Anaheim NMRA National Convention 2008\r\n<p>\r\nFamous Model RR clubs: - Glendale, Pasadena, Slim Gauge Guild, Belmont Shores - San Diego Model RR Museum - The Model RR Club, New Jersey - Washington State Museum''s Puget Sound Model RR Engineers\r\n<p>\r\nWorld-class Layout Tours include: - John Armstrong - Jim Blattau - Paul Dolkos - Dick Patton', 0, '', 'John Sing', 3, '', 'singj@us.ibm.com', '', 'Y', '650-868-9404', '', '', 'mywindows', 'Y', '2011-06-28 23:15:10'),
(23, 'C023', 'SP Freight Cars You Can Model', '2011-07-04 13:00:00', '2011-07-04 14:00:00', 'This talk presents examples of models from kits and kit conversions in HO scale that represent important SP freight cars for the steam-diesel transition era. All types of cars, from flats and gondolas to box, tank and hopper cars and cabooses, are included. The focus is on accurate and reasonable representations of each prototype car, not of museum-quality modeling. Some information on car usage is also included. A handout summarizes the car classes and commercial model(s) used as the basis for each car.', 0, '', 'Tony Thompson', 4, '', 'thompson@signaturepress.com', '', 'Y', '510-637-9960', '', 'mymac', 'mymac', 'Y', '2011-06-28 23:15:56'),
(25, 'C025', 'Using Logistics to Develop a Model Railroad Operations Scheme', '2011-07-04 09:30:00', '2011-07-04 10:30:00', 'Dustin will explain some thought processes to mesh real world logistics with planning prototypical operations. This clinic will approach planning ops from the stand point of moving goods and people on your layout not just moving cars. All levels of ops planning and intensity can be covered using this method. The techniques explained are applicable with most operations styles, eras, and even passenger service.', 0, '', 'Dustin Shoup', 3, '', 'dushoup@gmail.com', '', 'Y', '408-513-5563', '', '', 'convention', 'Y', '2011-06-28 23:14:10'),
(172, 'C172', 'Understanding Steam Locomotive Details', '2011-07-07 13:00:00', '2011-07-07 14:00:00', 'An expansion of his March 2007 <i>Model Railroader</i> article of the same name, Andy will explain the external appliances and piping of steam locomotives in terms of six major systems: water supply, fuel supply, steam distribution, sand for traction, air brakes, and electric lighting. The primary example is Santa Fe 4-8-4 no. 3751, with some other locomotives shown to illustrate variations.', 0, '', 'Andy Sperandeo', 5, '', 'asperandeo@mrmag.com', '', 'Y', '262-327-5343', '', '', '', '', NULL),
(27, 'C027', 'Disney Railroading', '2011-07-06 13:00:00', '2011-07-06 14:00:00', 'John Olson was recruited by Walt Disney Imagineering in 1974 when Mike O''Connell (owner of Chooch Enterprises) was working there as a show writer, and producing a film on model railroading for Kalmbach Publishing, which featured a few of John''s dioramas. John began with Disney as a model builder, and soon branched into production design and field art direction for the Disney Theme Parks. Katie, a Disney Scholarship winner, joined Disney shortly after John as a model painter and color designer. Together they have worked on too many Disney Theme Parks to name!\r\n\r\nBefore joining Disney, John worked closely with folks like Tom Daniel, Leo Campbell, and Fred Hill, among other manufacturers and retailers. Also at time, John began publishing with Kalmbach, Carstens, Narrow Gauge Gazette, and of course the NMRA Bulletin. John will be sharing memories of those days. \r\n\r\nGiven the fact that Walt Disney himself was a huge rail fan, trains are ever-present in the Disney vocabulary. Over the years there they have worked with several famous Disney characters, such as Ward Kimball (Grizzly Flats RR), Harper Goff (Great Locomotive Chase art director), Frank Thomas and Ollie Johnston (private railroads in two locations), Carl Fallberg (Fiddletown and Copperopolis), and many more. The clinic takes us to the homes of the above folks and a pictorial visit to their railroads. John and Katie will also discuss the ever present thread of trains in the Disney theme parks. Katie has color designed many of the railroad stations and locomotives in several of the parks.\r\n\r\nIt was during the early years at Walt Disney Imagineering that John built the Mescal Lines, Cielo Lumber Company, Jerome and Southwestern RR. Later he built (and Katie painted) the Ferrocarril de Tascosa and Calico. John will be sharing some images of his work, and discussing how building Disney theme parks is really similar to building a model railroad!', 0, '', 'John & Katie Olson', 7, '', 'John.D.Olson.-ND@disney.com,Katherine.T.Olson@disney.com', '', '', '', '', '', '', '', NULL),
(28, 'C028', 'Layout Design for Passenger Operations', '2011-07-04 14:30:00', '2011-07-04 15:30:00', 'Track plans for passenger train oriented layouts suggest how passenger terminals and main line layout design elements can be pulled together. Layout design elements such as turning arrangements, express and mail facilities, and coach yard requirements such as car washers, servicing platforms, Pullman and commissary buildings, and craft shops will be covered. Main line elements include junctions for merging and splitting of trains, and through stations with setouts will be discussed also.', 0, '', 'Robert Clark', 1, '', 'erierailroad@accessbee.com', '', 'Y', '', '', 'convention', 'convention', '', '2011-06-12 12:49:38'),
(29, 'C029', 'SP: Sacramento Shops', '2011-07-04 09:30:00', '2011-07-04 11:30:00', 'The Sacramento General Shops were the core of Southern Pacific''s system-wide shops. With a need to be self-reliant in the Far West, Sacramento long maintained the capability to build any and every piece of equipment needed on the railroad. This included nearly 200 locomotives, and a great many freight and passenger cars, along with many specialized pieces of equipment and, naturally, upgrades and rebuilds of almost anything on the railroad.', 0, '', 'Bob Pecotich', 4, '', 'bobpec@comcast.net', '', '', '', '', '', '', 'Y', '2011-06-28 23:13:35'),
(30, 'C030', 'SP: Steam Over Donner', '2011-07-07 14:30:00', '2011-07-07 15:30:00', 'Bob Church will cover the types of locomotives used from the early Central Pacific days on to the early Southern Pacific through to the end of steam in the mid-1950s.', 0, '', 'Bob Church', 3, '', 'gorail@earthlink.net', '', '', '916-955-4057', 'The title of my presentation is: "Steam Over Donner"\r\nIt covers the types of locomotives used from the early Central Pacific days on to the early Southern Pacific through to the end of steam in the mid-1950s.\r\n\r\nMy presentation is power point, done on a IMac computer. I will use the equipment provided.\r\n\r\nBob\r\n \r\n', '', 'convention', '', NULL),
(31, 'C031', 'SP: Diesels', '2011-07-04 16:00:00', '2011-07-04 17:00:00', '', 0, '', 'Joe Strapac', 4, '', 'josephstrapac@ca.rr.com', '', '', '562/897-1940', '', 'Can you provide reproduction services for a handout?', '', 'Y', '2011-06-28 23:19:44'),
(32, 'C032', 'Pacific Fruit Express Operations', '2011-07-04 19:30:00', '2011-07-04 20:30:00', 'Produce shipping was a complex business. The major operators of refrigerator cars, like PFE, handled and distributed cars in quite specific ways. These ranged from returning and cleaning empty cars, to icing and loading them, and then moving them to the destinations of their loads. The clinic summarizes these operations, focussing on the ice refrigeration era. In each topic area, modeling points to be gained from the prototype are emphasized, and are summarized in a handout.', 0, '', 'Tony Thompson', 4, '', 'thompson@signaturepress.com', '', 'Y', '510-637-9960', '', '', 'mymac', 'Y', '2011-06-28 23:21:49'),
(34, 'C034', 'Central California Traction', '2011-07-04 13:00:00', '2011-07-04 14:00:00', 'A detailed overview of the Central California Traction Company, from its beginnings in 1905 to the modern railroad it is today. The talk, by Dave Stanley, modeler, former CCT employee, and co-author of the book "The Central California Traction Company," will touch on street car and interurban passenger service, electric and diesel freight operations, and model availability.', 0, '', 'Dave Stanley', 3, '', 'rrfreek@gmail.com', '', 'Y', '209-985-8928', '', '', 'convention', 'Y', '2011-06-28 23:16:17'),
(35, 'C035', 'Yosemite Valley Railroad', '2011-07-04 13:00:00', '2011-07-04 14:00:00', 'Those who research railroads in the era from the late 1930s to the late 1940s tend to think of these railroads in black and white due to the limited color photography of the period. But there were some railfans of the era who put up with slow, ASA 10 film speed to record their favorite prototypes in color. This presentation by Yosemite Valley Railroad expert Jack Burgess, author of "Trains to Yosemite", a book on the YVRR, will take viewers on a gorgeous trip on the YVRR from Merced to El Portal on the western boundary of Yosemite National Park using some his favorite color and B/W images of the railroad.', 0, '', 'Jack Burgess, MMR', 7, '', 'jack@yosemitevalleyrr.com', NULL, 'Y', '510/928-4117', '', 'mywindows', 'mywindows', '', NULL),
(36, 'C036', 'Craftsman Structures Tips & Tricks', '2011-07-08 21:00:00', '2011-07-08 22:00:00', 'Art Fahie from Bar Mills Models will be presenting various tips and tricks for building a detailing craftsman kits.', 0, '', 'Art Fahie (Bar Mills Models)', 1, '', 'barmillsmodels@yahoo.com', '', 'Y', '', '', '', '', '', NULL),
(37, 'C037', 'Creating a Web site for your Layout', '2011-07-05 08:00:00', '2011-07-05 09:00:00', '<p>Wanting to join the Internet and put up a web site for your layout, but not sure where to start? Professional IBM Consultant John Sing is here to deliver a clinic on developing and implementing your own Model Railroad Web Site(s). Anyone will benefit, this clinic is designed for everyone - you don''thave to be a Internet expert! In fact, doing a web site.... it''s a lot like designing a model railroad.  :-)</p>\r\n\r\n<em>Everyone can do this!</em>\r\n<p>You can literally be up and running your own web page as soon as you get home from Convention. You might even be doing your web site this evening from your hotel room. No kidding!  We''ll show you how.  :-)</p>\r\n\r\n<p><img src="http://www.pcrnmra.org/coast/clinics/John_Sing_Web_Page_image.jpg" target="_blank" /></p>\r\n\r\n<p>\r\nWe''ll take an entertaining, easy-to-understand look at the following:\r\n</p>\r\n\r\n1.  What''s possible with Model RR web sites?  Who''s doing what locally?     \r\n2.  What should my "Givens & Druthers" be for my web site?                  \r\n\r\n<p>\r\n<a href="http://macrodyn.com/ldsig/wiki/index.php?title=Using_Givens_and_Druthers_to_guide_the_process" target="_blank">http://macrodyn.com/ldsig/wiki/index.php?title=Using_Givens_and_Druthers_to_guide_the_process</a>\r\n</p>\r\n \r\n3.  What are my web site options?  (from Easy to Advanced). Lots of options\r\n4.  What is my easy step-by-step list of things to do?  Easy steps\r\n5.   Examples / resources of what you can do today!                                                    \r\n\r\n<p>                             \r\nYou''ll see many examples, including how the Pacific Coast Region, Coast Division quarterly web site gets built.     \r\n</p>\r\n\r\n<a href="http://www.pcrnmra.org/coast/contest/Contest_March_2010.shtml" target="_blank">http://www.pcrnmra.org/coast/contest/Contest_March_2010.shtml</a>\r\n\r\n<p>It''s not as hard as you think!   *You* can do it!</p>\r\n\r\n<p>(As a supplement, you''re welcome to review John''s previous clinic on Photographing Railroad Models):\r\n<a href="http://home.comcast.net/~atsf_arizona/John_Sings_Photographing_Railroad_Models_John_Sing_v23.pdf" target="_blank">http://home.comcast.net/~atsf_arizona/John_Sings_Photographing_Railroad_Models_John_Sing_v23.pdf</a>\r\n</p>', 0, '', 'John Sing', 2, '', 'singj@us.ibm.com', '', 'Y', '650-868-9404', '', '', 'mywindows', '', NULL),
(146, 'C146', 'A Day in the Life of a Train Dispatcher', '2011-07-05 08:00:00', '2011-07-05 09:00:00', '', 20, '', 'Retired SP-UP Dispatcher Steve "Breezy" Gust', 1, '', 'dspr57@yahoo.com', '', '', '402-616-9747', 'Prefer to be listed as Retired SP-UP Dispatcher Steve "Breezy" Gust', 'Clinic will be in ppt on flash drive', 'convention', '', NULL),
(40, 'C040', 'Introduction to Free-mo', '2011-07-05 14:30:00', '2011-07-05 15:30:00', '<p><b>Free-mo:</b>More than just a standard</p>\r\n<p>The objective of the Free-mo Standard is to provide a platform for prototype modeling in a flexible, modular environment. Free-mo modules not only provide track to operate realistic models, but also emphasize realistic, plausible scenery; realistic, reliable trackwork; and operations. Free-Mo was designed to and continues to push the envelope of modular model railroading to new heights. It goes beyond the traditional closed-loop set-up in creating a truly universal "free-form" modular design that is operations oriented and heavily influenced by prototype railroading.</p>\r\n<p>This clinic will go over the basic parts of the Free-mo Standard. There will be time for questions and answers about the standards.</p>\r\n', 0, '', 'Bob Schrempp', 2, '', 'bschrempp@alumni.calpoly.edu', '', 'Y', '805-423-1580', '', '', 'mywindows', '', NULL),
(41, 'C041', 'Free-mo Modular Signal System', '2011-07-05 16:00:00', '2011-07-05 17:00:00', 'Beginning around 2004 the members of Northern California Free-mo and San Luis Obispo Free-mo wanted to add block signals to their modules.  Lead by Gregg Fuhriman they developed what has become know as the Modular Signal System, or MSS.  The goal was to have an inexpensive system that could provide basic Automatic Block Signals on the modules.  It had to meet two requirements:  No modification to rolling stock (no resistance wheelsets), and modules must be able to be assembled in any order and direction.  Stop by and learn about the ingenious system that has met and exceeded these goals, and can be used with any module system or on permanent layouts.', 0, '', 'Barry Draper', 2, '', 'barry_draper@hotmail.com', '', 'Y', '626-673-1601', 'Clinic Description:\r\n\r\nBeginning around 2004 the members of Northern California Free-mo and San Luis Obispo Free-mo wanted to add block signals to their modules.  Lead by Gregg Fuhriman they developed what has become know as the Modular Signal System, or MSS.  The goal was to have an inexpensive system that could provide basic Automatic Block Signals on the modules.  It had to meet two requirements:  No modification to rolling stock (no resistance wheelsets), and modules must be able to be assem', '', 'mywindows', '', NULL),
(42, 'C042', 'The NWP--a Prototype With Something for Every Modeler', '2011-07-05 09:30:00', '2011-07-05 10:30:00', '', 0, '', 'Fred Codoni', 3, '', 'nsgwfpc@comcast.net', NULL, 'Y', '415 819-8308', '', '', 'convention', '', NULL),
(43, 'C043', 'NWP: Restoring Wooden Railroad Cars', '2011-07-05 11:00:00', '2011-07-05 12:00:00', 'The Northwestern Pacific Railroad Historical Society is restoring 3 wood railcars. An 1899 caboose originally built in Sacramento and later sold to the Petaluma & Santa Rosa Railroad. A 1892 baggage car built in Tiburon for the SF&NP. And a 1869 Coach originally purchased from Wason Car Company by the Central Pacific. All three are currently in Petaluma CA, the caboose is almost finished. Gus will show in-service, recovery from former locations, and reconstruction photos. The cars will be on Tour on Wendesday.', 0, '', 'Gus Campagna', 3, '', 'campgus@earthlink.net', '', '', '415-990-3777', 'The Northwestern Pacific Railroad Historical Society is restoring 3 wood railcars. An 1899 caboose originally built in Sacramento and later sold to the Petaluma & Santa Rosa Railroad. A 1892 baggage car built in Tiburon for the SF&NP. And a 1869 Coach originally purchased from Wason Car Company by the Central Pacific. All three are currently in Petaluma CA, the caboose is almost finished. Gus will show in-service, recovery from former locations, and reconstruction photos.\r\nThe cars will be on To', '', 'convention', '', NULL),
(44, 'C044', 'NWP Operations adapted to Eel River Model RR', '2011-07-05 13:00:00', '2011-07-05 14:00:00', '', 0, '', 'Ron Plies, MMR and Don Nelson', 3, '', 'ron@ronpliesinsurance.com', '', '', '707-496-4949', '', '', 'convention', '', NULL),
(46, 'C046', 'Cadillacs and Crummies: Recreating the NWP in a modest space', '2011-07-05 16:00:00', '2011-07-05 17:00:00', '', 0, '', 'Ed Merrin', 3, '', 'edmerrin@earthlink.net', NULL, 'Y', '707-799-3734', 'Correct my email address: edmerrin@comcast.net\r\n', '', 'mymac', '', NULL),
(47, 'C047', 'Modeling a Country Grain Elevator', '2011-07-06 19:30:00', '2011-07-06 20:30:00', 'Scratchbuilding a styrene model of a corrugated metal-clad cribbed grain elevator, including interior structural and equipment details, in HO scale. The prototype for the model was the subject of the "Perspective" column in the August, 2009, issue of Railroad Model Craftsman. Step by step construction using templates and jigs, before and after coloring and assembly of components, mold making/plaster casting, and historical and other photos are included.', 0, '', 'Bob Van Arnem', 5, '', 'vanarnem@cableone.net', '', 'Y', 'cell 208-629-69', '', 'I prefer to present facing the projection screen (as the audience would view the screen) rather than facing the audience, but I have presented both ways. Just letting you know my preference. Thank you.', 'convention', '', NULL),
(48, 'C048', 'Building your own Signals', '2011-07-05 08:00:00', '2011-07-05 09:00:00', 'This clinic provides detailed instruction on building and wiring a signal using a commercial signal target, some brass tube and some plastic shapes. Results in a nice working signal for less than $8.00.', 0, '', 'David Metal', 4, '', 'dmetal@juno.com', '', '', '6316970450', 'is this a duplicate?', 'convention', '', '', NULL),
(50, 'C050', 'Card Stock Structures', '2011-07-05 11:00:00', '2011-07-05 12:00:00', '', 0, '', 'Scott Robertson', 4, '', 'uawildcats2@comcast.net', NULL, 'Y', '916-803-3072', '', 'I assume Powerpoint is provided on the Convention computer and that there is a USB port to accept a thumb drive. What version is the powerpoint software? I may bring a backup lap top just in case.', 'convention', '', NULL),
(51, 'C051', 'The World of DCC and Sound ', '2011-07-05 13:00:00', '2011-07-05 14:00:00', 'Operating a layout has never been more rewarding than this day and age thanks to all of the available options in DCC and sound. Now locomotives can be run by themselves not by the track and can have the correct sound to match. This clinic will cover an overview of how DCC works, what it takes to get started and a look at some of the impressive sound options currently offered on the market including the new Surroundtraxx layout system.', 0, '', 'Jarrette Ireland (Soundtraxx)', 4, '', 'support@soundtraxx.com', '', '', '', '', '', '', '', NULL),
(52, 'C052', 'Prototypical Operation of the Tsunami Steam Decoder', '2011-07-05 14:30:00', '2011-07-05 15:30:00', 'This exciting and informative clinic will cover all of the sounds found in the steam Tsunami and how they relate to a real steam locomotive. After an over view of the sounds we will examine setting up our decoder to match a specific prototype and then examine using the sounds and functions of the Tsunami to enhance an operating session. At the end will be a short Q&A period for all those in attendance.\r\n', 0, '', 'Jarrette Ireland (Soundtraxx)', 4, '', 'support@soundtraxx.com', '', '', '', '', '', '', '', NULL),
(53, 'C053', 'Prototypical Operation of the Diesel Tsunami Decoder', '2011-07-05 16:00:00', '2011-07-05 17:00:00', 'This exciting and informative clinic will cover all of the sounds found in the diesel Tsunami and they relate to a diesel locmotive. After an overview of the sound found in every diesel Tsunami we will examine setting up our decoder to match a specific prototype and then examine using the sounds and functions of the Tsunami to enhance an operating session. At the end will be a short Q&A period for all those in attendance.', 0, '', 'George Bogatiuk (Soundtraxx)', 4, '', 'support@soundtraxx.com', NULL, '', '', '', '', '', '', NULL),
(54, 'C054', 'Streamlined Trains in California', '2011-07-05 09:30:00', '2011-07-05 10:30:00', 'Beginning in 1936 California was witness to an interesting variety of streamlined passenger trains, some of the finest in the land. We will discuss the routes and unique features of the trains operated by several well-known railroads serving the Golden State, through to the introduction of Amtrak in 1971.', 0, '', 'Paul Hobbs', 5, '', 'pt_hobbs@yahoo.co.nz', '', '', '424 270 4494', 'Beginning in 1936 California was witness to an interesting variety of streamlined passenger trains, some of the finest in the land. We will discuss the routes and unique features of the trains operated by several well-known railroads serving the Golden State, through to the introduction of Amtrak in 1971.', '', 'convention', '', NULL),
(55, 'C055', 'Passenger Trains  in California 1971 - 2011', '2011-07-05 11:00:00', '2011-07-05 12:00:00', 'Paul Hobbs will discuss Amtrak''s impact on passenger service as well as commuter trains and light rail developments in the golden state.', 0, '', 'Paul Hobbs', 5, '', 'pt_hobbs@yahoo.co.nz', NULL, '', '424 270 4494', '', '', 'convention', '', NULL),
(56, 'C056', 'Prototype Research Panel Discussion', '2011-07-07 11:00:00', '2011-07-07 12:00:00', 'The panel for this presentation will include, Jack Burgess, Richard Hendrickson, Tony Koester, Tony Thompson, and Kyle Wyatt (Curator for CSRM). They will discuss a wide range of prototype research sources and techniques including photos, Official Equipment Registers, archives and libraries, specialty publications, patent drawings, Car Builders Cyclopedias, and more.', 0, '', 'Jack Burgess, MMR and others', 5, '', 'jack@yosemitevalleyrr.com', NULL, 'Y', '510/928-4117', '', 'mywindows', 'mywindows', '', NULL),
(59, 'C059', 'JMRI: Advanced Decoder Pro', '2011-07-06 13:00:00', '2011-07-06 14:00:00', '<a href="http://jmri.org">DecoderPro</a> is a great way to set CVs in your DCC locomotives, making simple configuration changes easy.  But it can also do very much more, and this clinic will focus on examples such as improving how function keys operate your locomotive, organizing locomotives for your club, making it easier to run your locomotives from Android or iPhones, and other neat things.  We''ll have lots of time for your questions.  This clinic assumes at least some familiarity with DecoderPro, and won''t cover installing it or basic operations.\r\n', 80, '', 'Bob Jacobsen', 1, '', 'jacobsen@berkeley.edu', '', '', '', '', '', '', 'Y', '2011-06-14 16:27:09'),
(60, 'C060', 'JMRI: Operations', '2011-07-06 14:30:00', '2011-07-06 15:30:00', '<a href="http://jmri.sourceforge.net/">JMRI</a> <a href="http://jmri.sourceforge.net/help/en/package/jmri/jmrit/operations/Operations.shtml">Operations</a> is a module within DecoderPro / PanelPro that provides a comprehensive car management / forwarding system.  In this clinic you''ll learn to set up and use Operations to configure Locations, Routes, Yards, Industry tracks, Car types and loads and Trains.  You''ll be shown how the program generates Switch Lists, Car Reports and Train Manifests.  In addition, basic troubleshooting and general configuration issues will be covered.  There will be time for a Q&A at the end of the clinic.', 30, '', 'Dennis Drury', 1, '', 'dennis95747@yahoo.com', NULL, 'Y', '916 747-2313', '', '', 'mywindows', '', NULL),
(61, 'C061', 'JMRI: LocoNet Signaling', '2011-07-06 16:00:00', '2011-07-06 17:00:00', '', 0, '', 'Dick Bronson', 1, '', 'dick@rr-cirkits.com', NULL, 'Y', '704-517-3339', 'I do not currently have a better description, pending new hardware availability in time for the presentations, ', '', 'mylinunx', '', NULL),
(62, 'C062', 'JMRI Users Meeting', '2011-07-04 21:00:00', '2011-07-04 23:00:00', '<a href="http://jmri.org">JMRI</a>, including DecoderPro and PanelPro, is a free software package for model railroaders to use in our great hobby. Whether you are new to JMRI, or an experienced JMRI user, please come to hear about in-progress developments, suggest new things, and meet others in the JMRI community. After a Q&A session focused on new and coming JMRI features, the floor will be open for general questions and suggestions related to all areas of JMRI.\r\n', 0, '', 'Bob Jacobsen', 2, '', 'jacobsen@berkeley.edu', '', 'Y', '510-708-5988', 'No comments', 'Wifi?', 'mymac', '', NULL),
(63, 'C063', 'Troubleshooting and Repairing Brass Steam Locomotives', '2011-07-06 08:00:00', '2011-07-06 09:00:00', 'Older brass steam locomotives have a reputation for running poorly.  This clinic will discuss the common problems and show you how to fix them.  A step by step example of a locomotive repair will be illustrated. This clinic is tailored to the beginner who wants learn how to improve the running of those cranky steam locomotives.', 0, '', 'Mark Schutzer', 1, '', 'mark.schutzer@sbcglobal.net', NULL, 'Y', '', '', '', 'mywindows', '', NULL),
(64, 'C064', 'Telecommunications for Model Railroaders', '2011-07-09 09:30:00', '2011-07-09 10:30:00', 'Communications play an important role in any operating model railroad.  This clinic explores the history of communications technology on prototype railroads and discusses how to model these systems for period operations.  The major focus is on telephone based communications as used from 1920s until radio became ubiquitous in the 1980s.', 0, '', 'Seth Neumann', 3, '', 'sneumann@pacbell.net', '', 'Y', '4156021510', '', '', 'mywindows', 'Y', '2011-06-28 23:27:19'),
(65, 'C065', 'Update on the Nickel Plate', '2011-07-06 11:00:00', '2011-07-06 12:00:00', 'Model Railroader contributing editor Tony Koester will review the myriad advancements in the hobby since he designed, built, and operated his well-known Allegheny Midland, including DCC, scenic materials, track construction, multi-deck/narrow-shelf design, and photo backdrops (including the dramatic advantages offered by photo-editing software such as Photoshop Elements), and recent developments in train-dispatching and car-forwarding systems.', 0, '', 'Tony Koester, ALWWD', 4, '', 'nkpfan@ptd.net', '', 'Y', '862-266-2958', '', '', 'mymac', 'Y', '2011-06-28 23:24:41'),
(66, 'C066', 'How I planned my signal system', '2011-07-06 13:00:00', '2011-07-06 14:00:00', 'This clinic goes into the planning and preparation of the railroad before starting to install signals. The clinic discusses creating signal blocks, block detection, signal drivers, wiring standards and wiring for the installation of signals.', 0, '', 'David Metal', 2, '', 'dmetal@juno.com', '', '', '6316970450', 'This should be a second clinic titled "how I planned my signal system"', '', 'convention', '', NULL),
(69, 'C069', 'Chasing Chinese Steam', '2011-07-06 19:30:00', '2011-07-06 20:30:00', 'In May of 2006, Barbara and Doug, together with 18 other enthusiasts traveled to northeast China to see and record some of Chinaâ€™s last working steam engines in normal service.  Although too late to witness mainline steam, the group visited many coal branch railroads.  Through video and still photography, Doug and Barbara will show you several varieties of standard gauge 2-8-2s and narrow gauge 0-8-0s performing their everyday tasks of hauling passengers and freight.  They will also share with you some of their experiences in this part of China where few foreigners venture.', 0, '', 'Doug Geiger, MMR & Barbara Geiger', 2, '', 'gmry@comcast.net', '', 'Y', '303-875-7691', '', '', 'mywindows', '', NULL),
(176, 'C176', 'Quick and Easy Freight Car Weathering', '2011-07-05 14:30:00', '2011-07-05 15:30:00', 'Get more satisfaction from those ready to run and shake the box models with all that fine detail, shiny paint and perfect lettering applied in the Peopleâ€™s Republic of China!  Add your personal touch to your freight car fleet, without scratchbuilding or super detailing, by imitating the effects of time and nature.  No prototype cars last long out of the paint shop before the weathering process begins.  This clinic will show how to use oil paint washes and other cheap and easy methods, without an airbrush, to improve the realism of your layout.  Techniques learned from the model railroad press and from trial and error over the past 45 years will be discussed in this clinic.', 0, '', 'Roger Nulton, MMR', 5, '', 'roger.nulton@comcast.net', '', 'Y', '253-302-6989', '', 'Hi Dave and Tony,\r\nI would like to have a small lectern to hold my laptop and notes, and a VGA cord to reach from the lectern to the projector.  I also need a banquet sized table to display my models, tools and materials.\r\nThanks, Roger', 'mywindows', '', NULL),
(71, 'C071', 'The World of DCC and Sound', '2011-07-06 09:30:00', '2011-07-06 10:30:00', 'Operating a layout has never been more rewarding than this day and age thanks to all of the available options in DCC and sound. Now locomotives can be run by themselves not by the track and can have the correct sound to match. This clinic will cover an overview of how DCC works, what it takes to get started and a look at some of the impressive sound options currently offered on the market including the new Surroundtraxx layout system.\r\n', 0, '', 'Jarrette Ireland (Soundtraxx)', 3, '', 'support@soundtraxx.com', '', '', '', '', '', '', '', NULL),
(72, 'C072', 'Prototypical Operation of the Tsunami Steam Decoder', '2011-07-06 11:00:00', '2011-07-06 12:00:00', 'This exciting and informative clinic will cover all of the sounds found in the steam Tsunami and how they relate to a real steam locomotive. After an over view of the sounds we will examine setting up our decoder to match a specific prototype and then examine using the sounds and functions of the Tsunami to enhance an operating session. At the end will be a short Q&A period for all those in attendance.\r\n', 0, '', 'Jarrette Ireland (Soundtraxx)', 3, '', 'support@soundtraxx.com', '', '', '', '', '', '', '', NULL),
(73, 'C073', 'Prototypical Operation of the Diesel Tsunami Decoder', '2011-07-06 13:00:00', '2011-07-06 14:00:00', 'This exciting and informative clinic will cover all of the sounds found in the diesel Tsunami and they relate to a diesel locmotive. After an overview of the sound found in every diesel Tsunami we will examine setting up our decoder to match a specific prototype and then examine using the sounds and functions of the Tsunami to enhance an operating session. At the end will be a short Q&A period for all those in attendance.', 0, '', 'George Bogatiuk (Soundtraxx)', 3, '', 'support@soundtraxx.com', NULL, '', '', '', '', '', '', NULL),
(74, 'C074', 'Photographing Your Models', '2011-07-06 14:30:00', '2011-07-06 15:30:00', 'John is one of the Coast Division''s prolific photographers of local model railroad layouts and models.\r\nExamples of his work can be seen on the Coast Division Model Contest web site (http://www.pcrnmra.org/coast/contest.shtml)\r\nand at his own personal model railroad web site (http://home.comcast.net/~j.sing/ ).\r\n\r\nhttp://home.comcast.net/~j.sing/Santa_Fe_PA1s_2_banner.jpg\r\n\r\nIn this clinic, John will discuss the his easy to follow methods for making digital model railroad photos, using today''s very affordable digital cameras.   (URL = http://www.dpreview.com/reviews/Q110superzoomgroup/  ) \r\n\r\nSpecific recommendations for equipment will be included, as well as ideas and recommendations for simple composition, lighting, backdrop, and exposure.\r\n\r\nPost-processing of the digital image is then covered (this is just as important as the original image itself) by using free simple but powerful photo editing software (I use IrfanView) that can be downloaded off the Internet.\r\n\r\nThe focus of this clinic is on easy to follow methods for digital model railroad photography.  Assumes limited photography experience, however, insights, tips and hints for experienced phototographers are included, as we all learn by sharing our experiences. \r\n\r\nThis clinic is aimed for the "everyone" in all of us -  we''re not going to go into the professional level details. So, if you just want to make better model railroad photos - come on out and hear what John has to say about "Everyone can do digital model railroad photos!!!" ', 0, '', 'John Sing', 3, '', 'singj@us.ibm.com', '', 'Y', '650-868-9404', '', '', 'mywindows', '', NULL),
(75, 'C075', 'Easy City Streets Using Sintra', '2011-07-06 16:00:00', '2011-07-06 17:00:00', 'What is Sintra and what is it good for? Come and find out why it is a neat, easy-to-use alternative to many commonly used methods of making city streets. Clinic also includes some basic guidelines for modeling urban streets that are applicable to most methods of street construction.', 0, '', 'Jim Sacco', 3, '', 'ctyclsscs@aol.com', '', '', '412-721-2439', '', 'convention', 'convention', '', NULL),
(76, 'C076', 'Tales of a Hobby Shop Owner', '2011-07-06 19:30:00', '2011-07-06 20:30:00', 'A discussion of the 26-year life of a hobby shop, from birth to death. Join with Bill as he discusses how he got started in the hobby shop business, figured out pay, their shop cat and his antics, the customers and their antics, robberies (maybe), and how he sold the shop. Audience participation is welcome.', 0, '', 'Bill Winans', 3, '', 'thewinans@cableone.net', '', 'Y', '928-273-3670', '', '', 'mywindows', '', '2011-06-14 16:10:07'),
(77, 'C077', 'Craftsman Structures Tips & Tricks', '2011-07-07 21:00:00', '2011-07-07 22:00:00', 'Art Fahie from Bar Mills Models will be presenting various tips and tricks for building a detailing craftsman kits.', 0, '', 'Art Fahie (Bar Mills Models)', 5, '', 'barmillsmodels@yahoo.com', '', 'Y', '', '', '', '', '', NULL),
(78, 'C078', 'A Brief History of the American Gas Station and Modeling Tips', '2011-07-06 09:30:00', '2011-07-06 10:30:00', 'The title pretty much says it all. Clinic includes a photo history of the gas station in North America, followed by some tips that may help modelers build a more realistic model of one. It concludes with a look at common, unusual or just plain wacky gas stations. Sit back, relax and enjoy the photos!', 0, '', 'Jim Sacco', 4, '', 'ctyclsscs@aol.com', '', 'Y', '412-721-2439', '', '', 'convention', '', NULL),
(80, 'C080', 'Modeling a Country Grain Elevator', '2011-07-07 11:00:00', '2011-07-07 12:00:00', 'Scratchbuilding a styrene model of a corrugated metal-clad cribbed grain elevator, including interior structural and equipment details, in HO scale. The prototype for the model was the subject of the "Perspective" column in the August, 2009, issue of Railroad Model Craftsman. Step by step construction using templates and jigs, before and after coloring and assembly of components, mold making/plaster casting, and historical and other photos are included.', 0, '', 'Bob Van Arnem', 1, '', 'vanarnem@cableone.net', NULL, 'Y', 'cell 208-629-69', '', 'I prefer to present facing the projection screen (as the audience would view the screen) rather than facing the audience, but I have presented both ways. Just letting you know my preference. Thank you.', 'convention', '', NULL),
(81, 'C081', 'The Traveling Toolbox System', '2011-07-06 14:30:00', '2011-07-06 15:30:00', 'When you can''t take the kitchen sink, what do you take? Many model railroaders travel to clubs and other layouts. Take what you need. This clinic will discuss how to organize a traveling toolbox system. Audience participation encouraged. All scales welcome.', 0, '', 'Pete Steinmetz', 4, '', 'peter.steinmetz@att.net', '', '', '', '', '', '', '', NULL),
(82, 'C082', 'Building Distressed Wood Structures', '2011-07-06 16:00:00', '2011-07-06 17:00:00', 'Learn how to create realistic distressed wood structures using my Weathering and Distressing Clapboard Siding and Strip Wood Techniques.', 0, '', 'Jimmy Simmons', 4, '', 'mrboyjrs@gmail.com', '', 'Y', '702-449-6900', '', '', 'none', '', NULL),
(83, 'C083', 'Nn3', '2011-07-06 19:30:00', '2011-07-06 20:30:00', 'An overview of commercially available products and typical techniques for modeling narrow gauge in 1:148 - 1:160 scales.\r\n\r\nThe clinic will cover:\r\n<ul>\r\n<li>A brief history of â€œNn3â€ from the 1950''s to present</li>\r\n<li>Locomotives (Kit, R-T-R, and â€œParts-Builtâ€)</li>\r\n<li>DCC & Sound</li>\r\n<li>Rolling Stock (Kit & R-T-R, Freight, Passenger, and Non-Revenue)</li>\r\n<li>Track Work (Sectional, Flex, Hand-Laid, Ballasting)</li>\r\n<li>Modules, Module Standards and Clubs</li>\r\n</ul>\r\n\r\nThe Power Point presentation will be supplemented by pass-around samples, a hand-out, and the operating Nn3 modular layout on show at the Convention, presented by the NorCal Division of the international group, The Nn3 Alliance. The layout has appeared at numerous NMRA and NNGC conventions and includes many of the products and techniques discussed in the clinic. The Nn3 Alliance includes over 800 modelers from ten countries modeling 2-foot, 3-foot, 42" and meter gauge in 1:148, 1:150, 1:152, and 1:160 scales.', 0, '', 'Tom Knapp, MMR', 4, 'www.Nn3.org', 'thomasknapp@att.net', '', 'Y', '4152039160', '', 'table for "show-and-tell" of example equipment', 'convention', '', NULL),
(84, 'C084', 'Introduction to Signals for your Model Railroad', '2011-07-07 13:00:00', '2011-07-07 14:00:00', 'This clinic provides an introduction to Prototype Signals and signaling systems for the modeler.  It goes on to discuss issues for planning and implementing a model signaling system for your railroad based on past LDSIG "Planning for Signals" panels.  This clinic is intended for the modeler who is exploring adding signals to an existing layout or designing signals (and CTC) into a new design.', 20, '', 'Seth Neumann', 1, '', 'sneumann@pacbell.net', NULL, '', '415 602 1510', '', '', 'mywindows', '', NULL),
(85, 'C085', 'R Street Industrial Corridor', '2011-07-07 19:30:00', '2011-07-07 20:30:00', 'Sacramento''s R Street corridor is a great example of an urban switching district. It had several elements that are good prototypes to model: interchange tracks, a scale track, freight houses, team tracks, and several industrial customers. R Street was served by the Southern Pacific and Western Pacific; the Sacramento Northern had trackage rights down R after 1954 or so. Using photos and maps, we''ll take a virtual walking tour down R Street in the 1940s and 1950s. Designing and building a module based on R Street will also be discussed.', 0, '', 'Tom Campbell', 2, '', 'caprikar21@yahoo.com', '', '', '916 402-2054', 'Please delete "Designing a track plan and associated module will also be discussed."  \r\n\r\nand replace with: \r\n"Designing and building a module based on R Street will also be discussed."\r\n\r\nThanks- \r\nTom Campbell', 'convention', '', '', NULL),
(156, 'C156', 'Woodland Scenics Foam Layout Construction', '2011-07-07 16:00:00', '2011-07-07 17:00:00', 'The newest method for building your layout or module is with high-density foam. Woodland Scenics has it all in the SubTerrain system and this clinic will show you how to use it. Learn how to create a fast and easy layout using no woodworking skills or tool and with very little mess.', 20, '', 'Miles & Fran Hale, MMR', 4, '', 'mileshale@sbcglobal.net', '', 'Y', '', '', '', '', '', NULL),
(87, 'C087', 'Signaling Your Model Railroad: Part 2', '2011-07-07 20:30:00', '2011-07-07 21:30:00', 'ABS, APB and Grade Crossing Warning Systems\r\n\r\nExpanding upon the content of the Railroader&rsquo;s Application Handbook, Bruce provides detailed coverage of optimized block occupancy detection and its application to establish Automatic Block Signaling (ABS) including its programming. Then, Bruce explains how the prototype utilizes &ldquo;Traffic Sticks&rdquo; to determine directional movement across block boundaries. Such capability plays a key role in setting up Absolute Permissive Block (APB) signaling thereby providing protection for bi-directional operation on the same track. The importance of &ldquo;traffic sticks&rdquo; in setting up grade crossing warning systems is discussed along with its utilization with a new Prototypical Grade Crossing Control (PGCC) card. Software examples are included for ABS, APB and for driving the PGCC.\r\n', 20, '', 'Bruce Chubb, MMR', 1, 'http://www.jlcenterprises.net/', 'chubbbrucemmr@aol.com', '', 'Y', '', '', '', 'convention', '', NULL);
INSERT INTO `prod_eventtools_clinics` (`id`, `number`, `name`, `start_date`, `end_date`, `description`, `status_code`, `cart_item`, `clinic_presenter`, `clinic_location_code`, `clinic_url`, `clinic_presenter_email`, `comment`, `clinic_ok`, `clinic_presenter_cell_number`, `clinic_presenter_confirm_comment`, `clinic_presenter_av_comment`, `clinic_presenter_av_request`, `mark_changed`, `last_mod_time`) VALUES
(155, 'C155', 'Disney Railroading', '2011-07-07 13:00:00', '2011-07-07 14:00:00', 'John Olson was recruited by Walt Disney Imagineering in 1974 when Mike O''Connell (owner of Chooch Enterprises) was working there as a show writer, and producing a film on model railroading for Kalmbach Publishing, which featured a few of John''s dioramas. John began with Disney as a model builder, and soon branched into production design and field art direction for the Disney Theme Parks. Katie, a Disney Scholarship winner, joined Disney shortly after John as a model painter and color designer. Together they have worked on too many Disney Theme Parks to name!\r\n\r\nBefore joining Disney, John worked closely with folks like Tom Daniel, Leo Campbell, and Fred Hill, among other manufacturers and retailers. Also at time, John began publishing with Kalmbach, Carstens, Narrow Gauge Gazette, and of course the NMRA Bulletin. John will be sharing memories of those days. \r\n\r\nGiven the fact that Walt Disney himself was a huge rail fan, trains are ever-present in the Disney vocabulary. Over the years there they have worked with several famous Disney characters, such as Ward Kimball (Grizzly Flats RR), Harper Goff (Great Locomotive Chase art director), Frank Thomas and Ollie Johnston (private railroads in two locations), Carl Fallberg (Fiddletown and Copperopolis), and many more. The clinic takes us to the homes of the above folks and a pictorial visit to their railroads. John and Katie will also discuss the ever present thread of trains in the Disney theme parks. Katie has color designed many of the railroad stations and locomotives in several of the parks.\r\n\r\nIt was during the early years at Walt Disney Imagineering that John built the Mescal Lines, Cielo Lumber Company, Jerome and Southwestern RR. Later he built (and Katie painted) the Ferrocarril de Tascosa and Calico. John will be sharing some images of his work, and discussing how building Disney theme parks is really similar to building a model railroad!', 20, '', 'John & Katie Olson', 2, '', 'John.D.Olson.-ND@disney.com,Katherine.T.Olson@disney.com', '', '', '', '', '', '', '', NULL),
(89, 'C089', 'JMRI: LocoNet Signaling', '2011-07-07 16:00:00', '2011-07-07 17:00:00', '', 20, '', 'Dick Bronson', 1, '', 'dick@rr-cirkits.com', NULL, 'Y', '704-517-3330', '', '', 'mylinunx', '', NULL),
(90, 'C090', 'CATS: a CTC Panel that Grows', '2011-07-08 14:30:00', '2011-07-08 15:30:00', 'This clinic is an introduction to the Computer Automated Traffic System (CATS).  CATS is open source software built upon JMRI for creating and operating a modern looking CTC panel.  The clinic will open with creating a CTC panel for John Armstrong''s "minimum-size loop-to-loop" layout, and operated as a magnet board.  It will progress to demonstrating how to add occupancy detection, turnout feedback, turnout control, and signal control, in a simulation mode.  The clinic will demonstrate other features built into CATS, including train tracking, session recording, train status display, crew management, and rapid CTC panel development for module groups.  For a preview, see the August 2010 NMRA Magazine or <a href="http://home.comcast.net/~kb0oys">http://home.comcast.net/~kb0oys</a>.', 0, '', 'Rodney Black', 2, '', 'rodneyblack2000@yahoo.com', '', '', '', 'I sent Dave a more fully detailed title and description.  I have not seen it posted, yet.', '', 'mywindows', '', NULL),
(91, 'C091', 'OpenLCB', '2011-07-04 19:30:00', '2011-07-04 20:30:00', '<a href="http://openlcb.org">OpenLCB</a> is an open community of model railroad, electronics and software hobbyists to create new electronics for controlling model railroads. We are creating a layout control bus (LCB) that connects boards &amp; programs. The result is easy to use, customizable, and brings new capabilities to model railroaders.\r\n<p>\r\nThis clinic describes what we''ve accomplished so far, where we''re going, and how you can get involved. Come see how modern tools can make many types of layout controls easier &amp; more reliable.', 40, '', 'Bob Jacobsen', 2, 'http://openlcb.org', 'jacobsen@berkeley.edu', '', '', '', '', '', '', '', '2011-06-13 14:00:57'),
(92, 'C092', 'Scratchbuilding Crossings in any Scale', '2011-07-07 14:30:00', '2011-07-07 15:30:00', '', 0, '', 'Dick Karnes', 2, '', 'rnk2202@yahoo.com', '', '', '', '', '', '', '', NULL),
(93, 'C093', 'Yosemite Valley Railroad', '2011-07-07 16:00:00', '2011-07-07 17:00:00', 'Those who research railroads in the era from the late 1930s to the late 1940s tend to think of these railroads in black and white due to the limited color photography of the period. But there were some railfans of the era who put up with slow, ASA 10 film speed to record their favorite prototypes in color. This presentation by Yosemite Valley Railroad expert Jack Burgess, author of "Trains to Yosemite", a book on the YVRR, will take viewers on a gorgeous trip on the YVRR from Merced to El Portal on the western boundary of Yosemite National Park using some his favorite color and B/W images of the railroad.', 0, '', 'Jack Burgess, MMR', 2, '', 'jack@yosemitevalleyrr.com', NULL, 'Y', '510/928-4117', '', 'mywindows', 'mywindows', '', NULL),
(94, 'C094', 'Rapid Prototyping', '2011-07-07 13:00:00', '2011-07-07 14:00:00', 'Bill Brisko of Pacific Locomotive Works will discuss tools and techniques available for rapidly creating cast details.', 0, '', 'Bill Brisko', 6, 'http://www.pacificlocomotive.com/', 'bbrisko@sonic.net', '', '', '', '', '', '', '', NULL),
(95, 'C095', 'Troubleshooting and Repairing Brass Steam Locomotives', '2011-07-07 08:00:00', '2011-07-07 09:00:00', 'Older brass steam locomotives have a reputation for running poorly.  This clinic will discuss the common problems and show you how to fix them.  A step by step example of a locomotive repair will be illustrated. This clinic is tailored to the beginner who wants learn how to improve the running of those cranky steam locomotives.', 0, '', 'Mark Schutzer', 4, '', 'mark.schutzer@sbcglobal.net', NULL, 'Y', '', '', '', 'mywindows', '', NULL),
(96, 'C096', 'World Wide Model Railroad Tour', '2011-07-07 09:30:00', '2011-07-07 10:30:00', 'Look over John''s shoulder as we go on a &quot;you-are-there&quot; fast-paced photo, movie, and multi-media tour of worldwide Americas, European, and Asian model and prototype railroad sites and people the world over. Enjoy the incredible diversity and interest. Gather ideas for future travels. Or just save the expense and watch here! \r\n<p>\r\nWW, European sites include: Miniature Wonderland, Hamburg 2007 - Narrow Gauge Live Steam, Saxony, Germany 2008 - The Deutsch Museum, Munich 2007 - Nuremburg Deutschbahn Museum - French TGV, Germany ICE - Gotthard Pass, Switzerland - Atlas Model RR HQ in NJ - Hawaii RR Museum, Oahu - Argentina has model railroading too! - Prototype industrial trackage you have to see to believe\r\n<p>\r\nNotable Hobby shops in countries around the world: - Visit to Japan Kato Showroom 2008 - Caboose Hobbies, Denver\r\n<p>\r\nModel RR Exhibitions and Conventions include: - Nottingham UK Model Railway Exhibition 2006 - US-themed Model RR Convention in Germany 2007 - Two largest N-Trak Layouts ever (2008 Louisville, 2004 Chantilly) - Amherst Model RR Show 2005 - Anaheim NMRA National Convention 2008\r\n<p>\r\nFamous Model RR clubs: - Glendale, Pasadena, Slim Gauge Guild, Belmont Shores - San Diego Model RR Museum - The Model RR Club, New Jersey - Washington State Museum''s Puget Sound Model RR Engineers\r\n<p>\r\nWorld-class Layout Tours include: - John Armstrong - Jim Blattau - Paul Dolkos - Dick Patton', 0, '', 'John Sing', 3, '', 'singj@us.ibm.com', NULL, 'Y', '650-868-9404', '', '', 'mywindows', '', NULL),
(98, 'C098', 'SP Freight Cars You Can Model', '2011-07-07 13:00:00', '2011-07-07 14:00:00', 'This talk presents examples of models from kits and kit conversions in HO scale that represent important SP freight cars for the steam-diesel transition era. All types of cars, from flats and gondolas to box, tank and hopper cars and cabooses, are included. The focus is on accurate and reasonable representations of each prototype car, not of museum-quality modeling. Some information on car usage is also included. A handout summarizes the car classes and commercial model(s) used as the basis for each car.', 0, '', 'Tony Thompson', 3, '', 'thompson@signaturepress.com', NULL, 'Y', '510-637-9960', '', 'mymac', 'mymac', '', NULL),
(99, 'C099', 'SP: Diesels', '2011-07-05 14:30:00', '2011-07-05 15:30:00', '', 0, '', 'Joe Strapac', 7, '', 'josephstrapac@ca.rr.com', NULL, '', '562/897-1940', '', 'If you want a handout, can you provide repro services?', 'convention', '', NULL),
(100, 'C100', 'SP: Passenger Cars', '2011-07-07 16:00:00', '2011-07-07 17:00:00', '', 0, '', 'Jeff Cauthen', 3, '', 'overland28@yahoo.com', NULL, 'Y', '650-703-4188', '', '', 'convention', '', NULL),
(101, 'C101', 'Modeling the Southern Pacific Business Train', '2011-07-07 19:30:00', '2011-07-07 20:30:00', 'When the Southern Pacific needed to reach deep into its publicity arsenal, it would dispatch a fleet comprised of official and business car equipment to cover events ranging from company advertising to major sporting events.  This polished varnish would create a clearly defined business train consist in the 1980s.  Southern Pacific Prototype Modeler Scott Inman decided to take on the arduous task of modeling the train in HO scale.  The clinic will describe both the prototype equipment, uses of the train, and the model alterations needed to accurately represent the Southern Pacific Business Train.', 0, '', 'Scott Inman', 3, '', 'tighttrains@hotmail.com', '', '', '916-205-9064', 'The only thing I would change is the title.  The title I have used to present the clinic in the past is "Modelin the Southern Pacific Business Train."\r\n', '6 or 8 foot Table to display the train on.', 'convention', '', NULL),
(102, 'C102', 'Nn3', '2011-07-07 21:00:00', '2011-07-07 22:00:00', 'An overview of commercially available products and typical techniques for modeling narrow gauge in 1:148 - 1:160 scales.\r\n\r\nThe clinic will cover:\r\n<ul>\r\n<li>A brief history of â€œNn3â€ from the 1950''s to present</li>\r\n<li>Locomotives (Kit, R-T-R, and â€œParts-Builtâ€)</li>\r\n<li>DCC & Sound</li>\r\n<li>Rolling Stock (Kit & R-T-R, Freight, Passenger, and Non-Revenue)</li>\r\n<li>Track Work (Sectional, Flex, Hand-Laid, Ballasting)</li>\r\n<li>Modules, Module Standards and Clubs</li>\r\n</ul>\r\n\r\nThe Power Point presentation will be supplemented by pass-around samples, a hand-out, and the operating Nn3 modular layout on show at the Convention, presented by the NorCal Division of the international group, The Nn3 Alliance. The layout has appeared at numerous NMRA and NNGC conventions and includes many of the products and techniques discussed in the clinic. The Nn3 Alliance includes over 800 modelers from ten countries modeling 2-foot, 3-foot, 42" and meter gauge in 1:148, 1:150, 1:152, and 1:160 scales.', 0, '', 'Tom Knapp, MMR', 3, '', 'thomasknapp@att.net', '', 'Y', '4152039160', '', 'table for "show-and-tell" of example equipment', 'convention', '', NULL),
(166, 'C166', 'Rebuilding Brass locomotives', '2011-07-06 09:30:00', '2011-07-06 10:30:00', 'This clinic will show you how to turn older brass loco&rsquo;s into great runners that will silently creep down the track.  Re-motoring and re-gearing will be discussed and illustrated in detail. Topics include motor and gearbox selection, motor mount construction, and the use of universal joint couplings.', 0, '', 'Mark Schutzer', 1, '', 'mark.schutzer@sbcglobal.net', '', 'Y', '', '', '', 'mywindows', '', '2011-06-23 01:40:00'),
(105, 'C105', 'Track Planning and Layout Design', '2011-07-07 21:00:00', '2011-07-07 22:00:00', 'What does it take to design, build and operate a satisfying model railroad, one you can and be proud to share with your friends?  We will discuss, and see examples of design goals, what is a prototype, and prototype-based freelance layout design, and explore some different approaches to a successful layout design. What kind of questions should you ask yourself before putting pencil to paper, or LDEs, on your hard drive? How do you find good resources and research tools? Also, how do Givens and Druthers fit into all of this? We hope to have a good time along the way, maybe a few chuckles too. Come and have some fun with us. Hope to see you there.', 0, '', 'Steve Moore', 4, '', 'kiss@kissmethodinc.com', '', '', '801-694-5084', '', 'The PC needs to have a fairly current version of PowerPoint. My visuals are all on PowerPoint. I will have my presentation on CD, and also on my portable hard drive with a USB connection. Either one will work. Hard drive is preferred.\r\n\r\nAre the Clinics held in the Convention Center? How do I find the Clinic Room?', 'convention', '', NULL),
(106, 'C106', 'Kam''s Train Tools - Next Generation', '2011-07-07 19:30:00', '2011-07-07 22:00:00', 'This clinic is a 2 hour session about model train software and collaborative computing.  We have been working on this for over 5 years, and now is the time.   This clinic will review the new hardware and software products that will lead the way into the next generation.', 80, '', 'Matt Katzer', 6, '', 'mkatzer@kamind.com', '', 'Y', '', '', '', 'mywindows', 'Y', '2011-07-01 21:10:01'),
(108, 'C108', 'JMRI: Operations', '2011-07-08 16:00:00', '2011-07-08 17:00:00', '<a href="http://jmri.sourceforge.net/">JMRI</a> <a href="http://jmri.sourceforge.net/help/en/package/jmri/jmrit/operations/Operations.shtml">Operations</a> is a module within DecoderPro / PanelPro that provides a comprehensive car management / forwarding system.  In this clinic you''ll learn to set up and use Operations to configure Locations, Routes, Yards, Industry tracks, Car types and loads and Trains.  You''ll be shown how the program generates Switch Lists, Car Reports and Train Manifests.  In addition, basic troubleshooting and general configuration issues will be covered.  There will be time for a Q&A at the end of the clinic.', 30, '', 'Dennis Drury', 3, '', 'dennis95747@yahoo.com', NULL, 'Y', '916 747-2313', '', '', 'mywindows', '', NULL),
(109, 'C109', 'DCC: Overview', '2011-07-08 13:00:00', '2011-07-08 14:00:00', 'What <i>is</i> DCC?  And what it <i>isn''t</i>!  This clinic is targetted to those of us who are still on the fence or who have newly installed DCC - and just want some help in understanding the basics of how DCC works and a few "best practices".', 0, '', 'Jim Betz', 1, '', 'jimbetz@jimbetz.com', '', '', '', '', '', '', '', NULL),
(110, 'C110', 'DCC: Installing Decoders', '2011-07-08 14:30:00', '2011-07-08 15:30:00', '', 0, '', 'Marcus Ammann', 1, '', 'mammann@optusnet.com.au', '', 'Y', '', '', '', 'mywindows', '', NULL),
(111, 'C111', 'DCC: Programming Decoders', '2011-07-08 16:00:00', '2011-07-08 17:00:00', 'An introduction to the process of setting up a decoder. The focus will be on the use of DecoderPro (JMRI) to set the address, motor control, lights, and a simple approach to speed matching - and upon de-mystifying the concepts. This clinic is targetted to those who are relatively new to the topic and will -not- cover advanced topics. Programming sound decoders will be touched upon briefly.', 0, '', 'Jim Betz', 1, '', 'jimbetz@jimbetz.com', '', '', '', '', '', '', '', NULL),
(112, 'C112', 'OpenLCB', '2011-07-08 19:30:00', '2011-07-08 20:30:00', '<a href="http://openlcb.org">OpenLCB</a> is an open community of model railroad, electronics and software hobbyists to create new electronics for controlling model railroads. We are creating a layout control bus (LCB) that connects boards &amp; programs. The result is easy to use, customizable, and brings new capabilities to model railroaders.\r\n<p>\r\nThis session will bring together the OpenLCB developer community to talk about what we''ve been doing and share ideas about what to work on next. Since this week is the first time many of us will have gotten together in person, it''ll also be a chance to show off what we''ve accomplished this week. Come see some of the most interesting developments in layout controls.', 40, '', 'Bob Jacobsen', 1, 'http://openlcb.org', 'jacobsen@berkeley.edu', '', '', '', '', '', '', '', NULL),
(199, 'C199', 'Steam-up of Granite Rock number 10', '2011-07-07 12:00:00', '2011-07-07 15:00:00', 'Ever wonder what goes on before you get on that steam powered tourist train? Visit with the CSRM locomotive crew as they prepare the Sacramento Southern Railroad&rsquo;s operating steam locomotive, Granite Rock Company No. 10, for operation. It will be pulling trains for NMRA convention-goers later in the day&mdash;at this eveningâ€™s big event!', 40, '', 'CSRM staff', 8, '', '', '', '', '', '', '', '', '', NULL),
(114, 'C114', 'Using Logistics to Develop a Model Railroad Operations Scheme', '2011-07-08 13:00:00', '2011-07-08 14:00:00', 'Dustin will explain some thought processes to mesh real world logistics with planning prototypical operations. This clinic will approach planning ops from the stand point of moving goods and people on your layout not just moving cars. All levels of ops planning and intensity can be covered using this method. The techniques explained are applicable with most operations styles, eras, and even passenger service.', 0, '', 'Dustin Shoup', 2, '', 'dushoup@gmail.com', '', 'Y', '408-513-5563', '', '', 'convention', '', NULL),
(116, 'C116', 'Trackside Signaling at the SMRHS', '2011-07-08 16:00:00', '2011-07-08 17:00:00', 'The SMRHS Membership voted on a full tear-down and rebuild of the club''s system in 2001. The Society agreed on an era, a prototype, DCC Control and elements of Dr. Bruce Chubbâ€™sâ€™ C/MRI for block detection and signaling. Join us for a discussion on how we achieved our goals.', 0, '', 'Joe Melhorn & Dave Megeath', 2, '', 'toyman@sbcglobal.net,d.megeath@comcast.net', '', '', '', '', '', '', '', NULL),
(262, 'C262', 'Vision and the Aging Modeler', '2011-07-07 08:00:00', '2011-07-07 09:00:00', 'The ability to do prolonged detail work at near changes with age. Mature modelers must also change how they model either by changing scales or by the use of vision-aids & lighting. This clinic will explain what difficulties these age-related changes present to the modeler. Discussed in detail will be methods of compensating for these changes so that modeling activities need not be curtailed or abandoned as the modeler ages. With these methods, the modeler can pursue detailed modeling, even in the smaller scales, for hours at a time without eyestrain or discomfort.', 0, '', 'Richard Meetz, OD MS FAAO', 2, '', 'meetz@indiana.edu', NULL, 'Y', '812-391-2768', '', '', 'convention', '', NULL),
(118, 'C118', 'The State Belt Railroad', '2011-07-08 13:00:00', '2011-07-08 14:00:00', 'The San Francisco Belt Railroad was a short-line railroad along the Embarcadero in San Francisco. It began as the State Belt Railroad in 1889, and was renamed when the city bought the Port of San Francisco in 1969. The railroad ceased operation in 1993.\r\n\r\nThe railroad connected the Port of San Francisco to many waterfront docks and to industries and warehouses which were adjacent to the waterfront. It had 67 miles (108 km) of trackage and its general offices were in the Ferry Building. Its function was to switch railroad cars from four major railroads to points along its system and vice versa. At the southern portion of the line, a track along King Street (passing the location now occupied by AT&T Park) connected with the Southern Pacific. A train ferry slip at Pier 43 allowed interchange with the Northwestern Pacific, the Western Pacific, and the Atchison. Topeka & Santa Fe railroads. To reach its northern terminus in the Presidio, the line passed through Fisherman''s Wharf, Aquatic Park, and a tunnel under Fort Mason.', 0, '', 'Bill Kaufman', 3, '', 'whk58@pacbell.net', NULL, 'Y', '415 298-1370', '', '', 'mywindows', '', NULL),
(119, 'C119', 'Building Distressed Wood Structures', '2011-07-08 14:30:00', '2011-07-08 15:30:00', 'Learn how to create realistic distressed wood structures using my Weathering and Distressing Clapboard Siding and Strip Wood Techniques.', 0, '', 'Jimmy Simmons', 3, '', 'mrboyjrs@gmail.com', '', 'Y', '702-449-6900', '', '', 'none', '', NULL),
(120, 'C120', 'Easy City Streets Using Sintra', '2011-07-08 21:00:00', '2011-07-08 22:00:00', 'What is Sintra and what is it good for? Come and find out why it is a neat, easy-to-use alternative to many commonly used methods of making city streets. Clinic also includes some basic guidelines for modeling urban streets that are applicable to most methods of street construction.', 0, '', 'Jim Sacco', 3, '', 'ctyclsscs@aol.com', '', 'Y', '412-721-2439', '', '', 'convention', '', NULL),
(121, 'C121', 'Streamlined Trains in California', '2011-07-08 19:30:00', '2011-07-08 20:30:00', 'Beginning in 1936 California was witness to an interesting variety of streamlined passenger trains, some of the finest in the land. We will discuss the routes and unique features of the trains operated by several well-known railroads serving the Golden State, through to the introduction of Amtrak in 1971.', 0, '', 'Paul Hobbs', 4, '', 'pt_hobbs@yahoo.co.nz', '', '', '424 270 4494', 'Beginning in 1936 California was witness to an interesting variety of streamlined passenger trains, some of the finest in the land. We will discuss the routes and unique features of the trains operated by several well-known railroads serving the Golden State, through to the introduction of Amtrak in 1971.', '', 'convention', '', NULL),
(122, 'C122', 'Passenger Trains  in California 1971 - 2011', '2011-07-08 21:00:00', '2011-07-08 22:00:00', 'Paul Hobbs will discuss Amtrak''s impact on passenger service as well as commuter trains and light rail developments in the golden state.', 0, '', 'Paul Hobbs', 4, '', 'pt_hobbs@yahoo.co.nz', '', '', '424 270 4494', '', '', 'convention', '', NULL),
(123, 'C123', 'Layout Design for Passenger Operations', '2011-07-08 14:30:00', '2011-07-08 15:30:00', 'Track plans for passenger train oriented layouts suggest how passenger terminals and main line layout design elements can be pulled together. Layout design elements such as turning arrangements, express and mail facilities, and coach yard requirements such as car washers, servicing platforms, Pullman and commissary buildings, and craft shops will be covered. Main line elements include junctions for merging and splitting of trains, and through stations with setouts will be discussed also.', 0, '', 'Robert Clark', 4, '', 'erierailroad@accessbee.com', '', 'Y', '', '', 'convention', 'convention', '', '2011-06-12 12:48:20'),
(124, 'C124', 'Lighting of Cars & Locomotives (DCC)', '2011-07-08 13:00:00', '2011-07-08 14:00:00', 'This will be an introductory clinic examining the types of LEDs available to the modeler. We''ll explore an LED Data Sheet to gather Voltage and Current ratings, luminous intensity and projection angle. We''ll select the correct current limiting resistor based on the LED data sheet. SMD LED wiring, soldering techniques and tools will be presented. Flicker Free lighting will be discussed as well as engine lighting effects.', 0, '', 'Joe Melhorn', 4, '', 'toyman@sbcglobal.net', '', '', '', '', '', '', '', '2011-06-14 16:12:59'),
(125, 'C125', 'Working with Plastics', '2011-07-08 14:30:00', '2011-07-08 17:00:00', 'Russ Miller, current President of the Bay Area Garden Railway Society,  and a store manager for TAP Plastics in San Leandro with 30 years in the industry will be presenting an in-depth clinic on working with plastics.  Russ will discuss the various materials on the market with emphasis on their suitability for use in our hobby.  He will then go on to discuss preferred techniques for working with the materials including cutting, bending and gluing the different plastics.  Free plastic samples available at the clinic.', 0, '', 'Russ Miller', 5, '', 'president@bagrs.org', '', '', '', '', '', '', '', NULL),
(126, 'C126', 'Welcome and Overview ', '2011-07-04 09:30:00', '2011-07-04 10:30:00', 'Join us as we reconnect with old friends, make new friends and learn about all the non-rail activities planned for the week. Refreshments will be served.', 0, '', 'Non Rail Committee', 6, '', 'nstokely@sbcglobal.net', '', '', '', '', '', '', '', NULL),
(127, 'C127', 'Welcome and Overview ', '2011-07-05 09:30:00', '2011-07-05 10:30:00', 'Join us as we reconnect with old friends, make new friends and learn about all the non-rail activities planned for the week. Refreshments will be served.', 0, '', 'Non Rail Committee', 6, '', 'nstokely@sbcglobal.net', '', '', '', '', '', '', '', NULL),
(128, 'C128', 'Card Making - fee required', '2011-07-04 11:00:00', '2011-07-04 12:00:00', 'It''s Tuesday night and you''re getting ready for bed when you remember you have to send a birthday card in the mail the next day. Using items found around the house, we will be making four cards for all occasions (you choose) that will re-use old cards, photographs, ribbons, and gift wrap. All supplies provided including envelopes. ', 0, '', 'Suzy Madsen', 6, '', 'bounos@telus.net', '', '', '', '', '', '', '', NULL),
(129, 'C129', 'Project Linus', '2011-07-04 13:00:00', '2011-07-04 14:00:00', '<p>We will be working with this National Organization that provides security blankets to children in need. Visit their website at <a href="http://www.projectlinus.org">www.projectlinus.org</a> for more information.</p>\r\n\r\n<p>Blankets can be made ahead of time and brought with you, or you can make quilt squares and we will put them together at the convention. Blankets can be quilted, tied, knitted, crocheted or fleece. Bring all your quilt squares and we will make some security blankets for children in need. This will be an ongoing project all week, so stop by often and lend a hand.</p>\r\n<p>There will be a presentation at the Event on Saturday night of all the blankets made by our group.</p>\r\n', 0, '', 'Susan Swindell', 6, 'http://www.projectlinus.org', 'swindell@value.net', '', '', '', '', '', 'none', '', NULL),
(160, 'C160', 'Five Strands of Narrow Gauge History', '2011-07-04 16:00:00', '2011-07-04 17:00:00', 'The Nevada County Narrow Gauge Then and Now', 0, '', 'Bill Schaumburg', 3, '', 'Bill Schaumburg <bills@rrmodelcraftsman.com>', '', 'Y', '973-997-6671', '', '', 'convention', 'Y', '2011-06-28 23:20:47'),
(131, 'C131', 'Gardening Workshop', '2011-07-05 16:00:00', '2011-07-05 17:00:00', 'Nancy Norris, of <a href="http://www.gardenlines.net">www.gardenlines.net</a> will share her expertise about gardening and garden railway landscaping with us and also give us a pruning demonstration.', 0, '', 'Nancy Norris', 6, 'http://www.gardenlines.net', 'nunorris@aol.com', '', 'Y', '925-408-9402', '', '', 'mymac', '', NULL),
(132, 'C132', 'Bingo', '2011-07-05 19:30:00', '2011-07-05 21:30:00', 'Come out and play this old favorite. Learn some new ways to play as well as the standards. Prizes will be awarded.', 0, '', '', 6, '', 'nstokely@sbcglobal.net', '', '', '', '', '', '', '', NULL),
(133, 'C133', 'Introduction to Genealogy', '2011-07-06 09:30:00', '2011-07-06 10:30:00', 'Been excited by the TV show "Who Do You Think You Are?"  Want to know more about how to do this popular hobby of genealogy?  Come learn how to get started.  This will be a hands-on experience filling out Family Group Sheets and Ancestry Charts.  You will also get a list of websites that will help you at home.', 0, '', 'Lisa Gorrell', 6, '', 'snrylisa@gmail.com', '', 'Y', '925 588-9070', '', '', 'convention', '', NULL),
(135, 'C135', 'Fabric Painting - fee required', '2011-07-06 16:00:00', '2011-07-06 17:00:00', 'Bring a T- shirt to paint. We will have shirts and other items to paint. This is a fun and easy project. Be creative. Shirts can be taken home or we will donate any that are left to a local Women''s Shelter.', 0, '', 'Mary Moore Campagna', 6, '', 'marycmoore@campagna.com', '', 'Y', '(415) 672-4806', '', '', 'none', '', NULL),
(136, 'C136', 'Movie Night  ', '2011-07-06 19:30:00', '2011-07-06 21:00:00', 'Come join us as we watch an oldie but goodie. Maybe even one you haven''t seen before!', 0, '', '', 6, '', 'nstokely@sbcglobal.net', '', '', '', '', '', '', '', NULL),
(137, 'C137', 'Guide Dogs for the Blind speaker', '2011-07-07 11:00:00', '2011-07-07 12:00:00', 'We will have a visitor from the local chapter of Guide Dogs for the Blind. They will be sharing with us their experiences as they foster a guide dog and what the organization does.', 0, '', '', 6, '', '', '', '', '', '', '', '', '', NULL),
(138, 'C138', 'Games Galore', '2011-07-08 14:30:00', '2011-07-08 15:30:00', 'Come learn some new games. Cards, dice or board games. Then later in the evening we will have a chance to play them all. ', 0, '', '', 6, '', 'nstokely@sbcglobal.net', '', '', '', '', '', '', '', NULL),
(139, 'C139', 'Quilt Shop Hop', '2011-07-09 09:00:00', '2011-07-09 12:00:00', 'We will carpool and visit different quilt and fabric stores in the Sacramento area. Come by the Non Rail room on Monday &amp; Tuesday and sign up. This is an exciting trip because you never know where the perfect piece of fabric will be.  ', 0, '', '', 0, '', 'strawberryMarilyn@hotmail.com', '', 'Y', '510-552-5370', '', '', 'none', '', NULL),
(140, 'CM1', 'Building A Laser Structure Kit', '2011-07-03 18:00:00', '2011-07-03 23:00:00', '<p>Join a team of Master Model Railroaders as they personally help you build a model.  These hands-on sessions will run during the convention Monday through Thursday.  Each session is 5 hours and will begin with a workshop on the project followed by a hands-on session during which you will build a model aided by a team of Master Model Railroaders who will assist you, answer your questions and share their modeling expertise, skills and techniques.  When the session is finished you will be able to take your project home.</p>\r\n<p>This clinic involves building a Laser Structure kit. Students will learn all the basic elements for building any laser kit.</p>\r\n<p>Attendance is limited to 28 total students.</p>\r\n<p>All students must bring the tools as listed on the tool list for each clinic. See <a href="http://www.x2011west.org/mwtm.html#mwtmtools">http://www.x2011west.org/mwtm.html#mwtmtools</a> for a list of tools</p>\r\nCost is $48 for N &amp; HO and $60 for S &amp; for O $75', 60, '', 'Lead Instructor: Kooning, Clark, MMR', 28, '', 'ckooning@msn.com', '', 'Y', '416 899 9041', '', 'convention', 'convention', '', NULL),
(141, 'CM2', 'Building A DPM Structure', '2011-07-04 07:30:00', '2011-07-04 12:00:00', '<p>Get your seat for one of the most exciting NMRA programs.  "Modeling with the Masters"!  Join a team of Master Model Railroaders as they personally help you build a model.  These hands-on sessions will run during the convention Monday through Thursday.  Each session is 5 hours and will begin with a workshop on the project followed by a hands-on session during which you will build a model aided by a team of Master Model Railroaders who will assist you, answer your questions and share their modeling expertise, skills and techniques.  When the session is finished you will be able to take your project home.</p>\r\n<p>This clinic involves building a Design Preservation Models (DPM) building including details and signs.  You might think you know how to build DPM kits but after you will know how. </p>\r\n<p>Attendance is limited to 28 total students.</p>\r\n<p>All students must bring the tools as listed on the tool list for each clinic. See <a href="http://www.x2011west.org/mwtm.html#mwtmtools">http://www.x2011west.org/mwtm.html#mwtmtools</a> for a list of tools</p>\r\nCost is $48 for N &amp; HO.\r\n\r\n', 60, '', 'Lead Instructor: Hale, Fran MMR', 28, '', 'mileshale@sbcglobal.net', '', 'Y', '', '', '', '', '', NULL),
(142, 'CM3', 'Building a White Metal Vehicle Kit', '2011-07-04 13:30:00', '2011-07-04 18:30:00', '<p>Get your seat for one of the most exciting NMRA programs.  "Modeling with the Masters"!  Join a team of Master Model Railroaders as they personally help you build a model.  These hands-on sessions will run during the convention Monday through Thursday.  Each session is 5 hours and will begin with a workshop on the project followed by a hands-on session during which you will build a model aided by a team of Master Model Railroaders who will assist you, answer your questions and share their modeling expertise, skills and techniques.  When the session is finished you will be able to take your project home.</p>\r\nThis clinic involves building a white metal vehicle and painting it. You will learn how to assembly these very detailed kits, including what glues to use<p/>\r\n<p>Attendance is limited to 28 total students.</p>\r\n\r\n<p>All students must bring the tools as listed on the tool list for each clinic. See <a href="http://www.x2011west.org/mwtm.html#mwtmtools">http://www.x2011west.org/mwtm.html#mwtmtools</a> for a list of tools</p>\r\n\r\nCost is $50 for N &amp; $65 for HO.', 60, '', 'Lead Instructor: Kooning, Clark MMR', 28, '', 'ckooning@msn.com', '', 'Y', '416 899 9041', '', '', 'convention', '', NULL),
(143, 'CM4', 'Building Plastic Walthers Modular Buildings', '2011-07-05 07:30:00', '2011-07-05 12:30:00', '<p>This clinic will cover the basics of preparing, gluing and painting plastic as participants construct a custom city structure.</p>\r\n<p>Attendance is limited to total of 28 students in N &amp; HO scales only. </p>\r\n<p>Cost of clinic $48. N or HO only.<p/>\r\n\r\n<p>All students must bring the tools as listed on the tool list for each clinic. See <a href="http://www.x2011west.org/mwtm.html#mwtmtools">http://www.x2011west.org/mwtm.html#mwtmtools</a> for a list of tools</p>\r\n\r\nThanks to the generous donation of the modular parts by Walthers Inc.', 0, '', 'Lead Instructor: Lowrance, John, MMR', 28, '', 'new-london@sbcglobal.net', '', 'Y', '210 630-5071', 'The "...take enough additional materials home to get them started with the Walthers modular custom building system" is no longer valid as Walthers was out of the kit we intended to use and we had substitute a set that will reguire all included parts to assemble the class project..thus it does not contain additional materials for students to take home.', 'Room will need projector screen and place (stand/etc)to put the projector', 'mywindows', '', '2011-06-23 17:35:31'),
(144, 'CM5', 'Scratchbuilding Car Loads For Your Freight Cars', '2011-07-05 13:30:00', '2011-07-05 18:30:00', '<p>Join a team of Master Model Railroaders as they personally help you build a model.  These hands-on sessions will run during the convention Monday through Thursday.  Each session is 5 hours and will begin with a workshop on the project followed by a hands-on session during which you will build a model aided by a team of Master Model Railroaders who will assist you, answer your questions and share their modeling expertise, skills and techniques.  When the session is finished you will be able to take your project home.</p>\r\n<p>In this clinic you will scratchbuild three different "loads" for a freight car. In addition to this, you will learn some basic weathering skills to be applied to the freight car, which will be supplied to you. </p>\r\n\r\n<p>All students must also bring the tools as listed on the tool list for each clinic. See <a href="http://www.x2011west.org/mwtm.html#mwtmtools">http://www.x2011west.org/mwtm.html#mwtmtools</a> for a list of tools</p>\r\n\r\nAttendance is limited to 28 students. Cost is $48 for N and HO.', 60, '', 'Lead Instructor: Hale, Miles, MMR', 28, '', 'mileshale@sbcglobal.net', '', 'Y', '', '', '', '', '', NULL),
(145, 'CM6', 'Building A Turnout Using A Commercial Fixture', '2011-07-06 08:00:00', '2011-07-06 12:30:00', '<p>Get your seat for one of the most exciting NMRA programs.  "Modeling with the Masters"!  Join a team of Master Model Railroaders as they personally help you build a model.  These hands-on sessions will run during the convention Monday through Thursday.  Each session is 5 hours and will begin with a workshop on the project followed by a hands-on session during which you will build a model aided by a team of Master Model Railroaders who will assist you, answer your questions and share their modeling expertise, skills and techniques.  When the session is finished you will be able to take your project home.</p>\r\n<p>This clinic involves building a turnout from scratch using a commercial fixture from Fastracks.</p>\r\nAttendance is limited to 28 total students.</p>\r\n\r\n<p>All students must bring the tools as listed on the tool list for each clinic. See <a href="http://www.x2011west.org/mwtm.html#mwtmtools">http://www.x2011west.org/mwtm.html#mwtmtools</a> for a list of tools</p>\r\n\r\nCost is $45 for N, HO, HOn3, S, Sn3,On30, and O\r\n\r\n', 60, '', 'Lead Instructor: Kooning, Clark, MMR', 28, '', 'ckooning@msn.com', '', '', '', '', '', '', '', NULL),
(147, 'C147', 'Introduction to Time Table and Train Order Dispatching', '2011-07-05 09:30:00', '2011-07-05 12:00:00', 'Timetable and Train Order (TT&TO) can be an arcane game of chess or a useful and challenging tool establishing authority to occupy the main track and move trains across your railroad.  This clinic will describe the elements of TT&TO, illustrate the use of those tools, then put "live" users through the paces of trying to get over the road against the clock, timetable and traffic.\r\n\r\nPresented in two parts, the first half is the mundane details, followed by participant led examples.  The approach is "hands on", so come and expect to be called on to participate.  We learn from experience, and the best experience is in the "deep end of the pool".  Come jump in!', 20, '', 'Dave Clemens', 1, '', 'upnw@earthlink.net', '', '', '', '', '', '', '', NULL),
(148, 'C148', 'Modern Verbal Authority (Track Warrants)', '2011-07-05 13:00:00', '2011-07-05 15:00:00', 'Modern Verbal Authority (Track Warrant Control)', 20, '', 'Retired SP-UP Dispatcher Steve "Breezy" Gust', 1, '', 'dspr57@yahoo.com', '', '', '402-616-9747', 'The clinic will NOT cover DTC and should last two hours, not 4.  I would prefer to be listed as "Retired Train SP-UP Dispatcher Steve "Breezy" Gust.  Please make corrections', 'White board for TWC examples', '', '', NULL),
(149, 'C149', 'CTC  Panel with Dispatchers and Signalmen', '2011-07-05 19:30:00', '2011-07-05 20:30:00', 'As part of the SIG sponsored Dispatching clinic track, retired dispatcher Steve Gust has assembled a panel of active and retired train dispatchers and signal technicians to discuss design and operation of Centralized Traffic Control (CTC or TCS) systems as seen from the "Big Chair" and from the field.  Topics will include Interlocking Plant rules, system design, dispatching strategy and questions from the audience.  These guys are the real deal and a question answered here is worth a thousand speculative messages on the chat lists!  Be sure to also attend UP Engineer Dave Bayless'' roundtable on rules for more straight talk from real railroaders.', 20, '', 'Steve Gust, Pat Flynn, Don Zinnecker, Jim Atkins', 1, '', '', '', '', '', '', '', '', '', NULL),
(151, 'C151', 'Building Scenery for your Railroad by Woodland Scenics', '2011-07-07 13:00:00', '2011-07-07 14:00:00', 'This clinic starts from the terrain up to show you magically how easy and fun it is to model ground cover, bushes, grasses, weeds, and trees for your layout. Learn simple blending and layering techniques that provide ultimate realism as you add both color and texture to your layout. The clinic is designed to help you begin a new layout or add finishing touches to an existing one. Landscaping is easy and almost magic when done the Woodland Scenics way. Come and let Fran and Miles make you a magician.', 20, '', 'Miles & Fran Hale, MMR', 4, '', 'mileshale@sbcglobal.net', '', 'Y', '', '', '', '', '', NULL),
(152, 'C152', 'Buildings for Your Layout by Design Preservation Models', '2011-07-06 14:30:00', '2011-07-06 15:30:00', 'Virtually every layout includes villages, towns, or cities-and they all need buildings. DPM has the full city system you need to build whatever structure you want. Learn easy techniques and tips for building the size, shape, and style of buildings your city needs with DPM kits and modular systems.', 20, '', 'Miles & Fran Hale, MMR', 5, '', 'mileshale@sbcglobal.net', '', 'Y', '', '', '', '', '', NULL),
(153, 'C153', 'Woodland Scenics Foam Layout Construction', '2011-07-06 16:00:00', '2011-07-06 17:00:00', 'The newest method for building your layout or module is with high-density foam. Woodland Scenics has it all in the SubTerrain system and this clinic will show you how to use it. Learn how to create a fast and easy layout using no woodworking skills or tool and with very little mess.', 20, '', 'Miles & Fran Hale, MMR', 5, '', 'mileshale@sbcglobal.net', '', 'Y', '', '', '', '', '', NULL),
(157, 'C157', 'Building Scenery for your Railroad by Woodland Scenics', '2011-07-06 13:00:00', '2011-07-06 14:00:00', 'This clinic starts from the terrain up to show you magically how easy and fun it is to model ground cover, bushes, grasses, weeds, and trees for your layout. Learn simple blending and layering techniques that provide ultimate realism as you add both color and texture to your layout. The clinic is designed to help you begin a new layout or add finishing touches to an existing one. Landscaping is easy and almost magic when done the Woodland Scenics way. Come and let Fran and Miles make you a magician.', 20, '', 'Miles & Fran Hale, MMR', 5, '', 'mileshale@sbcglobal.net', '', 'Y', '', '', '', '', '', NULL),
(158, 'C158', 'Buildings for Your Layout by Design Preservation Models', '2011-07-07 14:30:00', '2011-07-07 15:30:00', 'Virtually every layout includes villages, towns, or cities-and they all need buildings. DPM has the full city system you need to build whatever structure you want. Learn easy techniques and tips for building the size, shape, and style of buildings your city needs with DPM kits and modular systems.', 20, '', 'Miles & Fran Hale, MMR', 4, '', 'mileshale@sbcglobal.net', '', 'Y', '', '', '', '', '', NULL),
(212, 'C212', 'Passenger Cars of the Colorado & Southern', '2011-07-06 16:00:00', '2011-07-06 17:00:00', 'Ken Martin, one of the authors of <i>Colorado & Southern Freight and Passenger Cars (Narrow Gauge Pictorial, VIII (8))</i> will discuss the passenger car equipment of the C&S.', 0, '', 'Ken Martin', 7, '', 'kmartin537@surewest.net', '', 'Y', '', 'I do not have a cell phone.', '', 'mymac', '', NULL),
(161, 'C161', 'Five Strands of Narrow Gauge History', '2011-07-05 19:30:00', '2011-07-05 20:30:00', 'The Nevada County Narrow Gauge Then and Now', 0, '', 'Bill Schaumburg', 5, '', 'Bill Schaumburg <bills@rrmodelcraftsman.com>', '', 'Y', '973-997-6671', '', '', 'convention', '', '2011-06-23 01:39:26'),
(162, 'C162', 'Survey of Historic Sierra Railway Locomotives and Cars', '2011-07-03 16:00:00', '2011-07-03 17:00:00', 'Kyle K. Wyatt, Curator of History & Technology for the California State Railroad Museum will discuss the motive power and rolling stock in use at the Sierra Railroad in Jamestown, California\r\n', 0, '', 'Kyle Wyatt', 1, '', 'kylewyatt@aol.com', '', 'Y', '916-208-5507', 'Better to contact me via my home e-mail address\r\nkylewyatt@aol.com', 'It will be a PowerPoint presentation.  Should be easy.', 'convention', '', NULL),
(163, 'C163', '35 Years on the Sacramento Central', '2011-07-06 09:30:00', '2011-07-06 11:00:00', 'The story of the Sacramento Modular Railroaders and their club railroad, the Sacramento Central. For about 35 years, SMR has been an innovative group. We''ve been doing switchlist operations for many years, on a modular layout that changes at each setup.. We''ve developed lightweight, versatile modules that can combine quickly into railroads of many sizes (up to 40 by 60 feet or more), and of many shapes. For example, our main switchyard can be 30 or 36 feet long, in either a straight through or Tee configuration. Typical layout setup time runs about 1 1/2 hours, and is done without tools. Learn how we do this and more, how we''ve lasted that long, and are still at it. We''ll be featured in an early 2011 article in Model Railroader, and come see us at the National Train Show during the convention.', 0, '', 'Dick Witzens', 2, '', 'witzens@surewest.net', NULL, '', '', '', '', '', '', NULL),
(164, 'C164', 'Hostling a Steam Locomotive', '2011-07-03 19:30:00', '2011-07-03 20:30:00', 'Comment: Dave Tadlock, a volunteer from Railtown 1897 in Jamestown will talk about the care and feeding of steam locomotives year round and what it''s like to work inside the historic roundhouse.  Dave is a hands-on interpreter with experience in all aspects of the Railtown experience, from being a conductor on passenger excursions, to hostling and firing the steam locomotives, to running both the steam and diesel locomotives during the tourist season.  He also put in thousands of hours of mechanical maintenance on the steam locomotives as well as being known as the â€œcar-knockerâ€ for Railtown.  For those who will be riding the train the following day Dave will also point out things to look for and other tips to make your Railtown 1897 experience more enjoyable.', 0, '', 'Dave Tadlock', 1, '', '1oldmotorman@comcast.net', '', '', '209-628-4310', '', '', '', '', NULL),
(165, 'C165', 'SP: Passenger Cars', '2011-07-08 16:00:00', '2011-07-08 17:00:00', '', 0, '', 'Jeff Cauthen', 4, '', 'overland28@yahoo.com', '', 'Y', '650-703-4188', '', '', 'convention', '', '2011-06-23 01:40:58'),
(167, 'C167', 'Rebuilding Brass locomotives', '2011-07-07 09:30:00', '2011-07-07 10:30:00', 'This clinic will show you how to turn older brass loco&rsquo;s into great runners that will silently creep down the track.  Re-motoring and re-gearing will be discussed and illustrated in detail.  Topics include motor and gearbox selection, motor mount construction, and the use of universal joint couplings.', 0, '', 'Mark Schutzer', 4, '', 'mark.schutzer@sbcglobal.net', '', 'Y', '', '', '', 'mywindows', '', '2011-06-23 01:40:30'),
(168, 'C168', 'Judging The Model Contest', '2011-07-04 13:00:00', '2011-07-04 14:00:00', 'National Contest Chair Bob Hamm will take the audience through the process of model contest judging. This is a good orientation for new judges and a refresher course for the experienced veterans.  Bob will cover what the contest is and is not, and will discuss how and when the evaluation of entries will be performed. Topics such as judging team structure, the point scoring system, and use of the AP Judging Guidelines will be described in detail. We intend the clinic to be interactive and time permitting we will be happy to discuss any contest issues that folks would like to bring up.', 62, '', 'Bob Hamm, MMR, National Contest Chair', 5, '', 'rhamm1@nycap.rr.com', '', 'Y', '', 'The word "entries" is misspelled ("entires")midway through the second line of the description. You might wish to correct the description in the convention time table. Thanks!', '', 'convention', '', NULL),
(284, 'C284', 'Building Geodesic Foam Scenery', '2011-07-03 19:30:00', '2011-07-03 21:30:00', 'This two hour clinic is an in depth and comprehensive look at all aspects of building scenery from resin materials.  A mountain railroad diorama will be built during the clinic from the bench-work up.  Foam bench-work and roadbed, foam hard-shell and resin/foam rock casting will be demonstrated.  Also, realistic coloring of rocks and scenery plus final detailing will be covered.', 0, '', 'Joel Bragdon', 2, '', 'jbragdon@bragdonent.com', '', '', '1-530-906-3972', 'Please add to beginning of clinic description: TWO HOUR CLINIC.', 'Two tables, eight feet long, extension cord and cordless mic, if possible.', 'none', '', NULL),
(285, 'C285', 'Mold making and casting for the model maker', '2011-07-06 14:30:00', '2011-07-06 15:30:00', 'This clinic and will cover making a variety of types RTV rubber molds for reproducing detail parts, cars, vehicles, structures or almost anything.  One piece, multi piece and split molds will be demonstrated.  Casting with a variety of materials will be shown including fast curing space age, safe and odorless, polymer resins.   Over two hundred sample molds and castings will be shown to illustrate the great number of options.', 0, '', 'Joel Bragdon', 2, '', 'jbragdon@bragdonent.com', '', 'Y', '1-530-906-3972', '', 'Two tables, eight feet long, extension cord and cordless mic, if possible', 'none', '', NULL),
(170, 'C170', 'LED Lighting Effects for your Layout', '2011-07-04 21:00:00', '2011-07-04 22:00:00', 'Edward spent about several months experimenting with using LEDs to create lighting effects with his third exhibition layout. He will discuss a variety of techniques for using multi-color realistic day-night-day LED lighting as well as creating special effects such as lighting.', 0, '', 'Edward Gallier', 3, '', 'E.Gallier@electroboard.com.au', '', 'Y', '+61419629771', '', '', 'mywindows', '', NULL);
INSERT INTO `prod_eventtools_clinics` (`id`, `number`, `name`, `start_date`, `end_date`, `description`, `status_code`, `cart_item`, `clinic_presenter`, `clinic_location_code`, `clinic_url`, `clinic_presenter_email`, `comment`, `clinic_ok`, `clinic_presenter_cell_number`, `clinic_presenter_confirm_comment`, `clinic_presenter_av_comment`, `clinic_presenter_av_request`, `mark_changed`, `last_mod_time`) VALUES
(171, 'C171', 'LED Lighting Effects for your Layout', '2011-07-06 11:00:00', '2011-07-06 12:00:00', 'Edward spent about several months experimenting with using LEDs to create lighting effects with his third exhibition layout. He will discuss a variety of techniques for using multi-color realistic day-night-day LED lighting as well as creating special effects such as lighting.', 0, '', 'Edward Gallier', 1, '', 'E.Gallier@electroboard.com.au', NULL, 'Y', '+61419629771', '', 'mywindows', 'mywindows', '', NULL),
(173, 'C173', 'Understanding Steam Locomotive Details', '2011-07-05 13:00:00', '2011-07-05 14:00:00', 'An expansion of his March 2007 <i>Model Railroader</i> article of the same name, Andy will explain the external appliances and piping of steam locomotives in terms of six major systems: water supply, fuel supply, steam distribution, sand for traction, air brakes, and electric lighting. The primary example is Santa Fe 4-8-4 no. 3751, with some other locomotives shown to illustrate variations.', 0, '', 'Andy Sperandeo', 5, '', 'asperandeo@mrmag.com', '', 'Y', '262-327-5343', '', '', '', '', NULL),
(174, 'C174', 'Modeling California Packing Houses', '2011-07-05 08:00:00', '2011-07-05 09:00:00', 'Packing Houses were once a fixture of California, part of a citrus and produce industry that was a key source of railroad revenue. Jim Lancaster and Bill Messecar will discuss prototype packing houses along the SP and Santa Fe, as well as model packing houses and modeling techniques.', 0, '', 'Jim Lancaster', 3, '', 'ljames1@ix.netcom.com', '', '', '714-552-7830', 'The presenters are: Jim Lancaster and Bill Messecar\r\nThe text should read:\r\nPacking Houses were once a fixture of California, part of a citrus and produce industry that was a key source of railroad revenue. Jim Lancaster and Bill Messecar will discuss prototype packing houses along the SP and Santa Fe, as well as model packing houses and modeling techniques.', '', 'convention', '', NULL),
(175, 'C175', 'Modeling California Packing Houses', '2011-07-07 11:00:00', '2011-07-07 12:00:00', 'Packing Houses were once a fixture of California, part of a citrus and produce industry that was a key source of railroad revenue. Jim Lancaster and Bill Messecar will discuss prototype packing houses along the SP and Santa Fe, as well as model packing houses and modeling techniques.', 0, '', 'Jim Lancaster', 4, '', 'ljames1@ix.netcom.com', '', '', '714-552-7830', 'The presenters are: Jim Lancaster and Bill Messecar\r\nThe text should read:\r\nPacking Houses were once a fixture of California, part of a citrus and produce industry that was a key source of railroad revenue. Jim Lancaster and Bill Messecar will discuss prototype packing houses along the SP and Santa Fe, as well as model packing houses and modeling techniques.', '', 'convention', '', NULL),
(177, 'C177', 'Quick and Easy Freight Car Weathering', '2011-07-08 13:00:00', '2011-07-08 14:00:00', 'Get more satisfaction from those ready to run and shake the box models with all that fine detail, shiny paint and perfect lettering applied in the People&rsquo;s Republic of China!  Add your personal touch to your freight car fleet, without scratchbuilding or super detailing, by imitating the effects of time and nature.  No prototype cars last long out of the paint shop before the weathering process begins. This clinic will show how to use oil paint washes and other cheap and easy methods, without an airbrush, to improve the realism of your layout. Techniques learned from the model railroad press and from trial and error over the past 45 years will be discussed in this clinic.', 0, '', 'Roger Nulton, MMR', 5, '', 'roger.nulton@comcast.net', '', 'Y', '253-302-6989', '', 'Hi Dave and Tony,\r\nI would like to have a small lectern to hold my laptop and notes, and a VGA cord to reach from the lectern to the projector.  I also need a banquet sized table to display my models, tools and materials.\r\nThanks, Roger', 'mywindows', '', NULL),
(178, 'C178', 'Through Cars and Set-outs: Adding Pullman Service to Any Layout', '2011-07-07 08:00:00', '2011-07-07 09:00:00', '', 0, '', 'Jamie Bothwell', 5, '', 'vze4cs43@verizon.net', NULL, '', '', '', '', '', '', NULL),
(179, 'C179', 'Tree Making 101', '2011-07-07 09:30:00', '2011-07-07 10:30:00', '', 0, '', 'John McKenzie', 5, '', 'captmacrgs@yahoo.com', NULL, 'Y', '7076897579', '', 'I would like to have two tables each at least 6 feet long but two that were 8 feet long would be best. I must layout the tree making supplies and the finished tree examples for the clinic attendees to be able to see in person. I will also be making trees up in the clinic, so very much need enough table space.', 'convention', '', NULL),
(180, 'C180', 'Signaling Your Model Railroad: Part 1', '2011-07-07 19:30:00', '2011-07-07 20:30:00', 'Fundamental Concepts: Prototype and Model\r\n\r\nBruce expands upon the Signaling Made Easier series published in MR, and the newly released multi-volume Railroader&rsquo;s Application Handbook to cover prototypical signaling and how to adapt it to our models. The differences between ABS, APB and CTC signaling are discussed along with their impact on how railroads operate. A clear understanding is established regarding the difference between block and interlocking signals, speed versus route signaling and the corresponding aspects and indications used by different railroads and how they can be adapted to our models. Correct signal placement, total compatibility with DCC and how to easily drive different signal types are addressed. Bruce explains how to use the new Super Mini-Node card coupled with the power of the computer to joyfully reduce layout wiring and significantly reduce system cost while maximizing system flexibility and prototype fidelity.', 20, '', 'Bruce Chubb, MMR', 1, 'http://www.jlcenterprises.net/', 'chubbbrucemmr@aol.com', '', '', '', '', '', '', '', '2011-06-23 01:41:33'),
(181, 'C181', 'Signaling Your Model Railroad: Part 3', '2011-07-09 15:00:00', '2011-07-09 16:00:00', 'Centralized Traffic Control Systems\r\n\r\nBruce explains CTC operations and how it can smooth traffic flow on your railroad. As illustrated, constructing a dispatcher&rsquo;s CTC panel and interfacing it to your railroad is much easier than most modelers realize. Differences between US&S and GRS machines are explained and how their different components are interfaced. Straightforward programming techniques are introduced making is easy to &ldquo;cut-paste-and-change-numbers&rdquo; to set up a highly accurate C/MRI-based CTC system for any model railroad. Utilizing a standardized set of callable subroutines makes the programming easy while maximizing prototype fidelity.  Additionally, entrance-exit interlocking is discussed along with using computer graphics to emulate modern dispatching operations.', 20, '', 'Bruce Chubb, MMR', 4, 'http://www.jlcenterprises.net/', 'chubbbrucemmr@aol.com', '', '', '', '', '', '', 'Y', '2011-06-28 23:26:08'),
(182, 'C182', 'Sunset Valley Oregon System and Grand Rails 2012', '2011-07-09 11:00:00', '2011-07-09 12:00:00', 'The SVOS occupies 2600 sqft with up to 4 decks. Its dominate roll is maximizing prototypical fidelity and operations. Based upon specific prototypes, over 1000 structures are being constructed along with 150 feet of bridges and trestles. It&rsquo;s a monumental project with over 1400 feet of main/branch line trackage modeling 10 prototype railroads in the Pacific Northwest. Dr. Chubb explains how the teamwork of 38 associates is pulling together to have the system ready for the 2012 NMRA National in Grand Rapids where it will be on tour all day every day throughout the convention. In addition to the 38 regular scheduled tours, Bruce explains how the SVOS id setting up to host a 12-hour pre-convention operating session.', 0, '', 'Bruce Chubb, MMR', 4, '', 'Chubbbrucemmr@aol.com', '', '', '', '', '', '', 'Y', '2011-06-28 23:26:52'),
(183, 'C183', 'Sunset Valley Oregon System and Grand Rails 2012', '2011-07-04 21:00:00', '2011-07-04 22:00:00', 'The SVOS occupies 2600 sqft with up to 4 decks. Its dominate roll is maximizing prototypical fidelity and operations. Based upon specific prototypes, over 1000 structures are being constructed along with 150 feet of bridges and trestles. It&rsquo;s a monumental project with over 1400 feet of main/branch line trackage modeling 10 prototype railroads in the Pacific Northwest. Dr. Chubb explains how the teamwork of 38 associates is pulling together to have the system ready for the 2012 NMRA National in Grand Rapids where it will be on tour all day every day throughout the convention. In addition to the 38 regular scheduled tours, Bruce explains how the SVOS id setting up to host a 12-hour pre-convention operating session.', 0, '', 'Bruce Chubb, MMR', 1, '', 'Chubbbrucemmr@aol.com', '', '', '', '', '', '', '', NULL),
(184, 'C184', 'Signaling Your Model Railroad: Part 1', '2011-07-09 13:00:00', '2011-07-09 14:00:00', 'Fundamental Concepts: Prototype and Model\r\n\r\nBruce expands upon the Signaling Made Easier series published in MR, and the newly released multi-volume Railroader&rsquo;s Application Handbook to cover prototypical signaling and how to adapt it to our models. The differences between ABS, APB and CTC signaling are discussed along with their impact on how railroads operate. A clear understanding is established regarding the difference between block and interlocking signals, speed versus route signaling and the corresponding aspects and indications used by different railroads and how they can be adapted to our models. Correct signal placement, total compatibility with DCC and how to easily drive different signal types are addressed. Bruce explains how to use the new Super Mini-Node card coupled with the power of the computer to joyfully reduce layout wiring and significantly reduce system cost while maximizing system flexibility and prototype fidelity.', 20, '', 'Bruce Chubb, MMR', 4, 'http://www.jlcenterprises.net/', 'chubbbrucemmr@aol.com', '', '', '', '', '', '', 'Y', '2011-06-28 23:26:35'),
(185, 'C185', 'Signaling Your Model Railroad: Part 2', '2011-07-09 14:00:00', '2011-07-09 15:00:00', 'ABS, APB and Grade Crossing Warning Systems\r\n\r\nExpanding upon the content of the Railroader&rsquo;s Application Handbook, Bruce provides detailed coverage of optimized block occupancy detection and its application to establish Automatic Block Signaling (ABS) including its programming. Then, Bruce explains how the prototype utilizes &ldquo;Traffic Sticks&rdquo; to determine directional movement across block boundaries. Such capability plays a key role in setting up Absolute Permissive Block (APB) signaling thereby providing protection for bi-directional operation on the same track. The importance of &ldquo;traffic sticks&rdquo; in setting up grade crossing warning systems is discussed along with its utilization with a new Prototypical Grade Crossing Control (PGCC) card. Software examples are included for ABS, APB and for driving the PGCC.\r\n', 20, '', 'Bruce Chubb, MMR', 4, 'http://www.jlcenterprises.net/', 'chubbbrucemmr@aol.com', '', '', '', '', '', '', 'Y', '2011-06-28 23:26:20'),
(186, 'C186', 'Signaling Your Model Railroad: Part 3', '2011-07-07 21:30:00', '2011-07-07 22:30:00', 'Centralized Traffic Control Systems\r\n\r\nBruce explains CTC operations and how it can smooth traffic flow on your railroad. As illustrated, constructing a dispatcher&rsquo;s CTC panel and interfacing it to your railroad is much easier than most modelers realize. Differences between US&S and GRS machines are explained and how their different components are interfaced. Straightforward programming techniques are introduced making is easy to &ldquo;cut-paste-and-change-numbers&rdquo; to set up a highly accurate C/MRI-based CTC system for any model railroad. Utilizing a standardized set of callable subroutines makes the programming easy while maximizing prototype fidelity.  Additionally, entrance-exit interlocking is discussed along with using computer graphics to emulate modern dispatching operations.', 20, '', 'Bruce Chubb, MMR', 1, 'http://www.jlcenterprises.net/', 'chubbbrucemmr@aol.com', '', '', '', '', '', '', '', '2011-06-23 01:41:50'),
(258, 'C258', 'Blooming Fabric Flowers - fee required', '2011-07-08 09:30:00', '2011-07-08 10:30:00', 'These fabric flowers can be made into pins or home decor. They can be made using fabric glue or easy hand stitching. Diane will share with us the instructions on making three different flowers.', 30, '', 'Diane Forbes', 6, '', 'dryno47@cox.net', '', 'Y', '619-987-7966', '', '', 'none', '', NULL),
(187, 'C187', '35 Years on the Sacramento Central', '2011-07-09 11:00:00', '2011-07-09 12:00:00', 'The story of the Sacramento Modular Railroaders and their club railroad, the Sacramento Central. For about 35 years, SMR has been an innovative group. We''ve been doing switchlist operations for many years, on a modular layout that changes at each setup.. We''ve developed lightweight, versatile modules that can combine quickly into railroads of many sizes (up to 40 by 60 feet or more), and of many shapes. For example, our main switchyard can be 30 or 36 feet long, in either a straight through or Tee configuration. Typical layout setup time runs about 1 1/2 hours, and is done without tools. Learn how we do this and more, how we''ve lasted that long, and are still at it. We''ll be featured in an early 2011 article in Model Railroader, and come see us at the National Train Show during the convention.', 0, '', 'Dick Witzens', 3, '', 'witzens@surewest.net', NULL, 'Y', '916-708-4332', 'See my Tuesday comments.\r\n\r\nI may have accidentally given the wrong cell number on the Tuesday confirmation. 916-708-4332 is the correct one. ', '', 'convention', '', NULL),
(188, 'C188', 'Aviation in Model Railroading', '2011-07-04 13:00:00', '2011-07-04 14:00:00', 'Klaus will explain ways of using model aviation equipment to create unique layout features and memorable flat car loads. In addition to presenting several small dioramas, the availability of ready to display aircraft models, kits, and appropriate tools will be discussed.', 0, '', 'Klaus Keil', 1, '', 'kd6gte@comcast.net', NULL, '', '530-327-8146', '\r\nnone', '', '', '', NULL),
(189, 'C189', 'Aviation in Model Railroading', '2011-07-06 11:00:00', '2011-07-06 12:00:00', 'Klaus will explain ways of using model aviation equipment to create unique layout features and memorable flat car loads. In addition to presenting several small dioramas, the availability of ready to display aircraft models, kits, and appropriate tools will be discussed.', 0, '', 'Klaus Keil', 5, '', 'kd6gte@comcast.net', NULL, 'Y', '530-327-8146', '\r\nnone', '', '', '', NULL),
(190, 'C190', 'Napkin Folding Demonstration', '2011-07-05 10:00:00', '2011-07-05 11:00:00', 'Do you have envy when you eat in a restaurant where the napkins are folded in intricate ways? Come and learn how this is done. We will have one of the banquet captains from the Hyatt show us how this is done. ', 30, '', '', 26, '', '', '', '', '', '', '', '', '', NULL),
(192, 'C192', 'Making "Ready-to-Run" Freight Car Models Really Ready to Run', '2011-07-07 14:30:00', '2011-07-07 15:30:00', 'In recent years, a dramatic shift has taken place in freight car modeling:  the replacement of kits by assembled "ready-to-run" models.  The best of these models are, on the whole, well made, prototypically accurate and highly detailed.  However, are they really "ready-to-run"?  In this Power Point clinic, cars offered by several different manufacturers will be shown as they came out of the box and then as they appear when ready to put on the track of a prototypically realistic layout.  I''ll describe the process of making improvements and adding appropriate aging and weathering which make them truly layout-ready.  The models themselves will be on display in the RPM room.', 0, '', 'Richard Hendrickson', 5, '', 'rhendrickson@opendoor.com', NULL, '', '', '', '', '', '', NULL),
(193, 'C193', 'Making "Ready-to-Run" Freight Car Models Really Ready to Run', '2011-07-06 09:30:00', '2011-07-06 10:30:00', 'In recent years, a dramatic shift has taken place in freight car modeling:  the replacement of kits by assembled "ready-to-run" models.  The best of these models are, on the whole, well made, prototypically accurate and highly detailed.  However, are they really "ready-to-run"?  In this Power Point clinic, cars offered by several different manufacturers will be shown as they came out of the box and then as they appear when ready to put on the track of a prototypically realistic layout.  I''ll describe the process of making improvements and adding appropriate aging and weathering which make them truly layout-ready.  The models themselves will be on display in the RPM room.', 0, '', 'Richard Hendrickson', 5, '', 'rhendrickson@opendoor.com', NULL, '', '', '', '', '', '', NULL),
(194, 'C194', 'Bargain Wines from the Western States: A Wine Tasting Clinic', '2011-07-08 20:30:00', '2011-07-08 22:00:00', 'Why a Wine Tasting Clinic at an NMRA Convention?\r\n<p>\r\nBecause:\r\n<ol>\r\n<li>Most NMRA members and their significant others are interested in other things besides trains, and those interests often include good food and wine.\r\n<li> High quality table wines are among the more celebrated regional products of California and the Pacific Northwest.\r\n<li>We gave a similar clinic at the 2000 NMRA convention in San Jose and it was well received, so here we go again.\r\n</ol>\r\nFor people who like table wine, or at least think they might, and want to know more about buying it at reasonable prices and serving it confidently.  We''ll talk about how to get the most out of wine tasting, and we''ll then serve 2 oz. samples of eight California, Oregon, and Washington wines, four whites and four reds, which can be purchased for $12 a bottle or less.  We''ll talk about the wines, answer questions, and give each participant a handout with much information about wines, wine buying, and wine serving.  There will be a $15 per person charge to cover the cost of the wine and the nibbles that accompany it.  Limited to 24 participants.  See the &quot;<a href="http://www.x2011west.org/cart/index.php?main_page=product_info&cPath=10&products_id=125">Company Store</a>&quot; to purchase a ticket for this clinic.', 60, '', 'Richard and Sandra Hendrickson', 556, '', 'rhendrickson@opendoor.com', '', 'Y', '541-951-6817', '', 'No presentation equipment needed.  But what about glasses?  Last I heard, the convention committee was proposing to have wine glasses with the convention logo in the company store.  If so, those should be included with the clinic tickets (and the price perhaps raised accordingly).  If not, some other arrangement must be made to have wine glasses for the clinic.', 'none', '', '2011-06-30 12:08:37'),
(195, 'C195', 'Regions and Divisions Handbook: What''s in it for You?', '2011-07-04 11:00:00', '2011-07-04 12:00:00', 'The Regions and Divisions handbook has been in use for about a year. Come and find out what is in it for your Region or Division. Can you use any of the good ideas from other groups that it contains? Come and tell us what your experience has been using it.', 0, '', 'Bill Kaufman', 5, '', 'whk58@pacbell.net', '', '', '415 298-1370', 'The Regions and Divisions handbook has been in use for about a year. Come and find out what is in it for your Region or Division. Can you use any of the good ideas from other groups that it contains? Come and tell us what your experience has been using it. ', '', 'mywindows', '', NULL),
(204, 'C204', 'The Sierra Railroad: Modeling and Operating a Shortline', '2011-07-05 11:00:00', '2011-07-05 12:00:00', 'John Zach will discuss the "Why''s and How''s" of modeling and operating a shortline railroad, using his own HO Scale Sierra Railroad 1955 as an example.\r\n\r\nThis HO scale model railroad is based on the Sierra Railroad that started its long and glorious history in 1897 and is still in operation today. The time frame for the layout is the Spring of 1955 when the first diesels (Baldwin S-12s) arrive on the railroad and the logging railroads of the Pickering and WSLCo are still going strong. Currently we move 180 cars per operating session. This includes cars on the SP and ATSF that interchange with the Sierra or have a destination in Oakdale. It does not count the Passenger cars of the Sierra or the SP or the 56 log cars of the Pickering Railroad or any of the WSLCo equipment.  More than once the comment has been made that if the Sierra moved as many cars as we do they would have never filed bankruptcy or had any financial problems.', 0, '', 'John Zach', 2, 'http://www.sierrarailroad55.com', 'jzach@hrblock.com', NULL, 'Y', '209-625-5609', '', '', 'mywindows', '', NULL),
(197, 'C197', 'Helping Boy Scouts Earn a Model Railroading Merit Badge', '2011-07-04 09:30:00', '2011-07-04 10:30:00', 'A Round Table discussion of techniques that can be used to develop a successful BSA Railroading Merit Badge Program.  We will examine the program that I run for the Piedmont Division in Atlanta as one example of a successful program and why it works for us.  If you are thinking of developing a program or are already running a program, please stop by and join the discussion.', 0, '', 'John Stevens', 5, '', 'snevets4@bellsouth.net', NULL, '', '', '', '', '', '', NULL),
(198, 'C198', 'Division Meets the NMRA British Region Way', '2011-07-06 11:00:00', '2011-07-06 12:00:00', '', 0, '', 'Nobby Clarke', 7, '', 'nobbyclarke2@btopenworld.com', '', 'Y', '07854210624', '', '', 'convention', '', NULL),
(200, 'C200', 'Using the CSRM library and archives', '2011-07-07 13:00:00', '2011-07-07 14:30:00', 'The California State Railroad Museum Library is North America&rsquo;s largest railroad reference library, with an archival collection that includes literally millions of photographs, drawings, corporate records, periodicals, and much more. CSRM Library staff will begin with a presentation highlighting some of the collections contained in the Museum&rsquo;s archives, and focusing on those of likely interest to modelers. A visit to the CSRM  Library Reading Room will wrap up this session, and hopefully to acquaint NMRA members with the Museum''s broad array of resources&mdash;and how to access and utilize them.', 40, '', 'CSRM staff', 8, '', '', '', '', '', '', '', '', '', NULL),
(201, 'C201', 'Maintaining a continually running layout ', '2011-07-07 15:00:00', '2011-07-07 16:00:00', 'The California State Railroad Museum is open 362 days a year, from 10 a.m. to 5 p.m. each day. Have you ever considered the maintenance that would be necessary if you ran your model railroad that long? In this case, it&rsquo;s a Toy Train layout in the Thomas W. Sefton Gallery, featuring four different operating tracks and levels. Regular track cleaning, periodic replacement of drive mechanisms and tracks, and many other interesting things will be discussed in this &ldquo;behind the scenes&rdquo; session with Museum staff.', 40, '', 'CSRM staff', 8, '', '', '', '', '', '', '', '', '', NULL),
(202, 'C202', 'Layout Design Tricks', '2011-07-04 19:30:00', '2011-07-04 20:30:00', 'This clinic is a slide presentation focusing on the ways you can make your layout -look- bigger thru the use of subtle scenery, trackage, and structure techniques. The target audience is - any one who is interested in ways to make a layout "look better".', 0, '', 'Jim Betz', 1, '', 'jimbetz@jimbetz.com', '', '', '', '', '', '', '', NULL),
(203, 'C203', 'Layout Design Tricks', '2011-07-09 09:30:00', '2011-07-09 10:30:00', 'This clinic is a slide presentation focusing on the ways you can make your layout -look- bigger thru the use of subtle scenery, trackage, and structure techniques. The target audience is - any one who is interested in ways to make a layout "look better".', 0, '', 'Jim Betz', 2, '', 'jimbetz@jimbetz.com', '', '', '', '', '', '', '', NULL),
(205, 'C205', 'The Sierra Railroad: Modeling and Operating a Shortline', '2011-07-09 11:00:00', '2011-07-09 12:00:00', 'John Zach will discuss the "Why''s and How''s" of modeling and operating a shortline railroad, using his own HO Scale Sierra Railroad 1955 as an example.\r\n\r\nThis HO scale model railroad is based on the Sierra Railroad that started its long and glorious history in 1897 and is still in operation today. The time frame for the layout is the Spring of 1955 when the first diesels (Baldwin S-12s) arrive on the railroad and the logging railroads of the Pickering and WSLCo are still going strong. Currently we move 180 cars per operating session. This includes cars on the SP and ATSF that interchange with the Sierra or have a destination in Oakdale. It does not count the Passenger cars of the Sierra or the SP or the 56 log cars of the Pickering Railroad or any of the WSLCo equipment.  More than once the comment has been made that if the Sierra moved as many cars as we do they would have never filed bankruptcy or had any financial problems.', 0, '', 'John Zach', 2, 'http://www.sierrarailroad55.com', 'jzach@hrblock.com', NULL, '', '', '', '', '', '', NULL),
(206, 'C206', 'Modeling the Southern Pacific Business Train', '2011-07-06 14:30:00', '2011-07-06 15:30:00', 'When the Southern Pacific needed to reach deep into its publicity arsenal, it would dispatch a fleet comprised of official and business car equipment to cover events ranging from company advertising to major sporting events.  This polished varnish would create a clearly defined business train consist in the 1980s.  Southern Pacific Prototype Modeler Scott Inman decided to take on the arduous task of modeling the train in HO scale.  The clinic will describe both the prototype equipment, uses of the train, and the model alterations needed to accurately represent the Southern Pacific Business Train.', 0, '', 'Scott Inman', 7, '', 'tighttrains@hotmail.com', '', '', '916-205-9064', 'The only thing I would change is the title.  The title I have used to present the clinic in the past is "Modelin the Southern Pacific Business Train."\r\n', '6 or 8 foot table to display the train on.', 'convention', '', NULL),
(207, 'C207', 'Online Resources for Model Railroaders', '2011-07-07 09:30:00', '2011-07-07 10:30:00', 'The Model Railroad Hobbyist mediaZine staff de-mystifies the tricks to finding the best model railroading resources on the internet. If you want to leverage the world wide web as an information resource for your hobby, this is a "don''t miss" clinic.', 0, '', 'Joe Fugate', 1, '', 'joe@fugate.com', NULL, '', '', '', '', '', '', NULL),
(208, 'C208', 'Make it Run Like a Dream', '2011-07-05 19:30:00', '2011-07-05 20:30:00', 'Learn the secrets of getting the best "quality of run" from your layout operation so that your layout operates with optimum reliability. Hear the successes and failures from seasoned modeler Joe Fugate, whose HO Siskiyou Line layout has been in operation now for 20 years.', 0, '', 'Joe Fugate', 2, '', 'joe@fugate.com', '', 'Y', '503-984-0134', 'Yep, look sgood.', 'Actually this is my iPad with a VGA connector - works great!', 'mymac', '', NULL),
(209, 'C209', 'Make it Run Like a Dream', '2011-07-07 11:00:00', '2011-07-07 12:00:00', 'Learn the secrets of getting the best "quality of run" from your layout operation so that your layout operates with optimum reliability. Hear the successes and failures from seasoned modeler Joe Fugate, whose HO Siskiyou Line layout has been in operation now for 20 years.', 0, '', 'Joe Fugate', 2, '', 'joe@fugate.com', NULL, '', '', '', '', '', '', NULL),
(210, 'C210', 'Modeling The West Side Lumber Company', '2011-07-07 09:30:00', '2011-07-07 10:30:00', 'Burton Maxwell has spent a lifetime researching the West Side Lumber Company and building a model of it. In this informative clinic, he gives a little history and a lot of hands-on tips on modeling that could apply to any logging railroad layout. From design, through construction, to buildings, rolling stock and scenery, Burton has practical information to make a logging layout look so real, you&rsquo;ll swear you smell pine trees and sawdust. His wife, Patricia, joins him with her own scenery secrets.', 0, '', 'Burton Maxwell', 2, '', 'patgmaxwell@gmail.com', '', '', '619-292-1566', '', '', 'convention', '', NULL),
(211, 'C211', 'Passenger Cars of the Colorado & Southern', '2011-07-04 14:30:00', '2011-07-04 15:30:00', 'Ken Martin, one of the authors of <i>Colorado & Southern Freight and Passenger Cars (Narrow Gauge Pictorial, VIII (8))</i> will discuss the passenger car equipment of the C&S.', 0, '', 'Ken Martin', 4, '', 'kmartin537@surewest.net', '', 'Y', '', 'I do not have a cell phone.', '', 'mymac', '', NULL),
(213, 'C213', 'Overhead Wiring Engineering', '2011-07-05 08:00:00', '2011-07-05 09:00:00', 'Realistic operating catenary is possible!  Gurdon Miller will do a hands on demonstration of techniques to illustrate the basic concepts of tensioning, zig-zag, and pulling-off on curves to keep the wire within range of the pantograph. Although his models are based on a Swiss prototype, the principles are universal to all overhead wiring.\r\n', 0, '', 'Gurdon Miller', 5, '', 'gurdon@earthlink.net', NULL, '', '', '', '', '', '', NULL),
(214, 'C214', 'Finer than Fine Scale - Modeling Strong Maine in Proto 20.3n2', '2011-07-04 08:00:00', '2011-07-04 09:00:00', 'Strong, Maine was a focal point of operations on the Sandy River and Rangeley Lakes, the largest of the Maine 2 foot gauge railroads.  It was the junction with the major branch on the railroad, included engine servicing facilities, a lap siding and 7 industries including what was at the time the largest toothpick factory in the US.  All this in 1700 linear feet.\r\n<p>\r\nJim Providenza has been in HO Scale all his modeling life. Yet he has spent a good part of the last 5 years working on converting 40 actual linear feet of part of his backyard into a model of Strong, Me. in 1:20.3 proportion with a 2:1 lineal compression.  Jim is building the railroad using exact prototype wheel and track dimensions (Proto 20.3n2).  Follow along with Jim as he recounts the first part of what has become a very &quot;interesting&quot; and fulfilling journey.  Jim will discuss the joys and tribulations of working in a minority scale/gauge combination where almost everything has to be scratchbuilt, kitbashed or extensively reworked.  Topics will include research, developing standards, civil engineering &quot;for real&quot;, the use of full size tools for modeling, metal shop and the importance of drainage and why glue is often &quot;not good enough&quot;.', 0, '', 'Jim Providenza', 4, '', 'RRJim@aol.com', '', '', '415-720-2662', 'Middle of the second sentence of second paragraph should read, "... into a model of Strong, Me. ..."', '', 'convention', '', NULL),
(215, 'C215', 'Pen & Ink Drawing with JoAnn White - fee required', '2011-07-05 14:30:00', '2011-07-05 15:30:00', 'Learn the basic strokes used in pen and ink drawing.  Practice the strokes by adding details to a simple train scene.  Complete a picture of a rabbit using two of the basic strokes.  No experience needed.', 30, '', 'JoAnn White', 6, '', 'JAWhite865@aol.com', '', '', '', '', '', '', '', NULL),
(217, 'C217', 'Project Linus Speaker', '2011-07-06 14:30:00', '2011-07-06 15:30:00', 'Yvonne Jones, from the local chapter of Project Linus will share who they donate to, how many blankets they''ve donated and about Project Linus in general. Come out and hear about this organization and all the great work it does.', 30, '', 'Yvonne Jones', 6, '', 'maggiboo@surewest.net', '', 'Y', '9165052075', '', '', '', '', NULL),
(219, 'C219', 'Building Working Caboose "Frog Eye" Marker Lights', '2011-07-07 16:00:00', '2011-07-07 17:00:00', 'The clinic focuses on the construction, installation and control of operational Caboose "Frog Eye" Marker lights, including several different versions, Dual/Single and later styles. Easy to build and install DCC control features will also be discussed. The control portion would be of interest for any style of markers.\r\n', 0, '', 'Rich Malone', 5, '', 'rmalone4449@hotmail.com', NULL, 'Y', '(609) 284-0600', '', '', 'convention', '', NULL),
(220, 'C220', 'Modeling the Sacramento Belt Line', '2011-07-04 14:30:00', '2011-07-04 15:30:00', '', 0, '', 'William Burg', 5, '', 'b.burg@comcast.net', NULL, 'Y', '916-798-5449', '', '', 'convention', '', NULL),
(221, 'C221', 'Modeling the Sacramento Belt Line', '2011-07-05 19:30:00', '2011-07-05 20:30:00', '', 0, '', 'William Burg', 4, '', 'b.burg@comcast.net', '', 'Y', '916-798-5449', '', '', 'convention', '', NULL),
(222, 'C222', 'Running an NMRA Division', '2011-07-06 09:30:00', '2011-07-06 10:30:00', '', 0, '', 'Ed Liesse and Didrik Voss', 7, '', 'EELiesse@aol.com,davoss@pvmtengr.com', NULL, 'Y', '425-327-8549', '', '', 'mywindows', '', NULL),
(266, 'C266', 'Working Gemco: We Don''t Need No Stinkin'' Yardmaster', '2011-07-04 09:30:00', '2011-07-04 10:30:00', 'Dave is a railroad engineer who worked for many years in and around Southern Pacific''s Gemco Yard in the Los Angeles area. Gemco was SP''s support yard for General Motors'' Van Nuys plant as well as a Budweiser brewery just up the line. Many locals were based out of Gemco and there were approximately 300 - 500 cars switched in the yard each day, all without a yardmaster to be found. Come learn how this was done and how to simulate this in a yard on your railroad.', 0, '', 'Dave Bayless', 7, '', 'davebayl@pacbell.net', NULL, 'Y', '530-613-5784', '', 'laser pointer', 'mywindows', '', NULL),
(223, 'C223', 'Improving Waybills: Adapting Prototype Paperwork', '2011-07-03 13:00:00', '2011-07-03 14:00:00', 'The popular four-cycle waybill, used in many operating schemes, has the drawbacks that minimal prototype information is included, and that often the four cycles become a permanent feature for a particular car, never leaving the car card. An alternative approach based on prototype waybills is described, along with a discussion on what is useful for modeling in the prototype waybill. Prototype paperwork for car movement is described, and the use of the improved waybills in a layout operating scheme is presented and illustrated on the speaker''s layout. Implementation methods, and gains in flexibility and realism, are emphasized. Updates from published accounts of this approach are also included.', 0, '', 'Tony Thompson', 3, '', 'thompson@signaturepress.com', '', '', '', '', '', '', '', NULL),
(224, 'C224', 'Improving Waybills: Adapting Prototype Paperwork', '2011-07-08 16:00:00', '2011-07-08 17:00:00', 'The popular four-cycle waybill, used in many operating schemes, has the drawbacks that minimal prototype information is included, and that often the four cycles become a permanent feature for a particular car, never leaving the car card. An alternative approach based on prototype waybills is described, along with a discussion on what is useful for modeling in the prototype waybill. Prototype paperwork for car movement is described, and the use of the improved waybills in a layout operating scheme is presented and illustrated on the speaker''s layout. Implementation methods, and gains in flexibility and realism, are emphasized. Updates from published accounts of this approach are also included.', 0, '', 'Tony Thompson', 7, '', 'thompson@signaturepress.com', '', '', '510-637-9960', 'Not okay. You guys have lost my writeup. ', '', 'mymac', '', NULL),
(225, 'C225', 'Creating Waybills and Car Cards with Excel', '2011-07-04 08:00:00', '2011-07-04 09:00:00', 'One of the more useful software products for railroad modelers is Microsoft Excel.  It is ubiquitous, runs on many platforms and does some tasks exceptionally well.  One good application is to generate car cards and waybills for operations.  Two examples will demonstrate some possibilities.  1. Using Excel as a formatting tool.  The user types in data and Excel prints the data in a desired format.  2. Using some of the power in Excel to feed data from the car inventory, origin and destination tables, town lists, routing tables and commodity carried tables coupled with the random number function to generate the waybill.  A companion clinic covers other conventional and unconventional applications of Excel in model railroading.', 0, '', 'Gary Saxton', 3, '', 'gbs46@sbcglobal.net', '', 'Y', '281-910-0414', '', '', 'mymac', '', NULL),
(226, 'C226', 'Creating Waybills and Car Cards with Excel', '2011-07-06 08:00:00', '2011-07-06 09:00:00', 'One of the more useful software products for railroad modelers is Microsoft Excel.  It is ubiquitous, runs on many platforms and does some tasks exceptionally well.  One good application is to generate car cards and waybills for operations.  Two examples will demonstrate some possibilities.  1. Using Excel as a formatting tool.  The user types in data and Excel prints the data in a desired format.  2. Using some of the power in Excel to feed data from the car inventory, origin and destination tables, town lists, routing tables and commodity carried tables coupled with the random number function to generate the waybill.  A companion clinic covers other conventional and unconventional applications of Excel in model railroading.', 0, '', 'Gary Saxton', 5, '', 'gbs46@sbcglobal.net', '', 'Y', '281-910-0414', '', '', 'mymac', '', NULL),
(227, 'C227', 'Use and Abuse of Excel in Model Railroading', '2011-07-05 16:00:00', '2011-07-05 17:00:00', 'One of the more useful software products for railroad modelers is Microsoft Excel.  It is ubiquitous, runs on many platforms and does some tasks exceptionally well.  It can also be pushed, stretched and abused to do some modeling tasks not considered part of its usual repertoire.  This clinic will highlight timetables and string diagrams, track schematics, bridge and trestle plans, paper doll buildings and other miscellaneous tasks that can be handled by Excel.  A companion clinic demonstrates a couple of Excel base car card and waybill systems.', 0, '', 'Gary Saxton', 5, '', 'gbs46@sbcglobal.net', '', 'Y', '2819100414', '', '', 'mymac', '', NULL),
(228, 'C228', 'Use and Abuse of Excel in Model Railroading', '2011-07-07 08:00:00', '2011-07-07 09:00:00', 'One of the more useful software products for railroad modelers is Microsoft Excel.  It is ubiquitous, runs on many platforms and does some tasks exceptionally well.  It can also be pushed, stretched and abused to do some modeling tasks not considered part of its usual repertoire.  This clinic will highlight timetables and string diagrams, track schematics, bridge and trestle plans, paper doll buildings and other miscellaneous tasks that can be handled by Excel.  A companion clinic demonstrates a couple of Excel base car card and waybill systems.', 0, '', 'Gary Saxton', 3, '', 'gbs46@sbcglobal.net', '', 'Y', '2819100414', '', '', 'mymac', '', NULL),
(229, 'C229', 'Finer than Fine Scale - Modeling Strong Maine in Proto 20.3n2', '2011-07-08 13:00:00', '2011-07-08 14:00:00', 'Strong, Maine was a focal point of operations on the Sandy River and Rangeley Lakes, the largest of the Maine 2 foot gauge railroads.  It was the junction with the major branch on the railroad, included engine servicing facilities, a lap siding and 7 industries including what was at the time the largest toothpick factory in the US.  All this in 1700 linear feet.\r\n<p>\r\nJim Providenza has been in HO Scale all his modeling life. Yet he has spent a good part of the last 5 years working on converting 40 actual linear feet of part of his backyard into a model of Strong, Me. in 1:20.3 proportion with a 2:1 lineal compression.  Jim is building the railroad using exact prototype wheel and track dimensions (Proto 20.3n2).  Follow along with Jim as he recounts the first part of what has become a very &quot;interesting&quot; and fulfilling journey.  Jim will discuss the joys and tribulations of working in a minority scale/gauge combination where almost everything has to be scratchbuilt, kitbashed or extensively reworked.  Topics will include research, developing standards, civil engineering &quot;for real&quot;, the use of full size tools for modeling, metal shop and the importance of drainage and why glue is often &quot;not good enough&quot;.', 0, '', 'Jim Providenza', 7, '', 'RRJim@aol.com', '', '', '415-720-2662', 'Middle of second sentence should read, "... a model of Strong, Me. in..." ', '', 'convention', '', NULL),
(230, 'C230', 'Building Brass Models', '2011-07-08 14:30:00', '2011-07-08 15:30:00', 'This is a clinic to help modellers overcome their reluctance to try this medium for model building. Brass models have a mystique about them in model railroad circles. They are also considered to be the crÃ¨me a la crÃ¨me. It is hoped that once a modeller understands the techniques offered by this clinic, he or she can better decide whether to enter into this realm of modelling. Handouts will be provided.', 0, '', 'Andrew Malette', 7, '', 'andym@mlwservices.ca', '', 'Y', '647 521 8395', 'Forgot my cell number.', 'I will need power for soldering equipment.  The computer should have PowerPoint on it.', 'convention', '', NULL),
(232, 'C232', 'Copper on Rails', '2011-07-07 11:00:00', '2011-07-07 12:00:00', 'Don Marenzi will present the relationship between railroads and the copper industry across North America.  The use of rail equipment from mining, to smelting, refining, and finally delivery to end customers will be discussed.  The processing of copper, location of major landmarks, and traffic flows of the industry will be shown along with the railroads, specialized rolling stock and facilities. Information and a lot of photographs shown should inspire modeling opportunities and operating potential for your model railroad.', 0, '', 'Don Marenzi', 3, '', 'donmarenzi@aol.com', '', 'Y', '510-304-1384', '', '', 'mymac', '', NULL),
(233, 'C233', 'Interfacing a Computer to Your Model Railroad', '2011-07-04 08:00:00', '2011-07-04 09:00:00', 'Bruce, the inventor of the Computer/Model Railroad Interface (C/MRI) explains how easy it is to interface a computer to your model railroad. Focus is on the Super Mini-Node that greatly improves I/O distribution and significantly reduces system cost. Up to 128 nodes can be distributed all around your layout making wiring a snap. Simply connect any device directly to the nearest node. Only wiring between nodes is a single 4-wire cable. Applications focus on reducing layout wiring, signaling systems, staging track control, and interfacing to DCC. The result can greatly increase your railroad''s prototypical realism and hobby enjoyment.', 0, '', 'Bruce Chubb, MMR', 5, '', 'Chubbbrucemmr@aol.com', '', '', '', '', '', '', '', NULL),
(234, 'C234', 'Interfacing a Computer to Your Model Railroad', '2011-07-06 08:00:00', '2011-07-06 09:00:00', 'Bruce, the inventor of the Computer/Model Railroad Interface (C/MRI) explains how easy it is to interface a computer to your model railroad. Focus is on the Super Mini-Node that greatly improves I/O distribution and significantly reduces system cost. Up to 128 nodes can be distributed all around your layout making wiring a snap. Simply connect any device directly to the nearest node. Only wiring between nodes is a single 4-wire cable. Applications focus on reducing layout wiring, signaling systems, staging track control, and interfacing to DCC. The result can greatly increase your railroad''s prototypical realism and hobby enjoyment.', 0, '', 'Bruce Chubb, MMR', 4, '', 'Chubbbrucemmr@aol.com', '', '', '', '', '', '', 'Y', '2011-06-28 23:23:29'),
(235, 'C235', 'Layout Sound as a Serious Scale Modeling Medium', '2011-07-06 21:00:00', '2011-07-06 22:00:00', 'Hearing is believing. Focus in this clinic is on building the scale sound model... the soundtrack! if your interest lies with the ''sound system'', you may want to attend our other clinic. Keep in mind, a sound system is only as good as the soundtracks user loaded into it! \r\n\r\nIn this clinic we will examine the nature and processes of building scale sound models, and the modeling tricks we''ve stumbled into. The scale sound modeling workbench is the audio editor. If attendees wish, we will get into field recording, sound design in mineature, kit bashing, scartch building (sound design), or any other topic dealing with the actual construction of the scale model soundtrack.  And of course we will discuss the most important aspect of any believeable scale sound model... the scale imaging around the sound! \r\n\r\nA working scale sound workbench will be on hand, and examples of scale models will be ''on display'' (presented) throughout the clinic. Clinic starts with a bit of background into the nature of scale sound and human hearing, and perception of sound in scale. We''ll lay out the basics for you, and then we will open the discussion up to answering questions in areas of specific interest to attendees.', 0, '', 'Jim Wells', 4, 'http://www.fantasonics.com/', 'enginears@fantasonics.com', '', 'Y', '805-478-5090', '', '', '', '', NULL),
(236, 'C236', 'Layout Sound Applications', '2011-07-07 21:00:00', '2011-07-07 22:00:00', 'In this clinic we will focus on the practical aspects of both the soundtrack and sound system. Both elements are necessary, and should be integrated together, into the layout. Layout sound does not have to be complicated or expensive to be fun! Any sound is more fun than silence!  But we''ll cover all of the various options and approaches, from the rediculous to the sublime, documented over the years by the Model Railroad Layout Sound Group. The goal \r\nof this clinic will be to encourage and hopefully inspire model railroaders to learn about the skills and tools required to add sound to their layouts... and to give ''the other image'' an honest chance to add realism, believeability, unseen animation and life to your railroad empire. \r\n\r\nClinic starts with a bit of background into the nature and relationship of scale sound and human hearing/perception, and the basics. We will then open the discussion up to answering questions in areas of specific interest to clinic attendees.', 0, '', 'Jim Wells', 2, 'http://www.fantasonics.com/', 'enginears@fantasonics.com', '', 'Y', '805-478-5090', '', '', '', '', NULL),
(237, 'C237', 'Proto:87 in 2011', '2011-07-04 16:00:00', '2011-07-04 17:00:00', 'Rene Gourley will speak about the state of Proto:87 today.  After a brief look back at our humble beginnings, we will explore the products and knowledge that is available today and have a look at some of the great modeling here and overseas.  We will close with some speculation on where we might go from here.\r\n', 0, '', 'Rene Gourley', 1, '', 'rene@proto87.org', '', 'Y', '7786687119', '', 'mywindows', 'mywindows', '', NULL),
(238, 'C238', '3D Printing for Everyone', '2011-07-06 13:00:00', '2011-07-06 14:00:00', 'Rapid Prototyping has been in the dreams of model railroaders for over twenty years.  As the cost comes down and the quality goes up, the technology is finally nearly ready for us.  Rene Gourley will speak about getting a first model printed, the process for developing the design and obtaining the model, and the finishing that was required.', 0, '', 'Rene Gourley', 4, '', 'rene@proto87.org', NULL, 'Y', '', '', 'mywindows', 'mywindows', '', NULL),
(239, 'C239', 'Sierra Railway: Modeling the Angels Branch', '2011-07-09 13:00:00', '2011-07-09 14:00:00', 'The colorful Sierra Railway has often been described as the "perfect prototype."  In this clinic, long-time Sierra fan and modeler Glenn Sutherland will demonstrate that this is just as true for the railroad''s Angels Branch as it is for the Sierra as a whole.\r\n\r\nThe Sierra Railway was built in 1897 to connect the gold mines and lumber mills of Tuolumne County, CA with the outside world.  Shortly thereafter, the railroad built its 19-mile Angels Branch to reach the neighboring town of Angels Camp and the freight potential of the numerous gold mines operating in the area.  From 1902 to 1939, the quaint and picturesque Angels Branch used unique equipment to haul heavy loads up and down steep grades, across a major river, and through 4 switchbacks.\r\n\r\nAfter a very brief overview of the entire Sierra Railway, Glenn will describe and show historic photos of the Angels Branch and its colorful history.  Then Glenn will describe how to model the branch, including its signature scenes, key structures, unique equipment, and operating practices. He will show examples from his own HO scale prototype-based Sierra Railway layout (circa 1923), which includes a 160'' long depiction of the Angels Branch.', 0, '', 'Glenn Sutherland', 2, '', 'glennsutherland@sti.net', NULL, 'Y', '209-769-7255', 'None', 'None', 'mywindows', '', NULL);
