(240, 'C240', 'So, You Want To Build a Sawmill', '2011-07-03 13:00:00', '2011-07-03 14:00:00', 'Jim will discuss the various types of sawmills, their facilities and focuses on strategies for modeling. Before and during high school years I apprenticed for five summers learning the craft of saw filing for production operations under tutelage of my Father.  The first two and two-thirds years at Oregon State University were in the College of Forestry in its Forest Products course of study and became my minor as I took my degree in Business Administration. After another four years of study I received a Masters Degree.  During most of these years I worked as a laborer, heavy equipment and production machine operator first in a box factory and then in the woods and  at the sawmill of Feather River Lumber Co, Loyalton, CA.. Following 20  years in professional occupations I entered building construction with my own business.  My final formal employment ended with a 10 and a half years of service as quality control technician and production machine operator for Michigan-California Lumber Co. and its successor Sierra Pacific Industries, Camino Division.  I now have an organic Farm in Camino, CA.', 0, '', 'Jim Zeek', 1, '', 'jzgoodness@yahoo.com', NULL, '', '', '', '', '', '', NULL),
(241, 'C241', 'So, You Want To Build a Sawmill', '2011-07-05 19:30:00', '2011-07-05 20:30:00', 'Jim will discuss the various types of sawmills, their facilities and focuses on strategies for modeling. Before and during high school years I apprenticed for five summers learning the craft of saw filing for production operations under tutelage of my Father.  The first two and two-thirds years at Oregon State University were in the College of Forestry in its Forest Products course of study and became my minor as I took my degree in Business Administration. After another four years of study I received a Masters Degree.  During most of these years I worked as a laborer, heavy equipment and production machine operator first in a box factory and then in the woods and  at the sawmill of Feather River Lumber Co, Loyalton, CA.. Following 20  years in professional occupations I entered building construction with my own business.  My final formal employment ended with a 10 and a half years of service as quality control technician and production machine operator for Michigan-California Lumber Co. and its successor Sierra Pacific Industries, Camino Division.  I now have an organic Farm in Camino, CA.', 0, '', 'Jim Zeek', 3, '', 'jzgoodness@yahoo.com', '', '', '', '', '', '', '', NULL),
(251, 'C251', 'Intermodal Well Cars: Why So Many Colors, Sizes and Shapes?', '2011-07-07 16:00:00', '2011-07-07 17:00:00', 'The Evolution of Well Car Design and Manufacture with Corresponding Information on HO Scale Modeling of Double Stack Trains.  \r\n\r\nPresentation will provide the modeler and railfan with an overview of early double stack well cars introduced in the mid-1980â€™s to support 20â€™ and 40â€™ ISO containers, through the introduction of 48â€™ and 53â€™ well cars as high capacity domestic containers have influenced intermodal transport through 2011.  Information on commercially available HO Scale models will accompany each corresponding prototype.', 0, '', 'Timothy Costello', 7, '', 'tgcostello@cox.net', '', '', '', '', '', '', '', NULL),
(249, 'C249', 'Stamping Workshop - Fee Required', '2011-07-07 13:00:00', '2011-07-07 15:00:00', 'Our instructors will be walking us step by step through this project. Learn some new techniques and take home a great item.', 30, '', 'Marilyn Long', 9, '', 'strawberryMarilyn@hotmail.com', '', 'Y', '510-552-5370', '', '', 'none', '', NULL),
(243, 'C243', 'The Lackawana Railroad: Building a Miniature Movie Set', '2011-07-07 13:00:00', '2011-07-07 14:00:00', 'Jack Verducci and Kermit Paul discuss the construction of the Lackawana Railroad, a 1:32 railroad designed to be able to recreate any year in the northeast between 1925-1970 in precise and historically accurate detail.  For a sense of scale, the layout occupies 2,000 square feet, has over 10,000 trees, and features a slew of advanced animation elements.', 0, '', 'Jack Verducci, MMR and Kermit Paul, MMR', 7, 'http://lackawannarailroad.com/', '', NULL, '', '', '', '', '', '', NULL),
(245, 'C245', 'Modeling the Los Angeles Union Passenger Terminal', '2011-07-07 14:30:00', '2011-07-07 15:30:00', 'Owner John Goodrich and consulting engineer Kermit Paul describe their plans for Johnâ€™s new O scale Los Angeles River Railroad based on the Los Angeles Union Passenger Terminal and adjacent yard circa 1952.', 0, '', 'John Goodrich and Kermit Paul, MMR', 7, '', 'j41goodrich@sbcglobal.net', '', '', '', '', '', '', '', NULL),
