(250, 'C250', 'Game Night', '2011-07-08 19:30:00', '2011-07-08 21:00:00', 'Come join us as we play all kinds of games. The afternoon clinic taught many new ones and we will have some of the favorites and classics.', 30, '', '', 9, '', 'nstokely@sbcglobal.net', '', 'Y', '925-336-9247', '', '', '', '', NULL),
(252, 'C252', 'Scenery Techniques for Your Railroad', '2011-07-05 13:00:00', '2011-07-05 14:00:00', 'Charlie Comstock, editor of Model Railroad Hobbyist Magazine, will present various scenery techniques he''s been developing on his own layout. Topics will range from the importance of believable scenery, to tips and tricks for detailing your track work and creating backdrops.', 0, '', 'Charlie Comstock', 7, '', 'trains@upwardaccess.com', NULL, '', '', '', '', '', '', NULL),
(253, 'C253', 'Scenery Techniques for Your Railroad', '2011-07-07 19:30:00', '2011-07-07 20:30:00', 'Charlie Comstock, editor of Model Railroad Hobbyist Magazine, will present various scenery techniques he''s been developing on his own layout. Topics will range from the importance of believable scenery, to tips and tricks for detailing your track work and creating backdrops.', 0, '', 'Charlie Comstock', 5, '', 'trains@upwardaccess.com', '', '', '', '', '', '', '', NULL),
(254, 'C254', 'Avoiding Pitfalls of Model Railroad Photography', '2011-07-04 19:30:00', '2011-07-04 20:30:00', 'Charlie Comstock, winner of the MR Photography contest in 2000 will talk about taking photos your models. In this clinic, he''ll concentrate on avoiding the common goofs - just say no to flash photography (unless you''re Winston Link), get your white balance right, what is depth of field and why should you care?  Got grain(iness) and how to get rid of it. Lighting, lighting, and lighting - the three most important things in photography. Setting a scene for interest. What is focal length and what can it do for you?  Focus bracketing - how to get prototype depth of field in your photos with post processing. Making photos believable - send the company helicopter back to the hangar... Special effects - fog and nighttime.\r\n\r\n\r\n', 0, '', 'Charlie Comstock', 5, '', 'trains@upwardaccess.com', '', '', '', '', '', '', '', NULL),
(255, 'C255', 'Avoiding Pitfalls of Model Railroad Photography', '2011-07-05 16:00:00', '2011-07-05 17:00:00', 'Charlie Comstock, winner of the MR Photography contest in 2000 will talk about taking photos your models. In this clinic, he''ll concentrate on avoiding the common goofs - just say no to flash photography (unless you''re Winston Link), get your white balance right, what is depth of field and why should you care?  Got grain(iness) and how to get rid of it. Lighting, lighting, and lighting - the three most important things in photography. Setting a scene for interest. What is focal length and what can it do for you?  Focus bracketing - how to get prototype depth of field in your photos with post processing. Making photos believable - send the company helicopter back to the hangar... Special effects - fog and nighttime.\r\n\r\n\r\n', 0, '', 'Charlie Comstock', 7, '', 'trains@upwardaccess.com', NULL, '', '', '', '', '', '', NULL),
(256, 'C256', 'Sierra Pacific Sawmill Q&A', '2011-07-08 19:30:00', '2011-07-08 20:30:00', 'Jim Zeek will host and guest host Mr. Mark Luster, Community Relations Manager for Sierra Pacific Industries will host a question and answer session on the Sierra Pacific Sawmill. The Event is open to both those attending the tour as well as those who might be interested in lumber mills.\r\n', 30, '', 'Jim Zeek and Mark Luster', 7, '', 'jzgoodness@yahoo.com', '', '', '', '', '', '', '', NULL),
(257, 'C257', 'Modeling The West Side Lumber Company', '2011-07-06 19:30:00', '2011-07-06 20:30:00', 'Burton Maxwell has spent a lifetime researching the West Side Lumber Company and building a model of it. In this informative clinic, he gives a little history and a lot of hands-on tips on modeling that could apply to any logging railroad layout. From design, through construction, to buildings, rolling stock and scenery, Burton has practical information to make a logging layout look so real, you&rsquo;ll swear you smell pine trees and sawdust. His wife, Patricia, joins him with her own scenery secrets.', 0, '', 'Burton Maxwell', 1, '', 'patgmaxwell@gmail.com', '', '', '619-292-1566', '', '', 'convention', '', NULL),
(260, 'C260', 'The Slim Princess: SPs Narrow Gauge Line in the Owens Valley', '2011-07-03 13:00:00', '2011-07-03 15:00:00', 'Matt will present a 3 part clinic about the Southern Pacific''s narrow gauge line through the Owens Valley.\r\n\r\nPart 1\r\nRoute and history of the rails:  The history of the road starting with the first rails laid by the Carson and Colorado up to the abandonment of the route by the Southern Pacific.  Key historical influences of the area and decisions made by the officers of the road are examined and understood.  Geography and topography will be detailed as well as changes of route throughout the life of the 80 year road.\r\n\r\nPart 2\r\nPlaces and Industries along the Way:  The operation and maintenance of the road will be discussed. The hows and whys of Industrial comings and goings will be detailed as we move through the route of the Slim Princess.  A chronological discovery will take place in each of the towns and significant places along the right of way.  The daily operations throughout the life of the road will be understood.\r\n\r\nPart 3\r\nThe equipment and rolling stock of the line:  From the Locomotive back to the Caboose, all of the types and details of the cars will be discussed during this clinic.  A key understanding of why the road was stocked with the cars and engines it had will be covered.  The history of cars from origin to scrapped will be discussed.', 80, '', 'Matthew Buck', 2, '', 'mbuck545@gmail.com', '', '', '', '', '', '', '', '2011-07-03 15:26:08'),
(261, 'C261', 'The Slim Princess: SP''s Narrow Gauge Line in the Owens Valley', '2011-07-09 13:00:00', '2011-07-09 15:00:00', 'Matt will present a 3 part clinic about the Southern Pacific''s narrow gauge line through the Owens Valley.\r\n\r\nPart 1\r\nRoute and history of the rails:  The history of the road starting with the first rails laid by the Carson and Colorado up to the abandonment of the route by the Southern Pacific.  Key historical influences of the area and decisions made by the officers of the road are examined and understood.  Geography and topography will be detailed as well as changes of route throughout the life of the 80 year road.\r\n\r\nPart 2\r\nPlaces and Industries along the Way:  The operation and maintenance of the road will be discussed. The hows and whys of Industrial comings and goings will be detailed as we move through the route of the Slim Princess.  A chronological discovery will take place in each of the towns and significant places along the right of way.  The daily operations throughout the life of the road will be understood.\r\n\r\nPart 3\r\nThe equipment and rolling stock of the line:  From the Locomotive back to the Caboose, all of the types and details of the cars will be discussed during this clinic.  A key understanding of why the road was stocked with the cars and engines it had will be covered.  The history of cars from origin to scrapped will be discussed.', 0, '', 'Matthew Buck', 3, '', 'mbuck545@gmail.com', '', 'Y', '408-826-1157', '', '', 'mywindows', '', NULL),
(263, 'C263', 'Vision and the Aging Modeler', '2011-07-08 19:30:00', '2011-07-08 20:30:00', 'The ability to do prolonged detail work at near changes with age. Mature modelers must also change how they model either by changing scales or by the use of vision-aids & lighting. This clinic will explain what difficulties these age-related changes present to the modeler. Discussed in detail will be methods of compensating for these changes so that modeling activities need not be curtailed or abandoned as the modeler ages. With these methods, the modeler can pursue detailed modeling, even in the smaller scales, for hours at a time without eyestrain or discomfort.', 0, '', 'Richard Meetz, OD MS FAAO', 3, '', 'meetz@indiana.edu', '', 'Y', '812-391-2768', '', '', 'convention', '', NULL),
(264, 'C264', 'Airbrushing Hands-on Clinic', '2011-07-06 19:00:00', '2011-07-06 22:00:00', '<p>The only way to learn to airbrush is to pick one up and start spraying paint. In this Workshop, you&rsquo;ll learn the basics of airbrushing from someone who has been using an airbrush for 35 years. Scott will show you the basic techniques you need to know to airbrush, including paint dilutions, air pressure, and cleaning.  You&rsquo;ll see how an airbrush can be used to paint rockwork and structures.<p>\r\n\r\n<em>This clinic will be limited to 20 attendees.</em>\r\n\r\nWe will be holding a lottery to pick the 20 attendees for each of two sessions. Please indicate your preference of sessions that you wish to be considered for: <a href="mailto:airbrush@x2011west.org?subject=Enter me into the lottery for the WEDNESDAY EVENING session">Wednesday evening</a>, <a href="mailto:airbrush@x2011west.org?subject=Enter me into the lottery for the THURSDAY MORNING session">Thursday morning</a>, or <a href="mailto:airbrush@x2011west.org?subject=Enter me into the lottery for EITHER session">either</a> session.\r\n', 0, '', 'Scotty Mason', 35, '', 'smason2@comcast.net', '', 'Y', '774-571-8993', '', '', '', 'Y', '2011-06-25 11:03:46'),
(265, 'C265', 'Airbrushing Hands-On Clinic', '2011-07-07 08:00:00', '2011-07-07 12:00:00', '<p>The only way to learn to airbrush is to pick one up and start spraying paint. In this Workshop, you&rsquo;ll learn the basics of airbrushing from someone who has been using an airbrush for 35 years. Scott will show you the basic techniques you need to know to airbrush, including paint dilutions, air pressure, and cleaning.  You&rsquo;ll see how an airbrush can be used to paint rockwork and structures.<p>\r\n\r\n<em>This clinic will be limited to 20 attendees.</em>\r\n\r\nWe will be holding a lottery to pick the 20 attendees for each of two sessions. Please indicate your preference of sessions that you wish to be considered for: <a href="mailto:airbrush@x2011west.org?subject=Enter me into the lottery for the WEDNESDAY EVENING session">Wednesday evening</a>, <a href="mailto:airbrush@x2011west.org?subject=Enter me into the lottery for the THURSDAY MORNING session">Thursday morning</a>, or <a href="mailto:airbrush@x2011west.org?subject=Enter me into the lottery for EITHER session">either</a> session.\r\n', 0, '', 'Scotty Mason', 35, '', 'smason2@comcast.net', '', 'Y', '774-571-8993', '', '', '', 'Y', '2011-06-25 11:04:04'),
(267, 'C267', 'Working Gemco: We Don''t Need No Stinkin'' Yardmaster', '2011-07-07 08:00:00', '2011-07-07 09:00:00', 'Dave is a railroad engineer who worked for many years in and around Southern Pacific''s Gemco Yard in the Los Angeles area. Gemco was SP''s support yard for General Motors'' Van Nuys plant as well as a Budweiser brewery just up the line. Many locals were based out of Gemco and there were approximately 300 - 500 cars switched in the yard each day, all without a yardmaster to be found. Come learn how this was done and how to simulate this in a yard on your railroad.', 0, '', 'Dave Bayless', 1, '', 'davebayl@pacbell.net', NULL, 'Y', '530-613-5784', '', 'laser pointer', 'mywindows', '', NULL),
(268, 'C268', 'Rapid Prototyping', '2011-07-07 19:30:00', '2011-07-07 20:30:00', 'Bill Brisko of Pacific Locomotive Works will discuss tools and techniques available for rapidly creating cast details.', 0, '', 'Bill Brisko', 7, '', 'bbrisko@sonic.net', '', 'Y', '', 'See the other form I submitted.', '', 'mywindows', '', NULL),
(269, 'C269', 'Getting Down and Dirty with Weathering', '2011-07-04 11:00:00', '2011-07-04 12:00:00', 'Join Leslie Eaton, MMR and learn a variety of techniques including airbrushing, dry brushing, using stencils, and the layering of colours to achieve prototypical results on your cars and structures. Weathering techniques for cars and structures and colour selection will be demonstrated. Airbrush techniques will also be demonstrated to blend and enhance scenery.', 0, '', 'Leslie Eaton, MMR', 7, '', 'leslie.l.eaton@gmail.com', '', '', '281-615-5081', 'Dave and Tony,  PLEASE correct the name of my clinic to  Getting Down and Dirty With Weathering.', 'If available, I also would like the use of a projection camera to facilitate close-up viewing. Thank you.', 'mymac', '', NULL),
(270, 'C270', 'Getting Down and Dirty with Weathering', '2011-07-07 16:00:00', '2011-07-07 17:00:00', 'Join Leslie Eaton, MMR and learn a variety of techniques including airbrushing, dry brushing, using stencils, and the layering of colours to achieve prototypical results on your cars and structures. Weathering techniques for cars and structures and colour selection will be demonstrated. Airbrush techniques will also be demonstrated to blend and enhance scenery.', 0, '', 'Leslie Eaton, MMR', 6, '', 'leslie.l.eaton@gmail.com', '', '', '281-615-5081', 'Please correct the name of my clinic to  Getting Down and Dirty With Weathering', 'If you have it available, I would like to use a projection camera to facilitate close-up viewing.', 'mymac', '', NULL),
(271, 'C271', 'From Basement to Benchwork', '2011-07-05 11:00:00', '2011-07-05 12:00:00', 'Rich Coleman will share methods for building wooden benchwork. He''ll explain some tried and true techniques, and unique ways of applying them. Rather than just presenting construction &ldquo;in a vacuum,&rdquo; Rich will use his own layout as a case study. Various forms of L-girder, open grid, and plywood techniques will be discussed, including the use of spline roadbed, integrating work surfaces and car card boxes. Most importantly, Rich will share his lessons learned from triumphs and mistakes along the way.\r\n', 0, '', 'Rich Coleman', 7, '', 'richcoleman@mesanetworks.net', '', 'Y', '303-587-0345', '', '', 'convention', '', NULL),
(272, 'C272', 'From Basement to Benchwork', '2011-07-09 14:00:00', '2011-07-09 15:00:00', 'Rich Coleman will share methods for building wooden benchwork. He''ll explain some tried and true techniques, and unique ways of applying them. Rather than just presenting construction &ldquo;in a vacuum,&rdquo; Rich will use his own layout as a case study. Various forms of L-girder, open grid, and plywood techniques will be discussed, including the use of spline roadbed, integrating work surfaces and car card boxes. Most importantly, Rich will share his lessons learned from triumphs and mistakes along the way.\r\n', 0, '', 'Rich Coleman', 2, '', 'richcoleman@mesanetworks.net', '', 'Y', '303-587-0345', '', '', 'convention', '', NULL),
(273, 'C273', 'Marklin Update', '2011-07-07 14:30:00', '2011-07-07 15:30:00', 'Tom Catherall will discussing new developments from M&auml;rklin, the Digital Pioneers. More powerful equipment for LGB and 1 gauge; wireless control through an App on iPhone, iPad, iPod; Color touch screen control with memory cards; and Mobile station control with memory cards.', 0, '', 'Thomas Catherall', 6, '', 'tom@marklin.com', 'Tom needs some additional tables for setup of a loop of track: 2- 30" x 4'' or 6'' or 8 ''', '', '', '', '', '', '', '2011-06-29 19:11:21'),
(274, 'C274', 'Modeling an Anthracite Road: Why, Where, When, What, etc.', '2011-07-04 14:30:00', '2011-07-04 15:30:00', ' Jim Dalberg will be presenting presenting his clinic on modeling an Anthracite Road, in either the anthracite Era, or as these roads later developed.', 0, '', 'Jim Dalberg', 7, '', 'Jedalberg@aol.com', '', '', '484-678-8158', '', '', 'convention', '', NULL),
(275, 'C275', 'Modeling an Anthracite Road: Why, Where, When, What, etc.', '2011-07-05 09:30:00', '2011-07-05 10:30:00', ' Jim Dalberg will be presenting presenting his clinic on modeling an Anthracite Road, in either the anthracite Era, or as these roads later developed.', 0, '', 'Jim Dalberg', 7, '', 'Jedalberg@aol.com', '', '', '', '', '', '', '', NULL),
(288, 'C288', 'Building Geodesic Foam Scenery', '2011-07-04 19:30:00', '2011-07-04 21:30:00', 'This  is an in depth and comprehensive look at all aspects of building scenery from resin materials.  A mountain railroad diorama will be built during the clinic from the bench-work up.  Foam bench-work and roadbed, foam hard-shell and resin/foam rock casting will be demonstrated.  Also, realistic coloring of rocks and scenery plus final detailing will be covered.', 0, '', 'Joel Bragdon', 7, '', 'jbragdon@bragdonent.com', '', 'Y', '1-530-906-3972', '', 'Two tables, eight feet long, extension cord and cordless mic, if possible.', 'none', '', NULL),
(289, 'C289', 'Steel Strut Benchwork', '2011-07-03 16:00:00', '2011-07-03 17:00:00', 'When the Silicon Valley Lines began construction of their new layout in early 2000, the club decided to try some new construction techniques.  Rather than using traditional benchwork, one of the members, a commercial builder, suggested that steel strut might be a great way to build the multi-deck layout benchwork quickly. Steel C-Channel is often generically referred to as strut and can be thought of as a giant erector set, and when combined with some other modular building techniques allowed the club to build a very sturdy two level layout very quickly.', 0, '', 'Eric Eggel', 4, 'http://www.siliconvalleylines.com/', 'lists@equad.us', '', '', '', '', '', '', 'Y', '2011-06-28 16:09:10'),
(276, 'C276', 'History and Description of the Sierra Railway', '2011-07-03 14:30:00', '2011-07-03 15:30:00', 'The Sierra Railway was built in 1897 to connect the Southern Pacific (and a bit later Santa Fe) Railroad with the mining towns in the Central Mother Lode region of California. This railroad continues to operate freight trains today and the original steam facilities are preserved as Railtown 1897 State Historic Park. The clinic will provide an overview of the railroad, its construction, connections, customers and status today.', 0, '', 'Dave Connery', 1, '', 'dgconnery@sbcglobal.net', '', 'Y', 'None', '', '', 'convention', '', NULL),
(277, 'C277', 'A Clinic on Scenery (which everyone knows how to do)', '2011-07-04 14:30:00', '2011-07-04 15:30:00', 'The clinic will show a unique way to make a river or lake (not poured), form basic land forms using extruded styrofoam insulation board, how to use craft papier mache to form land and rock formations, paint the scenery using artists acrylic paints, model a realistic forest and finish a road.  Photos show real scenery and how John models them on his HO model railroads.\r\n<p>\r\nJohn Wissinger has been in the hobby since 1954, has been an NMRA member since 1970 and has lived in several regions and divisions across the Midwest and California.  He has held offices in divisions, regions and at the national level.  He is an NMRA life member and is Master Model Roader #99.  He has given clinics at local division meets, regional and national conventions and has written articles for MR, RMC, Trolley Talk and Model railroad planning.  He currently lives in Michigan and models in HO Interurban and Steam railroads in 1938.\r\n', 0, '', 'John Wissinger, MMR', 3, '', 'jww99nmra@hotmail.com', 'need to confirm with John Wissinger, MMR', 'Y', '734-718-0140 (i', '', 'My clinic has been produced on PowerPoint Windows Vista.  Is this compatable with the convention computers?', 'convention', '', '2011-06-13 13:59:42'),
(278, 'C278', 'A Clinic on Scenery (which everyone knows how to do)', '2011-07-06 08:00:00', '2011-07-06 09:00:00', 'The clinic will show a unique way to make a river or lake (not poured), form basic land forms using extruded styrofoam insulation board, how to use craft papier mache to form land and rock formations, paint the scenery using artists acrylic paints, model a realistic forest and finish a road.  Photos show real scenery and how John models them on his HO model railroads.\r\n <p>\r\nJohn Wissinger has been in the hobby since 1954, has been an NMRA member since 1970 and has lived in several regions and divisions across the Midwest and California.  He has held offices in divisions, regions and at the national level.  He is an NMRA life member and is Master Model Roader #99.  He has given clinics at local division meets, regional and national conventions and has written articles for MR, RMC, Trolley Talk and Model railroad planning.  He currently lives in Michigan and models in HO Interurban and Steam railroads in 1938.\r\n', 0, '', 'John Wissinger, MMR', 3, '', 'jww99nmra@hotmail.com', 'need to confirm with John Wissinger, MMR', '', '734-718-0140 (i', '', 'My clinic has been produced on PowerPoint Windows Visa.  Is this compatable with the convention computers?', 'convention', '', '2011-06-13 14:00:01'),
(279, 'C279', 'Lighting & Digital Techniques for Layout Photography', '2011-07-03 19:30:00', '2011-07-03 20:30:00', 'Professional photographer Steve Crise will be conducting a live demonstration of lighting techniques for digital & film photography. A Q&A session will be at the end of the presentation.', 0, '', 'Steve Crise', 3, '', 'scrise@aol.com', '', '', '', '', '', '', '', NULL),
(280, 'C280', 'Lighting & Digital Techniques for Layout Photography', '2011-07-05 09:30:00', '2011-07-05 10:30:00', 'Professional photographer Steve Crise will be conducting a live demonstration of lighting techniques for digital & film photography. A Q&A session will be at the end of the presentation.', 0, '', 'Steve Crise', 4, '', 'scrise@aol.com', '', '', '310 963 9265', 'Professional photographer Steve Crise will be conducting a live demonstration of lighting techniques for digital & film photography. A Q&A session will be at the end of the presentation. ', 'Either a chalk board or a dry marker board would be nice but not necessary. ', 'mywindows', '', NULL),
(281, 'C281', 'Theatrical Layout Lighting', '2011-07-06 16:00:00', '2011-07-06 17:00:00', 'Eric Eggel and Mark Fisher, both from the Silicon Valley Lines Model Railroad Club in San Jose, will discuss the club''s recent installation of a DCC multi-color lighting system from NCE Corporation.  Eric will discuss technical details of the system, while Mark will discuss lessons learned while completing the installation.', 0, '', 'Eric Eggel and Mark Fisher', 2, '', 'lists@equad.us', '', '', '', '', '', '', '', NULL),
(282, 'C282', 'Theatrical Layout Lighting', '2011-07-08 16:00:00', '2011-07-08 17:00:00', 'Eric Eggel and Mark Fisher, both from the Silicon Valley Lines Model Railroad Club in San Jose, will discuss the club''s recent installation of a DCC multi-color lighting system from NCE Corporation.  Eric will discuss technical details of the system, while Mark will discuss lessons learned while completing the installation.', 0, '', 'Eric Eggel and Mark Fisher', 6, '', 'lists@equad.us', '', '', '', '', '', '', '', NULL),
(283, 'C283', 'Gentle Yoga for Beginners', '2011-07-04 15:30:00', '2011-07-04 17:00:00', 'Do you think that you''re not flexible enough, not strong enough or just not able to do yoga? Do you struggle to crawl on the floor when visiting layouts that have duck-unders? Then this class is for you! Come and experience a beginning class where you will learn how to do basic poses that show you how to stand correctly so you don''t feel back pain,  how to get a good stretch of your hamstrings, and how to relax. Wear loose fitting clothes that you feel comfortable moving around in. The class is taught in the Iyengar tradition, which is yoga that can be practiced by anyone and emphasizes precision and correct alignment in the postures. \r\n\r\nTaught by Lori Neumann and Linda Thepot, who just completed their 200-hour teacher training at the Iyengar Institute of San Francisco.', 0, '', 'Lori Neumann & Linda Thepot', 29, '', 'lneumann@pacbell.net', '', 'Y', '650-704-4437', '', '', 'none', '', NULL),
(286, 'C286', 'Painless weathering', '2011-07-05 19:30:00', '2011-07-05 20:30:00', 'We will cover a broad range of weathering methods and materials including some traditional old favorites and some that are new or little known. Weathering wood, metal, plastic, paper and plaster for model cars, structures, details and scenery and much more will be demonstrated.  Near the end of the clinic the attendees will be invited to try their hand with some of the materials and techniques that they have seen and leave the clinic with some samples.', 0, '', 'Joel Bragdon', 7, '', 'jbragdon@bragdonent.com', '', 'Y', '1-530-906-3972', '', 'Two tables, eight feet long, extension cord.  Cordless mic, if possible.', 'none', '', NULL),
(287, 'C287', 'Painless weathering', '2011-07-03 16:00:00', '2011-07-03 17:00:00', 'We will cover a broad range of weathering methods and materials including some traditional old favorites and some that are new or little known. Weathering wood, metal, plastic, paper and plaster for model cars, structures, details and scenery and much more will be demonstrated.  Near the end of the clinic the attendees will be invited to try their hand with some of the materials and techniques that they have seen and leave the clinic with some samples.', 0, '', 'Joel Bragdon', 2, '', 'jbragdon@bragdonent.com', '', 'Y', '1-530-906-3972', '', 'Two tables, eight feet long, extension cord.  Cordless mic, if possible.', 'none', 'Y', '2011-06-28 16:11:01'),
(290, 'C290', 'Mold making and casting for the model maker', '2011-07-05 21:00:00', '2011-07-05 22:00:00', 'This clinic and will cover making a variety of types RTV rubber molds for reproducing detail parts, cars, vehicles, structures or almost anything.  One piece, multi piece and split molds will be demonstrated.  Casting with a variety of materials will be shown including fast curing space age, safe and odorless, polymer resins.   Over two hundred sample molds and castings will be shown to illustrate the great number of options.', 0, '', 'Joel Bragdon', 7, '', 'jbragdon@bragdonent.com', '', 'Y', '1-530-906-3972', '', 'Two tables, eight feet long, extension cord.  Cordless mic if possible.', 'none', '', NULL),
(291, 'C291', 'Steel Strut Benchwork', '2011-07-04 08:00:00', '2011-07-04 09:00:00', 'When the Silicon Valley Lines began construction of their new layout in early 2000, the club decided to try some new construction techniques.  Rather than using traditional benchwork, one of the members, a commercial builder, suggested that steel strut might be a great way to build the multi-deck layout benchwork quickly. Steel C-Channel is often generically referred to as strut and can be thought of as a giant erector set, and when combined with some other modular building techniques allowed the club to build a very sturdy two level layout very quickly.', 0, '', 'Eric Eggel', 7, 'http://www.siliconvalleylines.com/', 'lists@equad.us', '', '', '', '', '', '', '', NULL),
(292, 'C292', 'Digitrax User Forum', '2011-07-07 19:30:00', '2011-07-07 23:30:00', 'Zana and AJ Ireland of Digitrax invite you to come see what is new at the 2011 NMRA National Convention in Sacramento, CA. Check out what''s new and get your Digitrax and Loconet questions answered!', 0, '', 'AJ and Zana Ireland', 30, '', 'zana@digitrax.com', 'will be at the sheraton', '', '', '', '', '', '', '2011-06-12 12:36:38'),
(293, 'C293', 'CATS: a CTC Panel that Grows', '2011-07-06 21:00:00', '2011-07-06 22:00:00', 'This clinic is an introduction to the Computer Automated Traffic System (CATS).  CATS is open source software built upon JMRI for creating and operating a modern looking CTC panel.  The clinic will open with creating a CTC panel for John Armstrong''s "minimum-size loop-to-loop" layout, and operated as a magnet board.  It will progress to demonstrating how to add occupancy detection, turnout feedback, turnout control, and signal control, in a simulation mode.  The clinic will demonstrate other features built into CATS, including train tracking, session recording, train status display, crew management, and rapid CTC panel development for module groups.  For a preview, see the August 2010 NMRA Magazine or <a href="http://home.comcast.net/~kb0oys">http://home.comcast.net/~kb0oys</a>.', 0, '', 'Rodney Black', 2, '', 'rodneyblack2000@yahoo.com', '', '', '', '', '', 'mywindows', '', NULL),
(294, 'C294', 'OPSig Roundtable', '2011-07-05 15:30:00', '2011-07-05 17:00:00', 'Join in with other SIG members and anyone interested in railroad operations, both model and prototype in a moderated discussion of operation topics. Based on the lively discussions seen on the OPSig Email Discussion List and continuing the very successful and highly attended round table forums hosted by the OPSig held at various PCR region conventions, we''ll select several topics to review as a group. Dave is a locomotive engineer now with UP, hired on with SP out of LA in 1977 and has worked under most operating schemes used by the railroads.  Seth is Vice President of the Operations SIG and an accomplished, veteran operator and coordinator of many operations events, will be there to help moderate, offer support and direction to the discussions.  This will be the first time this forum is held at a National NMRA convention.  These forums are a place to exchange ideas, make new friends or renew acquaintances, ask questions of other knowledgeable modelers and/or prototype railroaders that may be present, and discuss operating possibilities, procedures, rules and applications to your model railroad!  We''ll continue where layout design leaves off and move into how to operate our layouts as we discuss a number of issues focused on Operations significance and relevance.  All convention attendees are welcome!', 0, '', 'Dave Bayless, Seth Neumann, Phil Monat', 1, '', 'davebayl@pacbell.net', '', '', '', '', '', '', '', NULL),
(295, 'C295', 'Free-moN: Modular Railroading', '2011-07-06 19:30:00', '2011-07-06 20:30:00', 'Dave Falkenburg of Silicon Valley Free-moN will give an introduction to N Scale Free-mo.  In addition to covering the standard, Dave will describe some neat techniques for building lightweight modular layouts.', 0, '', 'Dave Falkenburg', 7, '', 'falken@mac.com', '', '', '(408) 425-3936', '', '', '', 'Y', '2011-06-29 19:21:21'),
(296, 'C296', 'OPSig Roundtable', '2011-07-07 21:00:00', '2011-07-07 22:30:00', 'Join in with other SIG members and anyone interested in railroad operations, both model and prototype in a moderated discussion of operation topics. Based on the lively discussions seen on the OPSig Email Discussion List and continuing the very successful and highly attended round table forums hosted by the OPSig held at various PCR region conventions, we''ll select several topics to review as a group. Dave is a locomotive engineer now with UP, hired on with SP out of LA in 1977 and has worked under most operating schemes used by the railroads.  Seth is Vice President of the Operations SIG and an accomplished, veteran operator and coordinator of many operations events, will be there to help moderate, offer support and direction to the discussions.  This will be the first time this forum is held at a National NMRA convention.  These forums are a place to exchange ideas, make new friends or renew acquaintances, ask questions of other knowledgeable modelers and/or prototype railroaders that may be present, and discuss operating possibilities, procedures, rules and applications to your model railroad!  We''ll continue where layout design leaves off and move into how to operate our layouts as we discuss a number of issues focused on Operations significance and relevance.  All convention attendees are welcome!', 0, '', 'Dave Bayless, Seth Neumann, Phil Monat', 7, '', 'davebayl@pacbell.net', '', '', '', '', '', '', '', NULL),
(297, 'C297', 'Choosing, Using, Maintaining, and Troubleshooting Your Airbrush', '2011-07-06 11:00:00', '2011-07-06 12:00:00', 'This seminar will familiarize attendees with airbrush terminology and types, explain their differences, guide attendees regarding which type of airbrush is best for each finishing application they may desire to do, present useful air source/air hose/air regulator/other air source related accessory information, discuss varying media/paint types and preparations, present useful airbrush accessories information, and provide simple basic airbrush cleaning, maintenance, and troubleshooting instruction.\r\n\r\nKen Schlotfeldt is the President of Badger Air-Brush Co. and is a Christian.  Ken has been in the airbrush manufacturing industry for over 30 years.  He has designed, assembled, tested, sold, packed, shipped, serviced, and used airbrushes extensively during his industry tenure.  Ken has presented over 100 seminars on airbrushing to numerous national organizations, including NAMTA, NRHSA, NMRA, AMPS, IPMS, RBA, NFDA, SEMA, NTA, IBS and others. (Ask him if youâ€™d like to know what organizations these are).  Heâ€™s been married to a wonderful woman going on 24 years, and they have three wonderful children.  Ken loves airbrushes/airbrushing and helping air-brushers enjoy a successful airbrush experience through having good knowledge and information related to selecting, using, and maintaining their airbrush.', 0, '', 'Ken Schlotfeldt', 6, '', 'Kenbadger@aol.com', 'Additional Equipment Needed for Presentation:  Electricity, 8 ft. head table, row/aisle seating\r\n', '', '', '', '', '', '', NULL),
(298, 'C298', 'Choosing, Using, Maintaining, and Troubleshooting Your Airbrush', '2011-07-07 08:00:00', '2011-07-07 09:00:00', 'This seminar will familiarize attendees with airbrush terminology and types, explain their differences, guide attendees regarding which type of airbrush is best for each finishing application they may desire to do, present useful air source/air hose/air regulator/other air source related accessory information, discuss varying media/paint types and preparations, present useful airbrush accessories information, and provide simple basic airbrush cleaning, maintenance, and troubleshooting instruction.\r\n\r\nKen Schlotfeldt is the President of Badger Air-Brush Co. and is a Christian.  Ken has been in the airbrush manufacturing industry for over 30 years.  He has designed, assembled, tested, sold, packed, shipped, serviced, and used airbrushes extensively during his industry tenure.  Ken has presented over 100 seminars on airbrushing to numerous national organizations, including NAMTA, NRHSA, NMRA, AMPS, IPMS, RBA, NFDA, SEMA, NTA, IBS and others. (Ask him if youâ€™d like to know what organizations these are).  Heâ€™s been married to a wonderful woman going on 24 years, and they have three wonderful children.  Ken loves airbrushes/airbrushing and helping air-brushers enjoy a successful airbrush experience through having good knowledge and information related to selecting, using, and maintaining their airbrush.', 0, '', 'Ken Schlotfeldt', 6, '', 'Kenbadger@aol.com', 'Additional Equipment Needed for Presentation:  Electricity, 8 ft. head table, row/aisle seating\r\n', '', '', '', '', '', '', NULL),
(299, 'C299', 'Fun Fool-Proof Finishing with Acrylic Paints', '2011-07-06 13:00:00', '2011-07-06 14:00:00', 'This seminar presents the differences between water-based acrylic paints and other media types commonly used in model finishing.  Discussion will cover water â€“based acrylic paint characteristics, application techniques, and proper cleaning methods.  Additionally, information will be shared on substrates water-base acrylic paints can be used on, proper methods of preparing water-base acrylic paints for spraying, brush painting techniques for water-base acrylic paints, and available paint additives and accessories that can be utilized to ensure success when using water-based acrylic paints.\r\n\r\nKen Schlotfeldt is the President of Badger Air-Brush Co. and is a Christian.  Ken has been in the airbrush manufacturing industry for over 30 years.  He has designed, assembled, tested, sold, packed, shipped, serviced, and used airbrushes extensively during his industry tenure.  Ken has presented over 100 seminars on airbrushing to numerous national organizations, including NAMTA, NRHSA, NMRA, AMPS, IPMS, RBA, NFDA, SEMA, NTA, IBS and others. (Ask him if youâ€™d like to know what organizations these are).  Heâ€™s been married to a wonderful woman going on 24 years, and they have three wonderful children.  Ken loves airbrushes/airbrushing and helping air-brushers enjoy a successful airbrush experience through having good knowledge and information related to selecting, using, and maintaining their airbrush.', 0, '', 'Ken Schlotfeldt', 6, '', 'Kenbadger@aol.com', 'Additional Equipment Needed for Presentation:  Electricity, 8 ft. head table, row/aisle seating\r\n', '', '', '', '', '', '', NULL),
