(301, 'C301', 'Meet The NMRA President', '2011-07-06 21:00:00', '2011-07-06 22:00:00', 'Mike Brestel, and several members of BOD and the NMRA Officers will discuss NMRA matters and answer questions. Several special door prizes will be awarded to those in attendance. Must be present, and in the room at the time of the drawing, to win.', 0, '', 'Mike Brestel', 1, '', 'nmrapres@zoomtown.com', '', '', '', '', '', '', '', NULL),
(302, 'C302', 'The Art of Illusion', '2011-07-04 14:30:00', '2011-07-04 15:30:00', 'A photographic exploration of the philosophy and methods of creating a more believable model railroad through careful consideration of what is needed for that elusive "sense of rightness". Subjects such as planning, backdrops, mirrors, bridges and other subjects that help to elevate the level of realism of modeling. Magician''s tricks such as sleight of hand and distraction are covered. Soon to be a book published by Signature Press.', 0, '', 'CJ Riley, MMR', 6, '', 'cjriley42@yahoo.com', '', '', '', '', '', '', '', NULL),
(303, 'C303', 'Images of Speed: Streamlined Steam Locomotives', '2011-07-04 16:00:00', '2011-07-04 17:00:00', 'A presentation of the art of streamlining steam locomotives, begun in the 1930''s as an attempt at modernism and to compete with the new diesel-electric powered streamliners. Photos of examples both elegant and bizarre are shown as the concept evolved from â€œinverted bath tubsâ€ of the Commodore Vanderbilt to the elegance of the SP''s Daylights and the C&O''s Chessie, a steam turbine powered streamlined passenger train that was an early victim of the post WWII collapse of the passenger train.\r\n', 0, '', 'CJ Riley, MMR', 6, '', 'cjriley42@yahoo.com', '', '', '', '', '', '', '', NULL),
(304, 'C304', 'The Art of Illusion', '2011-07-07 14:30:00', '2011-07-07 15:30:00', 'A photographic exploration of the philosophy and methods of creating a more believable model railroad through careful consideration of what is needed for that elusive "sense of rightness". Subjects such as planning, backdrops, mirrors, bridges and other subjects that help to elevate the level of realism of modeling. Magician''s tricks such as sleight of hand and distraction are covered. Soon to be a book published by Signature Press.', 0, '', 'CJ Riley, MMR', 1, '', 'cjriley42@yahoo.com', '', '', '', '', '', '', '', NULL),
(305, 'C305', 'Images of Speed: Streamlined Steam Locomotives', '2011-07-08 13:00:00', '2011-07-08 14:00:00', 'A presentation of the art of streamlining steam locomotives, begun in the 1930''s as an attempt at modernism and to compete with the new diesel-electric powered streamliners. Photos of examples both elegant and bizarre are shown as the concept evolved from â€œinverted bath tubsâ€ of the Commodore Vanderbilt to the elegance of the SP''s Daylights and the C&O''s Chessie, a steam turbine powered streamlined passenger train that was an early victim of the post WWII collapse of the passenger train.\r\n', 0, '', 'CJ Riley, MMR', 6, '', 'cjriley42@yahoo.com', '', '', '', '', '', '', '', NULL),
(306, 'C306', 'S Scale Yahoo Group Meet-up', '2011-07-07 21:00:00', '2011-07-07 23:00:00', '', 0, '', '', 39, '', '', '', '', '', '', '', '', 'Y', '2011-06-29 19:16:10'),
(307, 'C307', 'NCE User''s Forum', '2011-07-07 19:30:00', '2011-07-07 21:30:00', 'Mark Schutzer and Marcus Ammann will host a question and answer session related to anything related to NCE DCC.', 0, '', 'Mark Schutzer & Marcus Ammann', 6, '', 'mark.schutzer@sbcglobal.net', '', '', '', '', '', '', 'Y', '2011-07-02 01:33:39');
