INSERT INTO `prod_eventtools_general_tours` (`id`, `number`, `name`, `start_date`, `end_date`, `description`, `status_code`, `cart_item`, `tour_price`, `tour_seats`, `tour_bus_type`, `tour_buses`, `tour_mileage`, `mark_changed`, `last_mod_time`) VALUES
(9, 'AG11', 'Military Vehicle Technology Foundation', '2011-07-02 08:15:00', '2011-07-02 12:00:00', 'The Military Vehicle Technology Foundation is one of the largest and most significant collections of historical military vehicles in the world.  It is the legacy of Jacques Littlefield and includes both domestic and foreign combat vehicles which have been fully restored to operating condition.  The display includes tanks, armored cars, self-propelled artillery, and many other technically significant machines of war.   We will have a private and very special tour of this facility.  See <a href=''http://mvtf.org''>mvtf.org</a>.<p/>\r\n<u>Advance Section registration is required</u> to attend any of the Advance Section events.', 60, '', 40.00, 45, '47', 1, 0, '', NULL),
(18, 'AP02', 'Lehigh Southwest Cement - Caltrain Maintenance Facility', '2011-07-01 13:00:00', '2011-07-01 18:00:00', 'Lehigh Southwest is one of the largest cement quarries and factories on the west coast.    The plant was originally constructed in 1939 to supply materials for the Shasta dam.  Today it provides more than half of all cement needs for the greater bay area. It is served by Union Pacific Railway with frequent trains grinding up the hill to the Cupertino facility.  See <a href=''http://lehighpermanente.com''>http://lehighpermanente.com</a>.\r\n<p/>\r\nThe Caltrain Maintenance Facility (CEMOF) is the bay area service and repair focus for California''s state owned passenger train system.  It was formerly operated by SP and has been expanded and upgraded to the latest technology and machines.  Our tour host will be the Valley Transportation Agency that partners with Cal Trains and Amtrak to provide a top grade regional heavy rail service.  Capitol Corridor trains provide frequent service between San Jose and Sacramento.  The CC can be used by those wishing to take the train to the main NMRA convention.  See <a href=''http://www.capitolcorridor.org/ ''>http://www.capitolcorridor.org/</a> and the <a href=''http://wikipedia.org/wiki/Caltrain_Centralized_Equipment_Maintenance_and_Operations_Facility''>CEMOF Wikipedia Article</a>.\r\n<p/>\r\n<u>Advance Section registration is required</u> to attend any of the Advance Section events.', 60, '', 25.00, 55, '47', 1, 0, '', NULL),
(17, 'AP01', 'Union Pacific Rail - Oakland Area Facilities', '2011-07-01 08:30:00', '2011-07-01 12:00:00', 'Union Pacific has promised us an interesting tour of their facilities in the northern bay area.  UP activity centers on the Oakland waterfront where the primary container port resides.  UP has inherited all the former SP and WP facilities in the area.  Some are only historic bones, but the waterfront remains an important source of traffic.  The mainline still runs down the center of the city street at Jack London Square.  This tour may also include BNSF facilities, but approval is still pending.  See <a href=''http://portofoakland.com''>http://portofoakland.com</a>\r\nand <a href=''http://jacklondonsquare.com''>http://jacklondonsquare.com</a>.\r\n<p/>\r\n<u>Advance Section registration is required</u> to attend any of the Advance Section events.', 70, '', 25.00, 55, '47', 1, 0, '', NULL),
(12, 'AG12', 'USS Potomac', '2011-07-02 17:15:00', '2011-07-02 22:00:00', 'The bus departs the Newark Hilton for Jack London Square at 5:15pm.  The cruise itself departs from the pier at Jack London Square at 6:00pm.\r\n<p/>\r\nThe former Presidential Yacht of Franklin D. Roosevelt has been chartered for an evening cruise on the Oakland-Alameda Estuary and San Francisco Bay.   Guests will wander through the private quarters of the president and experience the ambience of this fully operational historical museum.   The evening meal with premium wine, beer and soft drinks is included.   See <a href=''http://usspotomac.org''>http://usspotomac.org</a>.\r\n<p/>\r\n<u>Advance Section registration is required</u> to attend any of the Advance Section events.', 60, '', 125.00, 90, '47', 2, 0, '', NULL),
(16, 'AG21', 'Northwest Bay N Layouts and Disney Museum', '2011-07-03 08:00:00', '2011-07-03 15:00:00', 'This tour is a combined general-interest and layout tour.  For the layouts on this tour, see tour AL21.  Please do not sign up for both AG21 and AL21 -- they are the same tour!\r\n<p>\r\nThe Walt Disney Family Museum presents the real story of Walt Disney, the man, his work, his legacy of entertainment and love of trains.  The Museum is located in the historically preserved Presidio of San Francisco, a former U.S. Army base and now a National Park. The galleries are rooted in an architecturally preserved 19th century barracks.   Early animation techniques are shown and historic equipment for movie making is on display.  See <a href=''http://disney.go.com/disneyatoz/familymuseum/''>http://disney.go.com/disneyatoz/familymuseum/</a>.\r\n<p>\r\nOn the way to the Disney Museum the tour will visit three N scale layouts, one of which was featured on the cover of the June 2011 <i>Model Railroader Magazine</i>.  After the Museum we will head for the Oakland Amtrak station for those taking the train to Sacramento. The bus will then continue back to the Newark/Fremont Hilton Hotel. See layout tour AL21 for a description of the included layouts.\r\n<p>\r\n<u>Advance Section registration is required</u> to attend any of the Advance Section events.</p>\r\n<p>Please do not sign up for both AG21 and AL21 -- they are the same tour!</p>', 60, '', 40.00, 22, '47', 1, 0, '', NULL),
(8, 'G101', 'SACRAMENTO RIVER DINNER TRAIN', '2011-07-03 17:00:00', '2011-07-03 21:30:00', 'The Sacramento River Train operates on the 16-mile &quot;Woodland Branch&quot; between Sacramento and Woodland constructed in 1911 by the Northern Electric Company as the Sacramento and Woodland Railroad to link the fertile farmlands of Yolo County with Sacramento. The line was electrified by third rail except in Woodland where overhead power was used.  Passenger operations came to an end in 1940 with the advent of World War II, but the Sacramento Northern Railway continued to move freight over the line until the early 1960''s. The Sacramento Northern was acquired by the Western Pacific Railroad which in turn was merged with the Union Pacific Railroad in 1984.\r\n<p/>\r\nThe Yolo Shortline Railroad Company, created in 1991, purchased the Woodland Branch from the UP, and today continues to operate freight service out Woodland, California as well as the Sacramento River Dinner Train.\r\n<p/>\r\nOur trip on the Sacramento River Train will include a buffet dinner, a beer tasting featuring historic California beers and musical entertainment. \r\n', 60, '', 80.00, 112, '', 0, 40, '', '2011-06-27 00:32:31'),
(7, 'G102', 'RIVER CATS BASEBALL GAME (handicapped accessible)', '2011-07-03 17:30:00', '2011-07-03 22:15:00', '<b>TOUR MODIFIED AND PRICE REDUCED</b>\r\n<br>\r\n<br>Price reduced to $35.00 but transportation is on-your-own.  There will be carpool signup sheets at the tour desk, Sacramento Transit provides transportation to and from games, and the stadium is at 1.5 miles walkable but somewhat  distant.\r\n<br>Alumni of the Sacramento River Cats, the Oakland Athletics AAA farm team, have played on every winning World Series team since 1999.  The Rivercats traditional July third sell-out event includes a BBQ dinner before the game and fireworks after.   \r\n<p/>\r\nSo for a change of pace from train rides - we have at least one available every day - come out and join the festivities at Raley Field.\r\n', 60, '', 35.00, 19, '', 0, 90, '', '2011-06-27 00:24:30'),
(29, 'G201', 'JELLY BELLY FACTORY TOUR (handicapped accessible)', '2011-07-04 08:15:00', '2011-07-04 11:30:00', 'Ronald Reagan began sharing Jelly Belly&reg; candies at meetings in 1967 when he was the Governor of California. He later wrote that &quot;we can hardly start a meeting or make a decision without passing around the jar of jelly beans.&quot; After he was elected President, he made Jelly Belly&reg; candies a staple in the Oval Office, on Air Force One, and on Marine One. \r\n<p/>\r\nReader''s Digest once called The Jelly Belly Factory&reg; tour the best factory tour in America.  We think you will agree as you see how Jelly Belly&reg; and other candies are made, taste free samples, view the amazing art created from Jelly Belly&reg; candies, and explore their unique gift shop. \r\n<p/>\r\nTour G201 will run on July 4th, when the factory is not in production.  The Jelly Belly&reg; people have a special treat prepared for people who visit on days when they are not working.  So if you want the whole &quot;watch-em-work&quot; experience you''ll want G601.  If the thought of dancing robots is more your style, you want G201.\r\n', 70, '', 15.00, 57, '0', 0, 90, '', '2011-06-27 23:12:29'),
(34, 'G202', 'FIREWORKS AT RANCHO CORDOVA', '2011-07-04 19:15:00', '2011-07-04 23:00:00', 'The Sacramento Valley Live Steam Railroad Museum is a group of live steam enthusiasts that call Rancho Cordova, California&#146;s Hagen Park home.  The City of Rancho Cordova has used Hagen Park as the location of their annual Fourth of July festivities for over 25 years.  This lucky combination created an opportunity for us to join the SVLSRM  in viewing the evening&#146;s fireworks from a unique viewing area accessed by their loop of track.', 60, '', 20.00, 165, '0', 0, 28, '', NULL),
(35, 'G203', 'FIREWORKS AT CAL-EXPO', '2011-07-04 00:00:00', '2011-07-04 00:00:00', '', 0, '', -1.00, 0, '0', 0, 0, '', NULL),
(36, 'G301', 'AEROSPACE MUSEUM OF CALIFORNIA ', '2011-07-05 08:45:00', '2011-07-05 12:15:00', 'The Aerospace Museum of California features 40 civilian and military aircraft, a motion ride simulator, and numerous special exhibits. Aircraft on display include a wide range of military fighters, trainers, and other planes flown by the US Air Force and Navy from 1940 to 2000.  After our docent led tour, participants will have the opportunity to revisit their favorite portions of the museum for more a leisurely photography opportunity or visit the museums extensive gift shop.\r\n', 60, '', 25.00, 55, '0', 0, 70, '', NULL),
(93, 'G414', 'SHERATON KITCHEN TOUR', '2011-07-06 14:00:00', '2011-07-06 15:00:00', 'Every wondered how a hotel kitchen prepares for a banquet? Well, we will get to see this first hand. The Sheraton Hotel''s chef will take us on a tour of his facility while they are prepping for a banquet. We will be able to ask questions and see his crew in action. This event is limited to 20 participants.\r\n<p><b>Closed toed non-slip shoes are required for this tour.</b>', 60, '', 5.00, 19, '0', 0, 0, '', NULL),
(37, 'G302', 'DAYLIGHT SALES', '2011-07-05 09:30:00', '2011-07-05 11:30:00', 'If you''ve been to railroad conventions in the past, you will recognize manufacturer Daylight Sales. Daylight Sales makes silk screen and embroidered shirts, hats, and other railroad items. On this tour, you will see how their silk screen and embroidered products are created. Items will be available for purchase and shipping home if you wish.  A free shirt will be given to each attendee, hot off the press.\r\n', 60, '', 5.00, 55, '0', 0, 0, '', NULL),
(30, 'G401', 'BURBANK HOUSE AND SHULZ MUSEUM', '2011-07-06 08:00:00', '2011-07-06 16:30:00', 'Santa Rosa was the home to Luther Burbank, the famed horticulturalist, and more recently Charles Schulz, the cartoonist who gave us the Peanuts gang for almost fifty years.\r\n<p/>\r\nAt the Burbank House we will have a docent led tour of the home, gardens and greenhouse.  Our tour of the Schulz Museum and Research Center will also be docent led but will also allow time to visit the center&#146;s ice hockey rink where Mr. Schulz used to play.  \r\n<p/>\r\nOur on-your-own lunch stop will be at Railroad Square in Santa Rosa where tour participants can also visit the Northwestern Pacific Railroad Historical Society&#146;s display in the restored Northwestern Pacific Depot, or visit the antique shops around the square.  For dedicated antique shoppers, the Warm Puppy Caf&#233; at the Schulz Museum offers an alternative to the Railroad Square dining establishments.\r\n', 60, '', 45.00, 30, '0', 0, 215, '', '2011-06-29 22:57:24'),
(32, 'G402', 'GRANGE RESTAURANT LUNCHEON EXTRAVAGANZA', '2011-07-06 10:45:00', '2011-07-06 14:15:00', 'This is a very special and unconventional event  at the Grange Restaurant, one of Sacramento&#146;s premiere dining destinations. Chef Michael Tuohy, a 31-year veteran of the restaurant industry and leading proponent of the Slow Food Movement, will take attendees to Sacramento&#146;s farmer&#146;s produce market where he will explain what he looks for in selecting items. Back at the restaurant, attendees will watch preparation of a meal using the produce selected at the farmers market.  AND FINALLY, enjoy the meal they have seen prepared.', 70, '', 45.00, 19, '0', 0, 0, '', '2011-06-26 16:31:41'),
(31, 'G403', 'GOLD COUNTRY', '2011-07-06 09:00:00', '2011-07-06 16:00:00', 'This tour of California&#146;s Gold Rush country includes a trip to the site on the South Fork of the American River where James Marshall discovered gold in 1848 triggering the Gold Rush of 1849. The Gold Discovery State Park includes a replica of Marshall&#146;s original sawmill, a museum featuring period relics and displays, over 20 historic buildings and a monument marking the actual discovery site.\r\n<p/>\r\nAfter leaving the Discovery Site State Park we will travel to Placerville, California.  There we will visit two underground mines, one not normally open for public viewing, and their associated stamp mill.  These mines are representative of the hard rock mining that followed after the great hordes of 49er''s had panned out most of California&#146;s gold-bearing streambeds.  At the restored stamp mill, tour visitors will witness a replica of the stamping machine in operation. \r\n<p/>\r\nThis tour includes a box lunch at the gold discovery site.\r\n', 60, '', 45.00, 55, '0', 0, 100, '', NULL),
(39, 'G501', 'WINE TASTING', '2011-07-07 12:30:00', '2011-07-07 18:45:00', 'The Napa Valley is the best known of California''s wine regions. Although not as well known, or flashy, as Napa the Lodi area in Amador County just south of Sacramento is the home of over 50 wineries. Join us in a tour of some unique facilities and taste a variety of wines from the Lodi wineries.  Our wine tasting is planned to stop at three locations. We will visit the Woodbridge Winery where we will have a tour of the grounds with a discussion of wine making in addition to the tasting and the Oak Ridge Winery where the tasting room is a converted 50,000 gallon barrel. Time permitting we will make a third stop at the Lodi Wine and Visitor Center where you can sample wines from multiple Lodi area wineries.', 60, '', 40.00, 55, '0', 0, 0, '', NULL),
(40, 'G502', 'SACRAMENTO UNDERGROUND', '2011-07-07 00:00:00', '2011-07-07 00:00:00', '', 0, '', -1.00, 0, '0', 0, 0, '', NULL),
(33, 'G601', 'JELLY BELLY FACTORY TOUR (handicapped accessible)', '2011-07-08 08:15:00', '2011-07-08 11:30:00', 'Ronald Reagan began sharing Jelly Belly&reg; candies at meetings in 1967 when he was the Governor of California. He later wrote that &quot;we can hardly start a meeting or make a decision without passing around the jar of jelly beans.&quot; After he was elected President, he made Jelly Belly&reg; candies a staple in the Oval Office, on Air Force One, and on Marine One. \r\n<p/>\r\nReader''s Digest once called The Jelly Belly Factory&reg; tour the best factory tour in America.  We think you will agree as you see how Jelly Belly&reg; and other candies are made, taste free samples, view the amazing art created from Jelly Belly&reg; candies, and explore their unique gift shop. \r\n<p/>\r\nTour G201 will run on July 4th, when the factory is not in production.  The Jelly Belly&reg; people have a special treat prepared for people who visit on days when they are not working.  So if you want the whole &quot;watch-em-work&quot; experience you''ll want G601.  If the thought of dancing robots is more your style, you want G201.\r\n', 60, '', 15.00, 52, '0', 0, 90, '', NULL),
(41, 'G602', 'GUIDE DOGS FOR THE BLIND', '2011-07-08 08:30:00', '2011-07-08 14:00:00', 'Guide Dogs for the Blind was formed in 1942 in Los Gatos, California by Lois Merrihew and Don Donaldson who recognized the need to help wounded servicemen who would return from World War II without their sight.  In 1947 the school relocated to their primary campus in San Rafael, California, and in 1995 opened a second facility in Boring, Oregon.  \r\n<p/>\r\nSince 1942 Guide Dogs for the Blind has graduated over 10,000 teams, over 2,200 of whom are currently active.  The organization is supported by 140 puppy raising clubs and 1,400 puppy raising volunteers.  Staff and volunteers at the training facilities number 265 employees and 950 volunteers.\r\n<p/>\r\nDuring the HOUR LONG WALKING TOUR of the 11 acre campus, you''ll see how the dogs are cared for and trained. \r\n', 60, '', 25.00, 55, '0', 0, 163, '', NULL),
(21, 'G603', 'NAPA VALLEY WINE TRAIN', '2011-07-08 16:00:00', '2011-07-08 22:45:00', 'The Napa Valley wine country lies about 60 miles southwest of Sacramento and is one of the premier travel destinations in the world. There are picturesque rolling hills planted with vineyards lining the valley while wineries of every stature dot the landscape.   The track used by the Napa Valley Wine Train was originally built in 1864 to provide freight and passenger service to the Napa Valley.  Passenger service was discontinued in the 1930''s, and by the mid 1980''s Southern Pacific was down to running a single freight train a week.\r\n<p/>\r\nA group of concerned citizens founded the Napa Valley Wine Train in 1987 and acquired the line from the SP, restoring 25 miles of track for its current use. \r\n<p/>\r\nMotive power is provided by four FPA-4 diesel locomotives built by the Montreal Locomotive works in 1958 and 1959.  The dining cars are ex-Northern Pacific Railway First Class coaches built by the Pullman Company in 1915, and were extensively restored when the Napa Valley Wine Train acquired the cars from the D&amp;RGW in 1987.\r\n<p/>\r\nThe fare on this tour includes the train and bus transportation, dinner and the gratuity on dinner.   There is no wine included in the tour price, but an extensive collection of local wines are available for purchase on the train.\r\n', 60, '', 120.00, 110, '0', 0, 120, '', NULL),
(91, 'G304', 'CAL-FIRE AIRCRAFT MAINTENANCE FACILITY', '2011-07-05 10:15:00', '2011-07-05 12:30:00', '<b> CANCELLED </b>\r\n<br> see tour G305', 80, '', 20.00, 0, '0', 0, 0, '', NULL),
(43, 'P201', 'WESTERN PACIFIC MUSEUM PORTOLA AND FEATHER RIVER CANYON', '2011-07-04 07:15:00', '2011-07-04 18:15:00', 'The Western Pacific Railroad Museum located at Portola in California''s majestic Feather River Canyon has the largest and most complete locomotive and equipment collection in North America dedicated to a single railroad, with over 35 locomotives and 80 cars of various types. The museum encourages visitors to climb up in the cabs of locomotives, sit in the engineer''s seats, and browse through the many cabooses and passenger cars on display, including cars from the California Zephyr, one of the nation''s most famous passenger trains. \r\n<p/>\r\nOur trip will in one direction travel via the Feather River Canyon, an excellent locale for railfanning, with anticipated stops at Serpentine Canyon, Virgilia Siding and the Pulga Trestles.  Stops will be adjusted to allow photography of detected train traffic.  There will be no stop at the Keddie Wye where highway traffic is too dangerous to permit stopping and unloading the bus for photography.  We regret this omission from the trip, but safety is critical.\r\n\r\nTour P201 will travel directly to Portola via Interstate 80 through Truckee and return via the Feather River Canyon with the railfanning on the return.\r\n<p/>\r\nLunch from a local deli will be provided at the Museum.\r\n<p><b>The Museum does not restrict clothing or shoes but remember you will be in a railroad yard.  Getting on and off the bus at railfanning stops with questionable footing in the Feather River Canyon might be another reason to have practical footwear.  Lastly, at 5,000 feet elevation you may also want to bring a jacket and think about long pants instead of shorts.</b>', 60, '', 80.00, 43, '0', 0, 325, '', NULL),
(44, 'P202', 'WESTERN PACIFIC MUSEUM PORTOLA AND FEATHER RIVER CANYON', '2011-07-04 07:30:00', '2011-07-04 18:30:00', 'The Western Pacific Railroad Museum located at Portola in California''s majestic Feather River Canyon has the largest and most complete locomotive and equipment collection in North America dedicated to a single railroad, with over 35 locomotives and 80 cars of various types. The museum encourages visitors to climb up in the cabs of locomotives, sit in the engineer''s seats, and browse through the many cabooses and passenger cars on display, including cars from the California Zephyr, one of the nation''s most famous passenger trains. \r\n<p/>\r\nOur trip will in one direction travel via the Feather River Canyon, an excellent locale for railfanning, with anticipated stops at Serpentine Canyon, Virgilia Siding and the Pulga Trestles. Stops will be adjusted to allow photography of detected train traffic. There will be no stop at the Keddie Wye where highway traffic is too dangerous to permit stopping and unloading the bus for photography. We regret this omission from the trip, but safety is critical.\r\n\r\nTour P202 will travel via the Feather River Canyon with railfanning on the way to the WP Museum and will return via Interstate 80 through Truckee.\r\n<p/>\r\nLunch from a local deli will be provided at the Museum.\r\n<p><b>The Museum does not restrict clothing or shoes but remember you will be in a railroad yard. Getting on and off the bus at railfanning stops with questionable footing in the Feather River Canyon might be another reason to have practical footwear. Lastly, at 5,000 feet elevation you may also want to bring a jacket and think about long pants instead of shorts.</b>', 60, '', 80.00, 43, '0', 0, 325, '', NULL),
(45, 'P211', 'WESTERN PACIFIC WITH LOCOMOTIVE OPERATION', '2011-07-04 07:15:00', '2011-07-04 18:15:00', 'Tours P211 and P212 will share transportation with P201 and P202 and attendees will be able to participate in all activities noted for those tours.  Additionally, participants on these two tours will operate Southern Pacific GP9E #2873 for approximately 15 minutes and share the cab with three other participants for the balance of the one hour window each group of 4 will receive.   Tours P211 and P212 are limited to 12 participants each.\r\n<p><b>Shorts are OK but at 5,000 feet elevation you may want not just long pants but a jacket as well.  Closed toe shoes are highly recommended for people running the locomotive. THINK ABOUT IT.  Do you really want to be climbing the ladder into a locomotive in sandals, flip flops or high heels?  Getting on and off the bus at railfanning stops with questionable footing in the Feather River Canyon might be another reason to have practical footwear.</b>', 60, '', 115.00, 12, '0', 0, 325, '', NULL),
(46, 'P212', 'WESTERN PACIFIC WITH LOCOMOTIVE OPERATION', '2011-07-04 07:30:00', '2011-07-04 18:30:00', 'Tours P211 and P212 will share transportation with P201 and P202 and attendees will be able to participate in all activities noted for those tours.  Additionally, participants on these two tours will operate Southern Pacific GP9E #2873 for approximately 15 minutes and share the cab with three other participants for the balance of the one hour window each group of 4 will receive.   Tours P211 and P212 are limited to 12 participants each.\r\n<p><b>Shorts are OK but at 5,000 feet elevation you may want not just long pants but a jacket as well. Closed toe shoes are highly recommended for people running the locomotive. THINK ABOUT IT. Do you really want to be climbing the ladder into a locomotive in sandals, flip flops or high heels? Getting on and off the bus at railfanning stops with questionable footing in the Feather River Canyon might be another reason to have practical footwear.</b>', 70, '', 115.00, 12, '0', 0, 325, '', NULL),
(47, 'P203', 'SIERRA RAILWAY AT RAILTOWN 1897', '2011-07-04 09:30:00', '2011-07-04 18:30:00', 'Known as &quot;The Movie Railroad,&quot; the Sierra Railroad''s survival has long been aided by the film industry. The first known filming on the railroad was in 1919 for a silent serial called <i>The Red Glove</i>. Since then, the historic buildings, locomotives, and the railroad cars preserved here have appeared in more than 200 films, television productions, and commercials. Still a popular Hollywood location site, Railtown 1897 has been called &quot;the most photographed railroad in the world.&quot; <i>Petticoat Junction</i>, <i>The Wild, Wild West</i>, <i>High Noon</i>, <i>The Virginian</i>, <i>Unforgiven</i>, and <i>Back to the Future Part III</i> were all filmed on the railroad.\r\n<p/>\r\nIn 1982 the Sierra Railroad sold it''s Jamestown complex, along with the steam locomotives and other equipment, to the State of California, which now runs that facility as a California State Park called Railtown 1897 State Historic Park.  The three locomotives are: Sierra Railway No. 2, a Lima 1922 103-Ton Shay; Sierra Railway No. 3, a Rogers 1891 4-6-0, used for movies and specials and the oldest surviving Rogers 4-6-0 and Sierra Railway No. 28, a Baldwin 1922 2-8-0 that is currently out of service.\r\n<p/>\r\nOur tour will travel down the Mother Lode highway from Placerville to Jamestown, passing through  towns built during the Gold Rush. At Railtown 1897 State Historic Park, we will have a Texas Style BBQ in the park''s picnic grounds, a docent lead tour of the historic shops and grounds and take about a 50 minute ride behind one of the park''s steam locomotives.  Although the locomotive used will depend on their status at the time, it is currently expected the train that day will be pulled by the 1891 4-6-0 Sierra #3, star of innumerable movies and TV series, that has recently returned to service. \r\n<p/>\r\nOur return trip on the less scenic interstate system is designed to have participants arrive back in Sacramento around 6:00 pm, in time to join one of the evening''s fireworks events. \r\n', 70, '', 60.00, 115, '0', 0, 200, '', '2011-06-26 17:49:34'),
(50, 'P321', 'PHOTOGRAPHY SESSION - CSRM (handicapped accessible)', '2011-07-05 08:30:00', '2011-07-05 10:00:00', 'The California State Railroad Museum has a lot of wonderful equipment to photograph.  All of which can be done during normal museum hours, with flash and lots of people to shoot around.  This tour gives you the unique opportunity to use a tripod and be in a limited attendance environment of only convention attendees before normal Museum operating hours.  Tour size is limited to 50 attendees. ', 60, '', 5.00, 50, '0', 0, 0, '', NULL),
(49, 'P301', 'MODESTO AND EMPIRE TRACTION', '2011-07-05 08:00:00', '2011-07-05 12:45:00', 'While the names of the original railroad and the current M&amp;ET both seem to imply that the railroad was built as an interurban, wires were never strung and passenger service was initially provided by a gasoline railcar and later by a battery-powered street car. Passenger service ended in 1917, but freight operations continued and were handled by a variety of steam engines. Steam was replaced with GE 70-tonners beginning in 1947. The M&amp;ET now serves its customers with a fleet of seven Railpower GenSet 2000-HP locomotives.  \r\n<p/>\r\nOur tour will include a history of the railroad, a shop tour with photo ops of the locos and shops, and a narrated tour through the railroad''s switching district.  We will see and hear about the types of switching maneuvers, the businesses served, and the challenges of the railroad. \r\n<p><b>No open toed shoes or heels.  Shorts OK</b>  ', 60, '', 20.00, 55, '0', 0, 160, '', '2011-06-23 22:50:58'),
(51, 'P303', 'CENTRAL CALIFORNIA TRACTION', '2011-07-05 15:30:00', '2011-07-05 19:30:00', 'The Central California Traction Company was incorporated in 1905 and was originally conceived as a streetcar line for Stockton, a city south of Sacramento. By September 1907, electric passenger train service began between Stockton and the city of Lodi, south of Stockton. By August 1910, the passenger line had been extended northerly to Sacramento. Freight service began on the line about the same time.  Interurban passenger service made its last run in February 1933 at the height of the Depression. CCT''s freight operations continued under electricity for another decade until the CCT made the switch from electricity to diesel after the arrival of a pair of GE 44-tonners in 1946.\r\n<p/>\r\nToday, the CCT has two unconnected lines. One runs from Sacramento to Stockton with a connection to the city of Lodi. A second line serves the Port of Stockton, the second largest inland port on the West Coast, which serves the vast agricultural area of the San Joaquin Valley. This tour will give you an up-close view of this thriving shortline railroad.  \r\n<p>\r\nOur visit will include a shop tour and photo session of classic CCT equipment. \r\n<p><b>No open toed shoes or heels.  No shorts, you must wear long pants.</b>', 60, '', 20.00, 55, '0', 0, 50, '', NULL),
(52, 'P304', 'HAYES TRUCK MUSEUM /HEIDRICK AG HISTORY CENTER (handicap access)', '2011-07-05 13:00:00', '2011-07-05 17:00:00', 'The Hayes Antique Truck/Heidrick Ag History Center consists of two historical collections housed in a single 130,000-square-foot interactive exhibit. The cornerstones of these exhibits are the Fred C. Heidrick Antique Ag Collection, the world''s largest and most unique collection of one-of-a-kind antique agricultural equipment, and the Hayes Antique Truck Museum, recognized as the largest collection of antique trucks in the world. \r\n<p/>\r\nThe Heidrick collection in addition to farm implements and tractors ranging from an 1890 Deering Reaper to numerous Caterpillar, Holt, Fordson, and John Deere tractors from the 1920''s, this exhibit includes a restored City of Woodland horse drawn street car.  The Hayes Truck collection includes over 100 different makes of old trucks representing 94 different manufacturers including the one and only 1916 Breeding Steam Truck. And an ALCO Diesel - truck not locomotive.  \r\n', 60, '', 25.00, 49, '0', 0, 40, '', NULL),
(53, 'P401', 'NWP HISTORICAL SOCIETY AND PETALUMA TROLLEY RESTORATION SHOPS', '2011-07-06 08:00:00', '2011-07-06 16:05:00', 'The Northwestern Pacific Historical Society and Petaluma Trolley share a facility in which both are working on projects restoring equipment.  Our trip starts with a visit to that facility where we will meet with representatives of both organizations.  After leaving the facility in Petaluma we will travel to Santa Rosa where participants can visit the NWPHS'' display in the Santa Rosa Depot prior to or after lunch in one of Railroad Square''s dining establishments.  Before leaving Santa Rosa to return to Sacramento we will stop and visit local NWP themed layouts.', 80, '', 35.00, 55, '0', 0, 219, '', NULL),
(54, 'P302', 'NEVADA COUNTY NARROW GAUGE', '2011-07-05 08:30:00', '2011-07-05 16:00:00', 'This tour, led by Bill Shaumberg as an extension of his Monday clinic, will follow the NCNG right-of-way from Colfax to Nevada City with stops along the way to see bridge and station locations, view portions of the right-of-way, and visit the Nevada County Narrow Gauge Railroad Museum in Nevada City. At the museum, attendees will be given a docent-led historical tour of the museum, rail yards, and restoration shop. NCNG No.5, an 1875 Baldwin that initially hauled lumber, then passengers and freight and finally ended up as a movie engine at Universal Studios in Hollywood is on display. The rail yard houses a collection of wooden cars, some of which have been restored while others are awaiting their turn in the restoration shop.  \r\n<p/>\r\n(Was previously listed as P402 before being moved from Wednesday to Tuesday)\r\n<br><b>This tour will involve walking in unimproved areas.  Appropriate footwear for those conditions is highly recommended.</b>', 60, '', 40.00, 43, '0', 0, 125, '', NULL),
(55, 'P403', 'WESTERN RAILWAY MUSEUM - RIO VISTA', '2011-07-06 13:00:00', '2011-07-06 17:30:00', 'The Western Railway Museum has over 50 historic cars on display in its 2,400-square-foot display and exhibit hall. Our docent led tour will view cars in the exhibit hall and ride approximately ten miles of track in one of the museum''s restored trolleys. Afterwards tour participants will have time to visit the museum''s photographic displays and gift shop before returning to the Convention Center. \r\n', 60, '', 25.00, 55, '0', 0, 95, '', NULL),
(56, 'P413', 'PETALUMA TROLLEY AND WESTERN RAILWAY MUSEUM - SELF GUIDED', '2011-07-06 09:30:00', '2011-07-06 17:00:00', 'As our trolley enthusiasts know, tours for their interest are slim at our conventions, largely due to the limited number of members interested in that aspect of our hobby. Tour P401 is primarily Northwestern Pacific themed, but includes the Petaluma Trolley restoration project which is housed in the same facility as the NWPHS restoration project. Tour participants on P401 will not be back in time to participate in tour P403. Therefore, as SELF GUIDED ONLY we are offering both locations as an alternative tour. Participants need to arrive at the Petaluma Trolley Restoration facility by 9:30 a.m. and can arrive at the Western Railway Museum as early as noon.', 60, '', 15.00, 55, '0', 0, 0, '', NULL),
(57, 'P404', 'UNION PACIFIC ROSEVILLE YARD', '2011-07-06 08:30:00', '2011-07-06 12:00:00', 'The Union Pacific Railroad is North America''s largest railroad, covering 23 states with over 32,000 miles of track.  The Union Pacific has almost 42,000 employees and over 8,300 locomotives.  For fallen flags followers the UP now incorporates the Missouri Pacific, Western Pacific, MKT, Chicago and Northwestern and the Southern Pacific.\r\n <p/>\r\nThe Union Pacific''s Davis Yard in Roseville, California is the largest and most modern Classification Yard on the West Coast.  Approximately 98% percent of all UP traffic in Northern California moves through the Davis Yard.  The Davis Yard greatly improves the UP network to and from Northern California for manifest carload traffic. Davis Yard blocks all cars for Northern California into zones for satellite yards such as Oakland, San Jose, Sacramento, Fresno, Stockton, Tracy, Warm Springs, Milpitas and Modesto to avoid additional switching at these yards.\r\n <p/>\r\nThe yard encompasses 915 acres.  It has 2 mainlines, 8 receiving and departure tracks and 55 bowl tracks with a capacity for 6,500 cars.  There are also 247 switches and a repair facility capable of repairing damaged cars in a single day.\r\n<p/>\r\nDuring our tour we will visit with the yard''s mechanics and the main control tower.  \r\n<p><b>Long pants and hard shoes (no tennis shoes)are required.</b>', 70, '', 20.00, 110, '0', 0, 0, '', NULL),
(58, 'PXXX ', 'GLADDING MCBEAN', '2011-07-11 00:00:00', '2011-07-11 00:00:00', '<b><font color="red">PENDING - GET INFORMATION FROM COMPANY</font></b>', 0, '', -1.00, 0, '0', 0, 0, '', NULL),
(59, 'PXXX1', 'SACRAMENTO REGIONAL TRANSIT', '2011-07-11 00:00:00', '2011-07-11 00:00:00', '<b><font color="red">PENDING - GET INFORMATION FROM SACRAMENTO TRANSIT</font></b>', 0, '', -1.00, 0, '0', 0, 0, '', NULL),
(60, 'P407', 'SIEMENS', '2011-07-06 00:00:00', '2011-07-06 00:00:00', '<b><font color="red">PENDING - GET INFORMATION FROM COMPANY</font></b>', 0, '', -1.00, 0, '0', 0, 0, '', NULL),
(61, 'P408', 'FOLSOM HISTORICAL SITES', '2011-07-06 09:00:00', '2011-07-06 16:00:00', 'When the Folsom Powerhouse opened in 1895 it was the first power system to transmit high voltage alternating electric current over long distance power lines by sending power to Sacramento, twenty-two miles away.  That feat has earned it a spot in the National Register of Historic Places.   Our docent led tour of the Powerhouse is one of four stops we will make after arriving in Folsom. Our other stops, also docent led, are the Folsom Railroad Museum operated by the El Dorado Historical Society Railroad, the Folsom History Museum and the Folsom History Museum''s Pioneer Village Annex adjoining the Railroad Museum.  \r\n<p/>\r\nThis tour will travel via Sacramento Regional Transit''s Light Rail System from the Convention Center to end of the line in Downtown Folsom.  All of our stops in Folsom are within walking distance of the light rail stop.\r\n', 80, '', 20.00, 50, '0', 0, 0, '', NULL),
(62, 'P501', 'SIERRA PACIFIC LUMBER', '2011-07-07 07:30:00', '2011-07-07 11:45:00', 'Sierra Pacific Industries is a family-owned forest products company based in Anderson, California that owns and manages nearly 1.9 million acres of timberland in California and Washington.  It is the second largest lumber producer in the United States.  In addition to the forests, SPI operates sawmills and plants to produce products from finished lumber, to windows and even decorative landscaping bark.  \r\n<p/>\r\nOur tour will visit the Sierra Pacific Industries facility in Lincoln, California.  This saw mill complex consists of two band mill head rigs with conventional carriages, band re-saw, edgers and trim saw/sorting line plus a small log mill consisting of a twin band mill head saw to break down logs together with re-saw, edger and trim saw/sorting complex.  The complex is supported by log yard, de-barking operation, electrical power generation on site, dry kilns and a lumber/timber planing mill for finishing lumber for the retail market.\r\n<p/>\r\nOur bus guide on this tour will be a name many of you may recognize.  Jim Zeek has been a frequent presenter at both Regional and National NMRA conventions, most recently at the 2008 in Anaheim.   Jim is also a former SPI employee with extensive experience in the mill processes.  A follow up session is planned for Friday evening where both Jim and SPI Community Relations Manager, Mark Luster will be on hand to answer questions about the plant in a quieter environment than the plant.\r\n<p><b>Long pants and hard shoes (no tennis shoes)are required.</b>', 60, '', 20.00, 55, '0', 0, 62, '', NULL),
(63, 'Pxxx2', 'CALIFORNIA STATE RAILROAD MUSEUM', '2011-07-11 00:00:00', '2011-07-11 00:00:00', '<b><font color="red">DO WE WANT GENERAL DESCRIPTION?</font></b>', 0, '', -1.00, 0, '0', 0, 0, '', NULL),
(64, 'P521', 'SOUTHERN PACIFIC SHOPS TOUR - CSRM', '2011-07-07 08:30:00', '2011-07-07 11:00:00', 'The Southern Pacific Railroad''s Sacramento Shops began construction in 1867, and grew to become the largest single-site industrial complex west of St. Louis. It served as the technological innovation center for the nation''s first transcontinental railroad, and as time passed, it also emerged as the Central Shops for the mighty Southern Pacific Railroad and the Harriman railroad empire. Last used by SP successor Union Pacific in 1999, two of the remaining structures at the site are planned to become the Railroad Technology Museum, a major expansion of the California State Railroad Museum. Our tour will begin in the auditorium of the Museum with a presentation on the history of the Shops and plans for their future. We will then walk to the site for a behind-the-scenes guided tour.  The tour will include walking approximately one-half mile over uneven/unpaved surfaces, and is not recommended for persons with limited mobility.\r\n<p><b>Closed-toed shoes must be worn by all participants.</b>', 70, '', 5.00, 100, '0', 0, 0, '', '2011-06-25 14:01:57'),
(65, 'P522', 'SOUTHERN PACIFIC SHOPS TOUR - CSRM', '2011-07-07 09:30:00', '2011-07-07 12:00:00', 'The Southern Pacific Railroad''s Sacramento Shops began construction in 1867, and grew to become the largest single-site industrial complex west of St. Louis. It served as the technological innovation center for the nation''s first transcontinental railroad, and as time passed, it also emerged as the Central Shops for the mighty Southern Pacific Railroad and the Harriman railroad empire. Last used by SP successor Union Pacific in 1999, two of the remaining structures at the site are planned to become the Railroad Technology Museum, a major expansion of the California State Railroad Museum. Our tour will begin in the auditorium of the Museum with a presentation on the history of the Shops and plans for their future. We will then walk to the site for a behind-the-scenes guided tour. The tour will include walking approximately one-half mile over uneven/unpaved surfaces, and is not recommended for persons with limited mobility.\r\n<p><b>Closed-toed shoes must be worn by all participants.</b> ', 60, '', 5.00, 100, '0', 0, 0, '', NULL),
(66, 'P523', 'GRADE CROSSING WARNING SYSTEMS - CSRM', '2011-07-07 08:00:00', '2011-07-07 12:00:00', 'Almost every layout has at least one grade crossing, and a lot have more than just crossbucks as warning systems.  It is fun animation and something our layout visitors enjoy seeing.  But have you every seen the inside workings of the real thing, or wondered how our model systems work compared to prototype Warning Systems?  The Sacramento Southern Railroad Signal Department has, and they will spend this morning sharing their knowledge with us.\r\n<p/>\r\nThe Sacramento Southern Railroad is a working railroad owned and operated by the California State Railroad Museum in Old Sacramento.  Staffed by volunteers, the railroad operates steam powered excursion passenger trains with vintage 1920''s-era cars every weekend April-September.  The Sacramento Southern''s Signal Department is a group of volunteers who maintain the railroad''s various Grade Crossing Warning Systems.  They conduct all the necessary tests and inspections per Federal Railroad Administration rules and regulations, and make any necessary repairs and revisions to the signal facilities.\r\n<p/>\r\nOur morning will start in one of the Railroad Museum''s presentation theaters, with a discussion of not only how track detection and grade crossing signals work, but also the Federal Regulations that control those activities.  The how and why the signals are where they are and operate the way they do.  After that we will board a Sacramento Southern train and visit three different grade crossings on the line.  We will break into sub-groups with one at each crossing, rotating so each group can discuss the inner workings of each of the three types of crossing protection systems.\r\n<p/>\r\nThe trip requires boarding and disembarking from the train in multiple locations, and a half mile walk along the track. The Sacramento Southern Railroad''s trains are not fully accessible to persons with disabilities, due to historic, limited doorway widths and steep stepwells. <p/>\r\nNote: Specially scheduled trains Thursday evening during the X2011west Convention will provide everyone in attendance with the opportunity to experience the railroad''s route along the Sacramento River, pulled by a vintage steam locomotive.\r\n<p><b>Closed-toed shoes must be worn by all session participants for safety reasons.</b>\r\n\r\n', 60, '', 10.00, 120, '0', 0, 0, '', NULL),
(67, 'P524', 'USING THE CSRM LIBRARY AND ARCHIVES - CSRM ', '2011-07-07 14:00:00', '2011-07-07 15:30:00', 'The California State Railroad Museum Library is North Americaâ€™s largest railroad reference library, with an archival collection that includes literally millions of photographs, drawings, corporate records, periodicals, and much more. CSRM Library staff will begin with a presentation highlighting some of the collections contained in the Museumâ€™s archives, and focusing on those of likely interest to modelers. A visit to the CSRM  Library Reading Room will wrap up this session, and acquaint NMRA members with the Museumâ€™s broad array of resourcesâ€”and how to access and utilize them.', 20, '', 0.00, 50, '0', 0, 0, '', NULL),
(68, 'P525', 'STARTING A STEAM LOCOMOTIVE - CSRM', '2011-07-07 11:30:00', '2011-07-07 13:30:00', 'Ever wonder what goes on before you get on that steam powered tourist train?  Visit with the CSRM locomotive crew as the prepare the Sacramento Southern Railroad''s operating steam locomotive, Granite Rock Company No. 10, for operation.  It will be pulling trains for NMRA convention attendees later in the day at the evenings Big Event!  ', 20, '', 0.00, 25, '0', 0, 0, '', NULL),
(70, 'P527', 'MAINTENANCE OF A CONTINUALLY RUNNING LAYOUT - CSRM', '2011-07-07 15:00:00', '2011-07-07 16:00:00', 'The California State Railroad Museum is open 362 days a year, from 10 a.m. to 5 p.m. each day. Have you ever considered the maintenance that would be necessary if you ran your model railroad that long? In this case, itâ€™s a Toy Train layout in the Thomas W. Sefton Gallery, featuring four different operating tracks and levels. Regular track cleaning, periodic replacement of drive mechanisms and tracks, and many other interesting things will be discussed in this â€œbehind the scenesâ€ session with Museum staff.', 20, '', 0.00, 50, '0', 0, 0, '', NULL),
(71, 'P528', 'CSRM - Model and toy train exhibits', '2011-07-07 16:00:00', '2011-07-07 17:00:00', '<b><font color="red">GET DESCRIPTION FROM PAUL</font></b>', 20, '', 0.00, 50, '0', 0, 0, '', NULL),
(72, 'P512', 'SF TROLLEY AND CABLE CAR MUSEUMS  (handicapped accessible)', '2011-07-07 07:00:00', '2011-07-07 19:00:00', 'San Francisco is one of the few places in the world where you can get the actual experience of riding vintage rail transit in its &quot;natural habitat&quot; by riding on the historic trolleys maintained by the Market Street Railway and operated by the San Francisco Municipal Railway on their F-street line.  Muni, as it is affectionately called locally, operates a rotating twenty of the forty plus trolleys in regular service on a dedicated line that runs from Fisherman''s Wharf along the waterfront past the famous Ferry Terminal and then along Market Street through the city''s Financial District to the end of the line in what is known as the Castro District. Although visually unchanged from their historic appearance all of these &quot;museum in motion&quot; vehicles have been modified internally to be wheel-chair accessible, and many of the stops on the line, including the one at the Museum, have ramps. \r\n<p/>\r\nThe San Francisco Railway Museum, located across the street from the Ferry Building is designed to complement the historic rail vehicles of the F-line and cable car lines by serving as an information and interpretation center for them.   The museum features a full-sized exact replica of the motorman''s platform of a 1911 San Francisco streetcar, unique historic artifacts, illustrative and informative displays, rarely seen archival photography, and audio-visual exhibits to bring rail transit in the 19th and 20th centuries to life.\r\n<p/>\r\nWe will travel via Amtrak and Bay Area Rapid Transit (BART) to the San Francisco Railway Museum.   The tour fee includes a day pass on Muni, so once our docent led tour of the Museum  is over you will be on-your-own for the rest of the day.  Ride the trolleys, take pictures as they go by the Museum (all 20 have to pass in each direction in a traffic safe location) dine at either end of the F-street line at Fisherman''s Wharf or the less touristy Castro.\r\n<p/>\r\nAs a side trip, catch a Cable Car, the fare is included in the day pass.  Go for just the ride  or get off at the Cable Car Museum to view their exhibits and the operating wheel that pulls the cable.  The Cable Car option is not handicapped accessible, and can involve extensive waits to board at either end of the line.  Additionally, re-boarding at the Cable Car Museum can be difficult (they are always full and in the middle of heavy traffic) and you should be prepared to walk down a steep hill to the F-street trolley line.\r\n<p/>\r\nThe last of Amtrak''s Capitol Corridor trains from Richmond to Sacramento leaves at 8:30 pm. and you need to catch BART from San Francisco to Richmond at least an hour before that.  The convention shuttle running on Thursday will provide transportation from Old Town Sacramento (at the end of the Amtrak station) to the Convention Center until 7:00 pm.  See the tour desk prior to departure for more details on pick-up on Tuesday and after 7:00 pm Thursday.\r\n<p/>\r\nThis is a great tour for trolley fans, photography buffs, historians and anybody else just looking for an unconventional day.\r\n', 60, '', 65.00, 29, '0', 0, 0, '', NULL),
(73, 'P701', 'SPEEDER RIDES', '2011-07-09 09:00:00', '2011-07-09 13:15:00', 'They are noisy, bumpy, drafty and potentially the most fun you can have riding a &quot;train&quot; at this or any other convention.  Members of the Amador Central Railroad, a joint venture of the Recreational Railroad Coalition Historical Society and the Amador County Historical Society will provide rides on the Amador Central Railroad trackage out of Ione, California.  Round trip out and back to Ione will be approximately 2 hours of speeder operation.', 70, '', 55.00, 25, '0', 0, 80, '', NULL);
