(74, 'P702', 'CARSON AND TAHOE LUMBER FLUME TOUR', '2011-07-09 08:00:00', '2011-07-09 17:50:00', 'The Carson and Tahoe Lumber and Fluming Company was organized in 1873 and operated several flumes to transport lumber and over 8 miles of railroad.  Logging operations ceased around 1896 but the company was not formally dissolved until 1947.  The company''s center of activity was located around Glenbrook, Spooner Summit, and Clear Creek Canyon, where portions remain to this day. <p/>\r\nThe Truckee Donner Railroad Society is a group of individuals who recognizing the importance railroads played in the formation and development of Truckee and the surrounding area, formed a not-for-profit corporation in 2000.  Their mission is to perpetuate the study, advancement and knowledge of the working railroad in the Truckee Donner area.  On May 8, 2010 the TDRS opened a museum in a former SP caboose adjoining the Amtrak station in Truckee.<p/>\r\nJoin us for a tour, lead by a TDRS member that will start in Glenbrook, go up Spooner Summit to follow the old grade to a switchback on a trestle overlooking Lake Tahoe. From there it is a short drive to Spooner Meadow where lumber came off the railroad and was put in a V-Flume to float down to Carson City. After viewing a portion of that 17 mile flume route in Clear Creek Canyon we end this portion of the trip in Carson City with a visit to the Nevada State Railroad Museum.  Although the hikes on the Carson and Tahoe Lumber and Fluming Company right-of-way are classified as easy they are still significant walks. \r\n<p/>\r\n', 80, '', 40.00, 55, '0', 0, 275, '', NULL),
(75, 'P703', 'V&T AND VIRGINIA CITY', '2011-07-09 06:45:00', '2011-07-09 19:00:00', 'The Virginia and Truckee Railroad was an immensely profitable shortline railroad completed in 1872 to connect the Comstock silver producing mines with the reduction mills at Silver City and along the Carson River. It also provided these mines with needed lumber, mining timbers and cord wood for fuel. It ultimately extended from Virginia City to Reno via Carson City. However the decline of the Comstock mines near Virginia City forced the railroad to make its last run in May 1950.\r\n<p/>\r\nBut the V&amp;T was not forgotten. In the mid-1970s, Robert Gray began rebuilding the V&amp;T from Virginia City through Tunnel 4 to Gold Hill, a few miles away, as a tourist line. Steam trains began running over this portion of the historic line in 1976.  In 2005, work began on reconstruction of the line between Virginia City and Carson City and the inaugural run over the new line, much of which follows the original alignment, took place in August 2009.   \r\n<p/>\r\nWe will ride the reconstructed V&T from Carson City to historic Virginia City where you will have an opportunity to sightsee the old town as well as enjoy an own your own lunch.  After lunch we will take the train back down to Carson City for a visit to the Nevada State Railroad Museum.  The NSRM preserves the railroad heritage of Nevada including the V&amp;T and other railroads of the Silver State.  The museum houses two restored and operable V&amp;T steam locomotives and a V&amp;T McKeen motorcar which was returned to service in 2010.\r\n<p/>\r\nThe tour is designed to be back to the Convention Center in time for the Saturday evening event.\r\n', 60, '', 75.00, 112, '0', 0, 0, '', NULL),
(76, 'G503', 'FOLSOM OUTLET MALL SHOPPING', '2011-07-07 09:00:00', '2011-07-07 15:00:00', 'This is largely an on-your-own tour on Sacramento Regional Transit rather than by bus, and is designed to provide the maximum flexibility to attendees.  The mall provides a group discount book for savings in addition to the traditional outlet store discounts.  In order to receive the book, tour participants must arrive together.  After that, you are free to spend an hour, all day or shop till you drop.  You can return home or take Sacramento Transit into the Folsom Historic District first.\r\n<p/>\r\nCheck out <a href="http://www.premiumoutlets.com/outlets/outlet.asp?id=27">their website</a>!\r\n<p/>\r\nIf there is enough interest in a trip on a different day or time we will arrange a second discount book arrival.  Inquire at the tour desk.\r\n\r\n', 60, '', 0.00, 100, '0', 0, 0, '', NULL),
(77, 'GNQ', 'Nonquet', '2011-07-09 19:30:00', '2011-07-09 23:45:00', 'Saturday evening social hour. Instead of the usual NMRA banquet, we are taking the unconventional route and holding instead what we have coined as the Nonquet. Dessert will be served, a no-host bar will be open, and you will be able to socialize with all your old friends and make some new friends. Then there will be entertainment. WinteRail is a professionally done railroadiana show and photo exhibition. It has been held each March, for about 30 years, in Stockton, CA. The producers of WinteRail have graciously agreed to put on a show for us Saturday night. NMRA awards will presented during intermissions. This is going to be a true highlight of the convention. Don''t miss it.', 60, '', 5.00, 1200, '0', 0, 0, '', NULL),
(78, 'G303', 'DONNER SUMMIT', '2011-07-05 08:00:00', '2011-07-05 17:00:00', 'The summit is legendary; both for a party of pioneers and a pioneering railroad using immigrant labor to build roadbed over the treacherous Sierra Nevada Mountains.  The Central Pacific Railroad''s building of track from Sacramento, California to Promontory, Utah is beyond the scope of our tour, and even just  the construction of the roadbed, tunnels and snowsheds over Donner will  be difficult to cover in one morning.  Our guide, from the Truckee Donner Railroad Society will do that and more.\r\n<p/>\r\nThe Truckee Donner Railroad Society is a group of individuals who recognizing the importance railroads played in the formation and development of Truckee and the surrounding area, formed a not-for-profit corporation in 2000.  Their mission is to perpetuate the study, advancement and knowledge of the working railroad in the Truckee Donner area.  On May 8, 2010, the TDRS opened a museum in a former SP caboose adjoining the Amtrak station in Truckee.\r\n<p/>\r\nThat museum, along with an on-your-own lunch in one of downtown Truckee''s many dining establishments will be the final stop on our trip before heading back to the convention center.\r\n<p/>\r\n<em><b>This tour involves a significant amount of difficult walking at high altitude (7,000'') and is definitely not for convention attendees not physically able to contend with that effort.  Temperatures at that altitude, partiularly inside the tunnels can be chilly.</b></em>\r\n<p/>\r\nDue to track re-alignments by the Union Pacific, the exact routing of the walking portion of the tour is unable to be determined at this time, but rest assured it will be enjoyable (and strenuous) whatever the final routing will be.  \r\n', 60, '', 40.00, 55, '0', 0, 250, '', NULL),
(79, 'P704', 'SPEEDER RIDES', '2011-07-09 12:00:00', '2011-07-09 16:45:00', 'They are noisy, bumpy, drafty and potentially the most fun you can have riding a &quot;train&quot; at this or any other convention.  Members of the Amador Central Railroad, a joint venture of the Recreational Railroad Coalition Historical Society and the Amador County Historical Society will provide rides on the Amador Central Railroad trackage out of Ione, California.  Round trip out and back to Ione will be approximately 2 hours of speeder operation.', 60, '', 55.00, 25, '0', 0, 80, '', NULL),
(80, 'P405', 'SIERRA PACIFIC LUMBER', '2011-07-06 07:30:00', '2011-07-06 11:45:00', 'Sierra Pacific Industries is a family-owned forest products company based in Anderson, California that owns and manages nearly 1.9 million acres of timberland in California and Washington.  It is the second largest lumber producer in the United States.  In addition to the forests, SPI operates sawmills and plants to produce products from finished lumber, to windows and even decorative landscaping bark.  \r\n<p/>\r\nOur tour will visit the Sierra Pacific Industries facility in Lincoln, California.  This saw mill complex consists of two band mill head rigs with conventional carriages, band re-saw, edgers and trim saw/sorting line plus a small log mill consisting of a twin band mill head saw to break down logs together with re-saw, edger and trim saw/sorting complex.  The complex is supported by log yard, de-barking operation, electrical power generation on site, dry kilns and a lumber/timber planing mill for finishing lumber for the retail market.\r\n<p/>\r\nOur bus guide on this tour will be a name many of you may recognize.  Jim Zeek has been a frequent presenter at both Regional and National NMRA conventions, most recently at the 2008 in Anaheim.   Jim is also a former SPI employee with extensive experience in the mill processes.  A follow up session is planned for Friday evening where both Jim and SPI Community Relations Manager, Mark Luster will be on hand to answer questions about the plant in a quieter environment than the plant.\r\n<p><b>Long pants and hard shoes (no tennis shoes)are required.</b>', 60, '', 20.00, 55, '0', 0, 62, '', NULL),
(81, 'P500', 'MUSEUM SHUTTLE', '2011-07-07 08:00:00', '2011-07-07 20:00:00', 'On Thursday the convention will hold a number of special events in the California State Railway Museum and run a shuttle to and from Old Town to accomodate the need of attendees to move between the convention center and Museum.  Additionally the shuttle will operate between the Convention Center and other California State Parks and privately operated museums such as the Governor''s Mansion, Sutter''s Fort and the Crocker Art Museum.  Admission to the museums other than the CSRM will be your own responsibility but the tour desk will have discount coupons available and can help arrange group and docent led tours as requested.\r\n\r\nWe anticipate the shuttle schedule will include trips to local hobby stores mid-day.  \r\n\r\nThe shuttle fare is good for unlimited rides, and will only operate on Thursday. \r\n\r\nA detailed schedule of times at the Convention Center, CSRM and other interim stops will be available at the convention. ', 60, '', 5.00, 500, '0', 2, 0, '', NULL),
(82, 'AG21A', 'Amtrak to Sacramento - Via Oakland Jack London Square', '2011-07-03 15:25:00', '2011-07-03 18:00:00', 'Arrive Sacramento Station 5:23 PM  on Amtrak 736. Transfer from Disney Tour AG21 provided.\r\n<p/>This schedule <b>may not</b> allow adequate time for connection with some of the Sacramento evening tours.\r\n<p/>\r\n<u>Advance Section registration is required</u> to attend any of the Advance Section events.', 60, '', 30.00, 90, '0', 0, 0, '', NULL),
(83, 'AP23', 'Niles Canyon Railway and Amtrak to Sacramento', '2011-07-03 10:30:00', '2011-07-03 16:00:00', 'In 1987 The Pacific Locomotive Association entered into an agreement with Alameda County and began rebuilding the line through Niles Canyon that Southern Pacific had abandoned three years earlier.  Operating as the Niles Canyon Railway, association volunteers worked for over a year on the first part of the track reconstruction between Sunol and Brightside and on May 21, 1988, almost 122 years after the first Western Pacific passenger train ran in the canyon, the Pacific Locomotive Association brought railroad passenger operations back to life in Niles Canyon.\r\n<p/>\r\nSince that time, the Pacific Locomotive Association has extended the line as far as the town of Niles and now boards trains at both ends of the line, at Niles Station and the 1880''s depot in Sunol.\r\n<p/>\r\nAfter our round-trip ride from Niles to Sunol and back, we will return to the Hilton for you to eat and pick-up luggage prior to moving on the Fremont Amtrak station for the train trip to Sacramento.  Tour price includes, bus transportation, Niles Canyon ticket and Amtrak travel. \r\n<p/>\r\n<u>Advance Section registration is required</u> to attend any of the Advance Section events.', 60, '', 55.00, 53, '0', 0, 0, '', NULL),
(85, 'AT21', 'Amtrak to Sacramento - Via Fremont', '2011-07-03 12:15:00', '2011-07-03 16:30:00', 'Transfer from Fremont Hilton Hotel.   Arrives Sacramento Station 3:55PM on Amtrak 734.\r\n<p/>This schedule allows adequate time for connection with all of the Sacramento evening Tours.\r\n<p/>\r\n<u>Advance Section registration is required</u> to attend any of the Advance Section events.', 60, '', 30.00, 53, '0', 0, 0, '', NULL),
(86, 'AT22', 'Amtrak to Sacramento - Via Fremont', '2011-07-03 13:30:00', '2011-07-03 17:30:00', 'Transfer from Fremont Hilton Hotel. Arrives Sacramento Station 5:23 on Amtrak 736.\r\n<p/>This schedule <b>may not</b> allow adequate time for connection with some of the Sacramento evening Tours.<p/>\r\n<u>Advance Section registration is required</u> to attend any of the Advance Section events.', 60, '', 30.00, 53, '0', 0, 0, '', NULL),
(87, 'P502', 'SETZER FOREST PRODUCTS', '2011-07-07 09:45:00', '2011-07-07 11:30:00', 'The Setzer family has owned and operated various lumber operations in Sacramento since 1927, starting as an agricultural box manufacturing plant.  They added a sawmill in 1933, the first in the Central Valley rather than in the actual timber cutting areas, but in the 1950''s the sawmill lost much of its log pond to the newly constructed Interstate 5.  After that much of the operation was moved to Oroville, several hours north.  Today the Sacramento plant produces moldings from medium density fiberboard (MDF), but many portions of the previous operations are still standing on the grounds.\r\n<p/>\r\nThe facility has had rail service from the beginning, and was served by both Southern Pacific and Western Pacific. Rail service is now provided by the CSRM''s Sacramento Southern Railroad.\r\n<p/>\r\nOur tours will be divided into two groups, with half visiting the actual molding cutting operation.  The other half will visit the historic portions of the complex, where photography is not only permitted, but encouraged, especially for people who model the lumber industry.  The groups will then switch before returning to the Convention Center or other stop on the shuttle route.\r\n<p/>\r\nThe molding cutting operation is an active wood shop and is an environment with particulate matter in the air.  Participants with respiratory issues may want to avoid this portion of the tour.\r\n<p><b> Closed-toe shoes and long pants required.</b>', 60, '', 5.00, 23, '0', 0, 0, '', NULL),
