ine at Fisherman''s Wharf or the less touristy Castro.\r\n<p/>\r\nAs a side trip, catch a Cable Car, the fare is included in the day pass.  Go for just the ride  or get off at the Cable Car Museum to view their exhibits and the operating wheel that pulls the cable.  The Cable Car option is not handicapped accessible, and can involve extensive waits to board at either end of the line.  Additionally, re-boarding at the Cable Car Museum can be difficult (they are always full and in the middle of heavy traffic) and you should be prepared to walk down a steep hill to the F-street trolley line.\r\n<p/>\r\nThe last of Amtrak''s Capitol Corridor trains from Richmond to Sacramento leaves at 8:30 pm. and you need to catch BART from San Francisco to Richmond at least an hour before that.  The convention shuttle running on Thursday will provide transportation from Old Town Sacramento (at the end of the Amtrak station) to the Convention Center until 7:00 pm.  See the tour desk prior to departure for more details on pick-up on Tuesday and after 7:00 pm Thursday.\r\n<p/>\r\nThis is a great tour for trolley fans, photography buffs, historians and anybody else just looking for an unconventional day.\r\n', 60, '', 65.00, 29, '0', 0, 0, '', NULL),
(92, 'G305', 'CAL-FIRE AIRCRAFT MAINTENANCE FACILITY', '2011-07-05 13:45:00', '2011-07-05 16:00:00', 'CAL-FIRE is responsible for fire protection of over 31 million acres of California&#146;s wild lands. One key to controlling wildfires is getting air tankers and tactical aircraft to the scene as quickly as possible. CAL-FIRE&#146;s fleet of 23 air tankers, 11 helicopters, and 14 tactical airplanes are stationed at 13 air attack and 9 helicopter bases statewide, but all are maintained at the McClellan facility.\r\n<p/>\r\nJoin us in learning about how Cal-Fire keeps their aerial tankers ready to respond in protect the state''s residents from wildfires.\r\n<p><b>No open toed shoes or heels allowed.  Shorts OK</b>', 60, '', 20.00, 49, '0', 0, 0, '', NULL),
(94, 'GLSB', 'LDSIG Banquet', '2011-07-08 18:00:00', '2011-07-08 22:00:00', 'Enjoy a catered dinner in the round house display area of the California State Railroad Museum with fellow SIG members (no SIG membership requirement, all convention attendees with an interest in layout design are welcome!). No Host bar from 6:00 PM. There will be an after-dinner presentation by a prominent layout designer. A great opportunity to discuss everything you''ve seen during X2011 West and reflect on how to apply your learnings to your layout!', 40, '', 60.00, 140, '0', 0, 0, '', NULL),
(96, 'P406', 'HAYES TRUCK MUSEUM /HEIDRICK AG HISTORY CENTER (handicap a<none>', '2011-07-06 13:00:00', '2011-07-06 17:00:00', 'The Hayes Antique Truck/Heidrick Ag History Center consists of two historical collections housed in a single 130,000-square-foot interactive exhibit. The cornerstones of these exhibits are the Fred C. Heidrick Antique Ag Collection, the world''s largest and most unique collection of one-of-a-kind antique agricultural equipment, and the Hayes Antique Truck Museum, recognized as the largest collection of antique trucks in the world. \r\n<p/>\r\nThe Heidrick collection in addition to farm implements and tractors ranging from an 1890 Deering Reaper to numerous Caterpillar, Holt, Fordson, and John Deere tractors from the 1920''s, this exhibit includes a restored City of Woodland horse drawn street car.  The Hayes Truck collection includes over 100 different makes of old trucks representing 94 different manufacturers including the one and only 1916 Breeding Steam Truck. And an ALCO Diesel - truck not locomotive', 20, '', -1.00, 48, '0', 0, 0, '', NULL),
(97, 'P305', 'PACIFIC SOUTHWEST CONTAINER', '2011-07-05 08:00:00', '2011-07-05 12:45:00', 'Pacific Southwest Container, a family-owned business founded in 1973, is the West Coast''s premier provider of packaging for shipping, display and protective needs.   With more than 750,000 sq ft between their Modesto and Visalia, CA facilities, they offer comprehensive services, from planning and design, to manufacturing for boxes ranging from plain brown and pre-printed shipping cartons, to product packaging and  point of purchase display materials.  To meet the growing consumer and retailer demand for green products, PSC embraces a new era of resource-efficient, environmentally-friendly design and manufacturing techniques.\r\n<p>\r\nThis informative and comprehensive tour will focus on PSC''s entire production cycle from sizing and forming of corrugated materials to high speed color printing and preparation for shipment.  This unique tour is limited in the number of participants to approximately 20 so reserve your spot quickly. \r\n<p><b>Long pants and closed toed shoes (no tennis shoes) are required.</b>', 80, '', 20.00, 15, '0', 0, 0, '', '2011-06-23 22:50:37'),
(98, 'P504', 'SACRAMENTO REGIONAL TRANSIT LIGHT RAIL MAINTENANCE FACILITY', '2011-07-07 10:30:00', '2011-07-07 13:30:00', 'The Sacramento Regional Transit District operates 64 bus routes and 37.5 miles of light rail using 182 buses and 76 light rail cars.  Thirty-six of the cars were built by Siemens and run on direct current.  The other 40 cars were built by CAF and run on alternating current.   Sacramento Transit draws current for both from the same overhead power line.  \r\n<p>\r\nThe light rail system consists of two lines, linking downtown Sacramento to the Interstate 80 corridor (Blue Line) and Folsom on US 50 (Gold Line).  A third line, the Green Line, is currently under construction and will eventually run from downtown to the Sacramento Airport.  Our tour will travel to the Facility by bus and return to the Convention Center on the Blue Line.\r\n<p>\r\nOur tour will cover three areas of the Maintenance Facility, the shop tour, a discussion of the dual power source line with visits and discussion of the two styles of car and a ride on a restored 1911 Sacramento Street Car affectionately nicknamed &quot;Miss Daisy&quot;.\r\n<p><b>Long pants and closed toe shoes required.</b>', 60, '', 20.00, 48, '0', 0, 0, '', NULL),
(100, 'P444', 'UNION PACIFIC ROSEVILLE YARD', '2011-07-06 12:30:00', '2011-07-06 16:00:00', '<b>Tickets for this tour will only be available at the tour desk at the Convention</b><p>\r\nThe Union Pacific Railroad is North America''s largest railroad, covering 23 states with over 32,000 miles of track.  The Union Pacific has almost 42,000 employees and over 8,300 locomotives.  For fallen flags followers the UP now incorporates the Missouri Pacific, Western Pacific, MKT, Chicago and Northwestern and the Southern Pacific.\r\n <p/>\r\nThe Union Pacific''s Davis Yard in Roseville, California is the largest and most modern Classification Yard on the West Coast.  Approximately 98% percent of all UP traffic in Northern California moves through the Davis Yard.  The Davis Yard greatly improves the UP network to and from Northern California for manifest carload traffic. Davis Yard blocks all cars for Northern California into zones for satellite yards such as Oakland, San Jose, Sacramento, Fresno, Stockton, Tracy, Warm Springs, Milpitas and Modesto to avoid additional switching at these yards.\r\n <p/>\r\nThe yard encompasses 915 acres.  It has 2 mainlines, 8 receiving and departure tracks and 55 bowl tracks with a capacity for 6,500 cars.  There are also 247 switches and a repair facility capable of repairing damaged cars in a single day.\r\n<p/>\r\nDuring our tour we will visit with the yard''s mechanics and the main control tower.  \r\n<p><b>Long pants and hard shoes (no tennis shoes)are required.</b>', 62, '', 20.00, 0, '0', 0, 0, '', '2011-06-24 19:38:09');
