(7, 'R007', '', '', 'Located in a freestanding 34X80 foot building, Bob''s free-lanced transition era layout contains a mountain scene with spectacular bridges, a city scene and a port complete with cargo ship. Bob''s 2,694 feet (over 80,000 ties) of hand-laid track includes a seven track passenger station, industrial switching district and a large classification yard. Equipment inventory in Bob''s O scale empire includes 117 locomotives, 43 cabeese and over 1,000 freight cars.																	', 'O', '', '', '100%', '34 x 80', '', '', '', 'yes', 2, 'N', 'N', '', 'Bob', 'Jakl', '(209) 743-7812', '', '', '5034 Mykleoaks Road', 'Mariposa', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(8, 'R008', '', '', 'Dave''s 2,000 feet of hand-laid track occupies a 30 X 70 foot area on the second floor of a freestanding building. The design is a loose interpretation of the SP from Sacramento to Sparks, but Santa Fe and Sierra Railroad steam locomotives roam the rails as well. xxx feet of snowsheds protect Dave''s mainline from that precipitation, which has covered the southern half of this spectacularly sceniced layout. Downgrade from the snow is a large engine facility with turntable and roundhouse.', 'O', '', '', '100%', '30 x 70', '', '', '', 'yes', 5, 'N', 'N', '', 'Dave', 'Viale', '(209) 742-5737', '', '', '5652 Pilot Peak Road', 'Mariposa', 'CA', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', NULL),
(9, 'R009', '', '', 'Tom''s Lionel trains are certainly not a &quot;Lionel layout&quot;. This freelanced transition era layout is fully sceniced and ballasted with many scratch-built structures and is definitely not a toy train set-up. Tom''s 24 X 36 foot layout features a liftable bridge for access into the central viewing area.', 'O', '', '', '100%', '24 x 36', '', '', '', 'Analog', 4, 'N', 'N', '', 'Tom', 'Davis', '(209) 742-6131', '', '', '4838 Usona Road', 'Mariposa', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(11, 'R011', 'Glenwood & Black Creek NG (and Central California Coast SG)', '', 'The G&amp;BC narrow gauge represents 1/2 of a mountain division. Heavy freight and passenger trains work from and to several staging yards across the 2 1/2% grades over Cumbres pass - most require helpers. In between 8 towns and industries are serviced by peddler freights. There is also a 35 scale mile heavy branch line regularly in use, and a branch and facilities depicting the West Side Lumber Company. The standard gauge loops through the layout and emulates the Southern Pacific. The layout is 98% sceniced.', 'HO HOn3', 'Free lanced', '1930''s to 1960''s Cal', '98%', '14 X 33 plus side rooms', '242''', 'Point to Point (but connected loop for open house)', 'Self devised card system', 'DCC and sound', 2, 'N', 'N', '', 'Jim', 'Vail  MMR', '831-423-7962', 'Afternoon (12:01pm -- 5:59pm)', 'akacoot@comcast.net', '760 Graham Hill Road', 'Santa Cruz', 'CA', '95060-1437', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(12, 'R012', 'Mystic Mountain Railroad', '', 'A back country shortline loosely set in the early 1900''s consisting of 1200'' of code 250 Nickel Silver track. The railroad can be run as a single large loop or two smaller loops, with several passing sidings, two small yards, six spurs, a wye and a reversing loop for turning trains, and many tunnels and bridges. The Mountain Division runs over rugged mountains and deep canyons, necessitating many steel bridges, tunnels, and a large, complex helix. A scratch built turntable/roundhouse is located at the North End yard in the Mountain Division. Trains can also be run point-to-point between the two yards. Trains are track and battery-powered, radio controlled using Train Engineer, and Revolution with SoundTraxx sound systems. Realistic train operations can be run for added interest. One unique feature is the use of concrete rock wall castings painted with artist acrylics. A panoramic view of Silicon Valley serves as a natural backdrop to the railroad.\r\n\r\nSeveral trains can be operated simultaneously point-to-point or continuously over rugged mountains and through deep canyons (concrete rock castings painted with acrylics). The most recent additions are the Acme manufacturing plant ("Everything for the wily coyote") and the wharf and Mercury Cannery at North End yard. A separate whimsical fairy garden runs a Fairy Train.', 'G', 'Freelance', 'early 1900''s', 'complete', '100'' x 80''', '1200''', 'Garden, dual-oval', 'switch list', 'Radio', 3, 'Y', 'N', 'http://www.mysticmountainarts.com/MMRR/', 'Ray', 'Turner', '408-272-9234', 'Evening (6:01pm -- 9:59pm)', 'ray@mysticmountainarts.com', '10251 Kenny Ln', 'San Jose', 'CA', '95127', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Switchlist', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(14, 'R014', 'Silicon Valley Lines', '', 'Founded in 1979, Silicon Valley Lines (SVL) is a freelance HO Scale Model Railroad Club located in San Jose, California. Construction of the current layout began in late 2000 and is located in the basement of an industrial building near downtown San Jose. The railroad occupies a 23'' x 72'' space, and is a multi-level design built using commercial steel C-channel as a benchwork system with over 600 feet of mainline. The upper level is a single-track division, while much of the lower level is double tracked. The layout features two large operating yards, as a well as ample hidden, yet accessible staging.\r\n<p/>\r\nWe operate using NCE DCC, and utilize Direct Traffic Control (DTC) operating rules.', 'HO', 'freelance', 'freelance', '50%', '72''x23''', '>600 feet', 'Multi-deck around the walls', 'DTC', 'NCE DCC', 4, 'Y', 'N', 'http://www.siliconvalleylines.com', '', 'SVL Club', '408-203-6910', 'Afternoon (12:01pm -- 5:59pm)', 'svl@siliconvalleylines.com', '148 E. Virginia Street', 'San Jose', 'CA', '95112', '', 40, 'Evoke Era', 'Purposeful', 'Moderate', 'Sequence', 'Computer', 'Disciplined', 'DTC', 'Unknown', 'FRS', '', '', NULL),
(15, 'R015', 'South Bay Historical Railroad Society', '', 'SBHRS operates two model train displays, HO and N-scale layouts in the historic Santa Clara Depot (Opened in 1864). Both layouts include extensive signalling. Like many model railroads, they are works in progress and are undergoing constant change. Both layouts have many handcrafted scenes, such as a winery, dam, two helixes, row homes and a yacht harbor (N-scale) and meat packing, lumber mill, oil storage tanks, plus a replica of the San Jose Southern Pacific Depot, ca 1950 (HO-scale).\r\n<p/>\r\nScenery is about 90% complete on both layouts.  Handicapped access ramp on track side of depot. ', 'HO N', 'Emphasis on SP, UP, ATSF and WP', 'Thru 1959; western states, with emphasis on CA', '90%', 'HO: 15 x 80 ft. N: 11 x 52 ft.', 'HO: 200 ft. N: Up to 177 ft.', '', 'HO: two mainlines and point-to-point; N: three mainlines', 'HO: DCC. N: DCC and DC', 5, 'Y', 'N', 'http://www.sbhrs.org', 'South Bay', 'Historical Railway Society', '408-296-7779', 'Morning (9:01am -- 11:59am)', 'johoff@ix.netcom.com', 'Santa Clara Caltrain Depot 1005 Railroad Avenue', 'Santa Clara', 'CA', '95050', '', 60, 'Mix of Eras', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(16, 'R016', 'Tuolumne Forks', '', 'Scenery is complete and detailed. The railroad is a logging and tourist line with sawmills and a large hotel set in the Roaring Twenties. I also have an On30 limestone layout with kilns, a stave mill, and cooperage, above my workbench. There is also a collection of pioneer On3 models.', 'O On3 On30', 'freelance', 'Sierras in the Roaring Twenties', '100%', '25 x34', '?', 'bent in loop', 'run trains around', 'CVP Easy DCC', 3, 'N', 'N', '', 'Bob', 'Brown MMR', '650-948-9361', 'Morning (9:01am -- 11:59am)', 'gazette@att.net', '985 Campbell Ave.', 'Los Altos', 'CA', '94024', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(17, 'R017', 'Cumberland West', '', 'Western Maryland and B&O railroads run side by side in western Maryland and northern West Virginia. Both railroads have major junctions in Cumberland and interchange traffic at several points. The B&O has Color Position Light signals controlled by five towers with touch-screen CTC panels.', 'HO', 'B&O and Western Maryland', 'Cumberland, MD 1953', '30%', '1200 Sq Ft', '180 ft each RR', 'One leval panorama - Single stage feeds all destinations', 'B&O - double track towers Rule 251; WM - Train Orders/Clearance', 'Digitrax DCC, Tower controlled interlocking section, telephones', 2, 'N', 'N', 'http://www.bayrails.com/layouts2.php?m=parks', 'David', 'Parks', '650-961-7644', 'Morning (9:01am -- 11:59am)', 'bearwestern@comcast.net', '1281 Windimer Drive', 'Los Altos', 'CA', '94024', '', 60, 'Few Comp.', 'Adheres', 'High', 'Real Time', 'CC & WB', 'Disciplined', 'TT&TO', '251', 'Telephone', '', '', NULL),
(18, 'R018', 'New York Central -- Valley Division', '', 'This large S scale layout represents the NYC in the Catskill Mountains in 1948.  Steam is resisting diesel pressure to retire early, but is losing the battle.  Hauling long freights and fast passenger trains over the mountainous terrain is a routine daily task on this layout.  Scenery is 95% complete with a detailed backdrop, huge mountains, tall waterfall, long bridges and an unusual lightning/thunderstorm animation.  Industrial areas include a coal mine, logging camp, sawmill, oil refinery and a city area.   Not only has this layout been featured in <i>Great Model Railroads</i> in 2005,  <i>Model Railroader</i> in November 2008,  <i>Model Railroad Hobbyist</i> e-zine in October of 2009 and <i>nmra magazine</i> in September 2010, the layout was also featured on PBS TV''s program TRACKS AHEAD. ', 'S Sn3', 'NYC and WSLCo.', '1948 in the Catskill Mountains', '95%', '20'' x 30''', '305''', 'Very Interesting', 'Yes....!!', 'DCC', 1, 'N', 'Y', '', 'Edward', 'Loizeaux', '650-962-1577 *no', 'Morning (9:01am -- 11:59am)', 'Loizeaux@SBCGlobal.net', '2221 Via Maderos', 'Los Altos', 'CA', '94024-7113', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(19, 'R019', 'Sonora Pacific & Southern Pacific', '', 'HO/HOn3 layout depicting a California narrow gauge railroad interchanging with the Southern Pacific in the 1940''s thru 50''s. It is a series of scenes, each with its own theme, set apart effectively by scenic dividers. It features very fine rock work and  fantastic scenery. There are freelanced depictions of Los Angeles, Westside Lumber, and  a gold mine/mill complex.  Featured in Railroad Model Craftsman and in Narrow Gauge and  Short Line Gazette.', 'HO HOn3', 'SP & Several California NG R/R''s', '1940''s & 50''s California', '90%', '20''  X  20''', '80 ft.', 'Bent dog bone N.G.,  & bent figure eight S.G.', '', 'DC Radio Controlled', 3, 'N', 'N', 'http://fjohnlabarba.com/25401.html', 'F. John', 'LaBarba', '831-423-1109', 'Evening (6:01pm -- 9:59pm)', 'fjohnlab@earthlink.net', '741 Redwood Drive', 'Santa Cruz', 'CA', '95060', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(20, 'R020', 'D&RGW Durlin Branch', '', 'The Durlin Branch is a free-lance mountain branch line of the narrow gauge D&RGW fourth division hauling general freight, coal, ore concentrates, livestock and passengers. The branch ties into the San Juan Extension at Chama NM, with Durango CO to the west and Alamosa CO to the east represented by staging. The Durlin branch climbs a steady 3.8% grade through Cresco and Toltec Tunnel up to Carrumba where the line splits. One line continues on to Fritz Park, then descends a 4% grade through Resin Creek to Durlin. The other branch serves a large coal mine (stolen from the D&RGW third division) at Flint.  Steam locomotives rule with operations augmented by water tank, coal tower, ashpit, stock chute sounds and/or animation. \r\n\r\nFeatured  in <i>Model Railroader</i> May 2000, <i>The Finescale Railroader</i> 2003 Narrow Gauge Annual,  and <i>Model Railroad Hobbyist</i> April 2011.', '1/4" = 1 ft (On3)', 'D&RGW narrow gauge', 'pre-1936;Southwest Colorado, Northern New Mexico ', '90%+', '17ft X 27ft', '120 ft', 'Point to Point, Double Deck, Walk-Around, Hidden Staging', 'TT&TO, 4:1 fast clocks, CC&WB with car weights and load tonnages', 'DCC (Easy DCC, radio throttles, Soundraxx DSD and Tsunami sound)', 3, 'N', 'N', '', 'Dave', 'Adams', '408-244-1850', 'Evening (6:01pm -- 9:01pm)', 'dadamsc16@sbcglobal.net', '1464 Lamore Drive', 'San Jose', 'CA', '95130', '', 60, 'Full', 'Purposeful', 'High', 'Fast Clock', 'CC & WB', 'Casual', 'TT&TO', 'N/A', 'Telephone', 'http://www.x2011west.org/albums/adamsDave', '', NULL),
(21, 'R021', 'D&ELP', '', 'The region is the area between Deming and El Paso, with Deming and El Paso represented. Interchanges with the BNSF are modeled in Deming and in El Paso. The SP crossing of the Rio Grande west of El Paso is depicted. The era is modern. Scenery is about 20% complete, perhaps a little more.', 'HO', 'SP', 'Modern, southern New Mexico between Deming and El Paso', '20%', 'L shaped triple deck, 21 x 16 x 11 feet.', '240 feet', 'Out and back, continuous loop, dual helix', 'Car Card', 'DCC', 2, 'N', 'Y', '', 'Mark', 'Stearns', '831-899-3837', 'Evening (6:01pm -- 9:59pm)', 'steaks@juno.com', '1331 Waring Street', 'Seaside', 'CA', '93955', '', 40, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', NULL),
(22, 'R022', 'Union Pacific in Niles Canyon', '', 'The layout is set in the East Bay Area in 1999. The railroad represents the former Western Pacific San Jose and 1st Subdivisions, now the UP Niles, Oakland and Milpitas Subdivisions. The railroad is a branchline which supports an Auto plant (NUMMI) and a number of smaller industries.\r\n<p/>\r\nDispatching is by TCS (using CATS) which replicates a Digicon console. All signals are repeated on color lite signals above the layout. A unique feature of the layout is that there is no yardmaster, only a clerk. This is because the prototype Milpitas Yard has no permanent switcher. The clerk is responsible for managing the yard and the neighboring NUMMI complex, writing switch lists to instruct the crews where to place cars. All crews do their own work when passing through the yard. We expect the layout to be 70% sceniced by AS X2011W.', 'HO', 'Union Pacific', 'Spring 1999, East Ba', '70%', '12'' x 35''', '120 foot visible', 'Folded dogbone with staging', 'dispaching is CTC, car forwarding with clerk and switch lists', 'NCE DCC Radio', 3, 'N', 'N', 'http://www.bayrails.com/layouts2.php?m=neumann', 'Seth', 'Neumann', '650-965-4687', 'Afternoon (12:01pm -- 5:59pm)', 'sneumann@pacbell.net', '2712 Katrina Way', 'Mountain View', 'CA', '94040', '', 60, 'Few Comp.', 'Adheres', 'High', 'Fast Clock', 'Switchlist', 'Disciplined', 'CTC', 'Unknown', 'FRS', '', '', NULL),
(23, 'R023', 'ATSF Coast Lines, Fourth District, Valley Division', '', 'HO Scale proto-freelanced extension of the Santa Fe in the early 1970''s from the San Francisco Bay Area to Portland; modeled portion runs from the Central Valley town of Chico to McCloud just south of Mt. Shasta in a purpose-built 30'' x 49''room. Double deck point to point, mainline 85% complete with approx. 550 feet of track in place, permanent track is all hand laid. 30% sceniced. Dispatcher; interlocking tower; large yard with two switch crews and yardmaster/hostler; small yard with a full time switcher; heavy duty freight with some passenger; local switching; branchline. Wireless NCE DCC; FRS radios; Track Warrants; car cards and waybills. 46"duck under to enter layout during session.\r\n', 'HO', 'Santa Fe', 'Early 1970s, between SF Bay Area and Pacific Northwest', '30%', '1240 sq ft, 30ft x 49ft', 'Approx 550ft', 'Double deck point-to-point walkaround w/penninsula', 'Track Warrants, Car Cards/Waybills', 'Wireless NCE DCC', 3, 'N', 'Y', '', 'Rick', 'Fortin', '408-266-7245', '9:00am -- 9:00pm', 'rick@fortinweb.com', '5305 Alan Ave', 'San Jose', 'CA', '95124', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(24, 'R024', 'ATSF&SP', '', 'Diesel to steam transition, heavy on steam. Emphasis on extreme detailing and smooth running. About 50% sceniced with generic Ca theme. Double track mainline, 6 track passenger station, 13 track yard, and 14 stall roundhouse with 18 garden track. Tsunami sound.', 'O', 'Santa Fe and Southern Pacific', '1947-1951, generic California location', '50%', '20'' X 40''', '110''', 'Double track loop with large yard & engine terminal', 'Basically just watching highly detailed trains run', 'DCC', 2, 'N', 'Y', '', 'Gary', 'Schrader', '408-227-9491', 'Afternoon (12:01pm -- 5:59pm)', 'gs-sj@earthlink.net', '4201 Kingspark Drive', 'San Jose', 'CA', '95136', '', 40, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', NULL),
