(72, 'R072', '', '', '', '', '', '', '', '', '', '', '', '', 6, 'N', 'N', '', '', 'Witzens', '', '', '', '', 'Elk Grove', 'CA', '', '', 20, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(81, 'R081', 'Napa Valley Northern Railway', '', 'The Napa Valley Northern is a north-south bridge route from Stockton, CA to Portland, OR competing with the SP Cascade Route and the WP-GN/BN Inside Gateway route. The layout itself is the trackage from the Port of Napa, CA north through the Napa Valley then through the Mayacmas Mountains past Clear Lake to Ukiah, CA. Many of the past and present industries of the Napa Valley region are included in the local freight collection/distribution system. Connecting with the AT&amp;SF/BNSF, SP and WP/UP through Stockton plus the BN/BNSF, GN, NP, MILW, and UP at Portland, the NVN hosts various eras of run-through trains from 1940-era steam freight and passenger through 1970-era pool power freights to 2000-era Amtrak and double-stack inter-modal trains.  The club was featured in Scale Rails in early 2004.', 'HO', '', '', '100%', '125 x 15', '', '', '', 'DC and DCC', 2, 'N', 'N', 'http://www.nvmrc.org', ' Napa Model', 'Railroad Club', '', '', '', '575 Third Street', 'Napa', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(83, 'R083', 'Crockett Central', '', 'The layout represents a portion of the original transcontinental railroad and old Southern Pacific Railroad running between Oakland, CA and Sparks, NV . The timeframe varies from the 1950''s to present, allowing both steam and diesel locomotives to be operated through time appropriate scenery on the layout. Notice that the mainline is double tracked allowing operators to swiftly run from destination to destination without stops at sidings to wait for trains to meet and pass. The track is constructed on three levels with two large helixes on opposite corners providing a connection. The &quot;mushroom style&quot; layout is narrow with long tabletops that are stacked like bunk beds. This design provides maximum linear track space without having unrealistic twists back and forth, an undesirable but typical characteristic of older &quot;spaghetti bowl&quot; designs. Code 100 track is used on the 1st level and helixes only, and Code 83 track is used on the rest of the layout. Nominal minimum track radius is 48 inches.  Maximum 2% grade is found on the helixes. The club consists of 50 members, is growing and  welcomes new members. The UP mainline passes adjacent to the club''s second floor location.', 'HO', '', '', '30%', '30 x 60', '', '', '', 'DCC', 2, 'N', 'N', 'http://www.cmrstrainclub.org', '', 'Carquinez Model Railroad Society', '', '', '', '645 Loring Avenue', 'Crockett', 'CA', '94525', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(87, 'R087', 'Black Diamond Lines', '', 'The Black Diamond Lines Model Railroad Club began in July 1981 as a group of model railroaders who gathered in the back of a local hobby shop. Later that year, they incorporated as a non-profit organization and in December began work on their first layout, located in the Contra Costa County Fairgrounds.  In December of 1985, the fairgrounds decided not to renew the club''s lease and they we were forced to move to a location obtained through the City of Antioch in May 1986, where the layout remains to this day.\r\n<p/>\r\nThe Black Diamond Lines is an HO scale layout layout that occupies approximately 1500 square feet of space.  Track elevation ranges from 46 to 82 inches above floor level. All track is hand-laid on wooden ties, and all turnouts and crossings are hand made in place.', 'HO', 'Freelance', 'Transition', '', '1500 sq ft', '437''', 'point to point with continuous running capability', 'Single track mainline and branch line', 'DC and DCC', 4, 'Y', 'Y', 'http://www.blackdiamondlines.org', '', 'Antioch Model Railroad Club', '', '', '', '425 Fulton Shipyard Rd', 'Antioch', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Switchlist', 'Unknown', 'TT&TO', 'Unknown', 'Radio', '', '', NULL),
(88, 'R088', 'Union Pacific & Summit County RR', '', 'The Union Pacific and Summit County is multi deck HO scale layout in a 30''x48'' purpose-built building.  Currently only the Summit County Railroad portion is operational and occupies roughly 30% of the space.  The Summit County is a proto-freelance railroad based on the UP''s Park City branch, hauling coal, ore and livestock.  It connects to Union Pacific''s double track transcontinental mainline at Echo.  The yet-to-be-built portion models Ogden and the Weber and Echo Canyon portions of UP''s trackage.  The operating system is TT&TO with telephones for communication.  The sound equipped, primarily steam engine roster is controlled with an NCE Radio DCC system. Freight is forwarded with a CC&WB system and all turnouts are Tortoise controlled.  Scenery is underway and with a 75% completion goal by the convention.', 'HO', '', '', '75%', '30 x 48', '', '', '', 'NCE', 3, 'N', 'N', '', 'Phil', 'Gulley', '(530) 823-2627', '', 'gulley@pasco.com', '2475 Buena Vista Lane', 'Auburn', 'CA', '', '', 60, 'Few Comp.', 'Adheres', 'High', 'Fast Clock', 'CC & WB', 'Casual', 'TT&TO', 'N/A', 'Telephone', '', '', NULL),
(89, 'R089', 'NWP', '', 'Retired art teacher Richard Batho has focused on the quality of his "atmospheric perspective" backdrops for this Northwestern Pacific layout.  The main backdrop features Mount Shasta and the surrounding topography.  This fully-sceniced pike represents a fictitious NWP branchline that ran to the base of Mount Shasta.  Richard''s continuous running dogbone layout uses steam and early diesels to operate.  One main staging yard feeds the industries while passenger operation completes the theme and is still a large focus of revenue for the branch.  ', 'HO', '', '', '100 %', '16 X 9', '', '', '', 'Analog', 4, 'N', 'N', '', 'Richard', 'Batho', '(530) 644-0548', '', '', '2786 Alder Drive', 'Camino', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(90, 'R090', 'San Juan Railroad', '', 'The San Juan Railroad is built in O scale and features four different gauges, O Standard gauge, On2, On3 and On30 narrow gauges. The layout is set in Colorado and is dated in the 1920''s with mining as the primary theme. The main yard features both the standard gauge and the start of a 3'' line leading to the mountain division and a mining area where there is a 2'' mining line. At both ends there are several dual gauge turnouts. There is an area modeled after Georgetown loop with a similar high bridge and a Forks Creek area, named &quot;Spoon Brick&quot;. Locomotives are all steam pulling wood cars. Scenery is well along and the backdrop painting is about half done.', 'O On2 On3 On30', '', '', '60%', '22 X 33', '', '', '', 'DC', 2, 'N', 'N', '', 'Steve', 'Polkinghorn', '(530) 644-6945', '', '', '4221 Happy Hollow Ln', 'Camino', 'CA', '', '', 30, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(91, 'R091', 'SP Black Butte Sub', '', 'The 1955 SP Dunsmuir Shasta Division layout has four levels and is viewed from the main floor or elevated walkways.  It is a loop to loop to loop design and features three main line freights and three passenger trains: the Klamath Mail Train, the Cascade and the Shasta Daylight.  Presently there are about 300 feet of track.  When completed there will be over 10 scale miles (600 feet) of main line. Level One staging is at Gerber, under the peninsula, about 40 inches off the floor.  Level One also includes the Gerber, Red Bluff and Redding stations. Level Two has Dunsmuir, at 55 inches above the floor.  It is the main viewing point as you enter the room.  It is built to mostly exact scale, using the SP drawings for trackage and buildings.  The Dunsmuir South yard is at 44 inches and holds about 360 cars.  From Dunsmuir, through the Sacramento River Canyon, you travel over 250 feet as you pass through Small, Cantara Loop, Mott, Azalea, and arrive at Mount Shasta.  Mount Shasta has an interchange with McCloud River Lumber Co. - then continuing on to the third level, you reach the Black Butte Wye.  From here it splits to either the Siskiyou Line, which takes you to the lumber town of Weed, or head straight through to Grass Lake and the Klamath Falls Staging yard.  Once you reach Grass Lake, you have traveled almost 10 scale miles.  ', 'HO', '', '', '15%', '24 X 42', '', '', '', 'NCE', 2, 'N', 'N', '', 'Walt', 'Schedler', '(408) 431-1660', '', '', '1140 Third Street', 'Colusa', 'CA', '', '', 20, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(92, 'R092', 'SP Prototype', '', 'John is an Amtrak engineer who has undertaken the restoration of a Southern Pacific steam locomotive to operating condition. At this stop we will get to meet John and see the work he is doing to put SP #2706, a C-8 consolidation (2-8-0) back into operation. John has recently completed erecting a new shed to hold the locomotive during this process. In addition to the tender from #2706 John also has two other SP tenders on the property.', '1 to 1', '', '', '', '', '', '', '', '', 4, 'N', 'N', '', 'John ', 'Manley', '(650)270-6044', '', '', '1351 Parkhill Street', 'Colusa', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(93, 'R093', 'Picket Fence Antiques', '', 'A 16'' x 12''  "dog-bone" layout is O-gauge high rail, set in no particular locale, during the age of steam. It will be an expanded re-creation of the more detailed toy train layouts of the 1940s. Motive power is entirely Gilbert American Flyer from the 1939-1942 period.\r\n<p/>\r\nIt is in 3/16" scale, using castings nearly identical to the two-rail Flyer "S" gauge designs made after the war. At least one example of every locomotive type made by Gilbert is displayed, and most run. At this time, Lionel did not manufacture either a 4-8-4, or an 0-8-0. Passenger equipment is also Flyer from that period, and is diecast. These foot-long 12-wheel cars were available in just two colors, Tuscan (much less common) and dark green. I choose not to run any Flyer tinplate. Freight equipment is Marx 3/16" scale tinplate from the 1940s and 1950s, chosen over similar Flyer items, due to possessing far superior graphics. Flyer did make some very nice diecast freights, but weight becomes a serious issue for any consist over 4-5 cars. The change to Marx required that tender trucks be replaced on the freight haulers, due to coupler incompatibility. The layout is operated as it would have been back in the days - no fancy electronics, smoke or sound systems. What little automation exists, such as anti-derailing at the crossovers, is accomplished with insulated rails and hard wiring.\r\n', 'O', '', '', '20%', '10 X 14', '', '', '', 'Analog', 4, 'N', 'N', '', 'Richard', 'Hosmer', '(530) 458-8965', '', '', '334 Market Street', 'Colusa', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(95, 'R095', 'Cobre Mining Co.', '', 'O Meter Gauge [Narrow Gauge] with a 288 foot main line and a small yard and branch line. The Main Line winds and loops through backyard. Track built with Code 148 and Code 160 rail.  Trains are Swiss Narrow Gauge & Freelace Narrow Gauge Mining.', 'O meter', '', '', '100% garden', '40 X 60', '', '', '', 'Battery', 4, 'N', 'N', '', 'Joel', 'Segel', '(916) 933-2038', '', '', '2067 Woodmar Dr', 'El Dorado Hills', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(96, 'R096', 'Santa Fe Hereford Sub', '', 'The layout represents the 104 mile Hereford Subdivision of the Santa Fe from Clovis, NM to Amarillo, TX in 1983.  The layout features one active junction as well as interchange with the Burlington Northern at Amarillo and was designed with prototype operations in mind.  The primary commodities transported include; TOFC, automobiles, grain, and manufactured goods.  Scenery is specifically patterned after the prototype where possible. An article on this layout appeared in the January 2011 Railroad Model Craftsman.', 'HO', 'ATSF', '1980s', '30%', '22 X 18', '', '', '', 'Digitrax', 3, 'N', 'N', '', 'Robert', 'Hoffman', '(916) 684-6759', '', 'QLANY@aol.com', '9479 Dunkerrin Way', 'Elk Grove', 'CA', '', '', 40, 'Full', 'Tight', 'High', 'Sequence', 'Switchlist', 'Disciplined', 'CTC', 'N/A', 'Signals', '', '', NULL),
(97, 'R097', 'Chicago, Ohio & Eastern', '', 'Greg''s layout depicts a Mid-western railroad and is being modeled in the 1948 to 1955 steam to diesel transition period. The layout is designed to support up to 4 trains running simultaneously and signaling of the layout is underway. One of the scenic features is a 10 foot wide valley with steel bridges and wood trestle work spanning it with a maximum height of 150 scale feet.', 'HO', '', '', '20%', '12 x 19', '', '', '', 'DCC', 2, 'N', 'N', '', 'Greg ', 'Austin', '(916) 670-6353', '', '', '9009 Tessara Ct', 'Elk Grove', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(98, 'R098', 'Oahu Sierra', '', 'The Oaho and Sierra runs from Roseville to Truckee over Donner Summit, but this layout also features a narrow gauge line, the Michigan Cal Lumber Co. This second line runs from Camino to Pino Grande.  Scratchbuilt lumber mills, the enclosed Truckee roundhouse and the Roseville PFE ice plant are just a few of the highlights on Bill''s layout.', 'HO', '', '', '100%', '20 X 44', '', '', '', 'DCC', 4, 'N', 'N', '', 'Bill', 'Eversult', '(916) 961-3675', '', '', '8219 Oahu Drive', 'Fair Oaks', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(99, 'R099', 'Union Pacific - Columbia River Gorge', '', 'This loop to loop railroad features the Union Pacific''s Columbia River Gorge in a large room in back of the owner''s garage.  This layout is superbly detailed with excellent scenes.  The engine servicing facilities, forests, and scratch built structures give this layout top notch quality.  The layout is operated mostly by steam, but there are few diesels here and there in service.  The realistic scenery along the gorge and through The Dalles, Oregon is excellent.\r\n', 'HO', '', '', '50%', '15 X 37', '', '', '', 'DCC - Digitrax', 3, 'N', 'N', '', 'Tom', 'Weissgerber ', '(916) 985-7311', '', 'tom.weissgerber@intel.com', '213 Saddle Court', 'Folsom', 'CA', '', '', 60, 'Few Comp.', 'Purposeful', 'High', 'Fast Clock', 'CC & WB', 'Casual', 'TT&TO', 'Unknown', 'Telephone', '', '', NULL),
(100, 'R100', '', '', '', 'AF', '', '', '', '', '', '', '', '', 6, 'N', 'N', '', 'Berry', 'Menges', '(209) 745-0465', '', '', '72 A Street', 'Galt', 'CA', '', '', 0, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(101, 'R101', 'Denver & Welch River Southern', '', 'Terry''s freelanced HOn3 layout is based on D&amp;RGW and RGS equipment and locations. Features include sound equipped locomotives and nearly complete scenery. The modeled yard is based on Chama, Colorado and the layout includes a mirror image of Ophir, CO.', 'HOn3', '', '', '90%', '13 x 13', '', '', '', 'Digitrax DCC', 2, 'N', 'N', '', 'Terry', 'Schmidt', '(916) 903-7305', '', '', '1888 Levi Strauss Ct.', 'Gold River', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(102, 'R102', '', '', 'The presently under construction freelance narrow gauge layouts are based on the logging and mining areas of the northwestern United States.<p/>\r\nThe HOn3 layout is a point-to-point design with three different starting locations. There are two logging sites and a mining district with six mines. Passing various rural stops the trains travel down hill to a lumber mill and town at a &quot;Dog Hole&quot; bay on the Pacific Ocean. One of the logging sites utilizes dual gauge track to allow the running of standard gauge geared locomotives. Both the HOn3 and Std gauge engines are serviced at the main yard and shops using a dual gauge turntable. Logs hauled on standard gauge equipment are not interchanged for shipment to the mill but &quot;dumped&quot; down a bluff similar to the prototypical operations at Caspar Lumber Co, in Mendocino, CA. The mining district is modeled to represent activity during one of Nevada''s boom cycles. Grades to the mining and timber areas are steep, well over 10% on many sections. Trains are controlled by three wireless throttles using nine blocks and DC power. <p/>\r\nHoused in a separate room, Larry''s second layout represents a lush mountainous lumber and mining community. Beginning and ending in a yard, trains run on a half dog bone track plan through scenic timberlands of the coastal regions of Oregon and Washington. Trains are powered using Digitrax.\r\n', 'HOn3', '', '', '50%', '16 X 20 ', '', '', '', 'DC', 1, 'N', 'N', '', 'Larry', 'Moll', '(916) 791-1507', '', '', '9217 Purdy Lane', 'Granite Bay', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(103, 'R103', 'Sierra, Hetch Hetchy & Pickering', '', '', 'HO', '', '', '', '20 X 20', '', '', '', '', 6, 'N', 'N', '', 'Steve', 'O''Brien', '(530) 273-5366', '', '', '12156 Pine Crest Dr', 'Grass Valley', 'CA', '', '', 30, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(104, 'R104', 'Oregon I-5 RR', '', 'Bill has constructed a  layout with a 300 foot long mainline, some branch lines and a few yards. The prototype is contemporary times of modern trains running on the Union Pacific over the Cascades in Oregon. This is a large layout with lengthy trains running well on steep grades and relatively tight curves.', 'HO', 'UP', 'Modern Day', '30%', '25x30', '', '', '', 'Easy DCC, radio', 3, 'N', 'N', '', 'Bill ', 'Horstmeyer', '(415) 971-1689', '', 'bhorstmeyer@comcast.net', '76 Via La Cumbre', 'Green Brae', 'CA', '', '', 40, 'Few Comp.', 'Adheres', 'Moderate', 'Sequence', 'Switchlist', 'Disciplined', 'TWC', 'N/A', '5ch Radio', '', '', NULL),
(105, 'R105', 'C&O Alleghany Subdivision', '', 'Main line extends from Alleghany, Virginia to Prince, West Virginia with staging representing Clifton Forge, VA and Handley, WVA. There is a branch line off the main at Prince leading to the town of Raleigh, WVA with three coal mines to work and some industries in the town of Raleigh. Mainline industries include a large power plant, limestone quarry, produce distibuter, lumber mill, lumber yard, and coal dealer. Most online towns have a freight station to work. 5 passenger trains operate during a session as well. Operating sessions, when I have them, last 5 hours with a meal break in the middle.', 'HO', 'C&O', 'Summer 1947, Eastern West Virginia', '90%', '22'' x 48''', '5 scale miles', 'Walk-around, loop to loop staging', 'Run Trains on quasi C&O schedule for the day shift', 'DCC', 3, 'N', 'N', '', 'Andy', 'Schnur', '(925) 283-4476', 'Morning (9:01am -- 11:59am)', 'Schnurae@netzero.com', '853 Solana Drive', 'Lafayette', 'CA', '94549', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(106, 'R106', 'Southwest RR - a Division of the Santa Fe', '', 'This HO layout features three main functions for viewers to see; passenger train service and operations, logging and milling representation, and lumber and mining operations. Lumber Mill Company is named &quot;Falling Timber Lumber Co.&quot; The mine name is &quot;Cash Mine Operations&quot;. The owner and modeler''s motto is: ''The Unlimited possibilities of a free lancing layout and limitless use of imagination to recreate Real Life.''  Both analog and digital.  Special &quot;bonus feature&quot; in the backyard.', 'HO', '', '', '60%', '11 X 20', '', '', '', 'Both analog and digital', 1, 'N', 'N', '', 'Hugo', 'Solano', '(916) 543-9868', '', '', '2777 Black Hawk Lane', 'Lincoln', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(107, 'R107', 'Wilson''s Trains', '', 'This G Scale layout has several draw and lift bridges running throughout the interior of Sandy''s home.  Computerized automation control is run from a laptop and routes are forwarded and digitally choreographed.  Computer controlled speed by detecting analog voltage through I/O cards.  Runs from staging in family room down the hallway, through the kitchen, and back into staging.  Is a must-see for modelers interested in electronic train forwarding.  ', 'G', '', '', '', '50 X 30', '', '', '', 'Analog ', 4, 'N', 'N', '', 'Sandy', 'Wilson', '(916) 434-8593', '', '', '1738 Gingersnap Lane', 'Lincoln', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(108, 'R108', 'Harper Valley', '', 'Don''s aptly named Harper Valley is a freelanced, fully sceniced bi-level Sn3 layout.  Don says he builds what likes.  And we like what he builds, especially his fifty plus scratch built structures.  The Harper Valley has been seen in Model Railroading in March 1988, Model Railroad Craftsman in April 1990 and June 2004, 3/16 Scale Model Railroading in June 1991, Great Model Railroads in 1999 and Narrow Gauge Gazette in April 2004.', 'Sn3', '', '', '100%', '13 X 20', '', '', '', 'Analog', 1, 'N', 'N', '', 'Don', 'Harper', '(925) 447-0902', '', '', '1091 Essex Street', 'Livermore', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(109, 'R109', '', '', 'Arden''s large 40x40 layout is designed to pull long forty car Union Pacific trains behind Big-Boys, Challengers and Turbines between Laramie, WY and Sherman Hill.  His large mountain scenery runs from 48 to 88 inches in height and is geographically correct for the line he models.   This layout has a double tracked main, with 1% grades and center passing sidings.    Arden''s layout can run either DC or DCC.', 'S', '', '', '', '40x40', '', '', '', 'DC or DCC', 1, 'N', 'N', '', 'Arden', 'Goehring', 'none available', '', '', '12635 Tokay Colony Rd', 'Lodi', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(113, 'R113', '', '', 'Ray''s specialty is hand-crafting exquisite model buildings in HO scale (1/87 actual size).  He begins by milling his own miniature lumber and then constructs each building "board by board."  Dozens of his model buildings will be on display, including scale models of the Mariposa courthouse and the former Yosemite Valley Railroad depot in El Portal.  In addition to showcasing his buildings, his layout also features a wide variety of rolling stock (including a Hershey train), a video camera onboard one of his trains, and multiple track routes.\r\n\r\nAccess is by a full flight of steep stairs.  ', 'HO', '', '', '', '', '', '', '', '', 1, 'N', 'N', '', 'Ray', 'Price', '(209) 966-5168', '', '', '5429 Carleton Road', 'Mariposa', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(115, 'R115', 'Midland Rockies and Western', '', 'This layout is a free-lanced, HO scale set in about 1939, with steam and early diesel locomotives.The track is in a twisted figure-8 pattern, with passing sidings, and a turntable and engine facilities at either end. Overall shape is a "G".  The entry from the room door is to a 30" wide aisle. Layout is built of 1"x2" L-girders, on legs at 49" high, with code 83 nickel silver flex-track on Tru-Scale wood rail bed, and grades of 1-2%. Power is DC, with block operating system and signal lights.  There are tunnels with entry to hidden tracks. The scenery is over 95% complete, with prairie, mountain, high desert features, and there are mechanical and light animations.  Many of the models have won awards.', 'HO', 'free-lanced', '', '95%', '10 X 13', '54''', 'figure 8', '', 'DC block control', 2, 'N', 'N', '', 'Bob ', 'Wirthlin MMR', '(925) 228-8940', '', 'ddsmmr@att.net', '187 Blue Canyon Way', 'Martinez', 'CA', '94553', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(116, 'R116', 'Sierra RR', '', 'This three level HO layout of the Sierra Railroad in the 1920''s is only 25% sceniced as of this writing. Why? Because Glenn did what we all dream about -  tore down a wall and more than doubled the size of the layout. The part that is complete is highly accurate as to the prototype and we expect the percentage will be much higher come tour time. In addition to the layout, you will want to see Glenn''s room for visiting grandchildren: an indoor replica of a 1923 vintage caboose, complete with cupola, bunk beds and coal stove.', 'HO', '', '', '25%', '12 X 50', '', '', '', 'EZ DCC', 3, 'N', 'N', '', 'Glenn', 'Sutherland', '(209) 742-6131', '', '', '5090 Chamberlain Road', 'Midpines', 'CA', '', '', 20, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', NULL),
(117, 'R117', 'Central Sierra Pass Railway', '', 'Not too long ago, Les acquired a neighboring room for his railroad to expand and evolved a mature, nearly complete model of a Sierra inspired railroad into a very strong representation of much of the Sierra Railroad.  The trackage grew from approx. 150 ft to approx. 350 ft of main line, and the railroads  4 or 5 regular operators gained a heightened sense that they are repeating history on the Sierra Railroad.  Les'' layout has areas of interest to almost all visitors.', 'HO', '', '', '21 X 24', '21 X 24', '', '', '', 'NCE radio DCC', 3, 'N', 'N', '', 'Les', 'Gregory', '(209) 522-1120', '', '', '1413 Glenwood Court', 'Modesto', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(118, 'R118', 'Wolf Creek Railway of California', '', 'An HO scale Shortline steam railroad set in 1927, Tom''s Wolf Creek Railway of California is located in the foothills of California.  He has many scratch built structures,  wooden truss rod cars and a few custom built brass locomotives following Sierra Railway prototypes.  Tom has a strong interest in operations using JMRI''s (DecoderPro) switch list program.  His point to point design, interchanges with his son''s Buffalo Creek &amp; Grizzley Ridge Railway, another small point to point layout. Some dual gauge trackage. Above the Wolf Creek HO layout is the start of an HOn3 layout, the Nevada County Narrow Gauge Railroad (Nevada City, track only no scenery). All in all this is an HO scale empire, short trains battling steep grades, floods, fights, Indian raids and sometimes not being able to leave the station at all.', 'HO HOn3', '', '', '70%', '10 X 24', '', '', 'JMRI operations', 'NCE DCC', 2, 'N', 'N', '', 'Tom', 'Milam', '(209) 522-5649', '', '', '712 Kazmir Court', 'Modesto', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(119, 'R119', 'Morada Belt', '', 'Dave''s Morada Belt is HO scale, set in the 1950''s with 360 feet of mainline (not all of it installed yet) as well as a 35-foot branch line (yet to be installed).  Track is commercial code 83 and code 70, a &quot;point to loop&quot; design with 30&quot; minimum radius on the main track, one staging and two working yards.  The main yard is still under construction. Scenery ranges from Tehachapi-style semi-arid to sandstone cliffs (reminiscent of Eagles Nest, Montana on the Milwaukee Road) to the Sierra Nevada foothills.  Backdrops were painted by noted artist and book author John Signor. It is a trackage-rights operated bridge line used by several of the large western carriers of the 1950''s, utilized when their own corridors are congested.  This is a model railroad designed by a real-life railroader for operating sessions, without sacrificing the scenic beauty of the west.', 'HO', '', '', '50%', '20 X 20', '', '', '', 'DCC', 3, 'N', 'N', '', 'Dave', 'Stanley', '(209) 985-8928', '', '', '4916 Ridgewood Court', 'Morada', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(121, 'R121', 'Timbercreek Railroad', '', 'The freelanced Timbercreek Railroad is a branch line off the Southern Pacific RR at Truckee, CA from the East end of the Truckee yard. The SP is only visible at Truckee, the rest of the SP is under the layout as the staging area.  The rest of the layout is the Timber Creek Railroad which is the main emphasis, and takes up the whole inside of the building less the Truckee area. Also included is an On3 logging operation that starts at Truckee, CA and ends up in Timber Creek. The railroad includes the towns of Timber Creek, Moss Ridge, and Grizzly Flats.  The entire "O-Scale" layout is built to Proto 48 standards. All locomotives and rolling stock have had the wheels changed to Proto Craft wheel sets and/or machined in house by Gordon. ', 'O', '', '', '100%', '24 x 36', '', '', '', 'Analog', 1, 'N', 'N', '', 'Gordon', 'Briggs', '(530) 273-9145', '', '', '13371 Mystic Mine Rd', 'Nevada City', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL);
INSERT INTO `prod_eventtools_layouts` (`layout_id`, `layout_num`, `layout_name`, `layout_short_description`, `layout_long_description`, `layout_scale`, `layout_prototype`, `layout_era`, `layout_scenery`, `layout_size`, `layout_mainline_length`, `layout_plan_type`, `layout_ops_scheme`, `layout_control`, `layout_accessibility`, `layout_wheelchair_access`, `layout_duckunder_entry`, `layout_owner_url`, `layout_owner_firstname`, `layout_owner_lastname`, `layout_owner_phone`, `layout_owner_call_time`, `layout_owner_email`, `layout_street_address`, `layout_city`, `layout_state`, `layout_postcode`, `layout_local_url`, `layout_status_code`, `layout_fidelity`, `layout_rigor`, `layout_documentation`, `layout_session_pace`, `layout_car_forwarding`, `layout_tone`, `layout_dispatched_by1`, `layout_dispatched_by2`, `layout_communications`, `layout_photo_url`, `layout_mark_changed`, `layout_last_mod_time`) VALUES
(122, 'R122', 'Oregon, Washington Navigation & Railway', '', 'The OWNRy (Oregon, Washington Navigation & Railway) is a protolanced N scale layout based in Pacific Northwest. With Portland, Oregon as the major division point, 5 major Class 1 railroads intersected both freight and passenger traffic.  \r\n<p/>\r\nThe Union Pacific, delivers freight and passengers to and from Portland and the east coast via La Grande, Oregon. The SP&S (jointly run by both GN and NP) runs from Spokane through Pasco, WA, then along the North Bank to Portland.  The Southern Pacific serves as a conduit from Portland to California.  Pool traffic runs from Seattle and Tacoma to Portland. The OWNRy also operates a fictional branchline from Yakima and Walla Walla and Lyons Ferry to Pasco, Washington for interchange. 3 yards classify freight for destinations.\r\n<p/>\r\nCTC  is used for track authority on the mainlines with Digitrax DCC for engine control along with car cards and waybills for freight forwarding.  It also features several class one passenger trains, including City of Portland, the Daylight, Empire Builder and Northcoast Limited. The trackwork is complete, with scenery about 90% complete.', 'N', 'Union Pacific and SP&S Ry', '60''s Pacific Northwest', '90%', '10 x 24', '150 ft.', 'Point to Point with Division Terminal', 'Centralized Traffic Control with 3 Yards & 4 staging areas ', 'Digitrax DCC', 2, 'N', 'Y', 'http://ownry.squarespace.com/', 'Kent', 'Williams', '(530) 559-2345', 'evenings or weekends', 'kentwilliams108@gmail.com', '14618 Tyler Foote Rd', 'Nevada City', 'CA', '', '', 60, 'Evoke Era', 'Purposeful', 'Moderate', 'Sequence', 'CC & WB', 'Disciplined', 'CTC', 'Unknown', 'FRS', 'http://www.x2011west.org/albums/williamsKent', '', NULL),
(123, 'R123', 'Yosemite Valley RR', '', 'Jack''s layout replicates the prototype Yosemite Valley Railroad circa August 1939 via a multi-deck design. The scenery, scenes, vegetation, and details on the layout all match the prototype. All seven of the YV''s prototype locomotive roster circa 1939 are modeled. The rolling stock is a combination of  scratchbuilt, resin and styrene kit models and the models reflect the types and ownership of freight cars which might have been on the railroad in the time period being modeled. All 100+ buildings on the layout are scratchbuilt from plans based on photos and available information. \r\n<p/>\r\nJack''s Yosemite Valley Railroad has been featured in numerous articles in Model Railroader, Railroad Model Craftsman, Model Railroad Hobbiset and Great Model Railroads, most recently in the January 2010 edition of Railroad Model Craftsman.', 'HO', 'Yosemite Valley RR', 'August 1939', '100%', '20 x 20', '', 'Point-to-point, multi-deck ', 'TT/TO', 'NCE DCC', 2, 'N', 'Y', 'http://www.yosemitevalleyrr.com', 'Jack', 'Burgess MMR', '(510) 797-9557', '', 'jack@yosemitevalleyrr.com', '36129 Sandlewood Dr', 'Newark', 'CA', '94560', '', 60, 'Full', 'Purposeful', 'High', 'Fast Clock', 'Switchlist', 'Casual', 'TT&TO', 'N/A', 'Telephone', 'http://www.x2011west.org/albums/burgessJack/index.html', '', NULL),
(124, 'R124', 'Western Pacific', '', 'A beautiful re-creation in HO scale of the Western Pacific RR in the Spring of 1938. The area of the WP modeled is along the Feather River including the Keddie Wye and a small logging area. The fidelity to prototype of the scenery has been praised by old WP employees, who readily recognize the scenes. An interesting touch is the many sound modules included in the many detailed scenes. The layout has been featured in <i>Railroad Model Craftsman</i> June 1996, July 2000, March 2011, <i>Railmodel Journal</i> May 2000, <i>Model Railroader</i> Sept. 2001 and <i>Model Railroad Hobbyist</i> May-June 2010', 'HO', 'WP', '1938', '100%', '16 x 20', '', '', '', 'NCE DCC', 2, 'N', 'Y', '', 'Jim', 'Dias', '(510) 793-0968', '', 'jrengine09@sbcglobal.net', '5311 Surry Court', 'Newark', 'CA', '94560', '', 60, 'Full', 'Purposeful', 'High', 'Sequence', 'Switchlist', 'Disciplined', 'Voice', 'N/A', 'Voice', 'http://www.x2011west.org/albums/diasJim', '', NULL),
(125, 'R125', 'Southern Pacific', '', 'This double decked, mushroom style, layout is a model of SP''s storied Shasta Division from Redding, CA to Klamath Falls, OR located in a purpose-built 1,200 sq ft loft in the Oakland Hills overlooking San Francisco Bay. The Shasta Division is the last large layout designed by the late and legendary John Armstrong. Operations follow the prototype using a modified 1952 prototype timetable &amp; train orders and CTC. The layout is faithful to the prototype. Car forwarding is by car card and waybills. Trackside maps document the switching areas, and train briefs are provided.\r\n<p/>\r\nThe original John Armstrong design was modified in significant respects, largely to achieve operational goals. For example, sidings and spurs were added or modified to add to operational interest. Some track work was eliminated to create more interesting, and lengthy, runs between modeled towns. Most significantly, the capacity of the designed hidden staging yards at Redding and Klamath Falls were increased from 4 to 7 tracks. Additional staging tracks were added at Weed and lengthened from 8'' to nearly 20''. And, additional tracks were installed at the visible lower Dunsmuir yard.\r\n<p/>\r\nTrack is ME rail on CVP tie strips with hand laid turnouts. All mainline track, nearly 400 feet, is installed. Train control is via wireless NCE DCC. The layout is fully signaled from Redding to Black Butte(the CTC section). Computer interface is accomplished using C/MRI hardware and JMRI software. The tone of the layout is casual but purposeful.\r\n<p/>\r\nThe Shasta Division is 40% sceniced with painted backdrops from Redding to Dorris. Many key structures are in place or mocked up, giving the modeled scenes a sense of place For example, the Dunsmuir engine facility and City structures are nearly complete and in place.\r\n<p/>\r\nThe layout accommodates 16 operators including a yard crew of 3, two dispatchers (one CTC and one TT &amp; TO, two TO Operators, and road crews.)\r\n<p/>\r\nThe SP Shasta Division is featured in the April 2005 Model Railroader and Great Model Railroads 2011.', 'HO', 'SP Shasta Division', '1953', '40-50%', '22 x 53 plus adjacent dispatcher office', '', 'Armstrong Mushroom with helix', '', 'NCE DCC', 1, 'N', 'Y', 'http://www.spshastaroute.com/', 'Otis', 'McGee', '650-774-3249', '', 'omcgee@sheppardmullin.com', '5708 Balmoral Drive', 'Oakland', 'CA', '94619', '', 60, 'Full', 'Adheres', 'High', 'Fast Clock', 'CC & WB', 'Disciplined', 'TT&TO', 'CTC', 'Telephone', '', '', NULL),
(126, 'R126', 'Petaluma Valley', '', 'Angus MacDonald''s HO scale Petaluma Valley RR, is a freelance RR in its own 20'' x 40'' handicap accessible building. Trains run around the outside walls on a triple folded loop ending at the "Y" entrance to the inner peninsula (the 18'' x  5'' yard).  Completely sceniced, with more super detailing still being added,  Angus'' scratch built automatic bascule bridge is only one of the many scenes that shouldn''t be missed.  Check the interior of the winery warehouse, the farm and the stock yards! \r\n\r\n\r\n', 'HO', '', '', '100%', '20 X 40', '', '', '', 'DCC North Coast', 5, 'N', 'N', '', 'Angus', 'McDonald', '(707) 778-1595', '', '', '1081 Eastman Lane', 'Petaluma', 'CA', '', '', 20, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(127, 'R127', 'Western Pacific ', '', 'Ernie''s Western Pacific HO layout represents that railroad''s operation from Bieber, California to Salt Lake City.  It occupies a three car garage and is designed for operations. ', 'HO', '', '', '66%', '12 X 30', '', '', '', 'Digitrax', 3, 'N', 'N', '', 'Ernie', 'Simard', '(707) 762-9163', '', 'esimard@yahoo.com', '1920 Turtle Creek Way', 'Petaluma', 'CA', '', '', 40, 'Evoke Era', 'Purposeful', 'Moderate', 'Fast Clock', 'Switchlist', 'Disciplined', 'CTC', 'Unknown', 'Signals', '', '', NULL),
(128, 'R128', 'Colville, Republic and Palouse  (CRAP)', '', 'The Colville, Republic and Palouse Railroad (CRAP)\r\n<p/>\r\nThe CRAP is a walk-in HO scale proto-freelance linear railroad representing Eastern Washington during the wartime harvest season of 1944.  The layout is contained within a 13'' X 13'' air-conditioned room constructed within a two car garage.  It consists of five levels of track, on 2.3 decks.  The vertical rise is from 32&quot; in Pullman to 68&quot; in Republic.  Industrial areas of the city of Spokane occupy two decks, connected by a helix, along one side of the room.  The track North out of Spokane resembles Great Northern''s Kettle Falls branch, running through mountains and forests and servicing the mining, logging and cattle industries.  The track South out of Garry (Lower Spokane) resembles Northern Pacific''s Palouse and Lewiston branch.  It rambles through nearly treeless rolling hills of wheat, and services the many trackside elevators and canneries along the line.  Basically the CRAP gathers the natural resources from the &quot;Inland Empire&quot; and transports them to Spokane, where they are interchanged outside the layout room to one of the four transcontinental and two regional railroads that have a Spokane presence.  Thirty cars per operating session are interchanged off the layout, and are replaced by thirty cars of processed food, manufactured goods and machinery from the other railroads.  There is no overhead traffic on the CRAP - staging is in the form of six car cuts of interchange traffic.   Motive power is small steam of early 20th century vintage and is nearly all equipped with sound.  Train length is six cars, and all trains have a lot of switching to do.  There are ten towns in addition to the two large areas of Spokane.  Passenger service is by two motor cars.  There are eleven trains per session, with the North and South Turns and the Woods and Mine trains frequently running twice.  A session lasts something over four hours. Control is by NCE radio.  The layout''s maximum use of vertical space, 30''; deep decks and use of outside-of-the-room staging and industries make it one of the largest small layouts in existence.  Aisle space is very limited.  An operating crew of six pretty well fills it up! The environment is rustic.\r\n', 'HO', 'Proto-Freelance, heavy Northern Pacific flavor.', 'Harvest time, 1944, North and South from Spokane, Washington', '65%', '13 X 13, 5 levels', 'ca 160'', plus another 90'' in the helix', 'Linear, point (Spokane) to points (Republic and Pullman)', 'Car card, waybill and switch list.  Mother-may-I dispatching.', 'NCE Radio DCC', 1, 'N', 'N', '', 'Verne', 'Alexander', '(707) 763-9072', 'Afternoon, Evening', 'crapmanv@comcast.net', '907 Grouse Lane', 'Petaluma', 'CA', '94954', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(129, 'R129', 'New York Central', '', 'Chuck''s representation of the New York Central in Eastern New York and Western Massachusetts in June in the early 1950''s.  Passenger and freight and steam and diesel all run in this transition era.  Scenery is a balance of 80% heavily detailed and mostly kit-bashed Urban Pittsfied with the remainder of the layout about 20% detailed.  In the midst of scenery building, Chuck is converting from Analog to NCE DCC for control.\r\n<p/>\r\nAlthough New York Central may seem out of place for a California layout, it represents the owner''s childhood memories and his early modeling as a member of the Rensselaer Polytechnic Institute Model Railroad Society in Albany, NY.  ', 'HO', '', '', '20%', '16 X 24', '', '', '', 'Analog', 2, 'N', 'N', '', 'Chuck', 'Oraftik', '(510) 420-1144', '', '', '1364 Oakland Ave', 'Piedmont', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(130, 'R130', 'Chicago & Mackinac Railroad ', '', 'C&amp;M purchased the old GR&amp;I line from the PRR and has turned it into a somewhat profitable railroad.  Runs from Grand Rapids to Mackinaw City, with staging in Fort Wayne.  Interchanges with the Soo Line via the RR Ferry at Mackinaw City.\r\n<p/>\r\nDispatcher controlled 300'' single track mainline with passing sidings.  Several towns on the line offer lots of local switching.  Mainline through freight and passenger trains keep the local crews on their toes.\r\n<p/>\r\nOperates using wireless EasyDCC.  Car forwarding is CC&amp;WB. Verbal communication with DS via FRS radios.  Fast clock &amp; timetable for passenger trains.  Basic scenery about 70% complete, but many more details needed. Full crew around 10 operators.\r\n', 'HO', 'Mostly PRR (ex GR&I Line)', 'Summer 1967 - Western Michigan', '70%', '20'' X 22'' (two car garage)', '300''', 'Multi-Deck, Partial Mushroom', 'Dispatcher controlled (FRS), CC&WB', 'DCC - EasyDCC Wireless', 2, 'N', 'Y', 'http://www.cmrailroad.com', 'Bob', 'Osborn', '(925) 484-4136', 'Afternoon (12:01pm -- 5:59pm)', 'bob@cmrailroad.com', '5595 Corte Sonora', 'Pleasanton', 'CA', '94566', '', 60, 'Evoke Era', 'Adheres', 'Moderate', 'Fast Clock', 'CC & WB', 'Disciplined', 'TWC', 'Unknown', 'FRS', '', '', NULL),
(131, 'R131', 'Lone Pine & Tonopah', '', 'The Lone Pine and Tonopah is an imaginary railroad operating during WWII.  Motive power of steam and early diesels run on a single track mainline with reverse loops at both ends and there is a logging branch line.\r\n<p/>\r\nKermit is the master of animation and lighting effects which have been featured in the October 1999 issue of <i>Railroad Model Craftsman</i>, and March 2011 <a href="http://www.model-railroad-hobbyist.com"><i>Model Railroad Hobbyist</i></a>.  Some of his animation and lighting features include ballroom dancers, a fireworks display scrap metal loading and logs dumping into a millpond.  \r\n<p/>\r\nKermit also has a Museum of Technology and a Garden Railway for visitors to enjoy while waiting their turn in line for the HO layout.', 'HO and G', '', '', '100%', '27 X 44', '', '', '', 'Progressive cab control', 4, 'Y', 'N', '', 'Kermit', 'Paul MMR', '(925) 935-1859', '', '', '15 Boies Ct', 'Pleasant Hill', 'CA', '94523', '', 60, 'Evoke Era', 'Purposeful', 'High', 'Sequence', 'Tab on Car', 'Casual', 'CTC', 'Unknown', 'Signals', '', '', NULL),
(132, 'R132', 'California Oregon & Western', '', 'The California Oregon and Western is a short line that was spun off by the Southern Pacific in 1984 to provide continuing service to customers remaining on the Modoc line after the SP was granted permission to abandon it.  The layout is being constructed to represent the line from the SP/BN interchange at Klamath Falls then running to Alturas, CA.  The layout was designed for Operations using 3rdPlanit and uses Digitrax Radio along with JMRI for control.  In addition, the Operations module of JMRI is used as the car management / forwarding system. As a former railroader Dennis has created a layout that operates like the prototype it represents. The layout is scheduled for publication in the LDSIG Journal coming out in May or June.  The JMRI portion was discussed in episode 129 of the Model Rail Cast Show.', 'HO', '', '', '40%', '33 X 10', '', '', '', '', 4, 'N', 'N', '', 'Dennis', 'Drury', '(916) 747-2313', '', '', '2061 Wilcox Ranch Rd', 'Plumas Lake', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(133, 'R133', 'Central Valley Railroad', '', 'Ron has a unique layout housed in a replica depot in his back yard.  Over the past 20 years, Ron has built his Central Valley Railroad with the help of a round robin group.  The railroad runs over 400'' of mainline from Fresno staging to Redding staging.  There is an industrial switching railroad in the town of Delta and a shortline railroad at Westwood that serves a lumber and paper mill.  Ron enjoys prototype operations and included a lot of industry on this freelanced layout based in the mid ''70s.  His railroadiana collection that adorns the walls of the depot also makes this a welcoming home layout.  Ron is currently converting to DCC from walk around DC.\r\n\r\n', 'HO', '', '', '100%', '24 X 36', '', '', '', 'Analog', 4, 'N', 'N', '', 'Ron', 'Kerkes', '(916) 638-5601', '', '', '10318 Westwood Ct', 'Rancho Cordova', 'CA', '', '', 62, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(134, 'R134', 'Denver Rio Grande Western', '', 'The rarely modeled Rio Grande Joint-Line has been represented well on the operating layout by Jim Petro.  Many of the buildings are scratch built including a model of Denver Union Station.  Jim focuses on the transition era and has many steam and diesel engines for prototype operations.  Even though most scenery is just beginning, the unique topography of the layout will please the tour visitors.', 'HO', '', '', '20%', '20 X 30', '', '', '', 'Digitrax', 3, 'N', 'N', '', 'Jim', 'Petro', '(775) 852-5636', '', '', '14580 Grey Rock Rd', 'Reno', 'NV', '', '', 30, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(135, 'R135', 'SP and WP', '', 'The Southern Pacific from Oakland Pier to Sparks is usually not modeled town by town, but on Jim Price''s 1950''s SP empire, the plan is to make it as realistic as possible.  Even though the layout is still under construction, Oakland Pier to Stockton is built and operating under warrants car card and waybills.  The Oakland 16th St depot and Desert Yard is fully sceniced and detailed while trains pass by on their way to the Oakland Mole adjacent to the billiards room, or the Western and Sacramento Divisions of the SP in Jim''s 50 x 70 garage.  This impressive layout also caters to LDSig interests.  ', 'HO', '', '', '20%', '50 X 70', '', '', '', 'Digitrax', 5, 'N', 'N', '', 'Jim', 'Price', '(775) 825-2299', '', '', '14795 Toll Road', 'Reno', 'NV', '', '', 30, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(136, 'R136', 'Tonopah & Tidewater Railroad', '', 'Nevin models the Tonopah and Tidewater RR along with the Bullfrog Goldfield RR and the Las Vegas and Tonopah RR.  All were pre-WWI mining railroads in the deserts of Nevada and California.  The high desert scenery and attention to detail in this teens-era layout is superb.  The layout is built so it can be relocated and valance lighting gives the railroad a very well scaled dimension.  ', 'HO', '', '', '100%', '14 X 14', '', '', '', 'MRC DCC', 2, 'N', 'N', '', 'Nevin', 'Wilson', '(775) 473-6460', '', '', '1915 Dakota Ridge Rd', 'Reno', 'NV', '', '', 30, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(137, 'R137', '', '', 'The East Bay Model Engineers Society / Golden State Model Railroad Museum is home to three large layouts in O/HO/N scales with broad curves and long trains in a warehouse-sized building. All three layouts can operate on either DC or DCC and the club has been featured in Model Railroader magazine. Each of the layouts makes use of the high ceilings in the building to provide majestic mountain scenes.\r\n<p/>\r\nThe O/On3 (no name) is a more free lanced layout and features long mountain bridges, a mine scene and trains which are over 40'' long are common!', 'O', '', '', '60%', '165 X 30', '', '', '', 'DC and DCC', 5, 'N', 'N', 'http://www.gsmrm.org', '', 'East Bay Model Engineer Society', '', '', '', '900 Dorman Drive', 'Richmond', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(138, 'R138', 'Hangtown and Grizzley Ridge', '', 'A freelanced layout with an emphasis on tongue and cheek humor based on 28 plus years of prototype railroad experience. The time frame is 1960''s to 1970''s. The layout is on two levels and includes industrial areas, logging and desert scenery. There is a continuous loop with islands for industries. Mike uses a computer generated switch list for operating sessions.', 'HO', '', '', '100%', '20 X 20', '', '', '', 'Digitrax DCC', 2, 'N', 'N', '', 'Mike', 'McReynolds', '(209) 869-3251', '', '', '6242 High Mesa Way', 'Riverbank', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(139, 'R139', 'Southern Pacific Rocklin Sub', '', 'This fully sceniced &quot;Rocklin Subdivision&quot; layout features a double deck design with reverse loop staging yards at both ends.  Soundtraxx Tsunami sound decoders fill the room with realistic prime movers and SP light packages.  The layout was designed both for operations and long passenger trains. The impressive passenger terminal is home to many western name trains.  Focuses on the transition era.  Dave''s layout was featured in NMRA Magazine December 2010.', 'HO', 'SP LA & Central Valley, Sierras', '1950s', '100%', '55 X 14', '', '', '', 'Digitrax DCC', 1, 'N', 'N', '', 'Dave', 'Houston', '(916) 533-3135', '', 'daylightsales@gmail.com', '4508 Scenic Drive', 'Rocklin', 'CA', '', '', 60, 'Few Comp.', 'Purposeful', 'Moderate', 'Sequence', 'CC & WB', 'Disciplined', 'TWC', 'N/A', 'FRS', '', '', NULL),
(140, 'R140', 'Red Rock Green River', '', 'Red Rock Green River is a freelance layout loosely based on the D&amp;RGW maintenance yard in Chama NM, RGS and the Silverton branch canyons of the San Juan mountains. Bill''s layout consists of an over and under lazy eight with walk into the center and has multiple animations with ambient sound and lighting.  This layout was featured in the 2009 On30 Annual.', 'On30', '', '', '100%', '10 X 20', '', '', '', 'Lenz DCC', 1, 'N', 'N', '', 'Bill', 'Iwan', '(916) 435-3100', '', '', '1103 Sedona Way', 'Rocklin', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(142, 'R142', 'NWP 1959', '', 'The North Western Pacific Railroad, located on California''s isolated northern coast, ran through some of America''s most resplendent settings. Mitch''s layout, located in a downstairs 700 square foot bonus room, depicts 20 miles of the Redwood Route''s Northern Division. Multiple unit freights, locals, and the Redwood passenger train run from the docks of Eureka to the redwood forest at McCann, just as they did in 1958. An additional scene portrays a section of the Eel River Canyon. This free-standing layout is built on a 3/4 wall system with a cantilevered shelf. The 115 foot mainline features both code 40 and code 55 rail with turnout sizes from 7 to 14. Easy DCC powers the system. About 50% of the scenery is done, though the dark fascia framing the entire layout gives it a nicely finished look. There are over 500 trees in the forest area alone. Highly detailed SD-7s with working Mars lights highlight the motive power. This N scale project has been published in the NMRA Magazine in July 2011 and Model Railroader magazines.', 'N', '', '', '33%', '11 X 26', '', '', '', 'Easy DCC', 2, 'N', 'N', '', 'Mitch', 'Valder', '(916) 784-8658', '', '', '7029 Pembroke Way', 'Rocklin', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(143, 'R143', 'Southern Pacific Third & Townsend', '', 'The Southern Pacific Third and Townsend St. Depot located in San Francisco has been replicated by award-winning SP Prototype Modeler Mark Brown.  Mark has replicated the depot, platform tracks, and the Fourth Street tower in his garage.  The diorama is almost to scale and features custom double slip switches and crossovers to match SP prototype.  All structures built so far are completely scratch built.  ', 'HO', '', '', '40%', '16 X 10', '', '', '', 'Digitrax DCC', 4, 'N', 'N', '', 'Mark', 'Brown', '(916) 872-8499', '', '', '101 Roadrunner Court', 'Roseville', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(144, 'R144', 'Western Pacific', '', 'Aaron''s Sn3 Tuolume is a model of the upper Tuolumne yard on the West Side Lumber Co in the late 50''s.  It includes the sand, water and oil facility, the car shops, old engine house/car shops, depot and warehouse.  It is modeled close to prototype in a 15 foot long shadow box.  All the rail is hand laid code 55 and includes dual gauge S/Sn3.   Most of the structures are scratchbuilt and operating diorama is 100% sceniced.\r\n<p>\r\nThe N scale layout is loosely based on the Western Pacific in late 60''s to early 70''s. The layout features the small community of Virgilia on one side, and the Feather River Canyon on the other.  The layout will be 100% sceniced by the NMRA Convention and features numerous custom painted and detailed WP locomotives not available in N scale. \r\n', 'N and S', '', '', '100% both layouts', 'N 5X9', '', '', '', '', 3, 'N', 'N', '', 'Aaron', 'Splawn', '(916) 781-6720', '', '', '2216 Thornton Dr', 'Roseville', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', 'Y', '2011-06-14 18:22:10'),
(145, 'R145', '', '', 'The Roseville Roundhouse Model Railroad Club was founded in 1977 by a small group of modelers in the home town of Southern Pacific''s Jennings Yard.   Over time, the group moved to several locations before coming back to the Placer County Fairgrounds where they started.  The HO layout is approximately 30x17 and is built in the shape of a "Z" for the membership to operate trains.  The N scale layout is fully sceniced and is both DC and DCC by operating one mainline per control system.  The club''s Western Sierra Lines Railroad is freelanced on both layouts. ', 'HO and N', '', '', '70%', '30 X 17', '', '', '', 'MRC DCC', 5, 'N', 'N', '', 'Roseville', 'Roundhouse Model RR Club', '', '', '', '800 All American City Blvd', 'Roseville', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(146, 'R146', 'American River Navigation & Railway', '', 'The American River Navigation and Railway is a home railroad that is 1" scale, or 1/12 size. It is a rideable railroad that performs work for Matt moving firewood, landscape materials, and of course his two boys. The 4 3/4" gauge track winds from the front yard to the back with many sidings. A branch-line goes over to the neighbor''s yard (a relative) and skirts the pool to a fruit-packing shed where fresh oranges are loaded in the winter. The layout is laid out roughly like a self-type switching layout, except folded over on itself twice. The railroad uses battery-powered GP9''s, freelance 4-wheeled switchers, and steam locomotives to switch the 430'' long railroad. You are also welcome to visit the railroad''s machine shop where repairs are done and new locomotives built. An article on the layout was published in the Summer 2006 issue of The Home Railway Journal.', '1/12 scale', '', '', '100%', '120 X 140', '', '', '', 'Steam and on-board battery', 4, 'N', 'N', '', 'Matt ', 'Mason', '(916) 812-0055', '', '', '9475 Mira Del Rio Dr', 'Sacramento', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(148, 'R148', 'Sacramento Northern Beltline', '', 'Bill''s Sacramento Belt Line portrays Sacramento Northern Railway''s industrial belt line within the city of Sacramento, California, during the period of 1953-1965, set in the high summer peak harvest/canning season. Operation focuses on industrial switching and interchange between multiple Class I railroads (Southern Pacific and Western Pacific), using a modified &quot;wheel report&quot; operation scheme. Scenery is urban/suburban, running between heavy industrial areas and tree-lined residential neighborhoods. Industries are primarily agricultural processing (canning, almonds, dairy, lumber milling, grain milling) and interchange between railroads, warehouses, trucks and riverboats/barges.  Motive power consists of small diesel-electric switching locomotives operating on city streets and tight curves, formerly electric interurban right-of-way. The railroad is freight-only, aside from occasional chartered fan trips. Scale is HO, standard gauge, set up as a point-to-point shelf layout that will eventually circle the room entirely.', 'HO', '', '', '30%', '11 X 24', '', '', '', 'DC', 3, 'N', 'N', '', 'Bill', 'Burg', '(916) 446-1374', '', '', '1614 23rd Street', 'Sacramento', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(149, 'R149', 'Western Pacific First Sub', '', 'The Bay Area and Central Valley RR is a multi-level HO layout specifically geared w/ operations in mind.  The lower level depicts both the WP and SP from the SF/Oakland Bay Area south through the busy industrial area of E. Oakland, down through Fremont, Niles Jct. and eventually Warm Springs.  A ''nine times'' rotation helix takes you up and east into Pleasanton, the Altamont Pass area and back down into both the WP and SP Stockton Yards.  A branch off the WP, out of Stockton, runs south on the Tidewater Southern and takes you into S. Modesto with a number of the local industries represented.  The trackwork is about 80% complete with N. Stockton and the STE (Stockton Terminal & Eastern) in the near future plans.  The layout is still under construction and scenery is limited.', 'HO', '', '', '', '20 X 40', '', '', '', '', 6, 'N', 'N', '', 'Dave', 'Arrol', '(916) 548-5680', '', '', '8091 Paint Way', 'Sacramento', 'CA', '', '', 30, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(150, 'R150', 'Spokane Pullman and Southern Railway', '', 'The 26th Street Model Engineers have built their layout in the basement of charter member Keith Brownfield''s home.  The layout is freelanced, but scenes are modeled to depict the Pacific Northwest in the transition era.  Subdivisions divide the railroad and each one has a unique theme that focuses on various industries.  Scenery is mostly complete, and the club uses Railops to prototypically move freight cars.', 'HO', '', '', '95%', '30 X 50', '', '', '', 'NCE DCC', 1, 'N', 'N', '', '', '26th Street Model Engineers', '', '', '', '1019 26th Street', 'Sacramento', 'CA', '', '', 62, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(151, 'R151', 'Sierra Central (NG)', '', 'The Sierra Central Narrow Gauge is a loop to loop railroad with several branches connecting lumber camps, mines, and oil fields to the mainline.  The railroad''s location is freelanced, but scenes are themed around prototypes such as the East Broad Top Orbisonia Shops, Southern Pacific Narrow Gauge Owenyo Transfer Trestle, and Westside Lumber Camp 7.  With most scenes finished and detailed, the layout is in full operation.  The main aisle of the layout is handicapped accessible. This is one of the largest HOn3 layouts in California.', 'HOn3', '', '', '66%', '14 X 35', '', '', '', 'DC', 5, 'N', 'N', '', ' ', 'Sacramento MRHS', '', '', 'robert.rohwer@comcast.net', '1990 Grand Avenue', 'Sacramento', 'CA', '', '', 40, 'Few Comp.', 'Adheres', 'High', 'Sequence', 'CC & WB', 'Disciplined', 'CTC', 'TWC', 'FRS', '', '', NULL),
(152, 'R152', '', '', '', '', '', '', '', '', '', '', '', '', 6, 'N', 'N', '', 'Ralph', 'Merrill', '', '', '', '', 'Sacramento', 'CA', '', '', 20, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(153, 'R153', 'Nicasio Northern Railway', '', 'Around the turn of the century some prosperous ranchers and farmers in Nicasio, CA (Marin County) decided that they needed a better way to get their products to market. A railroad was discussed, incorporated, and funded. The plan was to build from Nicasio to Bayside, a small but bustling port on San Francisco Bay. \r\nThe Nicasio Southern Railroad laid rails, started running trains, hired the wrong president, and he very quickly stole all the capital and absconded.\r\n<p>\r\nA group of San Francisco financial types saw an opportunity to take a functional railroad, and a territory rich with farms, ranches, fisheries, and lumber, and create a viable railway with connections to the national rail network as well as the Bay. The Nicasio Northern Railway was born, and at this time in history (mid-1920''s) is a viable concern. Barely.\r\n<p>\r\nThe Nicasio Northern starts at Bayside, which has the main passenger and freight yards and the engine servicing facility. Bayside is on a peninsula jutting into the Bay. The wharf and several industries serve the railway and southern Marin.\r\n<p>\r\nFrom Bayside we go north past Backdoor Junction, the connection to short eastern branch to Dither. Past Backdoor, the road continues north through the hills (literally) until we hit Skalville. Skalville is the junction to the NN Railway''s eastern division, the town of Yawn, and the connection to the rest of the US rail network.\r\nFrom Skalville the line heads north to the thriving metropolis of Nicasio, with its ranching and farms. Leaving Nicasio, we continue northward to Highland, which is another railway town. The tracks continue to Hither.\r\nThe Nicasio Northern railway weaves through the hills on muddy and slippery roadbed. Need I mention that this is earthquake country? Even if the right of way was once perfectly laid out with straight tangents and smooth grades and curves, it didn''t stay that way. The little steam engines rock and roll as they lead their trains across the pike.\r\nTrack is complete and operational.  The layout has a peninsula in the center of the 12 x 21 foot space, and the rest of the track runs around perimeter of the room. Bayside yards and the engine terminal are on the peninsula.\r\n<P>There is a short, but steep, walk from the corner to Jon''s house in addition to two flights of stairs to access his train room.', 'HO', '', '', '', '12 X 21', '', '', '', 'Digitrax', 2, 'N', 'N', '', 'Jon', 'Schmidt', '(415) 342-1097', '', '', '542 San Pedro Cove', 'San Rafael', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(154, 'R154', 'OS&F RR', '', 'An outdoor G Scale Garden Railroad with two train operation on a single main line utilizing both battery power with AirWire control and conventional track power. A full-scale Watchman''s shanty serves as the operations center and provides a home for out-of-service equipment. Due the success of the local gold mine in the early 1900''s, the town of Loganville has grown rapidly with new commerce and industry.  Winding its way through tunnels and canyons and across scratch built bridges spanning rivers with cascading waterfalls, the OS&amp;F RR provides both passenger and freight services as it travels over the rugged terrain of the California foothills. The scratch built HOTEL SISTERS overlooks the town and provides guests with vistas of the MOCO mining activities. Many other building are scratch built complete with lighted interiors. An outfitters cabin, located in the heavily forested landscape, provides services for hunters.<p/>\r\nIn addition to the main line, the mining operations feature both ''O'' and HO gauge trains to transport ore from the mines to the stamp mill. Limited handicap access (stairs).\r\n', 'G', '', '', '100%', '30'' X 60''', '', '', '', 'AirWire, DC and on-board Battery', 1, 'N', 'N', '', 'Dart', 'Rinefort', '(415) 453-4371', '', '', '101 Wimbleton Way', 'San Rafael', 'CA', '', '', 30, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(155, 'R155', 'Penn Central - Boston', '', 'This is a double decked switching layout deep in the urban jungle of Boston in 1974 that is based on the Penn Central. The concept is to provide a switching experience with the curves and obstacles typical of urban switching, while trying to represent the city in a true urban context, buildings that are not simple rectangles, roads and trackage crossing and overlapping, and blocked sight lines. There is no main line here to speak of, and as a result Paul enjoys complicated and lengthy op sessions. Entirely code 83, Paul is slowly converting to hand laid turnouts as he moves to a premier standard of reliability and appearance. All of the structures are scratchbuilt or kitbashed, some reside on the layout but not all are complete yet.', 'HO', 'Penn Central', 'Boston 1974', '40%', '10 X 14', 'none', 'perimeter with island', 'switch list', 'NCE DCC', 3, 'Y', 'Y', '', 'Paul', 'Weiss', '(415) 497-5590', '', 'paulbweiss@mac.com', '40 Inverness Drive', 'San Rafael', 'CA', '', '', 40, 'Evoke Era', 'Purposeful', 'Moderate', 'Sequence', 'Switchlist', 'Casual', 'Yard Limits', 'Unknown', 'Voice', '', '', NULL),
(156, 'R156', 'State Belt RR', '', 'The State Belt ran for 100 years along piers and into warehouses of the San Francisco waterfront. Bill has taken important elements like a car float, interchange at King St. (where the Giants play today), street running, and switching areas under Telegraph Hill and built them into a 12'' x 12'' layout using interesting modular techniques. Operations follow the prototype State Belt with 2 crews each working their own division. The railroad is totally functional, and signature buildings like the Ferry Building and Merchants Ice and Cold Storage are being worked on. Control is Lenz DCC with wireless throttles. The State Belt was written up in the April 2007 <i>Railroad Model Craftsman</i>. ', 'HO', 'State Belt RR', '1944-45 along San Francisco Waterfront', '70%', '12x12', '', 'No Mainline and everything is in Yard Limits', 'Chief Clerk, CC&WB, and the B-7 car request that the Belt used', 'Lenz DCC w/CVP wireless throttle', 4, 'N', 'N', 'http://www.statebelt.org', 'Bill', 'Kaufman', '(415) 491-0543', '', 'whk58@pacbell.net', '32 Salvador Way', 'San Rafael', 'CA', '94903', '', 40, 'Full', 'Adheres', 'High', 'Sequence', 'Switchlist', 'Casual', 'Yard Limits', 'N/A', 'Voice', '', '', NULL),
(157, 'R157', 'Sierra Carson & Truckee(HO)  South West Side Lumber Company(Fn3)', '', 'Dave has two layouts, an Fn3 Garden Railway in his back yard and an HO layout in a room in his garage. \r\n<p/>\r\nHO - In a room created in a one car garage space. Era is 1929. Lower level is Sierra Railway and upper level is Virginia &amp; Truckee. Levels connected with helixes. Includes appearances of West Side Lumber Co and Carson &amp; Colorado (HOn3). Numerous scratch-built prototype structures along with kit and bashed scenes.\r\n<p/>\r\nFn3 - Relaxing garden setting features an 8'' waterfall, scale models of the Bourland and Little Reynolds Creek Bridges (Trestles), scale plantings and numerous scratch built and craftsman kits of rolling stock used on the West Side in the 1920''s - 1930''s. Motive power is Bachmann geared locomotives re-worked to better replicate specific West Side equipment.\r\n<p/>\r\nHis layouts have been featured in Railroad Model Craftsman in May 2000 and Model Railroader in May 2004. ', 'HO Fn3', '', '', '100%', '10 x 17 HO and 50 X 40 Garden', '', '', '', 'NCE for HO and Radio Control for Fn3', 2, 'N', 'N', '', 'Dave', 'Connery', '(925) 735-0134', '', 'dgconnery@sbcglobal.net', '3408 Lanai Drive', 'San Ramon', 'CA', '94582', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(158, 'R158', 'NWP', '', 'Layout is a depiction of the NWP running through Sonoma and Mendocino counties about 1958. It is double decked, connected by helix, with staging yards on a third level underneath. It is designed to be operated in a prototypical fashion, with trains and scheduling based on a prototype timetable. Most motive power are SD7s as per the real NWP of the time. Scenery is about half finished, with painted backdrops and blue foam covered with drywall "mud" and Sculptamold. Power is through a Lenz DCC system. A number of the locomotives are sound equipped.', 'HO', 'Northwestern Pacific', '1958/Northern California', '50%', '12 x 17', '', 'Two level, point to point with continuous running option', 'Timetable, train orders, fast clock.', 'Lenz DCC', 3, 'N', 'N', '', 'Ed', 'Merrin', '(707) 542-3620', 'Evenings', 'edmerrin@earthlink.net', '2115 E. Foothill Dr', 'Santa Rosa', 'CA', '95404', '', 60, 'Few Comp.', 'Adheres', 'High', 'Fast Clock', 'CC & WB', 'Casual', 'TT&TO', 'Unknown', 'Voice', '', '', NULL),
(159, 'R159', 'Whiskeytown & Shasta ', '', 'Steve''s narrow gauge Whiskeytown and Shasta is located in the area West of Redding, California along Clear Creek from Old Shasta through Whiskeytown to French Gulch.  It services the mines of the Tree Frog Mining Company and the livestock from the OC Cattle Company.  The line connects with the standard gauge Anderson & Bella Vista with a further connection with the SP to the outside world.  Quartz is mined and shipped to the copper smelter at Kennett.  On the West end is the connection with the Trinity Southern which provides mine timbers and lumber.  Trains are short with 4 or 5 cars and a caboose and small engines 4-6-0 and 2-8-0.\r\n', 'On3', '', '', '100%', '18X19', '', '', '', 'NCE DCC', 2, 'N', 'N', '', 'Steve', 'Skold', '(707) 539-1782', '', '', '5306 Yerba Buena Road', 'Santa Rosa', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(160, 'R160', 'The A B and old C', '', 'Dave has a basement dedicated to his train operation.  His 165 feet of mainline is hand laid as are his turn-outs.  The turntable is his own design and is powered and aligning.  He has a yard at either end of his point to point operation.  The larger yard has 34 turnouts.  Steam is king on this layout placed in 1936.  ', 'HO', '', '', '10%', '25 X 13', '', '', '', 'MRC Wireless DCC', 4, 'N', 'N', '', 'Dave', 'Croshere', '(707) 829-9230', '', '', '1331 Enos Avenue', 'Sebastopol', 'CA', '', '', 62, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(161, 'R161', 'Westrac Lines', '', 'The Ashland and Bridgeport Garden Railroad by Ray and Dianne Fernandes features a lush garden with a waterfall, tunnels, and bridges.  The mainline runs about 300 feet through their backyard in the foothills of the Sierra Nevada Mountains.  Many miniature pines and flowers are featured for scenery.  \r\n<p>\r\nRaymond''s HO layout is a Western Pacific theme that features industrial switching and interchange with the Southern Pacific on the "Westrac Lines."  The layout is MRC DCC and focuses on the transition era with early diesel power and 50''s freight equipment.  ', 'HO and G', '', '', '', '', '', '', '', 'Battery', 4, 'N', 'N', '', 'Raymond', 'Fernandes', '(916) 642-0115', '', '', '421 Ashland Court', 'Shingle Springs', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(162, 'R162', 'Western Pacific', '', 'Layout covers from San Francisco to Salt Lake City with Reno and Tidewater branches. Fully signal with CTC.  Computer generated waybill system. 1970 era. 4 large yards. 9 passing sidings. All diesel power. Includes prototypically correct scratch built models of the Oakland and Salt Lake depots (Salt Lake was featured  in MR trackside photo section).', 'HO', 'WP', '', '50%', '30 X 56', '', '', '', 'Chubb w/ infared throttles', 2, 'N', 'N', 'http://members.bigvalley.net/norma', 'Steve', 'Hayes', '(209) 536-1847', '', 'HAYESWP@hotmail.com', '16241 Fleetwood Street', 'Sonora', 'CA', '', '', 40, 'Full', 'Purposeful', 'Moderate', 'Sequence', 'Computer', 'Casual', 'CTC', 'N/A', 'Telephone', '', '', NULL),
(163, 'R163', 'Pacific Traction & Harbor Terminal RR', '', 'This transition era freelance water front maritime switching layout features a lot of operations and realistic freight industry. Set around the East-Bay area of California, there is heavy interchange with Western Pacific, Tidewater Southern, Sacramento Northern, Southern Pacific, Napa Valley interurban, and the Mare Island Naval railway.  Charlie was inspired as a teenager by the Sacramento Model Railroad Historical Society and his freelancing abilities have built a wonderful operating layout.', 'HO O', '', '', '100%', '12 X 33', '', '', '', 'NCE', 1, 'N', 'N', '', 'Charlie', 'Lix', '(775) 742-7366', '', '', '315 Fodrin Way', 'Sparks', 'NV', '', '', 30, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(164, 'R164', 'Tidewater Southern', '', 'This is a large club layout depicting the Tidewater Southern between the Port of Stockton and Modesto, California with two Branch lines to Turlock and Manteca. In addition to the layout, the club has an extensive display of Tidewater Southern artifacts on display. ', 'HO', '', '', '80%', '20 X 60', '', '', '', '', 4, 'N', 'N', 'http://tidewatersouthernrailway.org', 'Tidewater ', 'Southern Historical Society', '', '', '', 'San Joaquin Co. Fair', 'Stockton', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(165, 'R165', 'Santa Cruz Northern', '', 'Jim''s Santa Cruz Northern is a point to point, double deck, walk around style layout that shares a two car garage with a compact car.  The SCN is single track with about 240 feet of mainline, of which 45 feet is in a three level helix.  The maximum grade is 2.25%; minimum mainline radius is 26.5". The SCN is a jointly owned Western Pacific/Santa Fe subsidiary, running from a connection with the WP in San Jose California south to Santa Cruz on the Pacific Coast.  As such it shares many of the characteristics of similar lines in the area such as the Central California Traction Company or the Northwestern Pacific.  Five major sidings have been extended to average 15 feet in length. All of the visible mainline and most of the switches are hand laid. Set in the early 1970''s, motive power is either second hand or leased, quite often from the parent roads.  Traffic has traditionally centered around industrial products in San Jose, agricultural products from the Santa Clara Valley and wood products and cement from the Santa Cruz Mountains.  The layout has appeared in numerous model railroad magazines most recently in the March 2010 issue of Railroad Model Craftsman.', 'HO', 'WP / ATSF', '1971', '95%', '21 X 22', '240 feet', 'Double Deck walk around', 'Time Table and Train Orders, Car Card /Waybill and Switch lists', 'Lenz DCC w/CVP wireless throttles', 4, 'Y', 'N', '', 'Jim', 'Providenza', '(415) 472-6715', 'evenings', 'rrjim@aol.com', '16 Drakes Court', 'San Rafael', 'CA', '94903', '', 60, 'Few Comp.', 'Adheres', 'High', 'Fast Clock', 'Switchlist', 'Disciplined', 'TT&TO', 'Unknown', 'Telephone', '', '', NULL),
(166, 'R166', 'Western Pacific Third Sub', '', 'The Railroad is a Mushroom Design running from the foothills at Oroville up through the Feather River Canyon through the Keddie Wye,  with a Highline extension up to Crescent Mills and Staging,  and into Portola.  Leaving the forested,  rocky Canyon the Railroad continues east into the Desert,  via Reno Junction with the Reno Branch,  to  Desert Staging and  a reversing loop.  The year being modeled is spring 1981.', 'HO', '', '', '', '', '', '', '', '', 3, 'N', 'N', '', 'Steve', 'Cavanaugh', '(209) 835-9371', '', '', '1245 Palomino Road', 'Tracy', 'CA', '', '', 30, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(167, 'R167', 'Sierra Railroad', '', 'Multi - deck layout with over 10 scale miles of Sierra Railroad mainline trackage plus Interchanges with SP and ATSF in Oakdale, Pickering Lumber Co at Standard, WSLCo in Tuolumne and the Hetch Hetchy RR at Hetch Hetchy Jct. Prototypical operations based on 1955 prototype. Base scenery is about 90% done with some finished scenery. Most structures are in place. Layout designed for operations.', 'HO HOn3', 'Sierra Railroad', '1955', '66%', '22 X 65', 'over 10 scale miles - single track', 'around the walls - multi deck- one giant helix', 'Track Warrants', 'Easy DCC', 2, 'N', 'N', 'http://www.sierrarailroad55.com', 'John', 'Zach', '(209) 625-5609', '8 am - 10 pm', 'jzach@hrblock.com', '17921 Bononza Dr.', 'Twain Harte', 'CA', '95383', '', 60, 'Full', 'Purposeful', 'High', 'Fast Clock', 'Computer', 'Casual', 'TT&TO', 'N/A', 'Radio', '', '', NULL);
INSERT INTO `prod_eventtools_layouts` (`layout_id`, `layout_num`, `layout_name`, `layout_short_description`, `layout_long_description`, `layout_scale`, `layout_prototype`, `layout_era`, `layout_scenery`, `layout_size`, `layout_mainline_length`, `layout_plan_type`, `layout_ops_scheme`, `layout_control`, `layout_accessibility`, `layout_wheelchair_access`, `layout_duckunder_entry`, `layout_owner_url`, `layout_owner_firstname`, `layout_owner_lastname`, `layout_owner_phone`, `layout_owner_call_time`, `layout_owner_email`, `layout_street_address`, `layout_city`, `layout_state`, `layout_postcode`, `layout_local_url`, `layout_status_code`, `layout_fidelity`, `layout_rigor`, `layout_documentation`, `layout_session_pace`, `layout_car_forwarding`, `layout_tone`, `layout_dispatched_by1`, `layout_dispatched_by2`, `layout_communications`, `layout_photo_url`, `layout_mark_changed`, `layout_last_mod_time`) VALUES
(168, 'R168', 'Diablo Valley Lines', '', 'The Walnut Creek Model Railroad Society can trace its beginnings to 1948, when the original group began meeting in each other''s homes.  Their display of a 4x8 foot portable layout at special events such as Walnut Creek''s annual Walnut Festival led to their first permanent railroad in a freight shed moved onto a leased site near the Walnut Creek Southern Pacific depot in 1950. \r\nThis location served to house an impressive 20 x 40 foot layout until 1970 when flood control work along the creek, from which the city derives its name, required relocating the SP track and, of course, the WCMRS clubhouse. \r\nAt that time the WCMRS solved their clubhouse problem by reaching an agreement with the City of Walnut Creek for the present site with a structure that was the first in California (and one of very few in the world) to be designed and built specifically to house a model railroad. \r\nThe actual construction work was done in two years by members of the Society and upon completion in 1974 the building was donated to the city of Walnut Creek and the building of the Diablo Valley Lines Railroad commenced.<p/>\r\nThe current Diablo Valley Lines has over 4,300 feet of hand laid track on 175,000 individual ties with more than 340 turnouts.  The entire road is HO scale and has standard gauge, narrow gauge, freight and and interurban  trolley lines.\r\nUnder normal operating conditions it requires about 45 minutes for one train to complete a single circuit of the mainline. \r\n', 'HO', '', '', '100%', '54 X 32', '', '', '', '', 4, 'N', 'N', 'http://www.wcmrs.org', 'Walnut Creek', 'Model Railroad Society', '', '', '', '2751 Buena Vista Ave', 'Walnut Creek', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(169, 'R169', '', '', '', 'N', '', '', '', '', '', '', '', '', 6, 'N', 'N', '', 'club', 'Carnegie Museum', '', '', '', '', '', '', '', '', 20, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(170, 'R170', '', '', 'The railroad depicts two fictional railroads that traversed the Sierra Nevada Mountains. The Sierra Pacific Lines was a common carrier linking the eastern San Francisco Bay area and the Owens Valley.  Only a small portion of the Sonora Division of the SPL is modeled including a large yard and two other towns. The Lost Creek Lumber Co had established a saw mill and extensive trackage in the woods before the SPL came to the town of Lost Creek. Operations in the early 40''s had the SPL and the LCLCo sharing trackage rights from Lost Creek to the town of Murphys, where the logging company branch diverges to the woods. Four camps/landings are found on the LCLCo tracks in the woods. A feature is the switchback to one landing with 6% grades. Geared locomotives rule the branch line while many locomotives seen on some eastern roads (i.e. Colorado) ply the SPL main line.\r\n\r\n', 'Sn3', '', '', '20%', '20x21', '', '', '', 'NCE Digitraxx', 3, 'N', 'N', '', 'Paul', 'Claffey', '', '', '', '2340 Coachman Road', 'Mariposa', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(171, 'R171', 'Never Done and Always Changing', '', 'Scott''s freelanced &quot;Never Done and Always Changing&quot; railroad moves freight, passengers and various commodities from the mountains to the sea.  His layout includes fully detailed mountain scenery, small towns, and a port city, with emphasis on scenery and structures. Lots of details and mini-scenes are worked in around the layout. Simple loop track plan using code 100 PECO On30 track.  Scott was featured in the Nov-Dec 2010 Narrow Gauge Gazette and the 2011 On30 Annual.', 'On30', '', '', '80%', '16 X 18', '', '', '', 'Digitrax DCC', 2, 'N', 'N', '', 'Scott', 'Robertson', '', '', '', '', '', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(212, 'R212', 'Sierra Central', '', 'Since 1948, the Sacramento Model Railroad Historical Society has been the premier model railroad club in the Sacramento region.  A new layout was started in 2002 to represent the Southern Pacific from Oakland Pier to Sacramento, and the Western Pacific from Sacramento to Keddie, CA.  The society also has one of the largest HOn3 layouts in California featuring prototype scenes of the East Broad top, Colorado and Southern, and the SP narrow gauge.  The standard gauge is Digitrax DCC interfaced with CMRI and Panel Pro.  The club operates a prototype tri-color CTC signaling system featuring an original Western Pacific US&S Sacramento dispatching panel.', 'HO', '', '', '80%', '40 X 60', '', '', '', 'Digitraxx DCC', 5, 'N', 'N', '', '', 'Sacramento MRHS', '(916)205-9064', '', 'robert.rohwer@comcast.net', '1990 Grand Avenue', 'Sacramento', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(173, 'R173', 'Oregon Railway and Navigation', '', 'This is an HO scale layout that centers in The Dalles, Oregon running both East and West from that point. It is a single track railroad with passing sidings. All trains running from The Dalles wind their way into the hidden staging area located directly under the yard at The Dalles. While not specifically sceniced for the prototype, place names are taken from the area modeled. Industries along the way include a large lumber mill with its own railroad climbing into the forest, an oil refinery, a rock quarry, and a rail barge load out. Most scenes are highly detailed and extra care has been put into making sure most structures are lit and have interior detail such as the saw mill and log pond. Errol''s layout focuses on the transition era.  ', 'HO', '', '', '100%', '30 X 15', '', '', '', 'NCE DCC', 3, 'N', 'N', 'oscaller@aol.com', 'Errol', 'Spangler', '(408) 569-1899', '', '', '2915 Humphrey Road', 'Loomis', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(175, 'R175', 'Vallejo Valley RR', '', 'The Vallejo Valley RR features Western California 1880-1930 with mining &amp; lumber industries along with cattle and sheep, orchards and vineyards - a small agricultural town servicing local California industry. Many scratch built, kit and kit bashed structures including all of those made by Railroad Avenue are on Frank''s railroad.', 'G', '', '', '', '', '', '', '', 'Track power', 3, 'N', 'N', '', 'Frank', 'Schwarb', '(707) 557-0168', '', '', '5250 Marshfield Rd', 'Vallejo', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(176, 'R176', 'Greenhills Railroad', '', 'This live steam layout is situated in a lushly landscaped 35 year old semi-Japanese garden.  There are about 200 varieties of plants.  The 425'' of track go over 14 detailed bridges and through 5'' tall mountains.  The two waterfalls and Koi pond were designed and built by Jack Verducci.   Photos of the layout have appeared frequently in <i>Garden Railways</i>.', 'G', 'Freelance', 'Transition between the horse and the automobile ', 'Complete', '30'' x 50''', '425''', 'Garden', '', 'Live Steam', 4, 'N', 'N', '', 'Richard', 'Murray', '650-583-9995', '', 'steamer060@sbcglobal.net', '842 Helen Dr.', 'Milbrae', 'CA', '94030', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(177, 'R177', '', '', 'This 12 year old railroad has had several changes over the years. Three separate layouts travel throughout the backyard. The features include 60 buildings, 350 feet of track, 2 tunnels, 80 trees, 4 bridges and a life size potting shed built to look like a small railroad station. This railroad is well integrated into the backyard landscape.  ', 'G', '', '', '', '', '', '', '', 'Track Power', 4, 'N', 'N', '', 'Robert', 'Smith', '(650) 343-7914', '', '', '1137 Cabrillo', 'Burlingame', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(178, 'R178', 'Crystal Springs Railroad', '', 'Jack''s Crystal Springs Railroad represents a narrow gauge railroad that might have been. It is located on the SF peninsula. The line starts at the ocean shore town of Fog Harbor and climbs the coastal range to San Mateo and other points west. This garden has been featured in hundreds of articles in Garden Railways Magazine and several Garden Railway books. The owner is the premier garden railway builder in the country.', 'G', '', '', '', '', '', '', '', 'Live Steam', 4, 'N', 'N', '', 'Jack', 'Verducci  MMR', '(650) 341-4088', '', '', '2050 Fairmont Dr.', 'San Mateo', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(179, 'R179', 'Bill, Virginia & Truckee Railroad', '', 'Bill Allen  runs both  live steam and electric. The garden has miniature trees and plants and lots of scratch built items. The layout depicts the Truckee and Virginia City''s gold and silver era. Seven hundred feet of  layout with four looping and two back &amp; forth tracks, and a 33'' Koi pond with waterfall and river separate Virginia City from Truckee.  The layout also has eight bridges, seven tunnels, 4% grades and a 40'' mountain range. Bill has lots of scratch built structures and rolling stock.   There is a second section elevated oval 21'' X 31'' designed for Live Steam with dual tracks and turnouts.', 'G', '', '', '', '', '', '', '', 'Live Steam & Track Power', 4, 'N', 'N', '', 'Bill', 'Allen', '(650) 365-1906', '', '', '1739 Fernside St.', 'Woodside', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(180, 'R180', 'Lake Tahoe & Truckee Railroad', '', 'This railway is integrated into the existing tall Redwood landscaping. It runs along the back and side fence in a specially constructed raised rock area. One end is a sparsely populated mountain setting. An over and under figure 8 loop crosses a waterfall over a long high trestle. The line travels by small settlements en route to a hillside town and railyard in the middle of another over and under elevation loop. There are approximately 30 buildings and many special details. This railroad was featured in Garden Railways magazine.', 'G', '', '', '', '', '', '', '', 'Battery & Track Power', 4, 'N', 'N', '', 'Don', 'Watters', '(650) 941-4431', '', '', '260 Margarita Ct.', 'Los Altos', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(181, 'R181', '', '', '', '', '', '', '', '', '', '', '', '', 6, 'N', 'N', '', 'West', 'Swift', '', '', '', '', '', '', '', '', 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '', '', NULL),
(182, 'R182', 'Willoughby Line', '', 'Double deck proto-lanced railroad depicting West Coast steam in the 1950''s.  Scenes are taken from the Sierra, Southern Pacific, Western Pacific, Hetch-Hetchy and Yosemite Valley railroads.  OPs based trackplan with inventive staging and helix design.  Equipment features many super detailed and weathered rolling stock. Hardshell is 80% complete, overal scenery completion is 10%, Duck under at 60".', 'HO', 'Freelance with S.P., WP, Y.V., HHR and SRR influences', 'West Coast Central Valley and Sierras - !950''s Steam', '80% rough, 10% detailed', '13'' X  22'' Double Deck', '180'' (60'' in Helix)', 'Point to Point with display loops on each level', 'TT & TO', 'CVP Easy DCC', 2, 'N', 'Y', 'http://www.trainboard.com/railimages/showgallery.php/cat/500/ppuser/7495', 'Guy', 'Cantwell', '(831) 462-0480', 'Morning (9:01am -- 11:59am)', 'gtrguyone@comcast.net', '3525 Sevilla Dr.', 'Soquel', 'CA', '95073', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(196, 'R196', 'L & G R R (Lucas and Grandpa Railroad)', '', 'The railroad is built on a raised area surrounded by wooden retaining walls and is fully accessabile for wheelchairs.  The layout was started in 2008 and is complete.  \r\n<p/>\r\nThe landscaping is maturing nicely.  There is a lake fed by a waterfall with an exiting waterfull that empties into a stream which passes under a trestle and a bridge.  There are multiple bridges over a dry stream and an 18'' long curved trestle.  \r\n<p/>\r\nTwo tracks pass through a 6'' x 12'' storage shed which has a six track yard and multiple shelves for train storage.  The power supplies and receivers for train control are also located in the shed.  \r\n<p/>\r\nThere are three town areas (Western Town, Castle Town and Lucasville) which are all served by the mainline railroad as well as a trolley line. \r\n', 'G', '', 'All Era Mainline Railroad', 'garden', '43'' x 62''', '500 Feet', 'Folded loop with passing sidings and double-ended yard in shed', 'Continuous operation of long passenger and freight trains', 'Radio controlled track power', 4, 'Y', 'N', '', 'Gary', 'Knoth', '408-463-9412', 'Evening (6:01pm -- 9:59pm)', 'gary.w.knoth@prodigy.net', '305 Kalana Avenue', 'Morgan Hill', 'CA', '95037', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(185, 'R185', 'South West Pacific', '', 'Transition era steam and first generation diesel power in the East Bay.   Passenger traffic is still significant business for the railroad when the Southern Pacific was still the "Friendly" railroad.\r\n<p/>\r\n Piggyback service was inaugurated in 1953, there were yellow reefer blocks, black Overnights, locals, and short commuter runs are found on this railroad.  There is also an ectopically placed scenic loop located in the Bay Area.\r\n', 'N scale', 'Southern Pacific, Western Pacific, and Alameda Belt Line', '1953 East Bay to Stockton', '75%', '44'' by 16''', '200''', 'Walk around with swing gate entry. Freelance', 'Verbal track warrants and starting to use car cards', 'NCE Radio throttles DCC', 3, 'N', 'N', '', 'Steve', 'Van Meter', '510 521-7557', 'Morning (9:01am -- 11:59am)', 'steve@suredude.net', '1352 Bay St', 'Alameda', 'CA', '94501', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(186, 'R186', 'California Central Lines', '', 'An HO and HOn3 club layout located in the old Agnew depot, which was built for the South Pacific Coast Railroad. The club runs steam through diesel, and dispatching is done differently according to era. The 1,000 feet of track represents California connections to the Pacific Northwest, Southeast, and East. There is a small narrow gauge section. The layout has been featured in Model Railroader and Railroad Model Craftsman.', 'HO HOn3', '', '', '100%', '500 sq ft', '', '', '', 'Digitrax', 2, 'N', 'N', '', 'California', 'Central Club', '4088071455', '', '"Jim Betz" <jim@jimbetz.com>', '4185 Bassett Street', 'Santa Clara', 'CA', '95054', '', 60, 'Evoke Era', 'Purposeful', 'High', 'Fast Clock', 'CC & WB', 'Casual', 'TWC', 'N/A', 'Telephone', '', '', NULL),
(187, 'R187', 'Idaho-Montana Railway & Navigation Co', '', 'The IMR&N replicates prototype UP/MILW/GN railroad operations between Spokane, WA and Plummer, ID. Prototype trains, locales and activities are included. Operation is by TT&TO using modified prototype paperwork. Scenery is completed and equipment is weathered for a prototypical appearance.', 'HO', 'UP-MILW-SC&P (GN)', 'Spokane, Wash August 1952', '75%', '15 X 19', '200-feet', 'Continuous spiral shelves', 'TT&TO with CC&WB', 'Digitrax', 3, 'N', 'Y', '', 'David', 'Clemens', '(916) 784-9104', '', 'upnw@earthlink.net', '4318 Sandhurst Way', 'Rocklin', 'CA', '', '', 60, 'Full', 'Adheres', 'High', 'Fast Clock', 'CC & WB', 'Disciplined', 'TT&TO', 'N/A', '5ch Radio', '', '', NULL),
(188, 'R188', 'South Placer Lines', '', 'Protofreelance Stockton-Colfax-Oroville Route', '', '', '', '75%', '300 sq ft', '', '', '', 'Digitrax', 6, 'N', 'N', '', '', 'Draper', '', '', '', '', '', '', '', '', 20, 'Evoke Era', 'Purposeful', 'Moderate', 'Sequence', 'CC & WB', 'Casual', 'N/A', 'N/A', 'TBD', '', '', NULL),
(189, 'R189', 'Clay & Mud Point', '', 'History and Theme:  The C&amp;MP originally started out as the Coquille and Myrtle Point Railroad in 1984 in Eugene, Oregon.  \r\nThe C&amp;MP relocated to California in 1989 and changed the name to the fictitious but catchy title it bears today.  \r\nIt is intended to represent the end of a shortline common carrier in California''s Central Valley in autumn of 1972.  \r\nThe concept for the present track plan came from an On30 plan drawn in December 2008 by Lennart Elg. \r\nThe railroad boasts connections with the Southern Pacific and Western Pacific.  \r\nThis competitive situation keeps the shippers happy and allows the Clay & Mud Point to show a modest annual profit.  \r\nThe online shippers include a rice growers co-op (Dill''s Mills,) a micro-brewery (Clune''s Pale Ale,) an oil recycler (Rotten Robbies,) a fruit and nut packing house (Hi &amp; Dry,) a custom cabinet shop (Z&amp;Z Cabinets,) and an occasional car for the team track.\r\n</p>\r\n\r\n<p>\r\nDesign and Construction:  The C&amp;MP was built from two 4X8 sheets of 15/32 plywood divided into the two primary modules along three walls of an 11X11 bedroom.  \r\nRail and turnouts are Peco code 83.  \r\nPower is provided by an NCE DCC system.  \r\nStructures are mostly styrene kits from Walthers.  \r\nRolling stock is primarily styrene kits equipped with Kadee couplers and riding on metal wheel sets.  \r\nDue to the 22-inch minimum radius curves, cars in excess of 40 feet long generally do not operate on the C&amp;MP.  \r\nThe C&amp;MP owns several &quot;hand-me-down&quot; switchers from both SP and SN, but other locomotives may be used.\r\n</p>\r\n\r\n<p>The typical operating session on the C&amp;MP finds the crew assuming duty on the staging track and proceeding to Elgin.  \r\nTrain make-up and operating scheme are determined by the roll of a die.  \r\nUpon arrival at Elgin, each car in the train is traded for a like car currently on spot at the industries.  \r\nAfter the switching is completed, the engine and caboose must be properly positioned for the return trip to staging. \r\n</p>', 'HO', '', '', '66%', '50', '', '', '', 'NCE', 6, 'N', 'N', '', 'Steve', 'Gust', '', '', 'dspr57@yahoo.com', '', '', '', '', '', 40, 'Evoke Era', 'Purposeful', 'Moderate', 'Sequence', 'Car-for-Car', 'Casual', 'Yard Limits', 'N/A', 'N/A', '', '', NULL),
(190, 'R190', 'Copper Pass & Western', '', 'Based on a route in Alaska that was proposed and surveyed, but never built. The route runs north from port facilities on the Pacific Ocean to the Yukon River. The principle traffic consists of copper, zinc, coal, and forest products.  Entry to the layout requires negotiating 3 steps and a 50" high by 20" wide nod-under, so not wheelchair accessible.  All aisles 36" or more once inside layout room. Track is 95% complete, scenery 25%\r\n', 'HO', 'Freelance', '1976 Alaska', '25%', '19x22', '310 feet', 'Double deck, around the walls with peninsula, helix', 'TWC, point to point, hidden staging at each end', 'CVP''s Easy DCC, all wireless', 2, 'N', 'Y', '', 'Don', 'Marenzi', '510 794-3469', 'Evening (6:01pm -- 9:59pm)', 'DonMarenzi@aol.com', '8055 Par Court', 'Newark', 'CA', '94560', '', 60, 'Evoke Era', 'Purposeful', 'High', 'Sequence', 'CC & WB', 'Casual', 'TWC', 'N/A', 'FRS', '', 'Y', '2011-06-24 16:38:38'),
(191, 'R191', 'Agassiz Basin Railway', '', 'The Agassiz Basin is a proto freelanced bridge railroad in HO scale based upon Canadian National practices of the late 1950''s at the very end of the steam era. It is set in summer 1959 when the last steam engines ran in Western Canada. I grew up watching the last of the steam locomotives as I walked to and from school and wanted to capture that memory in model form.\r\n<p>\r\nThe layout room is 16x24 in my (rare for California) basement. It is a twice around the room design where the track passes through each scene twice. Once as a focal scene and a second time as background or mostly hidden trackage. The "twice around" design allows lots of running time between towns and a mainline of about 225'' point to point. There are 2 staging yards. One represents North/South (Winnipeg/Thompson) off layout traffic and the other East/West (Swan River/Saskatoon). Operations is my main interest and the layout is intended to run according to the practices of the late 50''s in Canada which is Time Table and Train Orders.\r\n<p>\r\nThe layout is still very early in its construction. I used CAD to design both the layout and the benchwork. The benchwork is complete and is all made out of 3/4" birch plywood ripped to dimensional sizes. Both staging yards are on "sliders" that allow me to lower the yards 18" down for maintenance or repairs. Track laying has begun and trains are beginning to roll ;-). The layout is controlled using Digitrax DCC.\r\n<p>\r\nIf you are looking for a beautifully scenicked, fully operating railroad, this is not your place to stop! But if you are interested in the design approach I used, the unusual staging yard design, or other aspects of construction or design, I''d enjoy sharing my experiences with you!', 'HO standard guage', 'Freelanced based upon CN prototype practices', '1959 Western Manitoba from Brandon north to Thompson', '0%', '16'' x 24''', '~225 feet', 'Twice around the walls walk-around with peninsula; swing gate en', 'Single track ABS, single dispatcher using TT&TO (for now)', 'Digitrax DCC', 4, 'Y', 'N', '', 'Charlie', 'Bedard', '408-406-6786', 'Evening (6:01pm -- 9:59pm)', 'cbedard6@comcast.net', '21750 Vintage Lane', 'Saratoga', 'CA', '95070', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(192, 'R192', 'Santa Alicia, Harrytown and Pacific Railroad', '', 'The layout is set in western United States depicting the steam to diesel transition era of\r\n1948-1960. Mike''s main interest is the streamlined passenger trains of the SP, UP, ATSF\r\nand WP. The layout is a freelanced design, with continuous running capability. There\r\nis a small yard at one end and a staging and passenger yard at the other end with engine\r\nservicing facilities on the peninsula near the passenger yard. The track height is 44 to 55\r\ninches and scenery is 85% complete. Mike''s layout is featured in the May 2011 issue of\r\nModel Railroader.', 'N', 'SP, ATSF, & UP', '1950''s , western USA', '85%', '36ft. X 3-4 ft. with 3ft. X 4ft. peninsula', 'about 75ft.', 'point to point with continuous running capability', '', 'DCC', 4, 'Y', 'N', '<a href="http://www.facebook.com/media/set/?set=a.202824656419201.50981.104852949549706">X2011W Facebook Gallery</a>', 'Mike', 'Blumensaadt', '415 333-6178', 'Morning (9:01am -- 11:59am)', 'mike@matrixphotographics.com', '306 Edna Street', 'San Francisco', 'CA', '94112', '', 60, 'Evoke Era', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(193, 'R193', 'Chittenden, Pajaro and Coyote Railroad', '', 'Models the Southern Pacific Coast Division, Watsonville to San Jose. Bench work is open frame construction with 1/2&quot; plywood sub-roadbed, Atlas Code 83 track on cork roadbed.  Tortoise switch machines operate DCC friendly turnouts. Fascia mounted panels, with signaling, provide walk around train and route management using C/MRI hardware and custom software.  Digitrax radio throttles are used for locomotive control only. An electrically interlocked swing gate provides access to the center of the layout.  Dave Biondi painted the backdrop, which depicts the west foothills along the SP mainline from Coyote to Morgan Hill.  Mainline is operational.\r\n', 'HO', 'Southern Pacific', 'Coast Division 1940-1953', '5%', '21'' x 13''', '180''', 'Around the Room, Two Levels', 'Local Freight & Passenger, Industry Switching', 'Digitrax DCC, C/MRI layout control, custom software', 3, 'N', 'N', 'http://www.cpcrr.org', 'Chuck', 'Catania', '408-846-5857', 'Evening (6:01pm -- 9:59pm)', 'cpcrr@charter.net', '2330 Stonecress St.', 'Gilroy', 'CA', '95020', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(194, 'R194', 'San Leandro Historical Railway Society', '', 'The San Leandro Historical Railway Society\r\noperates two model railroads and a railroad museum.  The\r\nfirst is a large HO display that depicts the Southern Pacific\r\nroute from the SF Bay Area over Donner Summit to Reno\r\nand Sparks, Nevada.  The second is a new garden railroad\r\nthat consists of both G and O gauge (3-rail) trains.  The\r\nmuseum has an excellent collection of railroad china and\r\nother artifacts.\r\n\r\nConstruction of the HO scale model railroad\r\ndisplay began in 1991. This layout was designed by the\r\nfamous model railroad track planner, John Armstrong, and\r\nwas featured in the March 1988 issue of Model Railroader\r\nMagazine.  Per the National Model Railroad Association\r\n(NMRA) Kalmbach Memorial Library, the SLHRS has the\r\nlargest HO scale helix in the United States both in height and\r\nin diameter.  There is over 4,000 feet of track on 3 levels;\r\ndozens of switches, and miles of wiring that have been\r\ninstalled by society members. The SLHRS was one of the\r\nfirst large club layouts to convert to DCC.  It takes about 45\r\nminutes for a train to travel the entire length of the display at\r\nscale speed. Most locomotives and rolling stock are\r\nmembership owned.\r\n\r\nThe new G&O garden railroad has two gauges:  G and O (3-rail).  \r\nConstruction was started in 2007.  Loops of G gauge\r\nand O gauge track plus a children''s area are in operation.\r\nThe G&O is designed to introduce the public to the model\r\nrailroading hobby.\r\n\r\nThe SLHRS is housed in the old San Leandro Southern\r\nPacific depot that was built in 1898.  It was rescued from\r\ndestruction by the SLHRS in 1988 and moved to its current\r\nlocation.  Construction of the HO layout and the museum\r\nwas started following three years of restoration work.', 'HO', 'Southern Pacific', '1950 to sort a present from Alameda, CA to Sparks, NV', '95%', 'Three Tiered layout', '243.7 Miles', 'Adapted from John Amstrong', 'SP Overland Route over Donner Pass', 'NCE DCC', 4, 'N', 'N', 'http://slhrs.org/', 'San Leandro', 'Historical Railway Society', '510-522-3937', 'Evening (6:01pm -- 9:59pm)', 'Joe Barker <jhb3ksb@yahoo.com>', '1302 Orchard St', 'San Leandro', 'CA', '94577', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Voice', 'Unknown', 'Radio', '', '', NULL),
(195, 'R195', '', '', 'Main line is SP, branch line is Sierra RR up to sawmill, Logging RR to logging camp. <br/>\r\nLayout includes:<br/>\r\nTwo towns, Citrus Grove with SP Station, Ice House and Facilities, Freight Dock, and more and Oak Flat with an SP and Sierra Station and more.<br/>\r\nA Engine Yard with Round Table, Five Stall Round House and Machine Shop.<br/>\r\nA Logging Mill, Blacksmith Shop and Logging Camp.<br/>\r\nA Mine with Head Rig, Boiler House and Black Smith Building. <br/>\r\n<p/>\r\nNote: wheelchair 2 inch riser Duckunder removeable.', 'HO', 'Free lance Southern Pacific', 'Early 50''s California, Central Valley and Central Sierra''s.', '100%', '16x22', '200 feet', 'Cantilevered round the wall with a small island', '', 'DCC by NCE and/or DC by Aristo-Craft your choice', 3, 'N', 'N', '', 'Wayne', 'Floyd', '510-522-0564', 'Evening (6:01pm -- 9:59pm)', 'waynejfloyd@yahoo.com', '2858 Santa Clara Ave', 'Alameda', 'CA', '94501-3067', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(197, 'R197', 'Virginia City Branch of the Virginia and Truckee Railroad', '', 'In the 1860s and 1870s, the venerable Virginia and Truckee Railroad of western Nevada was built to serve the mines and mills of the Comstock Lode, the largest silver deposit discovered in the United States. By the 1930''s, the glory days of mining around the once cosmopolitan Viginia City were fading fast and the former V&T mainline to Virgina City was now a lightly used branchline.\r\n<p/>\r\nThis small "California" garage layout is contained in a special room and is 100% sceniced. The layout features dozens of scratchbuilt and kit-bashed buildings and mines depicting Virginia City and Gold Hill, Nevada. Most of the scenic ground material was also collected from the Virginia City area. The layout was built by myself and Mark Cook specifically for the NMRA National Convention in 2000.\r\n', 'HO', 'Virginia and Truckee Railroad', '1930''s western Nevada', '100%', '14 feet x 10 feet', '48 feet', 'dogbone', '', 'DC, converting to DCC.', 4, 'Y', 'N', '', 'Michael', 'Laine', '801-824-9013', 'Morning (9:01am -- 11:59am)', 'mdlaine@earthlink.net', '1737 Comstock Way', 'San Jose', 'CA', '95124', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(198, 'R198', 'Claremont Docks Railroad', '', 'My goal is a museum quality diorama of rail-marine activity.  All infrastructure built.  Ship basin with scratch built pier shed and brick warehouse is completed.  Grain elevator and tank farm are yet to come. Very realistic scenery.  Lots of highly detailed boats.  Layout about 35% complete.', 'HO', 'Inspired by Lehigh Valley RR''s Black Tom Terminal', 'Harborside at Jersey City, N.J., circa 1944', '35%', '12'' x 12'' with 6'' extension', 'about 48''', 'Switching layout with loop for continuous running', '', 'NCE DCC', 2, 'N', 'Y', '', 'Howard', 'Lloyd', '408-535-5411', 'Afternoon (12:01pm -- 5:59pm)', 'hrmklloyd@verizon.net', '16544 Denevi Lane', 'Los Gatos', 'CA', '95030', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(199, 'R199', 'Twain Harte Sonora Pass RR', '', 'Layout represents what a logging line might have looked like in the Twain Harte area.  Based loosely on the West Side Lumber and Pickering Lumber Companies.  But also some inspiration from Mich Cal, Empire State Logging, and other logging companies in the Sierra''s near Sonora, CA.\r\n<p/>\r\nScenery is complete.  Featured in Nov/Dec 2010 Gazette.  Also check out <a href="http://twainhartesonorapassrr.blogspot.com/">Frank''s blog</a> about the railroad.\r\n', 'On3', 'Westside Lumber', '1940''s Twain Harte CA', '100%', '16'' by 20''', '1 scale mile - 110 feet', 'Point to Point continuous', 'Logging', 'DCC - all sound', 3, 'N', 'N', 'http://www.frankmarkovich.com/Twain%20Harte%20Sonora%20Pass.htm', 'Frank', 'Markovich', '408-505-2727', 'Morning (9:01am -- 11:59am)', 'frank.markovich@intusurg.com', '1904 Chula Vista Drive', 'Belmont', 'CA', '94002', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(200, 'R200', 'Ohio & Little Kanawha Railroad', '', 'The Ohio &amp; Little Kanawha is a mythical 1950''s West Virginia coal hauling railroad that runs around West Virginia with junctions intersecting the C &amp; O and B &amp; O.  The railroad runs steam with a few diesel locomotives. The layout has a main yard with an engine terminal which includes a turntable and round house. There are several structures that feature sound. The layout is powered by NCE DCC and all locomotives have sound on-board. All structures are scratch built or craftsman kits with some kits built by Charlie Getz, Scotty Mason, Clark Kooning and Bama Harman. Mainline is 100% complete and scenery about 30% complete. The layout is located in a office complex, not a home in a residential area.  The layout has a duckunder entry when trains are in operation. ', 'HO', 'none but C&O is dominate theme', 'mid 1950''s West Virginia Coal Hauling Railroad', '30%', '10 x 30', '140 feet', 'Twice around with upper level', '', 'DCC', 4, 'Y', 'Y', '', 'Ted', 'Stephens', '(650) 988-6941', 'Morning (8:01am -- 11:59am)', 'ted@stephensfam.com', '2672 Bayshore Parkway, Suite 610', 'Mountain View', 'CA', '94043', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(201, 'R201', '', '', 'The largest "trains only" hobby store in California north of Sacramento, Western Depot Hobby, will be our meal stop, with a BBQ lunch and a chance to peruse the stores over $2 million in model railroading inventory.', '', '', '', '', '', '', '', '', '', 4, 'N', 'N', 'http://www.westerndepot.com/', '', 'Western Depot Hobbies', '530-673-6776', '', '', '1650 Sierra Avenue', 'Yuba City', 'CA', '95993', '', 62, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(203, 'R203', '', '', 'The presently under construction freelance narrow gauge layouts are based on the logging and mining areas of the northwestern United States.<p/>\r\nLarry''s On3 layout represents a lush mountainous lumber and mining community. Beginning and ending in a yard, trains run on a half dog bone track plan through scenic timberlands of the coastal regions of Oregon and Washington. Trains are powered using Digitrax.<p/>\r\nThere is a separate HOn3 layout in another room which is a point-to-point design with three different starting locations. There are two logging sites and a mining district with six mines. Passing various rural stops the trains travel down hill to a lumber mill and town at a &quot;Dog Hole&quot; bay on the Pacific Ocean. One of the logging sites utilizes dual gauge track to allow the running of standard gauge geared locomotives. Both the HOn3 and Std gauge engines are serviced at the main yard and shops using a dual gauge turntable. Logs hauled on standard gauge equipment are not interchanged for shipment to the mill but &quot;dumped&quot; down a bluff similar to the prototypical operations at Caspar Lumber Co, in Mendocino, CA. The mining district is modeled to represent activity during one of Nevada''s boom cycles. Grades to the mining and timber areas are steep, well over 10% on many sections. Trains are controlled by three wireless throttles using nine blocks and DC power. <p/>\r\n', 'On30', '', '', '50%', '10 X 10', '', '', '', 'Digitrax DCC', 1, 'N', 'N', '', 'Larry', 'Moll', '(916) 791-1507', '', '', '9217 Purdy Lane', 'Granite Bay', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(204, 'R204', '', '', 'The East Bay Model Engineers Society / Golden State Model Railroad Museum is home to three large layouts in O/HO/N scales with broad curves and long trains in a warehouse-sized building. All three layouts can operate on either DC or DCC and the club has been featured in Model Railroader magazine. Each of the layouts makes use of the high ceilings in the building to provide majestic mountain scenes.\r\n<p/>\r\nThe N scale (no name) layout features the SP in Sacramento yard and icing docks, Tehachapi Loop, and magnificent snow-capped Sierra Nevada mountains. \r\n', 'N', '', '', '90%', '25 X 70', '', '', '', 'DC and DCC', 5, 'N', 'N', 'http://www.gsmrm.org', '', 'East Bay Model Engineer Society', '', '', '', '900 Dorman Drive', 'Richmond', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(205, 'R205', 'Port Richmond and Truckee', '', 'The East Bay Model Engineers Society / Golden State Model Railroad Museum is home to three large layouts in O/HO/N scales with broad curves and long trains in a warehouse-sized building. All three layouts can operate on either DC or DCC and the club has been featured in Model Railroader magazine. Each of the layouts makes use of the high ceilings in the building to provide majestic mountain scenes.\r\n<p/>\r\nThe HO/Hon3 Point Richmond &amp; Truckee features prototype based familiar places including Oakland, Sacramento, Roseville, Elvas Wye, Martinez, Colfax, and Truckee. Tracks gain over 6 feet in elevation as they move from the San Francisco Bay to the Sierra Mountains. Prominent features include Oakland Mole, Oakland 16th St. station, Elvas Wye, and in the Sierras; Long Ravine Bridges, snow sheds and the Chinese Wall. Trains 20'' in length and more are common sights. \r\n', 'HO', '', '', '80%', '120 X 35', '', '', '', 'DC and DCC', 5, 'N', 'N', 'http://www.gsmrm.org', '', 'East Bay Model Engineer Society', '', '', '', '900 Dorman Drive', 'Richmond', 'CA', '', '', 40, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(206, 'R206', 'Rhatische Bahn West', '', 'The RhB West models the Rhaetian Bahn (RhB) Bernina Express from the Chur area in Switzerland over the Alps to Italy. Four tunnels and four waterfalls are surrounded by both Alpine and Mediterranean flora. Plants include varieties of dwarf cypress, spruce and pine at the "Swiss" end of the layout, complemented by colorful perennials at the "Italian" end. Fifteen types of thyme are available for "sniffer"s to smell, along with several oregano and other herbs. DCC powered engines and switches allow several concurrent trains to run. About 1500 sq ft. The track is stainless steel with LGB ties, powered by a Massoth central station and wireless handhelds. All engines and most rolling stock are LGB. The engines have mostly Massoth decoders, some with remote-controlled couplers. The automation is done with decoders from Zimo and Digitrax. Several features remote control features include a gravel loading building loads gravel into hoppers,  a hopper that delivers and dumps gravel around the track; a barrel car that dump the barrels; a "Hot Metal" car that dumps water. \r\n\r\nThe walkway is uneven at one point getting into the garden.  \r\n', 'G', '', '', '', '2500 sq ft.', '', 'Garden', '', 'DCC', 3, 'N', 'N', '', 'Chip', 'Gierhart', '(650) 493-3668', '', '', '1099 Los Robles Ave.', 'Palo Alto', 'CA', '94036', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(213, 'R213', 'Nevada County Narrow Gauge', '', 'With the support of the Nevada County Fair Board a group of  Nevada County Narrow Gauge  enthusiasts formed the Nevada County Narrow Gauge Historical Model Railroad in 1983 and renovated an unused building at the County  Fairgrounds.  This endeavor was assisted by material and monetary contributions from local businesses and in 1985 the railroad was opened to the public.\r\n\r\nToday the railroad features an onboard wireless mini-camera to provide visitors a passenger eye view of riding the narrow gauge train thru the woodlands of the Nevada County on one of three TV screens placed around the layout.\r\n', 'On3', '', '', '100%', '24 X 60', '', '', '', 'NCE DCC', 4, 'N', 'N', 'www.ncngmodelrailroad.org', 'Nevada County ', 'Narrow Gauge Historical Model RR', '(530) 451-6264', '', '', 'Nevada County Fairgrounds', 'Grass Valley', 'CA', '', '', 62, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(207, 'R207', 'Maple Rock Garden Railway', '', 'The Maple Rock Garden Railway is unique because the railway is part of a nationally recognized three acre private garden. The railway is intended to represent a believable, small narrow gauge railway serving people and industries typical of this part of California in the 1920s to 1940s time. The Maple Rock Railway serves several small towns and small industries. Locomotives, cars, buildings, industries, and structures are necessarily small and compact. Locomotives include both live steam and onboard battery powered locomotives, each radio controlled. Battery powered locomotives also have electronic sound systems. Freight cars are typical 8 wheel freight and log cars or short, 4 wheel, ore cars. Passenger business is chiefly handled by combines run as mixed trains. The railway also runs periodic excursion trains for special occasions. Formed partly from graded and built up earth and partly following natural contours of the site, the railway is modeled in FN3 Scale, and has about 900 feet of track, or about 3.5 scale miles. Track is Llagas Creek code 215 rail, ties, and switches laid on granite "dust" ballast. Originally built as two sections, the lower section is built in a area of about 60 x 40 feet, has 450 feet of track in a large loop. The upper section has 120 feet of track, also a loop, is located 12 to 15 feet higher than the lower section. Later, a connector section was built between the two sections with 320 feet of track that climbs the 12 feet difference in height on 4% grades. A single "out and back" train trip from the lower section to the upper section is a bit over 3 scale miles and climbs and descends about 300 scale feet (15 actual feet) of elevation. Train trips continuing with a loop run around the lower section add another 2 scale miles, or a total of over 5 scale miles for a trip. Foliage in and around the railway are "in scale", living Dwarf Alberta Spruce, Juniper, and Japanese Maples, and ground covers. Also "decorating" the railway are several large Bonsai trees as old as 50 years and moss rocks as large as seven tons. This is a railway not to be missed.', 'Fn3', '', '', '', '3 plus acres', '', '', '', 'Battery and Live Steam', 5, 'N', 'N', '', 'Frank & Ruby', 'Andrews', '(916) 663-3887', '', '', '100 Clark Tunnel Road', 'Newcastle', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(208, 'R208', 'Silverwood Mining and Lumber Railroad', '', 'The Silverwood Mining and Lumber Railroad is built in a dog bone shape filling an area approximately two hundred feet long by thirty feet wide. The railroad depicts the steam era of railroading between 1900 and 1952 and uses track power, on board battery with radio control as well as live steam. On the Silverwood you will see passenger trains running as well as trains serving both mining and lumbering operations.																	\r\n', 'G', '', '', '100%', '', '', '', '', '', 4, 'N', 'N', '', 'Jerry', 'Abreu', '(916) 797-3814', '', '', '9175 Silverwood Court', 'Granite Bay', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(209, 'R209', '', '', '', 'G', '', '', '100%', '', '', '', '', '', 4, 'N', 'N', '', 'Ron', 'Titus', '(916) 372-0933', '', '', '3320 Malcom Island Street', 'West Sacramento', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(210, 'R210', 'Arden Park and Eastern   /  La Sierra Shortline', '', 'The Arden Park &amp; Eastern and its associated La Sierra Shortline is a western Sierra foothills narrow gauge railroad that was built in a Japanese garden so the railroad and the garden are well integrated. The project is still being developed but you will see the railroad and the garden are equally important to the owners.', 'G', '', '', '100%', '21 X 45', '', '', '', 'Track Power', 4, 'N', 'N', '', 'Gary & Chrisi', 'Phillips', '(916) 482-5951', '', '', '1508 La Sierra Drive', 'Sacramento', 'CA', '', '', 30, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(211, 'R211', 'Coyote Pass Railroad', '', 'The railroad is about 8 years old and was built in a naturally rugged, rocky, area using numerous fills and bridges to follow the natural land contours - much like the real thing. \r\nIt depicts a standard gauge mountain division line with rustic narrow gauge characteristics. Short, old time combines as well as long 15 to 20 car freights look right at home. The motive power ranges from kit bashed steam relics to late steam and early diesels of the 1950s and ''60s as well as a completely out of place GG1. The 700 feet of mainline is Llargas Creek code 250 rail, bent for broad curves. The ruling grade is 2%. There is also a 90-foot short line with sharp curves and a 6% grade that services a lumber camp.  Trains are track powered by Crest''s RC Train Engineer system and several trains can be run concurrently.  There is also a large live steam track connected to the mainline in a wye configuration. Interesting features include a 5-track car barn, cascading water flumes for a no muss, no fuss water feature and a working turntable. The over 75 structures, bridges and trestles are mostly scratch built and include animated features for the coaling tower, lumber mill and steam donkeys. Most of the structures light up for night time operations. Some of the rolling stock is also scratch built including a long, logging consist with handmade disconnects.\r\n', 'G', '', '', '100%', '30 X 100', '', '', '', 'Track Power and Live Steam', 4, 'N', 'N', '', 'Chuck & Sue ', 'Maley', '(530) 878-6185', '', '', '4804 Winding Way', 'Auburn', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(214, 'R214', '', '', 'The Sacramento Valley Live Steamers Railroad Museum is located within the Hagan Community Park in Rancho Cordova, California. The organization was started around 1965 and completed with a Golden Spike ceremony on May 20, 1973.\r\n\r\nIn 1992, the organization acquired more land and expanded to what is now over 6,300 feet with many sidings and several yards.  The railroad also features 5 wooden trestles, a 40ft truss bridge and a girder deck bridge.  The main line passes within 100 feet of the American River giving passengers a fine view.\r\n\r\n', '4 3/4 and 7 1/2 inch', '', '', 'natural', '6,300 linear feet', '', '', '', 'live steam', 4, 'N', 'N', '', 'Sacramento ', 'Valley Live Steam Historical Soc', '', '', '', 'Hagan Park', 'Rancho Cordova', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(215, 'R215', 'BNSF Pink Lady Sub', '', '', 'HO', '', '', '35%', '400 sq ft', '', '', '', 'NCE DCC', 4, 'Y', 'N', '', 'Jim', 'Radkey', '', '', 'sscotty@att.net', '', 'Albany', 'CA', '', '', 40, 'Evoke Era', 'Purposeful', 'Moderate', 'Sequence', 'CC & WB', 'Casual', 'TWC', 'N/A', 'FRS', '', '', NULL),
(217, 'R217', 'SP Vasona Branch', '', 'SP''s Vasona Branch models the Santa Clara Valley in the early 1930''s.  The layout tries to reproduce actual scenes along the San Jose - Los Gatos - Santa Cruz branch based on photos and Sanborn fire insurance maps.\r\n</p>\r\n<p>\r\nThe layout is a two deck 10'' by 14'' HO layout in half of a two car garage.  Track is complete.  Most rough scenery and some finished scenery is in.\r\n</p>\r\n<p>\r\nOperation focuses on switching the canneries, packing houses, and other industries in the valley; commute trains and freights heading to Santa Cruz also run to add additional traffic.  A pair of two-man crews do heavy switching during the session.\r\n</p>\r\n<p>\r\nLayout control is via EasyDCC wired throttles.  Most locomotives are sound-equipped; all locomotives are the small steam engines seen on the actual branch.  Much of the layout runs in "yard limits", but signals and informal dispatching control the track over the hill (as on the prototype); a 2:1 fast clock sets the pace of the session.  Switching is done from switch lists.', 'HO', 'Actual Southern Pacific Vasona Branch', '1930''s', '65%', '140 sq ft', '110 feet', 'staging-to-staging', 'switching, informal TT&TO', 'EasyDCC', 6, 'Y', 'N', 'http://vasonabranch.blogspot.com/', 'Robert', 'Bowdidge', '408-723-1925', '', 'rbowdidge@mac.com', '1623 Fairorchard Ave.', 'San Jose', 'CA', '95124', '', 60, 'Full', 'Purposeful', 'High', 'Fast Clock', 'Switchlist', 'Casual', 'Yard Limits', 'TT&TO', 'Voice', '', '', NULL),
(219, 'R219', 'Sacramento Central', 'California''s Central Valley, switching and through train operations on a modular layout.', '', '', '', 'Mix of eras', '95%', '500 sq ft', '', '', '', 'Digitrax', 4, 'N', 'N', '', '', 'Sacramento Modular', '', '', 'caprikar21@yahoo.com', '', '', '', '', '', 40, 'Mix of Eras', 'Attempt', 'Moderate', 'Sequence', 'Switchlist', 'Casual', 'TWC', 'DTC', 'FRS', '', '', NULL);
INSERT INTO `prod_eventtools_layouts` (`layout_id`, `layout_num`, `layout_name`, `layout_short_description`, `layout_long_description`, `layout_scale`, `layout_prototype`, `layout_era`, `layout_scenery`, `layout_size`, `layout_mainline_length`, `layout_plan_type`, `layout_ops_scheme`, `layout_control`, `layout_accessibility`, `layout_wheelchair_access`, `layout_duckunder_entry`, `layout_owner_url`, `layout_owner_firstname`, `layout_owner_lastname`, `layout_owner_phone`, `layout_owner_call_time`, `layout_owner_email`, `layout_street_address`, `layout_city`, `layout_state`, `layout_postcode`, `layout_local_url`, `layout_status_code`, `layout_fidelity`, `layout_rigor`, `layout_documentation`, `layout_session_pace`, `layout_car_forwarding`, `layout_tone`, `layout_dispatched_by1`, `layout_dispatched_by2`, `layout_communications`, `layout_photo_url`, `layout_mark_changed`, `layout_last_mod_time`) VALUES
(225, 'R225', 'Crystal Pass & Pacific RR', '', 'Rick is building his Crystal Pass &amp; Pacific in a room over a three car garage as a freelanced narrow gauge railroad that follows the Colorado prototypes of the Rio Grande Southern and Denver &amp; Rio Grande. Set in the time period of the late 1920''s to early thirties only steam locomotives ply the rails of this re-creation of southwestern Colorado. Short trains, high mountains, mines, trestles and tunnels are the rule.  Since the recent acquisition of the Crystal Pass &amp; Pacific by the D &amp; RGW you''ll see a mix of both line''s equipment on the railroad.\r\n<p>\r\nSince the scenery is in it''s early stages here''s a good opportunity to inspect some of the basics of layout construction including L girder framework, modified spline roadbed (Rick calls it &quot;speed spline&quot;), Geodesic scenery, turnout installation, etc. ', 'Sn3', '', '', '10%', '15 X 35', '', '', '', 'Analog with PBL sound switching to DCC', 1, 'N', 'N', '', 'Rick', 'Neet', '', '', '', '', '', '', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(226, 'R226', 'Thunder Valley Narrow Gauge Railway', '', 'Earl and Jody''s Thunder Valley Narrow Gauge Railway is an attempt to re-create a small railway built to serve the people and several industries of 1920s to 1930s "Gold Country", California. Being a small railway, locomotives, cars, buildings, industries, and structures are necessarily small and compact. Freight cars are four and eight wheel ore cars, quarry cars, and general freight cars. Passenger business is handled by combines run as mixed trains and a railbus. The railway also runs periodic excursion trains for special occasions. There is also a small excursion railway running through a botanical garden.\r\n<p>Built in FN3 Scale, with about 350 feet of track, the railway uses both live steam and onboard battery powered locomotives, radio controlled. The battery powered locomotives and a railbus also have electronic sound. Track is Llagas Creek code 215 rail, ties, and switches laid on granite "dust" ballast.\r\n<p>As a Garden Railway, most of the railway is outside. There is a town, a saw mill, locomotive facilities, some "whistle stops", and a small stream running to a dam with two gold mines and a quarry on a switchback. Grades on the railway are up to 8%. Trees are "in scale", living Dwarf Alberta Spruce, Cypress, and Rosemary, as well as verbena, and several ground covers.\r\nEarl has enjoyed model railroading for more than sixty five years, always modeling small, believable railways that "might have been".  So like real railways, the TVNG has a past.  It evolved from his Thunder Valley Tram begun about 50 years ago. The Tram (although On20 Scale at that time) began as a small back woods railway and very narrow gauge (20 inch), serving mines and a small community. As business got better and loads got heavier, tracks were widened to ON3 and eventually evolved into the Fn3 Thunder Valley Narrow Gauge Railway of today. \r\n\r\n', 'Fn3', '', '', '', '350 feet Garden Railway', '', '', '', 'Live Steam and Onboard Battery', 4, 'N', 'N', '', 'Earl and Jody', 'Martin', '(916) 773-0933', '', '', '4019 Pine Cabin Way', 'Roseville', 'CA', '', '', 62, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(227, 'R227', 'Chicago and Iowa', '', 'The Chicago and Iowa Railroad models 1970s Burlington Northern post-merger operations featuring equipment from the Burlington, Great Northern, Northern Pacific, and Spokane, Portland and Seattle Railroads.  This layout will please BN fans because of this rarely-modeled era.  ', 'HO', '', '', '50%', '12 X 20', '', '', '', 'MRG DCC', 1, 'N', 'N', '', 'Bryan', 'Smith', '(775) 427-9299', '', '', '1160 South Maine Street', 'Fallon', 'NV', '', '', 30, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(228, 'R228', '', '', 'Don''s 16''x22'' &quot;center of room layout&quot; is under construction. The layout will blend traditional American Flyer with hi-rail modeling and scenery.  \r\n<p>\r\nPrior to starting the layout after recently moving, Don constructed over 600 feet of shelving on the walls of his 25 X 40 foot train room to display his extensive (twenty five years worth) collection of American Flyer &quot;S&quot; Gauge trains. He also has a token representation of AF HO, O and Standard gauge trains and accessories and other catalogued and non-catalogued displayed, as well as Gilbert paper, and selections from Colber and Plasticville.\r\n<p>\r\nBesides the train collection, Don has a 1/64 scale toy vehicle and Ertl farm implement collection and his wife, Sue''s, collection of A.C. Gilbert electrical appliances on display.  Most of these items are rarely seen on display.\r\n', 'American Flyer', '', '', '0%', '16 X 22', '', '', '', '', 6, 'N', 'N', 'af2rail@att.net', 'Don', 'Rosa', '(530) 644-4330', '', '', '7670 Sly Park Road', 'Placerville', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(229, 'R229', 'SP and State Belt', '', 'The SP and State Belt railroads run along San Francisco''s waterfront around the walls of the room.  The central peninsula has the NWP with Petaluma, Tiburon and Healdsburg on one side and the Eel River canyon on the other.  In San Francisco, Market St has a cable car and the Ferry Building is busy receiving passengers from the PCC''s.  The State Belt runs along the Embarcadero below Telegraph Hill and Coit Tower.  The SP at 3rd and Townsend receives the Daylight and Lark plus many commuters.  The WP and AT&amp;SF have limited trackage as well.  Scenery is about 90% complete on the mid 50''s to early 60''s layout.', 'N', 'SP and State Belt', '1950s', '90%', '13 x 23', '', 'Walk-in', 'Dark TT&TO', 'DC', 6, 'N', 'N', '', 'John & Cindy', 'Petrovitz', '650-994-3690', '', 'cpetrovitz@hotmail.com', '161 Longford', 'South San Francisco', 'CA', '94080', '', 60, 'Evoke Era', 'Purposeful', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(231, 'R231', 'Southern Pacific', '', 'This 14''x26'' layout in its own specially built room is a late steam, early diesel branch line of the SP in the SF Bay Area.  Trackwork is complete and scenery is about 1/2 done.  The Vargas brothers have worked their magic to make things come alive!  The mainline is flex track with hand laid turnouts.  Most of the rolling stock is either scratch built or kit built. There is a duck-under to get into the layout space.', 'O', 'Southern Pacific', 'Steam to Diesel Transition', '50%', '14''x26''', '', '', '', '', 1, 'N', 'Y', '', 'Neil', 'Chichizola', '6505914136', '', 'juniemoon1@earthlink.net', '1379 Geneva Ave', 'San Carlos', 'CA', '94070', '', 20, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(232, 'R232', 'Tall Pine TImber Co', '', 'A 17'' x 19'' fully sceniced O and On3 layout operated by the San Mateo O Gaugers.  30 car O scale freight trains are not uncommon. Lots of super-detailed work trains and circus trains appear. Featured in Railroad Model Craftsman, Model Railroader, NG&SL Gazette, O Scale News, O Scale Railroading, NMRA Bulletin, Coast Dispatcher, PCR Branchline, and Great Model Railroads. Bob started railroading in 1956, started this layout in 1976, has held many NMRA offices, including national President and chaired 2 National Conventions.', 'O', '', '', '100%', '17'' x 19''', '', '', '', '', 1, 'N', 'N', '', 'Bob', 'Dupont', '650-343-8956', '', '', '600 Maple St', 'San Mateo', 'CA', '94402', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(233, 'R233', 'Los Arabis Creek Railway Company', '', 'A large garden RR  that models a mainline railroading during the transition era. The railroad  features four mainlines: a double track mainline of approximately 350 feet with wide radius curves and long straight runs; a third 300 foot mainline winds its way up a river canyon and through the mountains; and a fourth 200 foot line features numerous bridges. Unlike many garden railroads, we like to run long  passenger and  freight trains, pulled by track powered diesel and steam locomotives. The railroad is located in a beautiful setting. It features several tons of rocks, over 100 miniature trees (some trees being 15 years old), a river and pond, many unique structures and detailing, and an uncluttered feel. \r\n\r\nBackyard is wheelchair accessible, but the path around the layout is gravel.', 'G', 'UP & SP', '1950''s', 'Real dirt & rocks; miniature planting', '50'' x 150''', '350'' plus two branches', 'Garden', 'None', 'DC track power with walk around remotes', 4, 'Y', 'N', '', 'Bob', 'Evans', '925-283-0308', '', 'BOBE94549@yahoo.com ', '4033 Los Arabis Dr', 'Layfayette', 'CA', '94549', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(234, 'R234', 'Sisquoc, Solvang & Zaca Railroad', '', 'The railroad does not represent any particular railroad or time period. There is approximately 190 feet of Llagas Creek track, with track power operating standard and narrow gauge trains. The dog-bone design has a farm on the south end with mountains, a tunnel and trees on the north end. On display will be two 7 1/2 gauge live steam locomotives and a diesel switcher. Also, an operating station board from the Winston-Salem Southbound Railroad. ', 'G', '', '', '', '', '190''', 'Garden', '', '', 6, 'N', 'N', '', 'Horace', 'Fabing', '408-842-3865 ', '', 'nfabing@garlic.com', '505 La Sierra Way', 'Gilroy', 'CA', '95020', '', 20, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(236, 'R236', 'Hilary Logging, Lumber & Oil Co ', '', 'This railroad has grown -- it now has a service yard as well as a logging camp for its lumber jacks. There are wonderful water features and a well-designed mill pond and more. A point-to-point elevated section has two bridges and a section of trestles. If you haven''t got a lot of room, this is a magnificent example of what can be accomplished in a small space.', 'G', '', '', '', '', '', 'Garden', '', '', 6, 'N', 'N', '', 'Dave', 'Hartwig', '408-842-1843', '', 'davehart1@verizon.net', '6690 Devon Place', 'Gilroy', 'CA', '95020', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(237, 'R237', 'F&DL RR', '', 'The F&amp;DL RR is a waist-high dog bone with about 150 feet of mainline winding its way through 2 tunnels, under a non-recirculating waterfall, and up a 3% "post and ladder" trestle, which carries it above the village. Two trains run concurrently on the mainline, controlled by hardwired sensors. Track power with a mix of clean LGB brass, dirty LGB brass, and Aristo Stainless. There are a variety of miniature plants along the route, which eventually give way to the 1:1 scale garden at the village loop; and some unusual kit-bashed "stuff". (See Oct 08 Garden Railways.)', 'G', '', '', '100%, well established', '', '130'' mainline', 'Garden', '', 'Track power with hardwired sensors to turnouts', 3, 'N', 'N', 'http://www.lcc-mb.com/CHUG.html ', 'Frank', 'Lucas', '925-933-3360', '', 'fplucas@comcast.net ', '6 Boies Court', 'Pleasant Hill', 'CA', '94523', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(238, 'R238', 'Denver Rio Grande & Western RR', '', 'Howard McKinney''s freelance On3 Denver Rio Grande &amp;Western Railroad is a point-to-point railroad running between Victoria, Co. and Notell, Co. The time period being modeled is the late 1930''s through the early 1940''s. This part of Colorado has no mining, but has lush pine forests which provide timber for the mining industry in the state. Engine turning and servicing facilities exist at both Victoria and Notell. Dual standard and narrow gage trackage at Victoria connects this railroad division with common carrier railroads. Both C&S and RGS equipment can be seen operating on the railroad as both have been given trackage rights on this DRG&amp;W division. Lumber is being harvested from the lush forests of this area. The Sierra Western Co. that also has trackage rights on the railroad is doing the principle logging operation. Logging trains powered by geared locomotives transport logs from the logging camp near Notell to the saw mill at Kerberville which is way to Victoria. Howard''s On3 railroad is in a 7 by 19 foot room with 5 by 6 foot dog leg extension. All of the presently planned hand laid narrow and dual gage trackage is complete and operational. Scenery is approximately 95% complete. Many major structures including the coaling tower and sand house at Notell are in place. On his layout is all trains are DCC controlled using the NCE system and essentially all locomotives are Soundtraxx sound equipped. Tsunami Soundtraxx decoders are in most of the locomotives Access to the main room is via a duck under and an additional view of the Notell yard, engine facilities and town is available on a platform through an access window external to his railroad room. Approximately 5 visitors can be accommodated at a time.', 'On3', 'Denver & Rio Grande Western', '1930''s-1940''s', '95%', '7''x19'' plus 5''x6''', '', '', '', '', 2, 'N', 'Y', '', 'Howard', 'McKinney', '408-996-1581', '', 'mckinney@pacbell.net', '5970 Firar Court', 'San Jose', 'CA', '95129', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(239, 'R239', 'Great Basin Lines', '', '15'' x 48'' Southern Pacific transition era layout. On3 D&RGW will be added later. Designed for operation with stacked staging loops feeding double-decked mainline. Mainline, staging, and continuous-run connection are complete. New this year: more scenery, some tunnels.', 'O and On3', '', '', '', '15/ x 48''', '', '', '', '', 1, 'N', 'Y', '', 'Rod', 'Miller', '650-329-0424', '', 'rod@rodmiller.com', '876 Boyce Ave.', 'Palo Alto', 'CA', '94301', '', 20, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(240, 'R240', 'Chicago Northwestern & North Shore Line', '', 'Chicago and Northwestern &amp; North Shore Line: also includes other Chicago interurban and CSL street cars.  16''x13'' in a 2 car garage. Loaded with prize winning models 1940 to 1960 era on display.  Layout height: 48"', 'O', 'CNW, CNSM, CSL', '1940-1960', '70% complete', '16'' x 13''', '40 feet', 'shelf display', 'N/A', 'DC', 4, 'Y', 'N', '', 'Alf', 'Modine', '408-253-9528', 'anytime during the day', 'evandalf@att.net', '1180 Crestline Dr', 'Cupertino', 'CA', '95014', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(241, 'R241', 'Bay Area NTRAK', '', 'Our N-Trak club is the oldest in the San Francisco Bay Area. We follow the NTRAK Modular Railroading Standards, and model any era or road. All are welcome in the club and on the layouts. Our club has both traveling modules and a permanent layout.\r\n\r\nThe Club''s Permanent Layout is in the old SP Depot in Crockett, CA.  The club''s portion of the depot is the left side entering through the large freight doors. The right side, which was the historical passenger section, is a museum dedicated to the area''s part in WWII. The C &amp; H Sugar factory can be seen in the background. The Carquinez bridge is just west of the depot.\r\n\r\nThe club room features a large window that can be used for watching the main line rail traffic that passes along the waterfront between the depot and the sugar plant. It can also be used for watching some of the sugar loading operations at the plant. Many trains, from UP freight and container trains, to AMTRAK California passenger trains, go by at regular intervals.\r\n\r\nDCC is fully functional at the club . We have 3 complete lines running.\r\nOur scenery is about 60% complete.', 'N', 'Mixed Western Roads', 'Mixed between modern and transitional', '60%', '30'' x15''', '115''', 'Inside/Outside U - Modular', '', 'DCC', 1, 'N', 'N', 'http://bayarean-trak.org/', 'Bay Area', 'NTRAK Club', '510-749-7099', '', 'webmaster@bayarean-trak.org', ' 900 Loring St', 'Crockett', 'CA', '94525', '', 60, 'Mix of Eras', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(242, 'R242', 'Captosoquel & Watsonville RR', '', 'I model Southern Pacific prototype, 1950''s era, coast line and Santa Cruz branch line.  My layout size if 14''-6" long X 3'' at one end and 4''-6" on the other end.  How complete is the layout scenery??  Is any layout ever truly complete?  Not if the interest is there to transform it into something better!  But in all seriousness, layout is in the 90% range for completion.  I use 2 DC (MRC) power packs and an Irish temper for running my trains!  My rolling stock consists of 1944 FRA freight cars, SP Daylights, Larks, Suntan Special and stainless steel and red letterboards.  The power pool consists of Alco PA''s (including a super-detailed PA2 conversion) and EMD E9''s in Daylight paint scheme, F3 and F7 in black widow, GS4 4449, a pair of SD7s also in black widow scheme.     A must-see for any SP fan!', 'N', 'Southern Pacific', '1950''s', '90%', '14''-6" x 3'' to 4''-6" ', '', '', '', '', 6, 'N', 'N', '', 'Gordon', 'Searle', '408-448-2326', '', 'grsear43@yahoo.com', '907 Lanewood Drive ', 'San Jose', 'CA', '95125', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(243, 'R243', 'Southern Pacific', '', 'This is a shelf layout around the perimeter of a 20''x24'' garage. Scenery is currently about 50% complete. George models the late steam/early diesel era, and various SP steam engines and a few "Black Widow" diesels are featured. The curves are 60" radius. The garage is shared by several old automobiles -- another hobby George enjoys. Check out George''s beautifully re-detailed, great running Max Gray AC-9.\r\n', 'O', '', '', '99% complete', '20''x24'' shelf ', '', 'Shelf', '', '', 4, 'N', 'Y', '', 'George', 'Solimine', '650-992-9528', '', 'dickey.babara@gmail.com', '65 Duval Dr', 'San Francisco', 'CA', '94080', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(244, 'R244', 'Mill Valley Lumber Co. RR', '', 'The layout features logging operations around 1900, give or take 10 years, somewhere in northern California.  Just about everything on the layout is scratch built, including the big trees.  Hand-laid, code 83 rail and stub switches throughout.  All equipment operates with link and pin couplers, a variety of Climax and Shay geared locomotives and an 8 ton Porter switching the mill yard.\r\n\r\nNote:\r\nThe layout itself pretty much takes over the room - built for me alone operating trains.  Which is to say, access is very tight with aisle space that really only allows two folks in at a time and even then you won''t be able to pass each other without ducking under!\r\n', 'On3', 'Freelance Northern California', '1890 to 1910', '100%', '10'' by 10'' room', '36''', 'point-to-point, out and back', 'woods to the mill, empties up and loads down, etc.', 'DC, PFM sound', 6, 'N', 'N', '', 'Don', 'McKenney', '510-528-0565', 'Evening (6:01pm -- 9:59pm) ', 'don.mckenney@att.net', '121 San Carlos Avenue', 'El Cerrito', 'CA', '94530', '', 60, 'Evoke Era', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(246, 'R246', 'Livingstone, CA', '', 'A modern N scale layout representing a small piece of central California between Stockton and Fresno. This is a freelanced "L" shaped layout that has been built using Kato Unitrack and with completed scenery and structures representing modern America. There is a single mainline with operation opportunities and two staging areas with four tracks each.  The layout is fully automated using Digitrax DCC hardware and Railroad & Co. software.', 'N', 'UP and BNSF', 'Modern', '90%', '11'' x 14'' L-shaped', '20''', 'L-shaped, free standing', 'Automated train watching', 'Digitrax DCC with Railroad & Co Automation', 1, 'N', 'N', '', 'Jim', 'Bainbridge', '408-324-4773', '', '', '931 Gellert Blvd', 'Daly City', 'CA', '94015', '', 60, 'Few Comp.', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(248, 'R249', 'Colma Pacific RR', '', 'The Colma Pacific RR was designed and built as a freelanced railfaning layout so I could watch my trainsrun while working at my desk. Measuring 24ft long and  8ft at the widest, the double track folded dogbone loop allows continuous running of two trains, while also allowing a single train to operate on the branch line which serves the a lumber camp and the mine. Era is variable, from 1930s in one area, to 1980s in another. The layout is 99% complete. Enter through the wide gate to the left of the garage. The layout is in the building behind the house.\r\n\r\n', 'HO', 'Freelance', 'Variable', '99% Complete', '24'' x 8''', '', 'Folded dogbone', 'Watching trains run', 'NCE DCC', 3, 'N', 'N', '', 'Jack', 'McCloskey', '', '', '', '16 Louvaine Place', 'Colma', 'CA', '94015', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(250, 'R250', 'Santa Fe', '', 'Rich Melconian''s HO layout models the contemporary Santa Fe and also has some steam and Chief passenger trains. The single track mainline and sidings are laid with code 83 rail and #8 switches.  The sidings can accommodate trains consisting of twenty five 50 foot freight cars. The two yards have code 70 rail and #6 switches.  There are numerous industries with sidings using code 70 and 55 rail.  The layout landscape reflects the foothills of California with the mainline elevating to a mountain crossing and descending to a valley area. The scenery is about 70% complete.', 'HO', 'Santa Fe', 'Contemporary, with steam excursions', '70% complete', '', '', '', '', '', 1, 'N', 'N', '', 'Rich', 'Melconian', '650-595-3861', '', '', '1948 Oak Knoll Dr', 'Belmont', 'CA', '94002', '', 60, 'Mix of Eras', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', '', '', NULL),
(255, '', 'Western Pacific Feather River Canyon', '', 'Ron''s 20X35 train room is free-standing amid the vineyards of the Russian River Valley, and contains a replica of portions of the Feather River route of the Western Pacific Railroad in 1952.  With the staging yards, operations extend from Sacramento and Marysville to Winnemucca (east) and Bieber (north).  The Quincy Railroad is also included.  Eight years into a 20-year project, the layout is about 60% sceniced, and contains full-wall backdrops of the Sierras under an open-beamed ceiling.  It takes 12-15 members of the Sonoma County Hi-Ballers to operate the layout over a 12-hour fast-clock shift of seventeen trains.  \r\n<p>Wohler Bridge is a very nice photogenic single lane Truss Bridge accross the Russian River enroute to Ron''s house that you may want to enjoy as well, but be careful because the roads are narrow and winding.\r\n\r\n', 'HO', '', '', '60%', '20X35', '', '', '', '', 3, 'N', 'N', '', 'Ron', 'Kaiser', '(707) 431-1642', '', '', '7097 Westside Road', 'Healdsburg', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', '2011-07-01 23:05:30'),
(252, '', 'Restoration Facility', '', '', 'full size', '', '', '', '', '', '', '', '', 4, 'N', 'N', '', 'NWP and', 'Petaluma Trolley', '', '', '', '', '', '', '', '', 0, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(253, '', 'Financial Gap, Destitute and Ruin Railroad', '', 'The FGD&R was started in 1984 reached its current size in 1994. The railroad has approximately 300 feet of track in a folded loop configuration in an "L" shaped area 100'' by 30''.  Being an older garden railroad it has had many changes over the years including the reduction of the length of the mainline from 500'' to its present length. One item of interest is a real life example of just how big a "Dwarf Alberta Spruce" can get in 25 years. The layout uses track power for all operation and operates a mix of US and European equipment.  In fact, this layout has been described alternately as a European railroad with an "Old West" tourist area, or a western railroad with a town built by German immigrants.  Visit and decide for yourself which variation you prefer.', 'G', '', '', 'Garden Railway', '100 X 30', '', '', '', '', 4, 'N', 'N', 'mdreiling@surewest.net', 'Mike & Rosie', 'Dreiling', '(916) 201-0888', '', '', '8020 Red Pine Court', 'Citrus Heights', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL),
(254, '', 'Northwestern Pacific', '', 'Ron''s layout completely occupies a freestanding single car garage with a duck-under (that Ron''s says is more of a stoop-under because the layout height is an above average 48 inches.  In reconstructing his youth, Ron set his Northwestern Pacific line between Willits and Ukiah in October 1954 with a primary emphasis on the town of Ridge.  His line interchanges with the California Western and the mythical Royal Crown Lumber, a logging road.', 'HO', '', '', '100%', '14X22', '', '', '', '', 2, 'N', 'N', '', 'Ron', 'Learn', '', '', '', '1931 Will Scarlet Lane', 'Santa Rosa', 'CA', '', '', 60, 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'Unknown', 'N/A', 'Unknown', '', '', NULL);
INSERT INTO `prod_eventtools_layout_tours` (`id`, `number`, `name`, `start_date`, `end_date`, `description`, `status_code`, `cart_item`, `tour_price`, `tour_seats`, `tour_bus_type`, `tour_buses`, `tour_mileage`, `mark_changed`, `last_mod_time`) VALUES
(13, 'L201', 'SIERRA SUNRISE', '2011-07-04 07:30:00', '2011-07-04 18:30:00', 'This tour will first visit two large HO home layouts that are both prototype based and operations oriented.  The layouts are located in the Sierra Foothills to the east of Jamestown, CA. After visiting the two layouts the tour will travel to Railtown 1897 in Jamestown and there join Tour P 203 for a BBQ meal, steam train ride and tour of the historic shops. (See description of tour P 203 for more details).', 60, '', 75.00, 90, '', 0, 225, '', '2011-06-29 22:58:18'),
(14, 'L301', 'EAST BAY BY RAIL', '2011-07-05 07:00:00', '2011-07-05 17:00:00', 'There are two tours into the East Bay from Sacramento in addition to the layout visit opportunities from the Advance Section. In keeping with the Advance Section philosophy of smaller more intimate tours, both use 24 passenger buses once in the Bay Area.  \r\n<p/>\r\nL301 uses Amtrak both directions and L402 arrives in Fremont by bus from Sacramento and returns on Amtrak.  Three layouts, Kermit Paul, Jack Burgess and Jim Dias are the same both days.  L301 stays in the San Ramon Valley visiting Dave Connery, Bob Osborn and Bob Wirthlin.  L402 goes into the Oakland hills to visit Otis McGee, Chuck Oraftik and Andy Schnur. \r\n<p/>\r\nBoth tours will allow for on-your-own lunch breaks in locations with multiple eating options.\r\n\r\n ', 60, '', 85.00, 69, '', 0, 0, '', NULL),
(15, 'L302', 'PONY EXPRESS TRAIL', '2011-07-05 13:00:00', '2011-07-05 18:30:00', 'US Highway 50 runs from Sacramento in the west to the Atlantic Ocean in the east at Ocean City, Maryland.  Part of the highway follows the old pony express trail from Sacramento over the Sierras.  We will only be going a short portion of that route to visit five HO scale layouts, one with a G scale as well.', 60, '', 20.00, 56, '', 0, 0, '', '2011-06-16 09:48:56'),
(16, 'L303', 'AUBURN AND NEVADA CITY', '2011-07-05 09:00:00', '2011-07-05 16:00:00', 'This tour by 24 passenger bus will visit four layouts in the Auburn to Nevada City corridor. ', 60, '', 40.00, 23, '', 0, 0, '', NULL),
(8, 'AL01', 'Santa Cruz Bay', '2011-07-01 12:30:00', '2011-07-01 17:30:00', 'Santa Cruz Bay area.  There is also a self-guided tour to these layouts and more, see SAL01.\r\n<p/>\r\n<u>Advance Section registration is required</u> to attend any of the Advance Section events.', 60, '', 30.00, 46, '24', 1, 0, '', NULL),
(9, 'AL03', 'Southeast Bay', '2011-07-01 19:00:00', '2011-07-01 23:00:00', 'Fremont - Pleasanton. There is also a self-guided tour to these layouts and more, see SAL03.<p/>\r\n<u>Advance Section registration is required</u> to attend any of the Advance Section events.', 60, '', 30.00, 46, '24', 1, 0, '', NULL),
(10, 'AL11', 'Southwest Bay', '2011-07-02 08:00:00', '2011-07-02 12:00:00', 'San Jose - Los Altos. There is also a self-guided tour to these layouts and more, see SAL11.<p/>\r\n<u>Advance Section registration is required</u> to attend any of the Advance Section events.', 60, '', 30.00, 46, '24', 1, 0, '', NULL),
(11, 'AL14', 'Northeast Bay', '2011-07-02 13:00:00', '2011-07-02 17:00:00', 'Oakland - Pleasant Hill. Return Stop - Jack London Square. There is also a self-guided tour to these layouts and more, see SAL14.<p/>\r\n<u>Advance Section registration is required</u> to attend any of the Advance Section events.', 60, '', 30.00, 46, '24', 1, 0, '', NULL),
(17, 'L304', 'COLUSA TURN', '2011-07-05 09:00:00', '2011-07-05 16:00:00', 'This tour will visit four layouts and also visit the active restoration of Southern Pacific steam locomotive #2706 by \r\nJohn Manley an Amtrak engineer in Colusa.  Between Colusa and Rocklin on the way home, we will stop at Western Depot Hobbies in Yuba City for a barbeque lunch and shopping time.', 60, '', 25.00, 55, '', 0, 0, '', NULL),
(18, 'L305', 'NARROW GAUGE', '2011-07-05 13:00:00', '2011-07-05 19:30:00', 'This tour features seven narrow gauge layouts (two at one location) in a wide assortment of scales.  In addition the SMRHS layout has a standard gauge HO layout in an adjoining room.   ', 60, '', 20.00, 55, '', 0, 0, '', '2011-06-16 09:49:21'),
(19, 'L401', 'S SCALE LAYOUT TOUR AND TRAIN RIDES', '2011-07-06 07:00:00', '2011-07-06 18:00:00', 'This tour is comprised of three S-scale layouts and two train rides.  It departs Sacramento on Amtrak, transfers  to Bay Area Rapid Transit(BART) in Richmond, CA and boards a bus in Fremont, CA to tour the layouts.  Although open to all convention attendees, it is limited to 55 participants and priority will be given to NASG members in the event of an oversold situation.\r\n<p/>\r\nLunch will be on-your-own at a shopping center with multiple restaurant and fast-food options in conjunction with the layout viewing at Don Harper''s.', 60, '', 55.00, 56, '', 0, 0, '', '2011-06-29 22:08:11'),
(20, 'L402', 'EAST BAY HALF TRACK', '2011-07-06 07:30:00', '2011-07-06 17:00:00', 'There are two tours into the East Bay from Sacramento in addition to the layout visit opportunities from the Advance Section. In keeping with the Advance Section philosophy of smaller more intimate tours, both use 24 passenger buses once in the Bay Area.  \r\n<p/>\r\nL301 uses Amtrak both directions and L402 arrives in Fremont by bus from Sacramento and returns on Amtrak.  Three layouts, Kermit Paul, Jack Burgess and Jim Dias are the same both days.  L301 stays in the San Ramon Valley visiting Dave Connery, Bob Osborn and Bob Wirthlin.  L402 goes into the Oakland hills to visit Otis McGee, Chuck Oraftik and Andy Schnur.\r\n<p/>\r\nBoth tours will allow for on-your-own luch breaks in locations with multiple eating options.', 60, '', 85.00, 57, '', 0, 0, '', '2011-06-29 22:58:55'),
(21, 'L403', 'PETALUMA AND SANTA ROSA', '2011-07-06 08:00:00', '2011-07-06 16:00:00', 'This tour will visit several layouts in each city.  There will be a meal break between the two at Santa Rosa''s Railroad Square where participants can visit the restored Northwestern Pacific depot and associated NWP exhibit in addition to dining in a restaurant or deli within easy walking distance of the depot.\r\n\r\nThe three layouts in Petaluma will operate in a "round robin" with part of the bus at each layout on a rotating basis.  Ed Merrin''s layout in Santa Rosa requires a hike uphill on a long driveway. ', 60, '', 25.00, 25, '', 0, 0, '', NULL),
(22, 'L404', 'MODESTO', '2011-07-06 08:00:00', '2011-07-06 16:00:00', 'Two of the layouts on this tour were built by professional railroaders and one is undergoing a major expansion giving this trip a unique flavor.  Lunch is on-your-own at a location not as yet determined.', 80, '', 25.00, 110, '', 0, 0, '', NULL),
(23, 'L405', 'N- SCALE', '2011-07-06 00:00:00', '2011-07-06 00:00:00', '', 0, '', 0.00, 0, '', 0, 0, '', NULL),
(24, 'L406', 'ROCKLIN ROCKET', '2011-07-06 13:00:00', '2011-07-06 19:00:00', 'A six layout tour with a wide range of geographies and unique features that is enhanced by the proximity to the convention center and minimal travel time. ', 60, '', 20.00, 110, '', 0, 0, '', '2011-06-16 09:49:42'),
(26, 'L502', 'MARIN', '2011-07-07 08:00:00', '2011-07-07 15:00:00', 'This tour will visit five layouts in the Marin area, several of which have received extensive coverage in the model railroad press. Lunch will be on your own at a local shopping mall with multiple fast food opportunities.', 70, '', 25.00, 55, '', 0, 0, '', NULL),
(27, 'L503', 'COMSTOCK EXPRESS', '2011-07-07 08:30:00', '2011-07-07 17:30:00', 'All of the layouts on this tour are within easy reach of the Comstock Lode, but only one deals with mining as a theme.  The others are transplants modeling their roots in the Bay Area or Colorado.  The tour will include an on-your-own buffet lunch in Reno.', 30, '', 40.00, 0, '', 0, 0, '', '2011-06-27 23:16:18'),
(28, 'L504', 'SACRAMENTO - ELK GROVE ', '2011-07-07 13:00:00', '2011-07-07 17:00:00', 'This tour visits four layouts close to the Convention Center in Sacramento and Elk Grove, immediately south of Sacramento.  At under four hours it is a perfect tour for balancing a high quality and diversity of layout styles without spending a lot of time away from the convention center. ', 70, '', 20.00, 55, '', 0, 0, '', NULL),
(29, 'L501', 'VALLEY BLOSSOM SPECIAL', '2011-07-07 08:00:00', '2011-07-07 14:00:00', 'This tour will visit 5 especially nice garden railways that not only provide interesting railway adaptations but are all located in exceptionally fine gardens that anyone interested in residential horticulture will appreciate.', 60, '', 20.00, 55, '', 0, 0, '', NULL),
(30, 'L601', 'BAY AREA CLUBS - NORTH', '2011-07-08 17:00:00', '2011-07-08 23:00:00', 'This tour will visit three model railroad clubs in the San Francisco Bay Area, including the East Bay Model Engineer Society in Richmond, with its three different scale layouts.  ', 70, '', 25.00, 55, '', 0, 0, '', '2011-06-29 21:25:00'),
(31, 'L602', 'BAY AREA CLUBS - EAST', '2011-07-08 17:00:00', '2011-07-08 23:00:00', 'This tour will visit two clubs in the Bay Area, the Diablo Valley Lines in Walnut Creek and the Black Diamond Lines in Antioch, and the Tidewater Southern Historical Society layout and museum in Stockton.\r\n<p>\r\nAt the Diablo Valley Lines tour participants will be able to operate a cab on the club layout from the engineer''s area above the layout.', 60, '', 25.00, 55, '', 0, 0, 'Y', '2011-06-14 17:22:40'),
(32, 'L603', 'SACRAMENTO AREA CLUBS', '2011-07-08 18:00:00', '2011-07-08 22:00:00', 'Three clubs with five layouts.  The Sacramento Model Railroad Historical Society has separate HO and HOn3 layouts and the Roseville Roundhouse Model RR Club operates both HO and N scale.  ', 70, '', 15.00, 55, '', 0, 0, '', '2011-06-29 21:24:14'),
(34, 'L701', 'PENINSULA GARDENS', '2011-07-09 07:30:00', '2011-07-09 18:30:00', 'This tour has been expanded to visit seven really interesting garden railways in the San Francisco Bay Area. Each of these railways features well built outdoor railroads in garden settings that are sure to be of great interest to those into gardening as well as garden railway aficionados. Lunch will be on your own from a selection of fast food restaurants available at a local shopping area.  ', 60, '', 35.00, 55, '', 2, 0, '', '2011-06-16 09:50:04'),
(35, 'L350', 'TUESDAY SELF GUIDED - TICKET AND DIRECTIONS PACKAGE', '2011-07-05 10:00:00', '2011-07-05 22:00:00', 'We are offering non-bus alternative layout openings on a daily basis.  In general layouts open on bus tours will not be open for self-guided at the same time.  Some will not be open for self-guided at any time, and others will only be available as open self-guided.  Except for Friday evening tours, tickets are good for the entire day, but individual layouts are only open in the time window indicated by the layout owner.  It is your responsibility to be aware of the hours a layout owner is available before leaving for a particular destination.\r\n<p/>\r\nDirections packages will include a listing of addresses for entry in a GPS or internet maping system, including notations of known system glitches.  Pricing for self-guided tours assumes very few people go alone and not everyone requires a directions package.  Therefore, two ticket classifcations are available for each daily package; a ticket and directions package and ticket only for additional people in your party.  The 50 suffix tours include directions packages and the 51 suffix tours are ticket only.\r\n<p/>\r\nThe owners open for self-guided tours on Tuesday are:\r\n<p>\r\n<b>US-50 East of Sacramento</b>\r\n<br>Richard Batho 2:00 pm to 8:00 pm\r\n<br>Bill Eversult noon to 8:00 pm\r\n<br>Raymond Fernandes  noon to 6:00 pm\r\n<br>Ron Kerekes  2:00 pm to 8:00 pm\r\n<br>Rick Neet 10:00 am to 2:00 pm - <b>self guided only</b>\r\n<br> Steve Polkinghorn  1:00 pm to 8:00 pm - </br>\r\n<br>Don Rosa  2:00 pm to 8:00 pm - <b>self guided only</b> \r\n<br>Terry Schmidt 4:00 pm to 8:00 pm\r\n<br>Joel Segel 11:00 am to 3:00 pm\r\n<br>Tom Weissgerber  10:00 am to 10:00 pm\r\n<p>\r\n<b>Interstate-80 Northeast of Sacramento</b>\r\n<br>Dave Clemens 4:00 pm to 10:00 pm\r\n<br>Phil Gulley noon to 4:00 pm\r\n<br>Larry Moll 4:00 pm to 10:00 pm\r\n<br>Sacramento Model RR Historical Society  12:00 pm to 4:00 pm\r\n<br>Mitch Valder 3:00 pm to 9:00 pm\r\n<p>\r\n<b>Nevada City (CA 49 North of Auburn)</b>\r\n<br>Kent Williams 9:00 am to noon\r\n<br> Gordon Briggs 10:00 am to 2:00 pm\r\n<br> NCNG Historical Project noon to 4:00 pm\r\n<p><b>Interstate-5 North of Sacramento</b>\r\n<br>Dennis Drury 9:00 am - 5:00 pm\r\n<br>Richard Hosmer 10:00 am to 4:00 pm\r\n<br>Paul Mendez 10:00 am to 2:00 pm - <b>self guided only</b>\r\n<br>Walt Shedler 10:00 am to 4:00 pm', 60, '', 4.00, 75, '0', 0, 0, '', '2011-07-01 23:49:16'),
(36, 'L351', 'TUESDAY SELF GUIDED - ADDITIONAL TICKET', '2011-07-05 10:00:00', '2011-07-05 22:00:00', 'Additional ticket for L350. \r\n<p/>\r\n\r\n', 60, '', 2.00, 75, '0', 0, 0, '', NULL),
(37, 'L450', 'WEDNESDAY SELF GUIDED TICKET AND DIRECTIONS PACKAGE', '2011-07-06 10:00:00', '2011-07-06 22:00:00', 'We are offering non-bus alternative layout openings on a daily basis.  In general layouts open on bus tours will not be open for self-guided at the same time.  Some will not be open for self-guided at any time, and others will only be available as open self-guided.  Except for Friday evening tours, tickets are good for the entire day, but individual layouts are only open in the time window indicated by the layout owner.  It is your responsibility to be aware of the hours a layout owner is available before leaving for a particular destination.\r\n<p/>\r\nDirections packages will include a listing of addresses for entry in a GPS or internet maping system, including notations of known system glitches.  Pricing for self-guided tours assumes very few people go alone and not everyone requires a directions package.  Therefore, two ticket classifcations are available for each daily package; a ticket and directions package and ticket only for additional people in your party.  The 50 suffix tours include directions packages and the 51 suffix tours are ticket only.\r\n<p/>\r\nThe owners open for self guided tours on Wednesday are:\r\n<p>\r\n<b>Interstate-80 Northeast of Sacramento</b>\r\n<br>Mark Brown 2:00 pm to 6:00 pm\r\n<br>Dave Houston 1:00 pm to 7:00 pm\r\n<br>Earl Martin - 10:00 to 2:00 - <b>self guided only</B>\r\n<br>Hugo Solano 9:00 am to 1:00 pm\r\n<br>Errol Spangler 9:00 am to 1:00 pm\r\n<br>Sandy Wilson\r\n<p><b>Nevada City (CA 49 North of Auburn)</b>\r\n<br>Gordon Briggs\r\n<br> NCNG Historical Project\r\n<br>Kent Williams 9:30 am to 4:00 pm\r\n<p><b>Sonoma County (North of San Francisco)</b>\r\n<br>Verne Alexander 10:00 am to 3:00 pm\r\n<br>Dave Croshere 10:00 am to 4:00 pm - <b>self guided only</b>\r\n<br>Ron Kaiser 10:00 am to 6:00 pm - <b>self guided only</b>\r\n<br>Ron Learn 1:00 pm to 6:00 pm - <b> self guided only</b>\r\n<br>Angus McDonald\r\n<br>Ed Merrin  11:00am to 5:00 pm\r\n<br>Ernie Simard\r\n<br>Steve Skold 10:00 am to 5:00 pm\r\n<p><b>Inerstate-5 North of Sacramento</b>\r\n<br>Richard Hosmer\r\n<br>Walt Schedler\r\n<p><b>Interstate 5 South of Sacramento</b>\r\n<br>Steve Cavanaugh noon to 6:00 pm - <b>self guided only</b>\r\n<br>Robert Hoffman 6:00 pm to 10:00 pm\r\n<br>Mike McReynolds noon to 5:00 pm - <b>self guided only</b>\r\n<br>Tom Milam noon to 5:00 pm - <b>self guided only</b>\r\n<br>Dave Stanley 3:00 pm to 10:00 pm\r\n<p><b>Mariposa, Sonora and Twaine Hart</b>\r\n<br>Paul Claffey 11:00 am to 5:00 pm - <b>self guided only</b>\r\n<br>Tom Davis 11:00 am to 5:00 pm - <b>seld guided only</b>\r\n<br>Steve Hayes\r\n<br>Bob Jakl 11:00 am to 5:00 - <b>self guided only</b>\r\n<br>Ray Price 11:00 am to 5:00 - <b>self guided only</b>\r\n<br>Glenn Sutherland 11:00 am to 5:00 -  <b>self guided only</b>\r\n<br>John Zach', 60, '', 4.00, 75, '0', 0, 0, 'Y', '2011-07-01 23:56:19'),
(38, 'L550', 'THURSDAY SELF GUIDED - TICKET AND DIRECTIONS PACKAGE', '2011-07-07 10:00:00', '2011-07-07 22:00:00', 'We are offering non-bus alternative layout openings on a daily basis.  In general layouts open on bus tours will not be open for self-guided at the same time.  Some will not be open for self-guided at any time, and others will only be available as open self-guided.  Except for Friday evening tours, tickets are good for the entire day, but individual layouts are only open in the time window indicated by the layout owner.  It is your responsibility to be aware of the hours a layout owner is available before leaving for a particular destination.\r\n<p/>\r\nDirections packages will include a listing of addresses for entry in a GPS or internet maping system, including notations of known system glitches.  Pricing for self-guided tours assumes very few people go alone and not everyone requires a directions package.  Therefore, two ticket classifcations are available for each daily package; a ticket and directions package and ticket only for additional people in your party.  The 50 suffix tours include directions packages and the 51 suffix tours are ticket only.\r\n<p/>\r\nThe owners open for self guided tours on Thursday are:\r\n<p><b>Sacramento and Elk Grove (along Interstate-5 south of Sacramento)</b>\r\n<br>\r\nDave Arrol 3:00 pm to 8:00 pm- <b>Self Guided only</b>\r\n<br>Greg Austin 3:00 pm to 7:00 pm\r\n<br>Bill Burg  10:00 am to 4:00 pm\r\n<br>Matt Mason  10:00 am to 5:00 pm\r\n<p>\r\n<b>Interstate-80 Northeast of Sacramento</b>\r\n<br>Jerry Abrau 10:00 am to 2:00 pm\r\n<br>Frank and Ruby Andrews 10:00 am to 5:00 pm\r\n<br>Chuck and Sue Maley 10:00 am to 5:00 pm\r\n<br>Aaron Splawn 10:00 am to 5:00 pm- <b>Self Guided Only</b>\r\n<p>\r\n<b>Marin County - North of San Francisco</b>\r\n<br>Bill Horstmeyer\r\n<br>Bill Kaufman  10:00 am to 4:00 pm\r\n<br>Jim Providenza\r\n<br>Jon Schmidt\r\n<br>Paul Weiss\r\n\r\n', 60, '', 4.00, 75, '0', 0, 0, '', '2011-07-01 23:47:41'),
(39, 'L650', 'FRIDAY SELF GUIDED - TICKET AND DIRECTIONS PACKAGE', '2011-07-08 18:00:00', '2011-07-08 22:00:00', 'We are offering non-bus alternative layout openings on a daily basis.  In general layouts open on bus tours will not be open for self-guided at the same time.  Some will not be open for self-guided at any time, and others will only be available as open self-guided.  Except for Friday evening tours, tickets are good for the entire day, but individual layouts are only open in the time window indicated by the layout owner.  It is your responsibility to be aware of the hours a layout owner is available before leaving for a particular destination.\r\n<p/>\r\nDirections packages will include a listing of addresses for entry in a GPS or internet maping system, including notations of known system glitches.  Pricing for self-guided tours assumes very few people go alone and not everyone requires a directions package.  Therefore, two ticket classifcations are available for each daily package; a ticket and directions package and ticket only for additional people in your party.  The 50 suffix tours include directions packages and the 51 suffix tours are ticket only.\r\n<p/>\r\nFriday night is Club Night.  The self guided version gives you the opportunity to customize the clubs from the three scheduled tours. \r\n<p>Roseville Roundhouse  6:00 pm to 9:00 pm\r\n<br>Sacramento Model Railroad Historical Society 6:00 pm to 10:00 pm\r\n<br>26th Street Model Engineers (Sacramento) 6:00 pm to 10:00 pm \r\n<br>Tidewater Southern Railroad (Stockton)5:30 pm to 8:00 pm\r\n<br>Diablo Valley Lines (Walnut Creek)7:00pm to 9:00 pm\r\n<br>East Bay Model Engineer Society (Richmond)\r\n<br>Carquinez Model Railroad Society (Crockett)', 60, '', 4.00, 50, '0', 0, 0, '', '2011-07-01 23:44:13'),
(40, 'L451', 'WEDNESDAY SELF GUIDED - EXTRA TICKET', '2011-07-06 10:00:00', '2011-07-06 22:00:00', 'Additional ticket for L450. \r\n<p/>\r\n\r\n', 60, '', 2.00, 75, '0', 0, 0, '', NULL),
(41, 'L551', 'THURSDAY SELF GUIDED - EXTRA TICKET', '2011-07-07 10:00:00', '2011-07-07 22:00:00', 'Additional ticket for L550. \r\n<p/>\r\n\r\n', 60, '', 2.00, 75, '0', 0, 0, '', NULL),
(42, 'L651', 'FRIDAY SELF GUIDED - EXTRA TICKET', '2011-07-08 18:00:00', '2011-07-01 22:00:00', 'Additional ticket for L650. \r\n<p/>\r\n', 60, '', 2.00, 75, '0', 0, 0, '', NULL),
(44, 'L455', 'LDSIG Tour', '2011-07-06 09:00:00', '2011-07-01 22:00:00', 'Leaves immediately after the LDSIG business meeting.\r\n<p/>\r\nA <a href="http://www.x2011west.org/pdf/LDSIG-Layouts.pdf">selection of 15-20 layouts</a> of special interest to layout designers.  Carpooling strongly encouraged so you can discuss the unique features of these layouts as you travel.  No lunch is provided so you and your carpool buddies can eat what and when you want (there are plenty of good restaurants in all categories and price ranges along the route). Tour includes commemorative polo shirt.   A summary map and list of addresses will be provided so bring your GPS.', 60, '', 35.00, 150, '0', 0, 0, '', NULL),
(45, 'SAL01', 'Advanced Section Santa Cruz (self-guided)', '2011-07-01 13:00:00', '2011-07-01 17:00:00', 'Self-guided tour of layouts in the Santa Cruz Bay area.  This includes the layouts on AL01, plus a few more that the bus cannot quite reach.', 62, '', 0.00, 0, '0', 0, 0, '', NULL),
(46, 'SAL02', 'On the way to the Bay (self-guided)', '2011-07-01 12:00:00', '2011-07-01 17:00:00', 'This self-guided tour includes several layouts that are open for touring on your way to Newark for the Advance Section', 62, '', 0.00, 0, '0', 0, 0, '', NULL),
(47, 'SAL03', 'Southeast Bay (self-guided)', '2011-07-01 19:00:00', '2011-07-01 23:00:00', 'This self-guided tour includes all of the layouts available on the AL03 tour, plus a few that the bus cannot reach.', 62, '', 0.00, 0, '0', 0, 0, '', NULL),
(48, 'SAL11', 'Southwest Bay (self-guided)', '2011-07-02 08:00:00', '2011-07-02 12:00:00', 'This self-guided tour includes all of the layouts of the AL11 bus tour, plus many more that the bus cannot reach, with a tour area focused on the Southwest corner of the Bay Area.  You will not likely be able to his all of these layouts, but with the broad selection, you should find a set you can tailor to your interests.', 62, '', 0.00, 0, '0', 0, 0, '', NULL),
(49, 'SAL14', 'Northeast Bay (self-guided)', '2011-07-02 13:00:00', '2011-07-02 17:00:00', 'This is the self-guided counterpart to tour AL14.  This tour includes all of the layouts of AL14 <b><i>except for Otis McGee''s SP Shasta Division</i></b>.  If you want to see Otis'' layout, you must take one of the bus tours AL14 or L402.\r\n\r\nThis tour also includes a number of other layouts in the Northeast Bay Area which are not part of the AL14 bus tour.  There are too many layouts on this tour for you to expect to see them all, but the variety of layouts should let you put together a pleasant afternoon tour.', 62, '', 0.00, 0, '0', 0, 0, '', NULL),
(50, 'SAL21', 'Northwest Bay (self-guided)', '2011-07-03 09:00:00', '2011-07-03 14:00:00', 'This self-guided tour includes a variety of layouts on the San Francisco peninsula open for touring the morning of Sunday July 3.  These layouts are generally open a little earlier than the layouts of self-guided tour SAL22, so you may be able to pick and choose among them as you make your way to Sacramento.', 62, '', 0.00, 0, '0', 0, 0, '', NULL),
(51, 'SAL22', 'On the way to X2011W', '2011-07-03 09:00:00', '2011-07-03 15:00:00', 'This self-guided tour includes layouts that you can see on Sunday July 3 as you make your way from Newark to the main convention in Sacramento.  These layouts are generally open during a slightly later time window than those of tour SAL21, so you can probably see a few layouts from both tours if you wish.', 62, '', 0.00, 0, '0', 0, 0, '', NULL),
(52, 'AL21', 'Northwest Bay N Layouts and Disney Museum', '2011-07-03 08:00:00', '2011-07-03 15:00:00', 'This tour is a layout tour with a bonus stop at the Walt Disney Family museum (same as tour AG21).  Please do not sign up for both AG21 and AL21 -- they are the same tour!\r\n<p>\r\nThe Walt Disney Family Museum presents the real story of Walt Disney, the man, his work, his legacy of entertainment and love of trains.  The Museum is located in the historically preserved Presidio of San Francisco, a former U.S. Army base and now a National Park. The galleries are rooted in an architecturally preserved 19th century barracks.   Early animation techniques are shown and historic equipment for movie making is on display.  See <a href=''http://disney.go.com/disneyatoz/familymuseum/''>http://disney.go.com/disneyatoz/familymuseum/</a>.\r\n<p>\r\nOn the way to the Disney Museum the tour will visit three N scale layouts, one of which was featured on the cover of the June 2011 <i>Model Railroader Magazine</i>.  After the Museum we will head for the Oakland Amtrak station for those taking the train to Sacramento. The bus will then continue back to the Newark/Fremont Hilton Hotel.\r\n<p>\r\n<u>Advance Section registration is required</u> to attend any of the Advance Section events.', 60, '', 40.00, 22, '47', 1, 0, '', NULL);
