(15, 'NASG1', 'NASG Roundhouse Revue & BBQ too!', '2011-07-09 17:30:00', '2011-07-09 23:30:00', 'S scale BBQ and musical variety show in the California State Railroad Museum roundhouse on Saturday evening, July 9th.  Open to everyone including spouse and children.  Ticket MUST be presented to gain admission.', 60, '', 8, 'http://www.x2011west.org/nasg.html#banquet', '', '2011-06-23 01:52:47'),
(16, 'NASG2', 'S Scale Welcoming Gathering', '2011-07-06 20:00:00', '2011-07-06 23:30:00', 'Welcoming gathering and socializing on Wednesday evening, July 6th. Dessert and coffee will be served, but not dinner. Interesting presentation by Stephen Priest, Editor of the NMRA''s monthly magazine.  Open to everyone.', 60, '', 12, 'http://www.x2011west.org/nasg.html#welcome', '', NULL),
