(28, 'Nnqt', 'Nonquet', '2011-07-09 19:30:00', '2011-07-09 23:45:00', 'Saturday evening social hour. Instead of the usual NMRA banquet, we are taking the unconventional route and holding instead what we have coined as the Nonquet. Dessert will be served, a no-host bar will be open, and you will be able to socialize with all your old friends and make some new friends. Then there will be entertainment. WinteRail is a professionally done railroadiana show and photo exhibition. It has been held each March, for about 30 years, in Stockton, CA. The producers of WinteRail have graciously agreed to put on a show for us Saturday night. NMRA awards will presented during intermissions. This is going to be a true highlight of the convention. Don''t miss it. $5. <a href="http://www.x2011west.org/cart/index.php?main_page=product_info&products_id=67">Click to Order</a>', 60, '', 12, '', '', NULL),
(29, 'SIGB', 'LDSIG Banquet', '2011-07-08 18:00:00', '2011-07-08 22:00:00', 'Enjoy a catered dinner in the round house display area of the California State Railroad Museum with fellow SIG members (no SIG membership requirement, all convention attendees with an interest in layout design are welcome!). No Host bar from 6:00 PM. There will be an after-dinner presentation by a prominent layout designer. A great opportunity to discuss everything you''ve seen during X2011 West and reflect on how to apply your learnings to your layout!\r\n<p/>\r\n<a href="http://www.x2011west.org/cart/index.php?main_page=product_info&cPath=10&products_id=123">Click to Order</a>', 30, '', 8, '../groups.html', '', NULL),
(30, 'LDS1', 'LDSIG Self-Guided Layout Tours', '2011-07-06 09:00:00', '2011-07-06 21:00:00', 'Local Coordinator Dave Bayless has selected 16 excellent layouts from Lodi in the South to Nevada City in the North and West to Colusa in various stages of construction and operation. Plan on a full day tour starting immediately after our 8:00 AM business meeting. Bring your GPS, as no detailed maps will be provided.', 20, '', 13, '../groups.html#ldsig', '', NULL),
(31, 'LDS2', 'LDSIG Meet and Greet', '2011-07-03 19:00:00', '2011-07-03 22:00:00', 'Sunday evening starting at 7:00 PM in the SIG Room at the convention center in Sacramento.  An opportunity for all Layout Design and Operations SIG members and friends to introduce themselves and their interests.  Don''t worry about arriving late if youâ€™re enjoying tours and op sessions on the way up from Advanced Section, we''ll be there until at least 10:00 PM!', 20, '', 13, 'http://www.ldsig.org/ldsigwiki/conventions/Sacramento2011', '', NULL),
(32, 'LDS3', 'LDSIG Business meeting', '2011-07-06 08:00:00', '2011-07-06 09:00:00', '(Self-guided layout tours start immediately after meeting ends)', 20, '', 13, '../groups.html#ldsig', '', NULL),
(34, 'CSR1', 'California State Railroad Museum Open', '2011-07-04 10:00:00', '2011-07-04 17:00:00', 'The X2011west Convention has worked closely with the California State Railroad Museum to provide an interesting and informative week in Sacramento.  Convention attendees can visit the Museum any time during normal operating hours of 10:00 am to 5:00 pm with their convention credentials.  This provides an opportunity to roam the Museum''s 225,000 square feet of exhibit space including 21 restored locomotives and cars, both freight and passenger, as well as the extensive book store and gift shop at a time that does not conflict with other convention events of your choosing.   \r\n<p/>\r\nIn addition to the own-your-own opportunity to visit the Museum, we will have several special events, not just during normal Museum hours, but before and after as well.  Most, but not all, of these special opportunities will occur on Thursday.  Some will require an extra fee and others will not, but all except for Thursday night''s big event, require advance registration.  \r\n<p/>\r\nSee the Prototype Tours section for details of specific special events and registration numbers.  Not all events are completed as of this writing so check back occasionally for updates.\r\n', 40, '', 8, 'http://www.csrmf.org/', '', NULL),
